INSERT INTO `mystery_hunt_riddle` VALUES (1,'Animal Riddles','What four-legged animal can jump higher than a house?','Any, Houses can\'t jump.','Medium','2024-07-10 03:24:53.781894'),(2,'Animal Riddles','How many of each type of animal did Moses take on the Ark?','None, it was Noah.','Hard','2024-07-10 03:24:53.784170'),(3,'Animal Riddles','What animal is the best at baseball?','A bat.','Medium','2024-07-10 03:24:53.786548'),(4,'Animal Riddles','What animal is most likely to eat a relative?','An ant-eater!','Easy','2024-07-10 03:24:53.788135'),(5,'Animal Riddles','Why don\'t African animals play games?','There are too many cheetahs!','Easy','2024-07-10 03:24:53.789606'),(6,'Animal Riddles','Where do animals go to get their new tails when they\'re broken?','Retail Shop.','Easy','2024-07-10 03:24:53.791140'),(7,'Animal Riddles','What flower would remind you of a certain animal that took a great deal of care about its appearance?','A dandelion (dandy lion).','Medium','2024-07-10 03:24:53.792888'),(8,'Animal Riddles','I can spell yet I have no mouth I can speak to animals but can\'t speak to humans I am fierce but small. What am I?','I am a bee.','Easy','2024-07-10 03:24:53.794498'),(9,'Animal Riddles','I eat animals but I don\'t hunt or kill. What am I?','A vulture.','Hard','2024-07-10 03:24:53.796180'),(10,'Animal Riddles','Through a sea of green and islands of brown, leaving a crystal path behind, safe inside a spiral cave, preparing to come out again. What animal am I?','A snail.','Easy','2024-07-10 03:24:53.798047'),(11,'Animal Riddles','What kind of animal can do Kung fu?','Kung fu pandas!','Medium','2024-07-10 03:24:53.799258'),(12,'Animal Riddles','What kind of animal is a slope?','A Hypote-moose.','Hard','2024-07-10 03:24:53.801010'),(13,'Animal Riddles','What animal is it the hardest to have a staring contest with?','A fish. They cannot blink!','Easy','2024-07-10 03:24:53.802307'),(14,'Animal Riddles','Add 10 to nothing and you get what animal?','Unanswered.','Hard','2024-07-10 03:24:53.803522'),(15,'Animal Riddles','A man but an animal, a horn with two hands. What am I?','A Minotaur.','Hard','2024-07-10 03:24:53.805429'),(16,'Animal Riddles','What animal would you get crossed a duck, a beaver, and an otter?','A platypus.','Easy','2024-07-10 03:24:53.807003'),(17,'Animal Riddles','What animal has more lives than a cat?','A frog, it croaks every night!','Medium','2024-07-10 03:24:53.808834'),(18,'Animal Riddles','Add a letter to an animal, and make a building. What is it?','Sable, stable.','Hard','2024-07-10 03:24:53.810278'),(19,'Animal Riddles','How are people like animals?','We have bare (bear) feet, frogs in our throats, calves on our legs and bull on our tongue.','Easy','2024-07-10 03:24:53.811457'),(20,'Animal Riddles','What animals would be the best at playing video games?','An octopus.','Medium','2024-07-10 03:24:53.813039'),(21,'Animal Riddles','What animal probably likes doors?','A door mouse.','Hard','2024-07-10 03:24:53.814372'),(22,'Animal Riddles','What is 1 animal that can see at night but be blinded at day?','A bat.','Medium','2024-07-10 03:24:53.815619'),(23,'Animal Riddles','With what two animals do you always go to bed?','Two calves.','Easy','2024-07-10 03:24:53.817262'),(24,'Animal Riddles','What animal has no wings, but yet will fly?','A caterpillar has no wings, but will fly when it matures and becomes a butterfly.','Medium','2024-07-10 03:24:53.818615'),(25,'Animal Riddles','Use all letters of this sentence once each only to spell out three animals. \'TALL ELEPHANT OR APEMAN\' What are the three animals?','PANTHER, ANTELOPE, LLAMA','Hard','2024-07-10 03:24:53.819968'),(26,'Animal Riddles','Why did Tigger go to the bathroom?','He wanted to find his friend, Pooh!','Medium','2024-07-10 03:24:53.821679'),(27,'Animal Riddles','What do you call a bear with no teeth?','A gummy bear.','Hard','2024-07-10 03:24:53.823051'),(28,'Animal Riddles','Why couldn\'t Goldilocks sleep?','Because of night-bears.','Medium','2024-07-10 03:24:53.824243'),(29,'Animal Riddles','Why are teddy bears never hungry?','Because they are stuffed.','Medium','2024-07-10 03:24:53.825903'),(30,'Animal Riddles','A man builds a house with all 4 sides facing south. A bear walks past the house. What color is the bear?','White, the house is built directly on the North Pole.','Easy','2024-07-10 03:24:53.827227'),(31,'Animal Riddles','There are 30 cows in a field, and 28 chickens. How many didn\'t?','10. Listen closely: 30 cows, and twenty-eight chickens. Say EIGHT and ATE. They sound the same. Therefore, it means 20 ATE chickens. 30-20=10, so 10 cows didn\'t eat any chickens.','Medium','2024-07-10 03:24:53.828888'),(32,'Animal Riddles','There are two bodies on the floor. They are surrounded by water and broken glass. How did they die?','The bodies were goldfish because their fishbowl got knocked over onto the floor and broke.','Easy','2024-07-10 03:24:53.830593'),(33,'Animal Riddles','It has a long neck, a name of a bird, feeds on ships cargo, and is not alive. What is it?','A crane.','Hard','2024-07-10 03:24:53.832829'),(34,'Animal Riddles','Which bird does not belong in this group? Finch, gull, eagle, ostrich, or sparrow?','The Ostrich. It\'s the only bird that doesn\'t fly.','Easy','2024-07-10 03:24:53.834634'),(35,'Animal Riddles','There are 2 ducks in front of 2 other ducks. There are 2 ducks behind 2 other ducks. There are 2 ducks beside 2 other ducks. How many ducks are there?','Just four, in a square formation.','Easy','2024-07-10 03:24:53.836234'),(36,'Animal Riddles','There are 30 cows in a field, and 28 chickens. How many didn\'t?','10. Listen closely: 30 cows, and twenty-eight chickens. Say EIGHT and ATE. They sound the same. Therefore, it means 20 ATE chickens. 30-20=10, so 10 cows didn\'t eat any chickens.','Medium','2024-07-10 03:24:53.837792'),(37,'Animal Riddles','If a rooster laid a brown egg and a white egg, what kind of chicks would hatch?','Roosters don\'t lay eggs.','Easy','2024-07-10 03:24:53.839237'),(38,'Animal Riddles','Why did the turkey cross the road?','To prove he wasn\'t chicken.','Easy','2024-07-10 03:24:53.840907'),(39,'Animal Riddles','If a chicken says, \"All chickens are liars\". Is the chicken telling the truth?','Answer: Chickens cannot talk.','Easy','2024-07-10 03:24:53.842558'),(40,'Animal Riddles','If it takes 5 microwaves 5 minutes to cook 5 chickens, how long does it take 100 microwaves to cook 100 chickens?','5 minutes. We can assume that one chicken is placed in each microwave and that each chicken takes 5 minutes to cook.','Hard','2024-07-10 03:24:53.843996'),(41,'Animal Riddles','If there are four sheep, two dogs, and one herds-men, how many feet are there?','Two. Sheep have hooves; dogs have paws; only people have feet.','Hard','2024-07-10 03:24:53.845538'),(42,'Animal Riddles','All of Mrs. Smith\'s pets are dogs except one, and all her pets are cats except one. How many cats and dogs does she have?','Mrs. Smith has one cat and one dog.','Easy','2024-07-10 03:24:53.846927'),(43,'Animal Riddles','How can you tell the difference between dogs and trees?','By their bark.','Hard','2024-07-10 03:24:53.848824'),(44,'Animal Riddles','What animal keeps the best time?','A Watchdog.','Easy','2024-07-10 03:24:53.850104'),(45,'Animal Riddles','To you, rude would I never be, Though I flag my tongue for all to see. What am I?','A dog!','Easy','2024-07-10 03:24:53.851542'),(46,'Animal Riddles','There are 2 ducks in front of 2 other ducks. There are 2 ducks behind 2 other ducks. There are 2 ducks beside 2 other ducks. How many ducks are there?','Just four, in a square formation.','Easy','2024-07-10 03:24:53.853046'),(47,'Animal Riddles','What happened when the rubber duckie fell into the bathtub?','It quacked up.','Hard','2024-07-10 03:24:53.854474'),(48,'Animal Riddles','What do you call a crate of ducks?','A box of quackers!','Medium','2024-07-10 03:24:53.855834'),(49,'Animal Riddles','Arnold Schwarzenegger\'s is really long. Michael J. Fox\'s is short. Daffy Duck isn\'t human. Madonna doesn\'t have one. What am I?','The last name.','Hard','2024-07-10 03:24:53.857301'),(50,'Animal Riddles','A mouse, a squirrel, a duck, a chicken, and an elephant are sitting on the side of the road. Someone offers them a lift, but one prefers to stay. Who preferred to stay?','The Elephant Stayed. If you didn\'t know, elephants are scared of mice.','Hard','2024-07-10 03:24:53.859084'),(51,'Animal Riddles','Two fathers and two sons went fishing one day. They were there the whole day and only caught 3 fish. One father said, that is enough for all of us, we will have one each. How can this be possible?','There was the father, his son, and his son\'s son. This equals 2 fathers and 2 sons for a total of 3!','Medium','2024-07-10 03:24:53.860537'),(52,'Animal Riddles','I am a word of six; my first three letters refer to an automobile; my last three letters refer to a household animal; my first four letters is a fish; my whole is found in your room. What am I?','A carpet.','Easy','2024-07-10 03:24:53.862020'),(53,'Animal Riddles','There are two bodies on the floor. They are surrounded by water and broken glass. How did they die?','The bodies were goldfish because their fishbowl got knocked over onto the floor and broke.','Easy','2024-07-10 03:24:53.863516'),(54,'Animal Riddles','What has cities, but no houses; forests, but no trees; and water, but no fish?','A map.','Medium','2024-07-10 03:24:53.865251'),(55,'Animal Riddles','If fish lived on land, where would they live?','In Finland.','Hard','2024-07-10 03:24:53.867315'),(56,'Animal Riddles','A farmer has twenty sheep, ten pigs, and ten cows. If we call the pigs cows, how many cows will he have?','Ten Cows. We can call the pigs cows but it doesn\'t make them cows.','Medium','2024-07-10 03:24:53.869120'),(57,'Animal Riddles','What do you call pigs that write letters to each other?','Pen Pals.','Hard','2024-07-10 03:24:53.870567'),(58,'Animal Riddles','Why can\'t you play basketball with pigs?','Because they will \"hog\" the ball!','Hard','2024-07-10 03:24:53.871941'),(59,'Animal Riddles','Why did Momma Pig leave her husband?','Because he was a boar.','Easy','2024-07-10 03:24:53.873520'),(60,'Animal Riddles','What do you call a pig that does karate?','A Porkchop.','Easy','2024-07-10 03:24:53.874939'),(61,'Animal Riddles','Do rabbits use combs?','No, they use hare brushes.','Medium','2024-07-10 03:24:53.876825'),(62,'Animal Riddles','How can you say rabbit without using the letter R?','Bunny.','Medium','2024-07-10 03:24:53.878323'),(63,'Animal Riddles','How many hairs are in a bunny rabbit\'s tail?','None. They are all outside.','Easy','2024-07-10 03:24:53.879863'),(64,'Animal Riddles','Where does a rabbit go for shampoo?','To a hare-dresser.','Medium','2024-07-10 03:24:53.881475'),(65,'Animal Riddles','Who is never hungry during Christmas?','The turkey because he is always stuffed.','Easy','2024-07-10 03:24:53.882921'),(66,'Animal Riddles','Why did they let the turkey join the thanksgiving band?','Because he had the drumsticks.','Easy','2024-07-10 03:24:53.884620'),(67,'Animal Riddles','Why did the turkey cross the road?','To prove he wasn\'t chicken.','Medium','2024-07-10 03:24:53.886322'),(68,'Animal Riddles','Why didn\'t the turkey finish its dessert?','Because it was stuffed.','Hard','2024-07-10 03:24:53.888387'),(69,'Animal Riddles','What kind of key do you use on Thanksgiving?','A tur-key.','Medium','2024-07-10 03:24:53.890129'),(70,'Baseball Riddles','What did the baseball glove say to the ball?','Catch you later.','Easy','2024-07-10 03:24:53.891694'),(71,'Baseball Riddles','How do you know that a vampire loves baseball?','Because he turns into a bat every night.','Medium','2024-07-10 03:24:53.893461'),(72,'Baseball Riddles','What animal is the best at baseball?','A bat.','Hard','2024-07-10 03:24:53.894878'),(73,'Baseball Riddles','A guy was waiting at home, he swung a metal pole then took 3 left turns, and on his way back home there was a masked man waiting for him. What is he doing and who is the masked man?','He is playing baseball and the masked man is the Catcher.','Medium','2024-07-10 03:24:53.896235'),(74,'Baseball Riddles','Name the only sport in which the ball is always in possession of the team on defense, and the offensive team can score without touching the ball?','Baseball!','Medium','2024-07-10 03:24:53.897836'),(75,'Baseball Riddles','Why is the baseball field hot after a game?','All the fans left.','Hard','2024-07-10 03:24:53.899216'),(76,'Baseball Riddles','Why did the baseball coach hire a piano player?','Because his player had the perfect pitch!','Medium','2024-07-10 03:24:53.900911'),(77,'Baseball Riddles','Where do coal diggers play baseball?','The minor (miner) leagues.','Medium','2024-07-10 03:24:53.903237'),(78,'Baseball Riddles','Why was the baseball player\'s food always dirty?','He always stepped on the plate.','Easy','2024-07-10 03:24:53.904840'),(79,'Baseball Riddles','What was the spider doing on the baseball team?','Catching flies.','Medium','2024-07-10 03:24:53.906189'),(80,'Baseball Riddles','What has 18 legs and catches flies?','A baseball team.','Easy','2024-07-10 03:24:53.907731'),(81,'Baseball Riddles','What song was the baseball player singing on third base?','\"There\'s no place like home.\"','Medium','2024-07-10 03:24:53.909631'),(82,'Baseball Riddles','Why was the chef hired to coach the baseball team?','Because he knew how to handle batter.','Medium','2024-07-10 03:24:53.911409'),(83,'Baseball Riddles','What position do pigs play on the baseball field?','Short-stop.','Medium','2024-07-10 03:24:53.913563'),(84,'Baseball Riddles','I play on a diamond, I play fair, I always get dirty, And then I run home. What Am I?','Baseball Player','Easy','2024-07-10 03:24:53.915385'),(85,'Baseball Riddles','A man is running home, where he meets 2 men with masks on. Then he runs away from home. What is this man\'s job?','A baseball player. The 2 masked men are the umpire and the catcher.','Hard','2024-07-10 03:24:53.917630'),(86,'Baseball Riddles','Where do great dragon baseball players go?','To the Hall Of Flame.','Easy','2024-07-10 03:24:53.919666'),(87,'Baseball Riddles','Why can\'t turtles play baseball?','They can\'t run home.','Hard','2024-07-10 03:24:53.922353'),(88,'Baseball Riddles','What\'s the first game in the Bible?','Baseball Why: because In the big inning, Eve stole first, and Adam stole second. Cain struck out Abel, and the Prodigal Son came home. The Giants and the Angels were rained out.','Medium','2024-07-10 03:24:53.924709'),(89,'Baseball Riddles','There was a man who everybody called Batman he knew nothing about bats and thought they were gross. He still loved it when people called him Batman! How could this be?','He was the star baseball player!','Medium','2024-07-10 03:24:53.927154'),(90,'Baseball Riddles','Why don\'t chickens play baseball?','Because they hit fowl balls.','Hard','2024-07-10 03:24:53.929571'),(91,'Basketball Riddles','What is a good restaurant for a basketball team?','Dunkin Donuts.','Hard','2024-07-10 03:24:53.931620'),(92,'Basketball Riddles','Why can\'t you play basketball with pigs?','Because they will \"hog\" the ball!','Easy','2024-07-10 03:24:53.934130'),(93,'Basketball Riddles','A man takes a basketball and throws it as hard as he can. There is nothing in front, behind, or on either side of him, and yet, the ball comes back and hits him square in the face. How can this be?','He threw the ball straight up in the air.','Easy','2024-07-10 03:24:53.936604'),(94,'Basketball Riddles','What did the hoop say to the basketball?','May all your swishes come true!','Medium','2024-07-10 03:24:53.938818'),(95,'Basketball Riddles','What do you call a basketball game with no ball?','A basket game!','Hard','2024-07-10 03:24:53.941331'),(96,'Basketball Riddles','In the NBA, how many men are on the basketball court for each team?','Five, not ten!','Easy','2024-07-10 03:24:53.943686'),(97,'Bathroom Riddles','Why did Tigger go to the bathroom?','He wanted to find his friend, Pooh!','Medium','2024-07-10 03:24:53.946207'),(98,'Bathroom Riddles','If two snakes marry, what will their towels say?','Hiss and Hers.','Easy','2024-07-10 03:24:53.948812'),(99,'Bathroom Riddles','I am wet when drying. What am I?','A towel.','Easy','2024-07-10 03:24:53.951383'),(100,'Bathroom Riddles','What happened to Einstein when he took a shower?','He was brain-washed.','Medium','2024-07-10 03:24:53.953551'),(101,'Bathroom Riddles','If April showers bring may flowers, what do may flowers bring?','Pilgrims.','Hard','2024-07-10 03:24:53.960110'),(102,'Bathroom Riddles','On a fine sunny day a ship was in the harbor. All of a sudden the ship began to sink. There was no storm and nothing wrong with the ship yet it sank right in front of the spectator\'s eyes. What caused the ship to sink?','It was a Submarine.','Medium','2024-07-10 03:24:53.962797'),(103,'Bathroom Riddles','What gets wetter the more it dries?','A towel.','Medium','2024-07-10 03:24:53.965588'),(104,'Bathroom Riddles','You go in me for brushing, For flushing, For rushing; But please go in me one at a time, Or someone might be blushing. What am I?','A bathroom.','Hard','2024-07-10 03:24:53.968297'),(105,'Bathroom Riddles','How can people without noses smell?','If they don\'t shower.','Easy','2024-07-10 03:24:53.971973'),(106,'Bathroom Riddles','What do you call a tree that has been TP\'ed?','A toiletry.','Hard','2024-07-10 03:24:53.974915'),(107,'Bathroom Riddles','Why didn\'t the skeleton use a towel?','Because he always comes out bone dry.','Medium','2024-07-10 03:24:53.978308'),(108,'Bathroom Riddles','Why do you never bring a Pokemon into the bathroom with you?','They might Pikachu (Peek at u)','Medium','2024-07-10 03:24:53.980481'),(109,'Bathroom Riddles','Which rock singer really, REALLY needs a shower?','Mud-donna.','Easy','2024-07-10 03:24:53.982437'),(110,'Bathroom Riddles','Why did the toilet paper roll down the hill?','To get to the bottom.','Hard','2024-07-10 03:24:53.984393'),(111,'Bathroom Riddles','What does the Easter Bunny do after it takes a shower?','He uses a Hare dryer','Hard','2024-07-10 03:24:53.986253'),(112,'Bathroom Riddles','Imagine you are on a sinking raft in the middle of the Pacific with great white sharks surrounding you. How do you stop this predicament?','Stop imagining!','Hard','2024-07-10 03:24:53.988300'),(113,'Bathroom Riddles','Why did the prisoner take a shower before he broke out of jail?','He wanted to make a clean getaway','Medium','2024-07-10 03:24:53.990375'),(114,'Bathroom Riddles','Why can\'t the toilet paper cross the road?','Because it got stuck in the crack.','Easy','2024-07-10 03:24:53.992139'),(115,'Bathroom Riddles','A farmer has never taken a shower in his life. He gets dirty every day, wears no cleansing scents, and is always clean at the end of the day. How is this possible?','The farmer takes a bath every day.','Medium','2024-07-10 03:24:53.994101'),(116,'Bathroom Riddles','The more you dry yourself with me the more I get wet. What am I?','A towel.','Easy','2024-07-10 03:24:53.996156'),(117,'Bathroom Riddles','How can you make a needle float?','Take a thin piece of tissue paper and place the tissue paper under the needle before putting the needle in the water. The tissue paper will eventually sink and the needle will remain floating.','Hard','2024-07-10 03:24:53.998029'),(118,'Bathroom Riddles','When you are wet and it is dry and if you use it, it becomes wet but you\'re completely dry. What is it?','The towel.','Medium','2024-07-10 03:24:53.999748'),(119,'Bathroom Riddles','Each day many people come and visit me, however, they usually only stay for a few minutes. I am considered by many to be very dirty yet few people would want to live without me. What am I?','A toilet.','Medium','2024-07-10 03:24:54.001485'),(120,'Bathroom Riddles','Why do criminals shower so often?','They like to make a clean getaway.','Medium','2024-07-1