dden the ship began to sink. There was no storm and nothing wrong with the ship yet it sank right in front of the spectators\' eyes. What caused the ship to sink?','The \"Submarine\" Captain ordered the crew to dive.','Hard','2024-07-10 03:24:54.029728'),(135,'Bathroom Riddles','What did the faucet say to the shower?','\"You\'re a big drip.\"','Hard','2024-07-10 03:24:54.031418'),(136,'Bathroom Riddles','What do angels sing in the shower?','Soul.','Easy','2024-07-10 03:24:54.033079'),(137,'Bathroom Riddles','Why did Silly Sarah race to the bathroom?','Her boyfriend told her he\'d left a ring in the tub.','Easy','2024-07-10 03:24:54.034576'),(138,'Bathroom Riddles','Four men were in a boat on the lake. The boat turns over, and all four men sink to the bottom of the lake, yet not a single man got wet! Why?','Because they were all married and not single.','Hard','2024-07-10 03:24:54.036030'),(139,'Bathroom Riddles','If someone robbed you in the shower, what would you be?','An eye wetness.','Medium','2024-07-10 03:24:54.038093'),(140,'Bathroom Riddles','What do goblins sing in the shower?','Rhythm and boos.','Hard','2024-07-10 03:24:54.039998'),(141,'Bear Riddles','Why did Tigger go to the bathroom?','He wanted to find his friend, Pooh!','Easy','2024-07-10 03:24:54.041957'),(142,'Bear Riddles','What do you call a bear with no teeth?','A gummy bear.','Medium','2024-07-10 03:24:54.044569'),(143,'Bear Riddles','Why couldn\'t Goldilocks sleep?','Because of night-bears.','Easy','2024-07-10 03:24:54.046868'),(144,'Bear Riddles','Why are teddy bears never hungry?','Because they are stuffed.','Hard','2024-07-10 03:24:54.049396'),(145,'Bear Riddles','A man builds a house with all 4 sides facing south. A bear walks past the house. What color is the bear?','White, the house is built directly on the North Pole.','Medium','2024-07-10 03:24:54.051326'),(146,'Bear Riddles','What do you call a bear with no ear?','A b!','Medium','2024-07-10 03:24:54.053712'),(147,'Bear Riddles','When ar