e hand is worth two in the bush.','Easy','2024-07-10 03:24:54.187916'),(217,'Bird Riddles','Why did the duck get fired from his Easter job?','He kept quacking the eggs.','Easy','2024-07-10 03:24:54.189334'),(218,'Bird Riddles','This thing all things devours: Birds, beasts, trees, flowers; Gnaws iron, bites steel; Grinds hard stones to meal; Slays king, ruins town, And beats high mountain down. What am I?','Time!','Hard','2024-07-10 03:24:54.190541'),(219,'Bird Riddles','What do you call two birds that are in love?','Tweet-hearts','Easy','2024-07-10 03:24:54.191591'),(220,'Bird Riddles','What do you get when you cross a parrot with a centipede?','A walkie-talkie.','Easy','2024-07-10 03:24:54.192890'),(221,'Bird Riddles','Why did the eagle not fly over the sea?','Because if it flew over the sea it will be a seagull.','Medium','2024-07-10 03:24:54.193948'),(222,'Bird Riddles','Birds of a feather flock together. What is the contradictory proverb?','Opposites attract.','Hard','2024-07-10 03:24:54.195193'),(223,'Bird Riddles','How did the chicken manage to pay for, \'A de Luxe\' roost?','By Higher Perchase.','Hard','2024-07-10 03:24:54.196837'),(224,'Bird Riddles','Why was the Easter egg hiding?','It was a little chicken!','Easy','2024-07-10 03:24:54.198268'),(225,'Bird Riddles','Why are the rates at the bird hotel so much higher than other 4-star hotels?','Toucan stay for one!','Easy','2024-07-10 03:24:54.199511'),(226,'Bird Riddles','What does a chicken say instead of good?','EGGcelent','Easy','2024-07-10 03:24:54.201092'),(227,'Bird Riddles','Twenty-seven ducks are going to the pond. Five of them got lost, thirteen of them are staying home, and nine of them are at the pond. Where are the rest of them?','There aren\'t any anywhere else.','Easy','2024-07-10 03:24:54.202157'),(228,'Bird Riddles','A fast-food restaurant sells chicken in orders of 6,9 and 20. What\'s the largest number of pieces of chicken you cannot order from the restaurant?','43 is the last number that doesn\'t fall into these categories.','Hard','2024-07-10 03:24:54.203381'),(229,'Bird Riddles','Can one bird change a light bulb?','No, but toucan!','Easy','2024-07-10 03:24:54.204901'),(230,'Bird Riddles','Why does a chicken coop have two doors?','Because, if it had four it would be a sedan.','Hard','2024-07-10 03:24:54.206069'),(231,'Bird Riddles','What did the parrot say on the 4th of July?','\"Poly wants a firecracker!\"','Easy','2024-07-10 03:24:54.207487'),(232,'Bird Riddles','What does the cow say when he agrees with the duck?','The feeling is mootual.','Medium','2024-07-10 03:24:54.208897'),(233,'Bird Riddles','What animal would you get crossed a duck, a beaver, and an otter?','A platypus.','Easy','2024-07-10 03:24:54.210659'),(234,'Bird Riddles','What kind of can never needs a can-opener?','A toucan!','Easy','2024-07-10 03:24:54.211945'),(235,'Bird Riddles','Why did the woolly mammoth cross the road?','Because there were no chickens in the ice age!','Easy','2024-07-10 03:24:54.213552'),(236,'Bird Riddles','There are 10 birds on a branch, a man shot 5 of them. How many were left?','Zero, because when birds see someone coming or hear something they fly away.','Hard','2024-07-10 03:24:54.214886'),(237,'Bird Riddles','NASA was considering sending canaries into space to study them under zero gravity. The project was scrapped when someone realized that in spite of having sufficient water supplies, they could die of dehydration within a few hours. Why?','Birds, unlike humans, need gravity to swallow. Humans can swallow even while hanging upside down.','Easy','2024-07-10 03:24:54.216176'),(238,'Bird Riddles','What are the freedom of birds and the pen of old men?','Feathers. Feathers make up a bird\'s wings, giving it flight or freedom. Quill pens were used by men in older times.','Hard','2024-07-10 03:24:54.217947'),(239,'Bird Riddles','What do you get when you cross Santa Claus and a duck?','A Christmas quacker.','Hard','2024-07-10 03:24:54.219294'),(240,'Bird Riddles','Why don\'t chickens play baseball?','Because they hit fowl balls.','Hard','2024-07-10 03:24:54.221028'),(241,'Bird Riddles','Why did the chicken cross the playground?','To get to the other slide!','Easy','2024-07-10 03:24:54.222646'),(242,'Bird Riddles','In what place did the rooster crow when all the world heard him?','In Noah\'s Ark.','Medium','2024-07-10 03:24:54.224299'),(243,'Bird Riddles','A bird has a head 9cm long. The tail is equal to the size of the head plus half of the size of the body. The body is the size of the head plus the tail. How long is the bird?','72cm. Th head is 9cm. The tail is 18 + 9= 27cm. The body is 9 + 18 + 9= 36cm. 9 + 27 + 36= 72cm.','Hard','2024-07-10 03:24:54.225987'),(244,'Bird Riddles','A large truck is crossing a bridge 1 mile long. The bridge can only hold 14000 lbs, which is the exact weight of the truck. The truck makes it halfway across the bridge and stops. A bird lands on the truck. Does the bridge collapse?','No, it does not collapse. Because it has driven a half-mile - you would subtract the gas used from the total weight of the truck.','Medium','2024-07-10 03:24:54.227456'),(245,'Bird Riddles','What kind of can never needs a can-opener?','A pelican!','Medium','2024-07-10 03:24:54.230110'),(246,'Bird Riddles','A great banquet was prepared for a Roman emperor and his courtiers. 22 Dormice, 40 Larks\' Tongues, 30 Flamingos, and 40 Roast Parrots were served. How many portions of Boiled Ostrich were served?','42. Each vowel is worth 2 and each consonant 4, so Dormice gives 22, etc.','Hard','2024-07-10 03:24:54.231622'),(247,'Black Riddles','I am white when I am dirty, and black when I am clean. What am I?','A','Easy','2024-07-10 03:24:54.233180'),(248,'Black Riddles','What is black when you buy it, red when you use it, and gray when you throw it away?','Charcoal.','Easy','2024-07-10 03:24:54.234612'),(249,'Black Riddles','When is it bad luck to see a','When you are a mouse.','Medium','2024-07-10 03:24:54.235982'),(250,'Black Riddles','Why is Santa so good at Karate?','Because he has a black belt.','Hard','2024-07-10 03:24:54.237871'),(251,'Black Riddles','I\'m clean when I\'m black, Dirty when white; Get too close, And you might sneeze. What am I?','A Chalkboard.','Medium','2024-07-10 03:24:54.239272'),(252,'Black Riddles','I am white, black, and read all over. What am I?','Newspaper!','Hard','2024-07-10 03:24:54.240993'),(253,'Black Riddles','Pronounced as one letter, And written with three, Two letters there are, And two only in me. I\'m double, I\'m single, I\'m black, blue, and gray, I\'m read from both ends, And the same either way. What am I?','An eye.','Easy','2024-07-10 03:24:54.242246'),(254,'Black Riddles','Take one out and scratch my head, I am now black but once was red. What am I?','A Match.','Hard','2024-07-10 03:24:54.243984'),(255,'Black Riddles','What do you get when you cross a black cat and a lemon?','A Sour Puss.','Medium','2024-07-10 03:24:54.245763'),(256,'Black Riddles','If there is a Yellow house on Bluebird Lane, a Green House on Orange Street, a Pink house on Kitten Road, a Black House on Whitehorse Pike, and a Purple house on Firebird hill, where is the White House?','Washington, D.C.','Medium','2024-07-10 03:24:54.247185'),(257,'Black Riddles','You get 2 clues to this riddle. 1. It can be green, black, or even sweet. 2. It sounds like a letter. What is it?','Tea.','Hard','2024-07-10 03:24:54.248838'),(258,'Black Riddles','I am not a person or an animal. I was born from the death of something large and hot. I am capable of consuming anything and everything. I am very dark and exist in a place where there is no gravity. What am I?','A black hole.','Hard','2024-07-10 03:24:54.250547'),(259,'Black Riddles','Duels of good and evil, A fighter of good am I, Revealed beside watched words, King of the black night sky. What am I?','The dark.','Hard','2024-07-10 03:24:54.252270'),(260,'Black Riddles','Dark with white markings, smooth like a rock. Where learning occurs, I help convey thought. What am I?','Blackboard/chalkboard.','Easy','2024-07-10 03:24:54.254081'),(261,'Black Riddles','With three eyes and a black as night, I frequently knock down ten men with a single strike! What am I?','A Bowling ball.','Medium','2024-07-10 03:24:54.255688'),(262,'Black Riddles','Tear off one and scratch its head, what was red is now black instead. What is It?','A Matchstick!','Hard','2024-07-10 03:24:54.257309'),(263,'Black Riddles','Dead on the field lie ten soldiers in white, felled by three eyes, black as night. What happened?','A strike was thrown in 10-pin bowling.','Easy','2024-07-10 03:24:54.258894'),(264,'Black Riddles','The king of the jungle, rare as gold, black as night, in light not there and night not seen. Goes in water, goes on trees, goes in caves, goes on the ground. Claws of knives, teeth of swords, the roar of death but silent as a mouse. What is it?','A','Medium','2024-07-10 03:24:54.260293'),(265,'Black Riddles','What 3 common songs have the same melody?','Baa Baa Black Sheep twinkle twinkle little star and the Alphabet song! wow kid songs','Medium','2024-07-10 03:24:54.262278'),(266,'Black Riddles','What do you call a tavern of blackbirds?','A crowbar.','Easy','2024-07-10 03:24:54.264520'),(267,'Black Riddles','I\'m blue at day and black at night; I do contain some creatures born and died. What am I?','Sea water.','Medium','2024-07-10 03:24:54.267759'),(268,'Black Riddles','I always point in the right direction. My instructions are written in black and white. Disobey me and pay the consequences. I will never say more than two words at a time. What am I?','A \"One Way\" sign!','Hard','2024-07-10 03:24:54.270127'),(269,'Black Riddles','I\'m as plain to see as black & white. I prefer to roam about at night. Just don\'t attack or startle me. Or odiferous emissions may result you see. I\'m an omnivore yes it\'s true. But what\'s my name tell me do?','I am a skunk!','Hard','2024-07-10 03:24:54.272208'),(270,'Black Riddles'