y clothing, People think I am cool. What am I?','The Nike Symbol.','Easy','2024-07-10 03:24:54.314022'),(291,'Black Riddles','Out of 100 ladies attending the gala,85 had a white handbag;75 had black shoes;60 carried an umbrella;90 wore a ring; How many ladies must have had all four items?','10 Divide by 3. All the ladies had three items. The remainder shows the number of ladies who had 4. 85756090______310 / 3 = 100 + 10 remainder','Easy','2024-07-10 03:24:54.316068'),(292,'Black Riddles','Why do black sheep eat less than white sheep?','Because there are fewer black','Medium','2024-07-10 03:24:54.318192'),(293,'Black Riddles','The land was white the seed was black It\'ll take a good scholar to riddle me that. What am I?','An eye or an eyeball','Easy','2024-07-10 03:24:54.320334'),(294,'Black Riddles','Black I am and much admired, men seek me until they\'re tired. When they find me, they break my head and take from me my resting bed. What am I?','Coal','Easy','2024-07-10 03:24:54.322608'),(295,'Boat Riddles','Where do you take a sick boat?','To the dock!','Easy','2024-07-10 03:24:54.324650'),(296,'Boat Riddles','You can feel me but, I can\'t feel you. I can uproot trees and tear roofs off their houses. Yet, I can make a Baby sleep and be gentle. I can howl and whisper. I can spread and stop fires. I can toss boats and help them glide too. What am I?','I am the wind.','Hard','2024-07-10 03:24:54.326671'),(297,'Boat Riddles','A man is on one side of a river, his dog on the other. The man calls his dog, who immediately crossed the river without getting wet and without using a bridge or a boat. How did the dog do it?','The river was frozen.','Medium','2024-07-10 03:24:54.328618'),(298,'Boat Riddles','You walk onto a bridge you see a boat full of people but there is not a single person on it. How is that possible?','There all married.','Easy','2024-07-10 03:24:54.330632'),(299,'Boat Riddles','Pete and Repeat were on a boat. Pete fell out, who was left on the boat?','Repeat! Pete and Repeat were on a boat. Pete fell out, who was left on the boat? Repeat! Pete and Repeat were on a boat. Pete fell out, who was left on the boat? Repeat! Pete and Repeat were on a boat. Pete fell out, who was left on the boat? Repeat! Pete and Repeat were on a boat. Pete fell out, who was left on the boat? Repeat! Ex','Easy','2024-07-10 03:24:54.332823'),(300,'Boat Riddles','Two men had to go to the other side of the river, there is one boat, but only one person fits on it. Luckily they both got to the other side of the river. How?','They were on opposite sides of the river.','Hard','2024-07-10 03:24:54.335678'),(301,'Boat Riddles','What is a vampire\'s favorite boat to travel on?','A blood vessel.','Easy','2024-07-10 03:24:54.337695'),(302,'Boat Riddles','What house has a post on top, A roof at the bottom, While the rain comes from below?','A boat.','Easy','2024-07-10 03:24:54.339864'),(303,'Boat Riddles','What type of boat has authority?','Ownership!','Medium','2024-07-10 03:24:54.341725'),(304,'Boat Riddles','I dance in the wind and I bow to a storm. I grow best in temperatures that are warm. By the riverbeds, I like to grow, where the people in boats like to row. What am I?','A river reed. Didn\'t guess it did you?','Hard','2024-07-10 03:24:54.343776'),(305,'Boat Riddles','I\'m done to boats, to cargo, to loads; When indoors I\'m, in a way, a narrow road. What am I?','Haul?/ Hall','Hard','2024-07-10 03:24:54.345846'),(306,'Boat Riddles','Two people are standing on the bank of a river looking forward to crossing to the other side. There is one boat with a capacity for one person. The two people managed to cross the river safely. How did they do it?','The two were on opposite sides of the river.','Easy','2024-07-10 03:24:54.348155'),(307,'Boat Riddles','When is a boat like a knife?','When it is a cutter.','Hard','2024-07-10 03:24:54.350685'),(308,'Boat Riddles','A pro fisherman decided to become a pro golfer. In order to buy his clubs, he had to sell his boat. How did he list it?','Fore Sail!','Medium','2024-07-10 03:24:54.352971'),(309,'Boat Riddles','Why is a ferry boat like a good rule?','Because it works both ways.','Hard','2024-07-10 03:24:54.355285'),(310,'Boat Riddles','Four men were in a boat on the lake. The boat turns over, and all four men sink to the bottom of the lake, yet not a single man got wet! Why?','Because they were all married and not single.','Medium','2024-07-10 03:24:54.357954'),(311,'Boat Riddles','Peter celebrated his birthday on one day, and two days later his older twin brother, Paul, celebrated his birthday. How could this be?','When the mother of the twins went into labor, she was traveling by boat. The older twin, Paul, was born first, barely on March 1st. The boat then crossed a time zone, and the younger twin was born on February the 28th. In a leap year, the younger twin celebrates his birthday two days before his older brother.','Easy','2024-07-10 03:24:54.360346'),(312,'Boat Riddles','A girl went over to the U.S. on the 4th of July and partied for 3 days and came back on the 4th of July. How did she do that?','She went over on the date of the 4th of July and came home on the boat called the 4th of July.','Easy','2024-07-10 03:24:54.362668'),(313,'Brother Riddles','Mr. and Mrs. Mustard have six daughters and each daughter has one brother. How many people are in the Mustard family?','There are nine Mustards in the family. Since each daughter shares the same brother, there are six girls, one boy, and Mr. and Mrs. Mustard.','Easy','2024-07-10 03:24:54.364734'),(314,'Brother Riddles','I have a heart that never beats, I have a home but I never sleep. I can take a man\'s house and build another, And I love to play games with my many brothers. I am a king among fools. Who am I?','The King of Hearts in a deck of cards.','Easy','2024-07-10 03:24:54.366798'),(315,'Brother Riddles','There is a brother and a sister. The boy wants to visit his father in jail, and the sister wants to visit her