of the twins went into labor, she was traveling by boat. The older twin, Paul, was born first, barely on March 1st. The boat then crossed a time zone, and the younger twin was born on February 28th. In a leap year, the younger twin celebrates his birthday two days before his older brother.','Hard','2024-07-10 03:24:54.432369'),(341,'Chicken Riddles','There are 30 cows in a field, and 28 chickens. How many didn\'t?','10. Listen closely: 30 cows, and twenty-eight chickens. Say EIGHT and ATE. They sound the same. Therefore, it means 20 ATE chickens. 30-20=10, so 10 cows didn\'t eat any chickens.','Easy','2024-07-10 03:24:54.434626'),(342,'Chicken Riddles','If a rooster laid a brown egg and a white egg, what kind of chicks would hatch?','Roosters don\'t lay eggs.','Easy','2024-07-10 03:24:54.436745'),(343,'Chicken Riddles','Why did the turkey cross the road?','To prove he wasn\'t chicken.','Hard','2024-07-10 03:24:54.438986'),(344,'Chicken Riddles','If a chicken says, \"All chickens are liars\". Is the chicken telling the truth?','Answer: Chickens cannot talk.','Medium','2024-07-10 03:24:54.441553'),(345,'Chicken Riddles','If it takes 5 microwaves 5 minutes to cook 5 chickens, how long does it take 100 microwaves to cook 100 chickens?','5 minutes. We can assume that one chicken is placed in each microwave and that each chicken takes 5 minutes to cook.','Hard','2024-07-10 03:24:54.443759'),(346,'Chicken Riddles','Why do chickens lay eggs?','Because if they drop them, they will break.','Easy','2024-07-10 03:24:54.446481'),(347,'Chicken Riddles','What\'s 3/7 chicken, 2/3 cat, and 2/4 goat?','Chicago. The first three words out of seven of chicken is CHI, the first two words out of 3 of cat is CA, and first two words out of','Easy','2024-07-10 03:24:54.448896'),(348,'Chicken Riddles','What did the scientist get when he crossed a chicken and a cow?','Roost beef.','Easy','2024-07-10 03:24:54.451171'),(349,'Chicken Riddles','What do you get if you cross a hen with a guitar?','A chicken that plucks itself.','Medium','2024-07-10 03:24:54.454260'),(350,'Chicken Riddles','What do you call a chicken with bad sunburn?','Fried Chicken.','Hard','2024-07-10 03:24:54.456537'),(351,'Chicken Riddles','Why did the chicken cross the road twice, and jump in the mud?','He was a dirty double-crosser.','Easy','2024-07-10 03:24:54.459581'),(352,'Chicken Riddles','If a rooster laid 11 eggs and the farmer took 5 of them and another','0, Roosters don\'t lay eggs.','Easy','2024-07-10 03:24:54.462230'),(353,'Chicken Riddles','A mouse, a squirrel, a duck, a chicken, and an elephant are sitting on the side of the road. Someone offers them a lift, but one prefers to stay. Who preferred to stay?','The Elephant Stayed. If you didn\'t know, elephants are scared of mice.','Medium','2024-07-10 03:24:54.464420'),(354,'Chicken Riddles','Why did the sheriff arrest the chicken?','It used fowl language','Easy','2024-07-10 03:24:54.466462'),(355,'Chicken Riddles','Why was the chicken forbidden from sending e-mails?','Because he kept using fowl language.','Medium','2024-07-10 03:24:54.469035'),(356,'Chicken Riddles','My call, I pray, at dawn of day, Shall rest you from your slumber, With job all done, my song all sung, I\'ll sit on the seat of lumber. What am I?','A Rooster.','Easy','2024-07-10 03:24:54.471650'),(357,'Chicken Riddles','How do chickens like to dance?','Chick to chick','Hard','2024-07-10 03:24:54.474210'),(358,'Chicken Riddles','Under no circumstances compute the number of your barnyard fowl previous to their incubation. What is the proverb?','Do not count your chickens before they hatch.','Medium','2024-07-10 03:24:54.476673'),(359,'Chicken Riddles','A Rooster laid an','It didn\'t. And since when do Roosters lay Eggs?','Medium','2024-07-10 03:24:54.479446'),(360,'Chicken Riddles','I have a house with no doors no windows, nothing. If I want to get out I break the wall. Who am I?','Chicken as if it wants to come out breaks the wall.','Medium','2024-07-10 03:24:54.481722'),(361,'Chicken Riddles','If a rooster lays an egg on the ridge of a roof, which side will the egg fall on?','Roosters don��t lay eggs. Hen��s do.','Easy','2024-07-10 03:24:54.483592'),(362,'Chicken Riddles','How did the chicken manage to pay for, \'A de Luxe\' roost?','By Higher Perch-ase.','Medium','2024-07-10 03:24:54.485529'),(363,'Chicken Riddles','Why was the','It was a little chicken!','Easy','2024-07-10 03:24:54.487412'),(364,'Chicken Riddles','What does a chicken say instead of good?','EGGcelent','Hard','2024-07-10 03:24:54.489970'),(365,'Chicken Riddles','He\'s a boastful, puffed-up fellow, wearing spurs; eyes gleaming yellow. As he proudly struts about, he\'s in charge, there is no doubt. What is he?','He is a Rooster.','Easy','2024-07-10 03:24:54.492048'),(366,'Chicken Riddles','A fast-food restaurant sells chicken in orders of 6,9 and 20. What\'s the largest number of pieces of chicken you cannot order from the restaurant?','43 is the last number that doesn\'t fall into these categories.','Medium','2024-07-10 03:24:54.493762'),(367,'Chicken Riddles','Why does a chicken coop have two doors?','Because, if it had four it would be a sedan.','Easy','2024-07-10 03:24:54.495310'),(368,'Chicken Riddles','Why did the woolly mammoth cross the road?','Because there were no chickens in the ice age!','Hard','2024-07-10 03:24:54.497301'),(369,'Chicken Riddles','Why don\'t chickens play baseball?','Because they hit fowl balls.','Hard','2024-07-10 03:24:54.499263'),(370,'Chicken Riddles','Why did the chicken cross the playground?','To get to the other slide!','Medium','2024-07-10 03:24:54.501111'),(371,'Chicken Riddles','What is the time-piece, That needs no winding?','A rooster.','Easy','2024-07-10 03:24:54.502712'),(372,'Chicken Riddles','In what place did the rooster crow when all the world heard him?','In Noah\'s Ark.','Medium','2024-07-10 03:24:54.504583'),(373,'Classroom Riddles','Why does the teacher wear sunglasses when she comes to the class?','Because the students are bright.','Easy','2024-07-10 03:24:54.506638'),(374,'Classroom Riddles','When is homework not homework?','When it\'s done at school.','Hard','2024-07-10 03:24:54.508332'),(375,'Classroom Riddles','A teacher is yelling, she closes the door, the window, and a book. What did she forget to close?','Her mouth.','Hard','2024-07-10 03:24:54.509826'),(376,'Classroom Riddles','What do mathematics teachers like to eat?','Pi.','Easy','2024-07-10 03:24:54.511303'),(377,'Classroom Riddles','Why did the boy eat his homework?','Because the teacher said it was a piece of cake.','Medium','2024-07-10 03:24:54.513171'),(378,'Classroom Riddles','What happened to the plant in the math classroom?','It grew square roots, of course.','Medium','2024-07-10 03:24:54.514476'),(379,'Classroom Riddles','What is the most useful instrument in a mathematics teacher\'s tool kit?','Multi-pilers!','Easy','2024-07-10 03:24:54.517163'),(380,'Classroom Riddles','What do grape students do when they have a question?','Raisin their hand!','Easy','2024-07-10 03:24:54.520025'),(381,'Classroom Riddles','What\'s the difference between a Teacher and a Train?','The Teacher says \"Spit out your gum!\" And the train says \"Chew, Chew, Chew!\"','Easy','2024-07-10 03:24:54.522011'),(382,'Classroom Riddles','What are the science teacher\'s favorite states?','Solid, Liquid, Gas. The states of all matter.','Hard','2024-07-10 03:24:54.523584'),(383,'Classroom Riddles','1. Where do fish go on vacation? 2. Where do songbirds go on vacation? 3. Where do zombies go on vacation? 4. Where do Thanksgiving Birds go on vacation? 5. Where do geometry teachers go on vacation? 6. Where do locksmiths go on vacation?','1. Finland 2. The Canary Islands 3. The Dead Sea 4. Turkey 5. Cuba 6. The Florida Keys','Hard','2024-07-10 03:24:54.525397'),(384,'Classroom Riddles','A student was once given a simple task to accomplish. He was given 6 numbers: 1, 10, 20, 30, 40, and 80, and was told to sum them together to be equal to 100. At last, he was able to accomplish this task. How did he do it?','He read 10 and 80 backward to give him 01 and 08 respectively. So, 1 + 01 + 20 + 30 + 40 + 08 = 100.','Easy','2024-07-10 03:24:54.527528'),(385,'Classroom Riddles','What word can be grammatically correct when used consecutively in the English language?','Had: \"James while John had had had had had had had had had had had a better effect on the teacher\" is an English sentence used to demonstrate lexical ambiguity and the necessity of punctuation, which serves as a substitute for the intonation, stress, and pauses found in speech.\"-Wikipedia. Cool, Huh?','Hard','2024-07-10 03:24:54.530148'),(386,'Classroom Riddles','In the olden days, the student of logic was given this problem: If half of 5 were 3, what would one-third of 10 be?','It would be 4.','Hard','2024-07-10 03:24:54.532033'),(387,'Classroom Riddles','Why was the student\'s homework in his father\'s handwriting?','Because the student borrowed his pen.','Easy','2024-07-10 03:24:54.534139'),(388,'Dark Riddles','A man rode out of town on Sunday, he stayed a whole night at a hotel and rode back to town the next day on Sunday. How is this possible?','His Horse was called Sunday!','Hard','2024-07-10 03:24:54.536090'),(389,'Dark Riddles','It can\'t be seen, can\'t be felt, can\'t be heard, and can\'t be smelt. It lies behind stars and under hills, And empty holes it fills. It comes first and follows after, Ends life, and kills laughter. What is it?','The dark.','Hard','2024-07-10 03:24:54.538003'),(390,'Dark Riddles','I always follow you around, everywhere you go at night. I look very bright to people, but I can make the sun dark. I can be in many different forms and shapes. What am I?','The moon!','Medium','2024-07-10 03:24:54.539739'),(391,'Dark Riddles','I run in and out of town all day and night. What am I?','A road.','Easy','2024-07-10 03:24:54.541575'),(392,'Dark Riddles','I was carried into a dark room, and set on fire. I wept, and then my head was cut off. What am I?','A Candle.','Medium','2024-07-10 03:24:54.543551'),(393,'Dark Riddles','What did Sir Lancelot wear to bed?','A knight gown!','Easy','2024-07-10 03:24:54.545883'),(394,'Dark Riddles','I am the beginning of sorrow and the end of sickness. You cannot express happiness without me, yet I am in the midst of crosses. I am always in risk, yet never in danger. You may find me in the sun, but I am never out of darkness. What am I?','The letter S.','Medium','2024-07-10 03:24:54.547701'),(395,'Dark Riddles','A little pool with two layers of wall around it. One white and soft and the other dark and hard, amidst a light brown grassy lawn with an outline of green grass. What am I?','A Coconut.','Hard','2024-07-10 03:24:54.549879'),(396,'Dark Riddles','How do you know that a vampire loves baseball?','Because he turns into a bat every night.','Medium','2024-07-10 03:24:54.552111'),(397,'Dark Riddles','What falls down but never breaks?','Nightfall.','Hard','2024-07-10 03:24:54.554724'),(398,'Dark Riddles','What boy wizard magically grew a beard each night?','Hairy Potter.','Medium','2024-07-10 03:24:54.556414'),(399,'Dark Riddles','Why couldn\'t Goldilocks sleep?','Because of nightbears.','Easy','2024-07-10 03:24:54.559027'),(400,'Dark Riddles','When I point up it\'s bright, but when I point down it\'s dark. What am I?','A Light Switch.','Hard','2024-07-10 03:24:54.561252'),(401,'Dark Riddles','I\'m like a doll, But I\'m not for playing; I stand up straight, but if windy I may be laying; I\'m well-known and famous for having no brain; I work outside both day and night in sunshine or in rain. What am I?','A Scarecrow.','Medium','2024-07-10 03:24:54.563298'),(402,'Dark Riddles','Lovely and round, I shine with pale light, grown in the darkness, A lady\'s delight. What am I?','A Pearl.','Easy','2024-07-10 03:24:54.565959'),(403,'Dark Riddles','They are dark and always on the run. Without the sun, there would be none. What are they?','Shadows.','Easy','2024-07-10 03:24:54.567669'),(404,'Dark Riddles','Why does a dragon sleep all day?','So it can hunt knights!','Medium','2024-07-10 03:24:54.569228'),(405,'Dark Riddles','What falls but doesn\'t break, and what breaks but doesn\'t fall?','Night and Day.','Easy','2024-07-10 03:24:54.570756'),(406,'Dark Riddles','I follow you by day, by night I blend right in but no one sees me except when I\'m in the light. What am I?','A shadow.','Easy','2024-07-10 03:24:54.572370'),(407,'Dark Riddles','Every night, I\'m told what to do. And every morning, I do what you tell me to do. But you still get mad at me and hit me. What am I?','An alarm clock.','Hard','2024-07-10 03:24:54.574145'),(408,'Dark Riddles','I weaken all men for hours each day. I show you strange visions while you are away. I take you by night, by day take you back, None suffer to have me, but do from my lack. What am I?','Sleep.','Hard','2024-07-10 03:24:54.576182'),(409,'Dark Riddles','My first four letters describe all living things. My last five letters are another word for knight. My job is to save you, and I\'m a fan of water. Who am I?','I��m a lifeguard','Easy','2024-07-10 03:24:54.578050'),(410,'Dark Riddles','A man rides into town on Friday. He stays two nights. How does he leave on Tuesday?','His horse was called Friday.','Hard','2024-07-10 03:24:54.579495'),(411,'Dark Riddles','Who always stalks you during the day but becomes too tired to stalk you at night?','Your own shadow!','Easy','2024-07-10 03:24:54.581128'),(412,'Dark Riddles','People have stepped on me, but not many. I never stay full for long. I have a dark side. What am I?','The moon.','Hard','2024-07-10 03:24:54.582395'),(413,'Dark Riddles','What do ghosts like to do on a Saturday night?','BOOGIE.','Medium','2024-07-10 03:24:54.583829'),(414,'Dark Riddles','I can fly but have no wings. I can cry but I have no eyes. Wherever I go, darkness follows me. What am I?','Clouds.','Hard','2024-07-10 03:24:54.585249'),(415,'Dark Riddles','The marathon man timed himself and found out that if he wore a bright white outfit he ran 20 miles in 80 minutes, but when he wore a dark outfit, he ran 20 miles in one hour and twenty minutes. What does this mean for his next race?','Absolutely nothing, as 80 minutes equals an hour and twenty minutes.','Easy','2024-07-10 03:24:54.586608'),(416,'Dark Riddles','I sleep by day, I fly by night. I have no feathers to aid my flight. What am I?','I am a Bat.','Medium','2024-07-10 03:24:54.587863'),(417,'Dark Riddles','What\'s light during the day but heavy during the night?','Eyelids.','Hard','2024-07-10 03:24:54.589724'),(418,'Dark Riddles','You can have me almost every night, sometimes I could be bad sometimes I can be nice or good, Whether you were a child or an adult I\'ll be there. What am I?','Dreams between (Sweet dreams, Nightmare).','Hard','2024-07-10 03:24:54.590922'),(419,'Dark Riddles','I have 16 legs then, I sleep for about a fortnight and a merge with 6 legs. What am I?','A Butterfly','Hard','2024-07-10 03:24:54.592367'),(420,'Dark Riddles','I am not a person nor an animal. I was born from the death of something large and hot. I am capable of consuming anything and everything. I am very dark and exist in a place where there is no gravity. What am I?','A black hole.','Easy','2024-07-10 03:24:54.593879'),(421,'Dark Riddles','At night they come without being fetched, And by day they are lost without being stolen. What are they?','The stars.','Easy','2024-07-10 03:24:54.595338'),(422,'Dark Riddles','Duels of good and evil, A fighter of good am I, Revealed beside watched words, King of the black night sky. What am I?','The dark.','Easy','2024-07-10 03:24:54.597012'),(423,'Dark Riddles','When I am metal or wood, I bring you home. When I am flesh and blood, in the darkness I roam. What am I?','A bat.','Easy','2024-07-10 03:24:54.598298'),(424,'Dark Riddles','A nightmare for some. For others, a savior I come. My hand\'s cold and bleak. It\'s the warm hearts they seek. What am I?','Death.','Easy','2024-07-10 03:24:54.599829'),(425,'Dark Riddles','I grow in the dark and shine in the light; The paler I am, the more I am liked; My maker never gets paid, but never goes on strike. What am I?','A pearl.','Medium','2024-07-10 03:24:54.601489'),(426,'Dark Riddles','I have an eye in the middle of me, but as you see, I cannot see. I am dark and not far away. You don\'t see me every day. I am not night and I am not bright. I can have twists and water and scares. What am I?','A hurricane.','Medium','2024-07-10 03:24:54.602851'),(427,'Dark Riddles','I\'m far away from you, but I still shine bright. I sleep by day, I wake up at night. I stay by the moon but never get close to it. What am I?','A star.','Easy','2024-07-10 03:24:54.604070'),(428,'Dark Riddles','I can\'t t hurt you, but I can leave you with scars. Nobody wants me, but everyone has me. But you are the only one who can see me. What am I?','Nightmares.','Medium','2024-07-10 03:24:54.605695'),(429,'Dark Riddles','You see me at night, by day you tell everyone about me. I come back looking different than before. I sometimes leave you in the darkness. What am I?','A dream.','Hard','2024-07-10 03:24:54.607084'),(430,'Dark Riddles','With three eyes and a black as night, I frequently knock down ten men with a single strike! What am I?','A Bowling ball.','Easy','2024-07-10 03:24:54.608874'),(431,'Dark Riddles','I\'m grown from darkness but shine with a pale light. Very round I am, and always a lady\'s delight. What am I?','A Pearl.','Medium','2024-07-10 03:24:54.610305'),(432,'Dark Riddles','I take you by night, by day take you back. None suffer to have me but do from my lack. What am I?','Sleep','Medium','2024-07-10 03:24:54.611523'),(433,'Dark Riddles','Dead on the field lie ten soldiers in white, felled by three eyes, black as night. What happened?','A strike was thrown in 10-pin bowling.','Hard','2024-07-10 03:24:54.613346'),(434,'Dark Riddles','What loses its head in the morning, and gets it back at night?','A Pillow.','Hard','2024-07-10 03:24:54.615369'),(435,'Dark Riddles','The king of the jungle, rare as gold, black as night, in light not there and night not seen. Goes in water, goes on trees, goes in caves, goes on the ground. Claws of knives, teeth of swords, the roar of death but silent as a mouse. What is it?','A black panther (black jaguar)','Medium','2024-07-10 03:24:54.617052'),(436,'Dark Riddles','I am nothing, I am everything. I am perfect dark, I am the brightest light. I am hungry, I am full. I am nowhere, I am everywhere. I am unseen, I am watched by millions. What am I?','The universe.','Easy','2024-07-10 03:24:54.618524'),(437,'Dark Riddles','I\'m blue at day and black at night; I do contain some creatures born and died. What am I?','Seawater.','Easy','2024-07-10 03:24:54.619864'),(438,'Dark Riddles','I\'m the first thing you see in the morning and the last thing you see at night, I\'m always there but you choose to ignore me, cross your eyes and you will see me. What am I?','Your nose.','Easy','2024-07-10 03:24:54.621516'),(439,'Dark Riddles','Dark with white markings, And smooth like a rock. Where learning occurs, I help convey thought. What am I?','Blackboard/chalkboard.','Hard','2024-07-10 03:24:54.622933'),(440,'Dark Riddles','I welcome the day with a show of light, I stealthily came here in the night. I bathe the earthy stuff at dawn, But by noon, alas! I\'m gone. What am I?','The morning dew!','Medium','2024-07-10 03:24:54.624163'),(441,'Dark Riddles','What brightens your day when it\'s dark, although it\'s usually in the shade?','A lamp.','Medium','2024-07-10 03:24:54.625959'),(442,'Dark Riddles','I\'m as plain to see as black & white. I prefer to roam about at night. Just don\'t attack or startle me. Or odiferous emissions may result you see. I\'m an omnivore yes it\'s true. But what\'s my name tell me do?','I am a skunk!','Easy','2024-07-10 03:24:54.627437'),(443,'Dark Riddles','You use me every day but let me rest at night. I have an identical twin beside me all the time. For some reason, you always cover me up. I am not alive but I have a soul. What am I?','Your Feet.','Easy','2024-07-10 03:24:54.629072'),(444,'Dark Riddles','I watch you sleep, I haunt you by day. You stare at me and saw nothing, but darkness. What am I?','Fear.','Medium','2024-07-10 03:24:54.630771'),(445,'Dark Riddles','Sometimes I am black, sometimes I am white sometimes you can see me at night. I have friends that are with me that are much smaller. Some of you have walked on me but not all. What am I?','The Moon.','Medium','2024-07-10 03:24:54.632400'),(446,'Dark Riddles','I usually wear a yellow coat. I usually have a dark head. I make marks wherever I go. What am I?','A pencil.','Hard','2024-07-10 03:24:54.633919'),(447,'Dark Riddles','My first is in ocean but never in sea, my second\'s in wasp but never in bee. My third is in glider and also in flight, my whole is a creature that comes out at night. What am I?','An Owl.','Hard','2024-07-10 03:24:54.635291'),(448,'Dark Riddles','I come out at night, I am neither human nor animal, I rarely eat I only drink, I can only be found at night, I will glow in the sunlight. What am I?','A vampire.','Easy','2024-07-10 03:24:54.636972'),(449,'Dark Riddles','Imagine you are in a dark room. How do you get out?','Stop imagining.','Hard','2024-07-10 03:24:54.638451'),(450,'Dark Riddles','Allan survived 12 days without sleep. How is this possible?','He sleeps during the night.','Medium','2024-07-10 03:24:54.640435'),(451,'Dark Riddles','The man had not slept in days, yet he was well-rested. How could this be?','He only sleeps at night (he had not slept in DAYS)','Easy','2024-07-10 03:24:54.642365'),(452,'Dark Riddles','I am life, yet not real. When we first meet, things are dark. When we leave each other, you are in the light. I meet many people with and after you. What am I?','A movie.','Easy','2024-07-10 03:24:54.643972'),(453,'Dark Riddles','I have billions of eyes, yet I live in darkness. I have millions of ears, yet only four lobes. I have no muscle, yet I rule two hemispheres. What am I?','The human brain.','Easy','2024-07-10 03:24:54.645841'),(454,'Dark Riddles','In a tunnel of darkness lies a beast of iron. It can only attack when pulled back. What is it?','A bullet.','Medium','2024-07-10 03:24:54.647530'),(455,'Dark Riddles','The ghost of the mountain never to be seen, leaps like a raging fire to catch his prey. As pale as the moon but fast as the wind. Cold as ice, but a flash of light in the night. What is it?','A snow leopard.','Hard','2024-07-10 03:24:54.649069'),(456,'Dark Riddles','My body has a dozen heads or more, My tails don\'t wag when you walk in the door. Count the ways you can hold me tight, Or use me for a special night! What Am I?','A piggy bank.','Hard','2024-07-10 03:24:54.650627'),(457,'Dark Riddles','From dawn to dusk I soar through the sky, A thunderous voice, but silent I fly. Through the darkest depths, I will not die, Yet I can not be seen by the naked eye. What am I?','Radio waves.','Medium','2024-07-10 03:24:54.652485'),(458,'Dark Riddles','A group of men is suddenly awakened by a loud, piercing, continuous sound. They all scramble out of their beds, get dressed, grab a pole, and disappear into a hole. What in the world are these men doing?','The men are firemen who were on night-shift duty at their firehouse. When they heard the fire alarm, they got dressed, slid down the fire pole, and got in the fire truck.','Medium','2024-07-10 03:24:54.654328'),(459,'Dark Riddles','What falls but never breaks? What breaks but never falls?','Night and Day!','Hard','2024-07-10 03:24:54.656126'),(460,'Dark Riddles','A light aloft alone in shadow, I light the way for paths you follow. What am I?','\"Lampost\" - Reasoning: Often, a street lampost will be a source of light above paths that are often traveled at night, hence it is the reference to this lonely light guiding you on paths through the darkness.','Easy','2024-07-10 03:24:54.658006'),(461,'Dark Riddles','I scream out in the dark, I bring light to you, my flame whispers in the darkness. What am I?','A candle.','Easy','2024-07-10 03:24:54.659808'),(462,'Dark Riddles','Nick timed himself and found out that if he wore a bright white outfit he ran 20 miles in 80 minutes, but when he wore a dark outfit, he ran 20 miles in one hour and twenty minutes. What does this mean for his next race?','Nothing, as 80 minutes equals an hour and twenty minutes.','Easy','2024-07-10 03:24:54.661830'),(463,'Dark Riddles','In the light, I may reflect. In the dark, I\'m cold and wet. What am I?','Water.','Medium','2024-07-10 03:24:54.664084'),(464,'Dark Riddles','From house to house he goes, A messenger small and slight. And whether it rains or snows, He sleeps outside at night. What am I?','A Street or Road.','Hard','2024-07-10 03:24:54.666411'),(465,'Dark Riddles','Where once there were many, now there are none. Time has done ticking; the hours are done. For now, is an end, but also beginning, For darkest is now, but soon shall be thinning. What is it?','\"Midnight\" - Reasoning: The riddle is all about following something through to the end - a day. Once the day reaches its end, at midnight, when all the hours of the day are gone, right down to the last second, the clock resets. Thus, it marks both the end of a day and the beginning of a new one.','Medium','2024-07-10 03:24:54.668409'),(466,'Dark Riddles','Stealthy as a shadow in the dead of night, Cunning but affectionate if given a bite. Never owned but often loved. In my','A cat.','Hard','2024-07-10 03:24:54.670931'),(467,'Dark Riddles','Which is the creature that has one voice, but has four feet in the morning, two feet in the afternoon, and three feet at night?','Man crawls on all fours as a baby, walks on two as an adult, and needs a walking cane when old.','Hard','2024-07-10 03:24:54.673156'),(468,'Dark Riddles','A glow in the dark, A place without life, Where a small spark, Means the greatest strife. Where am I?','Space.','Hard','2024-07-10 03:24:54.675256'),(469,'Dark Riddles','One knight, a pregnant lady, and a doctor walk into a hospital, the next morning three people walk out, who was the third person?','The knight.','Medium','2024-07-10 03:24:54.677419'),(470,'Dark Riddles','Spelled forwards is a type of rodent that you might find in drains, spelled backward is something that you cannot touch but see it every day at night. What is this word?','Rats, star.','Hard','2024-07-10 03:24:54.679269'),(471,'Dark Riddles','My first is a part of the day, My last a conductor of light, My whole to take the measure of time, Is useful by day and by night. What am I?','An Hour-glass.','Easy','2024-07-10 03:24:54.681338'),(472,'Dark Riddles','There lived a man in a house and every time he went to bed he turned on the light. One night, the man forgot to turn on the light. The next day he read the paper and killed himself. Why?','The man lived in a lighthouse. He forgot to turn on the light and a ship crashed. The next morning he read in the paper that the ship crashed and killed himself because he felt guilty.','Medium','2024-07-10 03:24:54.683100'),(473,'Dark Riddles','Which would see most clearly in total darkness? A bat, a tiger, or an owl.','None. In total darkness, it is impossible to see anything.','Medium','2024-07-10 03:24:54.685915'),(474,'Dark Riddles','The more it is made, the more it is destroyed. The case can\'t be cracked, yet you won\'t be able to avoid it. It can be used for play or just a simple stay. Small, medium, or large, used in both light and in dark. What is it?','A Bed.','Easy','2024-07-10 03:24:54.688051'),(475,'Dark Riddles','I\'m in Kentucky, with 2 bowls of chili. I stay there for 3 nights. I take a train to Georgia and back peddle to Kansas. Where am I?','Do not know the answer, help! Driving me crazy, and it\'s a short trip.','Easy','2024-07-10 03:24:54.690112'),(476,'Dark Riddles','My legs are knives. I am a knight. I can reclaim what I lose in a fight. What am I?','A crab.','Hard','2024-07-10 03:24:54.691890'),(477,'Dark Riddles','What happens only in the middle of each month, in all of the seasons, except summer, and happens only in the night, never in the day?','The letter \'N.\'','Medium','2024-07-10 03:24:54.693589'),(478,'Dark Riddles','Here\'s a riddle for those who fiddle. Our clan is safe within the middle. So those for dark go to little. As you\'ll see a dragon\'s crittle. The Irish can help a diddle. But can you see the misinformed biddle?','This riddle is unanswered.','Medium','2024-07-10 03:24:54.695237'),(479,'Dark Riddles','I am, in truth, a yellow fork From tables in the sky By inadvertent fingers dropped The awful cutlery. Of mansions never quite disclosed And never quite concealed The apparatus of the dark To ignorance revealed. What am I?','I am lightning.','Hard','2024-07-10 03:24:54.697268'),(480,'Dark Riddles','Empty as space, Scary as a ghost, I appear every night What am I?','Darkness.','Medium','2024-07-10 03:24:54.698982'),(481,'Dark Riddles','A color is seen on a stoplight, an item you use to eliminate the darkness. What comic book character is it?','Green Lantern.','Hard','2024-07-10 03:24:54.701124'),(482,'Dark Riddles','How long would it take a fly, wearing a pair of wellingtons, walk through a tin of treacle?','A fortnight, it��s too weak.','Hard','2024-07-10 03:24:54.703049'),(483,'Dark Riddles','I could sell tickets day and night, I am always awake I never get a break. What am I?','I don��t know.','Easy','2024-07-10 03:24:54.705209'),(484,'Dark Riddles','Slam slam slam all day long slam slam slam some fast, some slow something solid. flat and sturdy its friend lights up the night and is sensitive to the eye slam slam slam A through Z 1,2,3 black as night. What am I?','A Computer keyboard.','Easy','2024-07-10 03:24:54.707137'),(485,'Dark Riddles','What can only move by jumping?','The Knight chess piece.','Hard','2024-07-10 03:24:54.709328'),(486,'Dark Riddles','I am round or oval? It can be light or dark. You can cut me into pieces. What am I?','A Potato.','Medium','2024-07-10 03:24:54.711033'),(487,'Dark Riddles','No legs or two legs, four legs or more, the color of green, on Terra it stays. Teeming with chemicals of darkness and light, needing only a wind, a breath to lift the kite. What is it?','Life.','Hard','2024-07-10 03:24:54.713000'),(488,'Dark Riddles','Where do zombies go for a night out?','Club Dead.','Hard','2024-07-10 03:24:54.714831'),(489,'Dark Riddles','A room with no windows or doors, walks in the night, grows in a day, and is found where there is death and decay. What is it?','Mushrooms.','Hard','2024-07-10 03:24:54.716446'),(490,'Dark Riddles','What is it that is full all day and empty at night?','Shoes.','Hard','2024-07-10 03:24:54.718094'),(491,'Dark Riddles','What animal has more lives than a cat?','A frog, he croaks every night!','Easy','2024-07-10 03:24:54.719827'),(492,'Dark Riddles','I have four legs but no tail. Usually, I am heard only at night. What am I?','A Frog.','Easy','2024-07-10 03:24:54.721441'),(493,'Dark Riddles','Where do dead outlaws go on a Saturday night?','To ghost towns.','Hard','2024-07-10 03:24:54.723226'),(494,'Dark Riddles','What famous nurse wore her pajamas all day long?','Florence Nightingown.','Medium','2024-07-10 03:24:54.725137'),(495,'Dark Riddles','What is dressed when night falls and undressed when day breaks?','Fire.','Hard','2024-07-10 03:24:54.726846'),(496,'Dark Riddles','What is significant about 3661 seconds past midnight on 1st January 2001?','The time and date will be 01:01:01 on 01/01/01.','Hard','2024-07-10 03:24:54.728793'),(497,'Dark Riddles','You can get fooled by me and you have no clue what you are doing, you can see them day and night. What am I?','A sign.','Medium','2024-07-10 03:24:54.730586'),(498,'Dark Riddles','Runs over fields and woods all day Under the bed at night sits not alone, With long tongue hanging out, Awaiting for a bone. What am I?','A shoe.','Medium','2024-07-10 03:24:54.732300'),(499,'Dark Riddles','What is 1 animal that can see at night but be blinded at day?','A bat and 1=a.','Hard','2024-07-10 03:24:54.734663'),(500,'Dark Riddles','What wears an eyepatch and robs ships at night?','A vampirate.','Easy','2024-07-10 03:24:54.736299'),(501,'Dark Riddles','It takes the town hall clock 6 seconds to strike 4 o\'clock in the afternoon. How long does it take to strike midnight?','22 Seconds.','Easy','2024-07-10 03:24:54.737890'),(502,'Dark Riddles','How many times does the long hand of the clock pass the shorthand between midnight one day and midnight the following day? As both hands are together at the starting time of midnight this does not count as a pass.','21','Easy','2024-07-10 03:24:54.739659'),(503,'Dark Riddles','A person gets up 180 times every night and sleeps for at least 7 hours at a time. Where does the person live?','At the North or South Pole.','Medium','2024-07-10 03:24:54.741285'),(504,'Dark Riddles','Who spends the day at the window, goes to the table for meals, and hides at night?','A fly.','Medium','2024-07-10 03:24:54.743223'),(505,'Dark Riddles','A woman is walking down a street at night at a constant pace. As she passes the street light, she notices that her shadow becomes longer. Does the top of her shadow move faster, slower, or the same when the shadow is longer as when it is shorter?','This point maintains a constant speed, independent of the length of the shadow.','Medium','2024-07-10 03:24:54.745301'),(506,'Dentist Riddles','What\'s at least 6 inches long, goes in your mouth, and is more fun if it vibrates?','A toothbrush.','Medium','2024-07-10 03:24:54.747068'),(507,'Dentist Riddles','I\'m white, and used for cutting and grinding. When I\'m damaged, humans usually remove me or fill me. For most animals, I am a useful tool. What am I?','A tooth!','Medium','2024-07-10 03:24:54.748999'),(508,'Dentist Riddles','Why did the king go to the dentist?','To get a new crown.','Easy','2024-07-10 03:24:54.750594'),(509,'Dentist Riddles','What would you do if you broke a tooth while flossing?','Use toothpaste.','Medium','2024-07-10 03:24:54.752105'),(510,'Dentist Riddles','Why are Tooth Fairies so smart?','They gather a lot of wisdom teeth.','Easy','2024-07-10 03:24:54.753824'),(511,'Dentist Riddles','What do you call dental X-rays?','Tooth-Pics.','Easy','2024-07-10 03:24:54.755396'),(512,'Dentist Riddles','How do you clean a dirty tuba?','With a tuba toothpaste!','Medium','2024-07-10 03:24:54.757024'),(513,'Dentist Riddles','Who is a painstaking man?','The dentist.','Easy','2024-07-10 03:24:54.758674'),(514,'Dentist Riddles','When should you charge your electric toothbrush?','When you can\'t pay cash.','Medium','2024-07-10 03:24:54.760575'),(515,'Dentist Riddles','Blend a teapot shot so the pearlies whites won\'t rot! What is it?','Toothpaste!','Easy','2024-07-10 03:24:54.762612'),(516,'Dog Riddles','If there are four sheep, two dogs, and one herds-men, how many feet are there?','Two. Sheep have hooves; dogs have paws; only people have feet.','Medium','2024-07-10 03:24:54.764382'),(517,'Dog Riddles','All of Mrs. Smith\'s pets are dogs except one, and all her pets are cats except one. How many cats and dogs does she have?','Mrs. Smith has one cat and one dog.','Hard','2024-07-10 03:24:54.766650'),(518,'Dog Riddles','How can you tell the difference between dogs and trees?','By their bark.','Hard','2024-07-10 03:24:54.768395'),(519,'Dog Riddles','What animal keeps the best time?','A Watchdog.','Hard','2024-07-10 03:24:54.770234'),(520,'Dog Riddles','To you, rude would I never be, Though I flag my tongue for all to see. What am I?','A dog!','Hard','2024-07-10 03:24:54.772379'),(521,'Dog Riddles','If a dog is tied to a piece of rope that is 6m long, how can he reach a bone that is 7m away?','The other end is not tied to anything.','Hard','2024-07-10 03:24:54.774527'),(522,'Dog Riddles','Stranger: Does your dog bite? Farmer: Nope. All of a sudden the dog bites the stranger on the leg. Yet the farmer was telling the truth! How can this be?','It was not the farmer\'s dog!','Hard','2024-07-10 03:24:54.776658'),(523,'Dog Riddles','There are 10 dogs in a yard. 3 go out, 4 run behind a tree, and 2 jump in the hole. How many are left?','10. Because none of them left the yard.','Easy','2024-07-10 03:24:54.779032'),(524,'Dog Riddles','What happens after it rains cats and dogs?','You step in a poodle.','Hard','2024-07-10 03:24:54.781342'),(525,'Dog Riddles','What type of dogs do scientists have?','Laboratory retrievers.','Medium','2024-07-10 03:24:54.783562'),(526,'Dog Riddles','Two dogs are sitting on a porch - a fat dog and a thin dog. The little dog is the son of the fat dog, but the fat dog is not the father of the thin dog. Can you explain?','The fat dog is the mother.','Easy','2024-07-10 03:24:54.785979'),(527,'Dog Riddles','A man is on one side of a river, his dog on the other. The man calls his dog, who immediately crossed the river without getting wet and without using a bridge or a boat. How did the dog do it?','The river was frozen.','Medium','2024-07-10 03:24:54.788116'),(528,'Dog Riddles','What do you get when you cross a dog and a clock?','Lots and lots of tics!','Hard','2024-07-10 03:24:54.790801'),(529,'Dog Riddles','What is the smallest sentence with all letters in the English alphabet?','The quick brown fox jumps over the lazy dog.','Hard','2024-07-10 03:24:54.793596'),(530,'Dog Riddles','What type of dog does a vampire have?','A Bloodhound!','Hard','2024-07-10 03:24:54.795798'),(531,'Dog Riddles','Walk on the living, they don\'t even mumble. Walk on the dead, they mutter and grumble. What are they?','Fallen leaves.','Medium','2024-07-10 03:24:54.798031'),(532,'Dog Riddles','When is the worst weather for rats and mice?','When it rains cats and dogs.','Medium','2024-07-10 03:24:54.800243'),(533,'Dog Riddles','What kind of dog does Dracula have?','A blood-hound.','Medium','2024-07-10 03:24:54.802409'),(534,'