\" without using any Rs?','Bob and Dick bought a dog.','Easy','2024-07-10 03:24:54.831561'),(548,'Dog Riddles','Four hang, four sprang, two-point the way, two to ward off dogs, one dangles after, always rather dirty. What am I?','A cow.','Hard','2024-07-10 03:24:54.833709'),(549,'Dog Riddles','When is a dog\'s tail not a tail?','When it\'s a wagon.','Easy','2024-07-10 03:24:54.835577'),(550,'Dog Riddles','Why did the skeleton climb up the tree?','Because the dog was after his bones.','Easy','2024-07-10 03:24:54.837590'),(551,'Dog Riddles','A dog leash is attached to a dog and is 3.2 meters long. A bone is 7.8 meters away from the dog. How does the dog get the bone?','It simply walks to the bone!','Hard','2024-07-10 03:24:54.839638'),(552,'Dog Riddles','What does a dog become when it walks from Britain to Spain?','Perro.','Medium','2024-07-10 03:24:54.841908'),(553,'Dog Riddles','How do you put nine dogs in eight kennels?','Eight kennels. \"N\", \"I\", \"N\", \"E\", \"D\", \"O\", \"G\", \"S\"','Hard','2024-07-10 03:24:54.844168'),(554,'Dog Riddles','I\'m like a dog with the tail that wags and all but am not a dog. What am I?','I am a puppy.','Hard','2024-07-10 03:24:54.846976'),(555,'Dog Riddles','Forward I am an animal, but backward I am one who no man can ever see. What am I?','I am a dog.','Hard','2024-07-10 03:24:54.849743'),(556,'Dog Riddles','What would you name your dogs Rolex and Timex?','If you needed some watchdogs!','Hard','2024-07-10 03:24:54.852304'),(557,'Dog Riddles','Why was the dog kicked out of the flea circus?','Because he stole the show!','Hard','2024-07-10 03:24:54.854161'),(558,'Dog Riddles','Which has more tails? A. 1 Dog B. 2 Dogs C. 3 Dogs D. No Dog','D. No Dog NO dog has more tails!','Medium','2024-07-10 03:24:54.855768'),(559,'Dog Riddles','Name three things that? 1. Are red 2. Can swim 3. Give off heat','Answers may vary. 1. Apples, Roses, Stop Signs 2. Fish, Dogs, Snakes 3. Sun, Fire, Your body','Easy','2024-07-10 03:24:54.857362'),(560,'Dog Riddles','A dog had three puppies, named Mopsy, Topsy, and Spot. What was the mother\'s name?','What','Hard','2024-07-10 03:24:54.858960'),(561,'Dog Riddles','Why is it that Snoop Dogg needs an umbrella?','Because of the drizzle.','Easy','2024-07-10 03:24:54.860848'),(562,'Duck Riddles','There are 2 ducks in front of 2 other ducks. There are 2 ducks behind 2 other ducks. There are 2 ducks beside 2 other ducks. How many ducks are there?','Just four, in a square formation.','Easy','2024-07-10 03:24:54.862382'),(563,'Duck Riddles','What happened when the rubber duckie fell into the bathtub?','It quacked up.','Easy','2024-07-10 03:24:54.864721'),(564,'Duck Riddles','What do you call a crate of ducks?','A box of quackers!','Hard','2024-07-10 03:24:54.867285'),(565,'Duck Riddles','Arnold Schwarzenegger\'s is really long. Michael J. Fox\'s is short. Daffy Duck isn\'t human. Madonna doesn\'t have one. What am I?','The last name.','Easy','2024-07-10 03:24:54.869841'),(566,'Duck Riddles','A mouse, a squirrel, a duck, a chicken, and an elephant are sitting on the side of the road. Someone offers them a lift, but one prefers to stay. Who preferred to stay?','The Elephant Stayed. If you didn\'t know, elephants are scared of mice.','Medium','2024-07-10 03:24:54.872456'),(567,'Duck Riddles','A duck arrives near a lake. He sees a sign where it is written \"No swimming allowed.\", but the duck jumps into the water. Why?','Because ducks can\'t read.','Easy','2024-07-10 03:24:54.876029'),(568,'Duck Riddles','Why did Mama Duck scold her goslings?','For eating quackers in bed.','Medium','2024-07-10 03:24:54.878704'),(569,'Duck Riddles','What time does a duck get up?','At the quack of dawn.','Medium','2024-07-10 03:24:54.881528'),(570,'Duck Riddles','Why did the duck get fired from his Easter job?','He kept quacking the eggs.','Medium','2024-07-10 03:24:54.883614'),(571,'Duck Riddles','Twenty-seven ducks are going to the pond. Five of them got lost, thirteen of them are staying home, nine of them are at the pond. Where are the rest of them?','There aren\'t any anywhere else.','Hard','2024-07-10 03:24:54.886097'),(572,'Duck Riddles','What does the cow say when he agrees with the duck?','The feeling is moo-tual.','Hard','2024-07-10 03:24:54.888857'),(573,'Duck Riddles','What animal would you get crossed a duck, a beaver, and an otter?','A platypus.','Medium','2024-07-10 03:24:54.891103'),(574,'Duck Riddles','What do you get when you cross Santa Claus and a duck?','A Christmas quacker.','Easy','2024-07-10 03:24:54.894294'),(575,'Fire Riddles','I am not alive, but I grow; I don\'t have lungs, but I need air; I don\'t have a mouth, but water kills me. What am I?','Fire.','Hard','2024-07-10 03:24:54.896958'),(576,'Fire Riddles','I was carried into a dark room, and set on fire. I wept, and then my head was cut off. What am I?','A Candle.','Hard','2024-07-10 03:24:54.899266'),(577,'Fire Riddles','If a fire hydrant has H2O inside, what does it have on the outside?','K9P (you\'ll get it eventually).','Medium','2024-07-10 03:24:54.901636'),(578,'Fire Riddles','No legs have I to dance, No lungs have I to breathe, No life have I to live or die And yet I do all three. What am I?','Fire.','Hard','2024-07-10 03:24:54.903287'),(579,'Fire Riddles','If I eat I live yet if I drink I die. What am I ?','Fire.','Medium','2024-07-10 03:24:54.904986'),(580,'Fire Riddles','What lives as long as it eats but dies when it drinks?','Fire.','Medium','2024-07-10 03:24:54.906740'),(581,'Fire Riddles','There are three doors. In each door is a way to die. The first door has fire and lava. The second door has lions that haven\'t eaten in 5 years. In the third door, there is a 1,000-foot drop into alligators. Which door will you likely survive?','The second door with the lions. Since they haven\'t eaten in 5 years they will have died.','Medium','2024-07-10 03:24:54.908579'),(582,'Fire Riddles','If there is a Yellow house on Bluebird Lane, a Green house on Orange Street, a Pink house on Kitten Road, a Black house on Whitehorse Pike and a Purple house on Firebird hill, where is the White house?','Washington, D.C.','Medium','2024-07-10 03:24:54.910555'),(583,'Fire Riddles','If you feed me, I live, but if you water me, I die. What am I?','A Fire','Hard','2024-07-10 03:24:54.912217'),(584,'Fire Riddles','You can feel me but, I can\'t feel you. I can uproot trees and tear roofs off their houses. Yet, I can make a Baby sleep and be gentle. I can howl and whisper. I can spread and stop fires. I can toss boats and help them glide too. What am I?','I am the wind.','Easy','2024-07-10 03:24:54.913828'),(585,'Fire Riddles','Give me food, and I will live; give me water, and I will die. What am I?','Fire!','Easy','2024-07-10 03:24:54.915247'),(586,'Fire Riddles','If I drink, I die, if I eat, I\'m fine. What am I?','Fire!','Hard','2024-07-10 03:24:54.916902'),(587,'Fire Riddles','I am always hungry, I must always be fed, The finger I touch will soon turn red. What am I?','I am fire.','Medium','2024-07-10 03:24:54.918280'),(588,'Fire Riddles','I eat, I live. I breathe, I live. I drink, I die. What am I?','Fire','Medium','2024-07-10 03:24:54.919691'),(589,'Fire Riddles','If I drink, I die. If i eat, I am fine. What am I?','A fire.','Easy','2024-07-10 03:24:54.921311'),(590,'Fire Riddles','What can\'t be burned in fire, nor drowned in water?','Ice.','Medium','2024-07-10 03:24:54.923297'),(591,'Fire Riddles','One day, a thirty story building was on fire. A man jumped out a window and nothing happened to him. Nothing was under him. How is this possible?','He was first floor.','Easy','2024-07-10 03:24:54.925062'),(592,'Fire Riddles','I can be half without getting thinner. I can shine with no fire. I can be hidden but never taken. I can stay dry while moving the ocean. What am I?','The Moon.','Medium','2024-07-10 03:24:54.926493'),(593,'Fire Riddles','I live in a really noisy place, And I only appear when my loud friend is with me. I have my house high in the air, and I cause deadly fires. What am I?','Lightning lives in a noisy place, And it doesn\'t appear without thunder. It has it\'s house high in the air, And it cause deadly fires.','Easy','2024-07-10 03:24:54.927968'),(594,'Fire Riddles','Crimson I am born, yellow I dance, ebony I die. What am I?','Fire.','Hard','2024-07-10 03:24:54.929677'),(595,'Fire Riddles','I truly am cause for alarm. When you see me you can lose your house or your life. When you hear me you can also lose your job. What am I?','Fire.','Hard','2024-07-10 03:24:54.931169'),(596,'Fire Riddles','I have a butt, but I\'m not alive. I bring smoke, but am not fire. I destroy, I kill, though I am not used in a war. What am I?','A cigarette.','Medium','2024-07-10 03:24:54.932922'),(597,'Fire Riddles','Despised I am by knave and liar. After me, the wise inquire, I rise above all death and fire. What am I?','The Truth.','Easy','2024-07-10 03:24:54.934355'),(598,'Fire Riddles','I am hewn from Earth and Fire; But to the sky, I aspire. I am nothing but contented; Until my patient rage is vented. What am I?','A volcano.','Medium','2024-07-10 03:24:54.935742'),(599,'Fire Riddles','The ghost of the mountain never to be seen, leaps like a raging fire to catch his prey. As pale as the moon but fast as the wind. Cold as ice, but a flash of light in the night. What is it?','A snow leopard.','Easy','2024-07-10 03:24:54.937346'),(600,'Fire Riddles','What insect does a blacksmith manufacture?','He makes the firefly.','Easy','2024-07-10 03:24:54.939142'),(601,'Fire Riddles','A group of men is suddenly awakened by a loud, piercing, continuous sound. They all scramble out of their beds, get dressed, grab a pole, and disappear into a hole. What in the world are these men doing?','The men are firemen who were on night-shift duty at their firehouse. When they heard the fire alarm, they got dressed, slid down the fire pole, and got in the fire truck.','Easy','2024-07-10 03:24:54.941212'),(602,'Fire Riddles','Fire is often maintained above me, and if you remove my first letter, you will find the home shared by everyone you have ever known. What am I?','A Hearth.','Medium','2024-07-10 03:24:54.943039'),(603,'Fire Riddles','Why does a firefly glow?','It eats light meals.','Medium','2024-07-10 03:24:54.944972'),(604,'Fire Riddles','I am energy. I am heat. I am hot. I am red. What am I?','I am fire.','Medium','2024-07-10 03:24:54.946550'),(605,'Fire Riddles','A group of men are suddenly awakened by a loud, piercing, continuous sound. They all scramble out of their beds, get dressed, grab a pole, and disappear into a hole. What in the world are these men doing?','They are firemen who were sleeping in their fire station. When they heard the fire alarm, they quickly got dressed, slid down the fire pole, and got in the fire engine to head to the reported fire.','Hard','2024-07-10 03:24:54.948392'),(606,'Fire Riddles','What can be underwater, under fire, on fire and taking water all at the same time?','Submarine. Underwater meaning in water. Under fire meaning getting shot at. On fire meaning burning. Taking water meaning water is flooding into or through something.','Medium','2024-07-10 03:24:54.950657'),(607,'Fire Riddles','Why did the duck get fired from his Easter job?','He kept quacking the eggs.','Hard','2024-07-10 03:24:54.952223'),(608,'Fire Riddles','What insect does a blacksmith manufacture?','He makes the firefly.','Easy','2024-07-10 03:24:54.953839'),(609,'Fire Riddles','I am very important to all living creatures. I was firstborn in the sun. I am a chapter in textbooks and I am not made of fire. I make the sun-worthy. Too much of me may kill you. But humans can still prevent me. What am I?','Heat!','Medium','2024-07-10 03:24:54.955567'),(610,'Fire Riddles','I can make many people scream yet I can still be seen I make many things grow yet still I can melt the snow. What am I?','I am fire.','Easy','2024-07-10 03:24:54.957605'),(611,'Fire Riddles','As destructive as life, As healing as death; An institutioner of strife, Just as prone to bless. It is all that is good, Yet with an evil trend; As it was the beginning of things, It can also be the end. What is it?','It is fire!','Medium','2024-07-10 03:24:54.959259'),(612,'Fire Riddles','In me a gas is confined, Upon my head a pot, And out of me is fire. What I am?','A gas cooker!','Easy','2024-07-10 03:24:54.961214'),(613,'Fire Riddles','I give you a group of three. One is sitting down, and will never get up. The second eats as much as is given to him, yet is always hungry. The third goes away and never returns. What are the three things?','Stove, fire, and smoke.','Hard','2024-07-10 03:24:54.962568'),(614,'Fire Riddles','Why is the letter F like an incendiary?','Because it makes ire fire.','Medium','2024-07-10 03:24:54.964290'),(615,'Fire Riddles','My head and the point are made from same. I am held by what\'s taken apart from the grain. I am atop of a great ocean beast. My swing will let fire and lead release. What am I?','Hammer.','Hard','2024-07-10 03:24:54.965909'),(616,'Fire Riddles','What did the parrot say on the 4th of July?','\"Poly wants a firecracker!\"','Hard','2024-07-10 03:24:54.967539'),(617,'Fire Riddles','What did the firecracker say to the other firecracker?','\"My pop is bigger than your pop\".','Hard','2024-07-10 03:24:54.969258'),(618,'Fire Riddles','Inside a burning house, this thing is best to make. And best to make it quickly, before the fire\'s too much to take! What is it?','Haste!','Hard','2024-07-10 03:24:54.970608'),(619,'Fire Riddles','The fire shows - my kin, born. The fire grows - my kin, adorn. The fire slows - my kin, deform. The fire goes - my kin, mourn.','Fruit-bearing tree through the four seasons.','Medium','2024-07-10 03:24:54.972285'),(620,'Fire Riddles','What is dressed when night falls and undressed when day breaks?','Fire.','Easy','2024-07-10 03:24:54.973961'),(621,'Fire Riddles','When is a ship at sea not on the water?','When she is on fire.','Medium','2024-07-10 03:24:54.975621'),(622,'Fire Riddles','Name three things that? 1. Are red 2. Can swim 3. Give off heat','Answers may vary. 1. Apples, Roses, Stop Signs 2. Fish, Dogs, Snakes 3. Sun, Fire, Your body','Easy','2024-07-10 03:24:54.977189'),(623,'Fish Riddles','Two fathers and two sons went fishing one day. They were there the whole day and only caught 3 fish. One father said, that is enough for all of us, we will have one each. How can this be possible?','There was the father, his son, and his son\'s son. This equals 2 fathers and 2 sons for a total of 3!','Easy','2024-07-10 03:24:54.979353'),(624,'Fish Riddles','I am a word of six; my first three letters refer to an automobile; my last three letters refer to a household animal; my first four letters is a fish; my whole is found in your room. What am I?','A carpet.','Medium','2024-07-10 03:24:54.981594'),(625,'Fish Riddles','There are two bodies on the floor. They are surrounded by water and broken glass. How did they die?','The bodies were goldfish because their fishbowl got knocked over onto the floor and broke.','Easy','2024-07-10 03:24:54.983427'),(626,'Fish Riddles','What has cities, but no houses; forests, but no trees; and water, but no fish?','A map.','Hard','2024-07-10 03:24:54.985539'),(627,'Fish Riddles','If fish lived on land, where would they live?','In Finland.','Easy','2024-07-10 03:24:54.987163'),(628,'Fish Riddles','What do you call a fish with no eye\'s?','Fsh.','Hard','2024-07-10 03:24:54.989122'),(629,'Fish Riddles','What does a shark eat with peanut butter?','Jellyfish!','Easy','2024-07-10 03:24:54.990794'),(630,'Fish Riddles','A big person and a small person are going to fish. The big person is not the small person father but the small person is the big person\'s son. What is the relationship between the two?','The big person is the small person\'s mother.','Easy','2024-07-10 03:24:54.992407'),(631,'Fish Riddles','If you hadn\'t put me in a bowl, I would have lived for 20 years. What am I?','I\'m your goldfish, you monster.','Medium','2024-07-10 03:24:54.994080'),(632,'Fish Riddles','Inside napper, bird chaser, quick stoker, small animal killer, fish eater. What is it?','A cat.','Easy','2024-07-10 03:24:54.995758'),(633,'Fish Riddles','Alive without breath, As cold as death, Never thirsty, Ever drinking, Clad in mail, Never clinking, Drowns on dry land, Thinks an island Is a mountain, Thinks a fountain Is a puff of air. What am I?','A fish.','Hard','2024-07-10 03:24:54.997428'),(634,'Fish Riddles','10 fish are in a tank. 10 drown. How many died?','None, cause fish can\'t drown.','Hard','2024-07-10 03:24:54.999102'),(635,'Fish Riddles','Where do fish keep their money?','In the riverbank.','Medium','2024-07-10 03:24:55.001021'),(636,'Fish Riddles','There were two mothers and two daughters,and they all went fishing. All of them caught a fish but when they counted there were only three fish. How was this possible?','There were only three because there was a grandmother a mother and a daughter. The mother was the daughter to the grandmother and she was the mother to the mother and the daughter was the daughter to the mother.','Easy','2024-07-10 03:24:55.002573'),(637,'Fish Riddles','Why are some fish at the bottom of the ocean?','Because they dropped out of school!','Hard','2024-07-10 03:24:55.004026'),(638,'Fish Riddles','Why are fish so clever?','They live in schools.','Hard','2024-07-10 03:24:55.005621'),(639,'Fish Riddles','If you have nine fish in a fish bowl and 3 drown how many fish do you have left?','Nine because fish don\'t drown.','Hard','2024-07-10 03:24:55.007129'),(640,'Fish Riddles','1. Where do fish go on vacation? 2. Where do songbirds go on vacation? 3. Where do zombies go on vacation? 4. Where do Thanksgiving Birds go on vacation? 5. Where do geometry teachers go on vacation? 6. Where do locksmiths go on vacation?','1. Finland 2. The Canary Islands 3. The Dead Sea 4. Turkey 5. Cuba 6. The Florida Keys','Easy','2024-07-10 03:24:55.008891'),(641,'Fish Riddles','A grandfather, a father, and a son go fishing. Each gets one fish but there is only one fish how is this?','It is only one person. He is a son of his father, he is a father to his son and he is a grandfather to his grandchild.','Medium','2024-07-10 03:24:55.010413'),(642,'Fish Riddles','I\'m first found in caves, now prolific online; I\'m a depiction, a drawing, a symbol, or a sign. I\'ll convey whichever mood you could wish; or for that matter, a fist, flask, or fish. What am I?','An emoji.','Hard','2024-07-10 03:24:55.012005'),(643,'Fish Riddles','Where do fish go for vacation?','Finland.','Easy','2024-07-10 03:24:55.013516'),(644,'Fish Riddles','Where do jellyfish sleep?','In tent-acles.','Easy','2024-07-10 03:24:55.015085'),(645,'Fish Riddles','What do sea monsters eat for lunch?','Fish and ships.','Easy','2024-07-10 03:24:55.016811'),(646,'Fish Riddles','There were seven fish in the sea. Two drowned and three swam away. How many are left?','Four because fish can\'t drown.','Easy','2024-07-10 03:24:55.018362'),(647,'Fish Riddles','Martha and George died, there was glass and water all around but, no blood. How did they die?','They were fish.','Medium','2024-07-10 03:24:55.019775'),(648,'Fish Riddles','Forward I catch fish, backward I am the tenth of numbers. What am I?','Net.','Easy','2024-07-10 03:24:55.021479'),(649,'Fish Riddles','Why are fish so good at watching their weight?','Because they have lots of scales.','Medium','2024-07-10 03:24:55.023726'),(650,'Fish Riddles','What did the cowboy go fishing with a lasso?','To catch a Bull Shark or maybe some Sea Horses.','Easy','2024-07-10 03:24:55.025405'),(651,'Fish Riddles','Larry is dead the window is open. There is a glass and water on the floor, and Mary is sleeping. What happened??','Larry is a fish. the breeze from the window knocked over his fishbowl it broke and he died from no water.','Medium','2024-07-10 03:24:55.026871'),(652,'Fish Riddles','Why wouldn\'t the shrimp share his treas