sk the person\'s grave why they did what they did that resulted in their death, as a form of mourning, or to ask their chosen God or Gods why they took that person to their grave. And peoples solitude refers to people sleeping on their own, or the mourners usually coming the mourn privately.','Hard','2024-07-10 03:24:55.391924'),(870,'Horror Riddles','When people add me they\'re often shaking; On the tip of their tongue there\'s no mistaking; I\'m here to help if the devil is waiting. What am I?','Salt.','Hard','2024-07-10 03:24:55.393480'),(871,'Horror Riddles','Why was 6 afraid of 7?','Because 7,8,9.','Medium','2024-07-10 03:24:55.394795'),(872,'Horror Riddles','Our armor may be stolen, But still a thousand blades cause us no fear, One or many, it\'s all the same, Before our number, you will fall. What are we?','Sheep.','Hard','2024-07-10 03:24:55.396370'),(873,'Horror Riddles','I\'m scared of the water, But not scared of heights; I\'m light and come in different colors, But typically just white. What am I?','Tissue','Hard','2024-07-10 03:24:55.397818'),(874,'Horror Riddles','I am brave but, wear the thing I used to fear most, I am bold, but not willing to kill. Who am I?','Batman.','Medium','2024-07-10 03:24:55.399197'),(875,'Horror Riddles','Why were the notebooks afraid to go to college?','Because the College ruled notebooks!','Hard','2024-07-10 03:24:55.401069'),(876,'Horror Riddles','I am the creature that robs men of their dignity, pride, and will. I feast on children\'s dreams till\' they have none. I am the monster in your head, waiting to strike. What am I?','I am fear, SO FEAR ME!','Easy','2024-07-10 03:24:55.402503'),(877,'Horror Riddles','I am something that the naughty boys use to draw on, girls write beautifully on the side, you have to clap my defeaters every day, and I stand dumbly as the young children cry. What am I?','A chalkboard. (When the young children cry, it means they are crying for a turn to write the answer and the defeaters are the era