ura is in WHAT ROOM. Didn\'t guess it right?','Easy','2024-07-10 03:24:55.440962'),(897,'Kitchen Riddles','When is 90 greater than 100?','On a microwave timer. When you type 100, the timer interprets it as 1 minute. When you type 90, it will read 90 seconds, which is 1 minute 30 seconds.','Hard','2024-07-10 03:24:55.442471'),(898,'Kitchen Riddles','Why can\'t a cook swallow his apron?','Because it goes against his stomach.','Hard','2024-07-10 03:24:55.444279'),(899,'Kitchen Riddles','If place 1 cake of soap on a pan of a scale and 3/4 cake of soap and a 3/4-pound weight on the other, the pans balance. How much does a cake of soap weigh?','Since 1/4 cake weighs 3/4 pound, and the entire cake weighs 3 pounds.','Medium','2024-07-10 03:24:55.445949'),(900,'Kitchen Riddles','What goes through the door without pinching itself, sits on the stove without burning itself, sits on the table, and is not ashamed?','The Sun.','Medium','2024-07-10 03:24:55.447402'),(901,'Lawyer Riddles','Which of the following words don\'t belong in the group and why? CORSET, COSTER, SECTOR, ESCORT, COURTS','Courts. All of the others are anagrams of each other.','Hard','2024-07-10 03:24:55.449154'),(902,'Lawyer Riddles','What does a lawyer wear to court?','A Lawsuit.','Easy','2024-07-10 03:24:55.450813'),(903,'Lawyer Riddles','Why would Snow White be a good judge?','Because she\'s the fairest in the land','Medium','2024-07-10 03:24:55.452478'),(904,'Lawyer Riddles','Don\'t judge a book by its cover. What is the contradictory proverb?','Clothes make the man.','Medium','2024-07-10 03:24:55.454187'),(905,'Lawyer Riddles','A woman proves in court that her husband was murdered by her sister, but the judge decides that the sister cannot be punished. Why?','The sisters are Siamese twins.','Easy','2024-07-10 03:24:55.456137'),(906,'Lawyer Riddles','How did the court know the judge was ready for bed?','He was wearing his robe.','Easy','2024-07-10 03:24:55.458022'),(907,'Monster Riddles','What room do ghost