lley, and the man who died was a pin spotter. A player had a strike and was to bowl again, but he bowled too soon before the pin spotter was clear. The X is on the score sheet and this tells the detective the name of the bowler.','Hard','2024-07-10 03:24:55.679124'),(1018,'Murder Riddles','I am brave but, wear the thing I used to fear most, I am bold, but not willing to kill. Who am I?','Batman.','Hard','2024-07-10 03:24:55.682049'),(1019,'Murder Riddles','A color is seen on a stoplight, an item you use to eliminate the darkness. What comic book character is it?','Green Lantern.','Easy','2024-07-10 03:24:55.684342'),(1020,'Murder Riddles','I am as small as a beetle, as annoying as a fly, and I like to kill trees, what am I?','A Lantern Fly! (Also stop stealing my riddles, Berries, the LearnyVerse Wizard from Pyranic)','Hard','2024-07-10 03:24:55.697583'),(1021,'Murder Riddles','Endlessly, I hunger, Lazily, I sleep. Murderous, I thunder, Desires, I do seek. Hoarding countless treasures, so my stature I retain, Envious of others whose feet on Earth remain. What am I?','\"The Seven Deadly Sins\" - Reasoning: Each sentence structure portrays one of the seven deadly sins from Christian theology, with the exception of the final 5 words. In order according to the riddle, these are; gluttony, sloth, wrath, lust, greed, pride, and envy. The final 5 words, \"whose feet on Earth remain\", act in conjunction with the section on envy, demonstrating the perspective of a sinner in hell, who is envious of those still alive, and thus can still repent for their sins in order to enter Heaven.','Easy','2024-07-10 03:24:55.700572'),(1022,'Murder Riddles','What dies but is never killed?','A bad joke.','Hard','2024-07-10 03:24:55.703420'),(1023,'Murder Riddles','A parliament, a congress, a conspiracy, a murder, a wake. What am I?','A flock of Corvids.','Hard','2024-07-10 03:24:55.706345'),(1024,'Murder Riddles','A woman proves in court that her husband was murdered by her sister, but the 