lace like home.\"','Hard','2024-07-10 03:24:55.764493'),(1048,'Music Riddles','You can hear me and feel me but you can\'t see me or smell me, yet everyone has a taste in me. I can be created, but after that only remembered. What am I?','Music.','Medium','2024-07-10 03:24:55.766473'),(1049,'Music Riddles','My call, I pray, at dawn of day, Shall rest you from your slumber, With job all done, my song all sung, I\'ll sit on seat of lumber. What am I?','A Rooster.','Easy','2024-07-10 03:24:55.768374'),(1050,'Music Riddles','I cannot be felt, seen or touched; Yet I can be found in everybody; My existence is always in debate; Yet I have my own style of music. What Am I?','I am a soul.','Easy','2024-07-10 03:24:55.770773'),(1051,'Music Riddles','Play my music, if you dare. Turn my crank, although I\'m square. Stand back, or get a scare, when you see my surprising glare. What am I?','Jack-in-the-Box.','Easy','2024-07-10 03:24:55.772816'),(1052,'Music Riddles','From dawn to dusk I soar through the sky, A thunderous voice, but silent I fly. Through the darkest depths I will not die, Yet I can not be seen by the naked eye. What am I?','Radio waves.','Hard','2024-07-10 03:24:55.775298'),(1053,'Music Riddles','1. Where do fish go on vacation? 2. Where do songbirds go on vacation? 3. Where do zombies go on vacation? 4. Where do Thanksgiving Birds go on vacation? 5. Where do geometry teachers go on vacation? 6. Where do locksmiths go on vacation?','1. Finland 2. The Canary Islands 3. The Dead Sea 4. Turkey 5. Cuba 6. The Florida Keys','Medium','2024-07-10 03:24:55.777812'),(1054,'Music Riddles','What is a device that you always have access to, that do not require recharging, and can record all of the useful information you have learned?','Your brain!','Medium','2024-07-10 03:24:55.780130'),(1055,'Music Riddles','What kind of music does a blacksmith like?','Heavy metal!','Medium','2024-07-10 03:24:55.782323'),(1056,'Music Riddles','What musical instruement would you use to catch a fish?','Castanets.','Hard','2024-07-10 03:24:55.784596'),(1057,'Music Riddles','Why did the man hold a shoe to his ear?','Because he was listening to sole music.','Medium','2024-07-10 03:24:55.786781'),(1058,'Music Riddles','I can soothe you, or drive you nuts. I can be quiet, but also blare in your ears. What does this? Figure that out, and you have found out the riddle.','Music ( ROCK!!!! or classical)','Medium','2024-07-10 03:24:55.789336'),(1059,'Music Riddles','A rock group with four members, Each of whom are dead; But people still come to see us, Though an album was never released. What am I?','Mt. Rushmore','Hard','2024-07-10 03:24:55.791564'),(1060,'Music Riddles','If you were by a door, where would music originate?','From the HANDEL.','Hard','2024-07-10 03:24:55.794088'),(1061,'Music Riddles','What music do cows like to dance to?','Cow-lypso (Calypso) music.','Easy','2024-07-10 03:24:55.796519'),(1062,'Music Riddles','It is a short song, It has a lot of names, and rhymes a lot. Hint: It is food. What is the pea\'s favorite song?','Greens Pea\'s potatoes tomatoes!','Hard','2024-07-10 03:24:55.799031'),(1063,'Music Riddles','My shallow hills are the faces of kings. My horizon is always near. My music sends men to the grave. My absence sends men to work. What am I?','Coins.','Hard','2024-07-10 03:24:55.801284'),(1064,'Music Riddles','What is the noblest musical instrument?','An upright piano.','Medium','2024-07-10 03:24:55.803145'),(1065,'Music Riddles','What was the pilgrim\'s favorite type of music?','Plymouth Rock.','Easy','2024-07-10 03:24:55.805129'),(1066,'Music Riddles','The letters of the alphabet but only just a few; It\'s hard to say if I was invented or just discovered by you. What am I?','Music','Easy','2024-07-10 03:24:55.807351'),(1067,'Music Riddles','What pets make stirring music?','Trumpets.','Hard','2024-07-10 03:24:55.810248'),(1068,'Music Riddles','My love\'s the type of thing you have to earn, but when you earn it, you won\'t need it. Who a