en says, \"All chickens are liars\". Is the chicken telling the truth?','Answer: Chickens cannot talk.','Medium','2024-07-10 03:24:55.838440'),(1080,'Pet Riddles','All of Mrs. Smith\'s pets are dogs except one, and all her pets are cats except one. How many cats and dogs does she have?','Mrs. Smith has one cat and one dog.','Medium','2024-07-10 03:24:55.840451'),(1081,'Pet Riddles','How can you tell the difference between dogs and trees?','By their bark.','Medium','2024-07-10 03:24:55.842585'),(1082,'Pet Riddles','What animal keeps the best time?','A Watchdog.','Medium','2024-07-10 03:24:55.844513'),(1083,'Pet Riddles','If it takes 5 microwaves and 5 minutes to cook 5 chickens, how long does it take 100 microwaves to cook 100 chickens?','5 minutes. We can assume that one chicken is placed in each microwave and that each chicken takes 5 minutes to cook.','Medium','2024-07-10 03:24:55.846298'),(1084,'Pet Riddles','Why do chickens lay eggs?','Because if they drop them, they will break.','Medium','2024-07-10 03:24:55.848017'),(1085,'Pet Riddles','To you, rude would I never be, Though I flag my tongue for all to see. What am I?','A dog!','Medium','2024-07-10 03:24:55.850461'),(1086,'Pet Riddles','What do you call pigs that write letters to each other?','Pen Pals.','Hard','2024-07-10 03:24:55.852461'),(1087,'Pet Riddles','If a','The other end is not tied to anything.','Medium','2024-07-10 03:24:55.854706'),(1088,'Pet Riddles','Stranger: Does your dog bite? Farmer: Nope. All of a sudden the dog bites the stranger on the leg. Yet the farmer was telling the truth! How can this be?','It was not the farmer\'s dog!','Easy','2024-07-10 03:24:55.857583'),(1089,'Pet Riddles','There are 10 dogs in a yard. 3 go out, 4 run behind a tree, and 2 jump in the hole. How many are left?','10. Because none of them left the yard.','Medium','2024-07-10 03:24:55.860047'),(1090,'Pet Riddles','What\'s 3/7 chicken, 2/3 cat, and 2/4 goat?','Chicago. The first three words out of seven of chicken are