 Riddles','Here on earth it is true, yesterday is always before today; but there is a place where yesterday always follows today. Where?','The Dictionary.','Hard','2024-07-10 03:24:56.091565'),(1202,'Planet Riddles','What is one thing that all wise men, regardless of their politics or religion, agree is between heaven and earth?','The word \'And\'.','Hard','2024-07-10 03:24:56.093607'),(1203,'Planet Riddles','What is always traveling, has life, has sense but doesn\'t live?','The Earth!','Easy','2024-07-10 03:24:56.095348'),(1204,'Planet Riddles','I come right in front of Earth, at the end of time, and twice in a week. What am I?','The letter E.','Medium','2024-07-10 03:24:56.097316'),(1205,'Planet Riddles','How can we tell that Saturn was married more than once?','Because she has so many rings!','Medium','2024-07-10 03:24:56.099088'),(1206,'Planet Riddles','I\'m first on earth, second in heaven, I appear twice in a week, and once in a year, I\'m in the middle of the Sea. What am I?','The letter E.','Hard','2024-07-10 03:24:56.101052'),(1207,'Planet Riddles','Why did Mickey Mouse go to space?','To look for Pluto!','Hard','2024-07-10 03:24:56.102626'),(1208,'Planet Riddles','What is made of wood but no saw on earth is sharp enough to cut?','Sawdust.','Easy','2024-07-10 03:24:56.104121'),(1209,'Planet Riddles','I blossom like a flower, a hindrance I create, and save you from the earth, do not use me too late. What am I?','A Parachute.','Hard','2024-07-10 03:24:56.105794'),(1210,'Planet Riddles','The higher I climb, the hotter I engage, I can not escape my crystal cage. What am I?','Mercury in a thermometer.','Medium','2024-07-10 03:24:56.107214'),(1211,'Planet Riddles','I welcome the day with a show of light, I steathily came here in the night. I bathe the earthy stuff at dawn, But by the noon, alas! I\'m gone. What am I?','The morning dew!','Hard','2024-07-10 03:24:56.109924'),(1212,'Planet Riddles','I begin the earth and end the eclipse, I occur in seconds and minutes, but never in a hand although I am in a lifetime. What am I?','Letter E.','Medium','2024-07-10 03:24:56.111432'),(1213,'Planet Riddles','What do cows give after an earthquake?','Milk shakes.','Easy','2024-07-10 03:24:56.113528'),(1214,'Planet Riddles','I am hewn from Earth and Fire; But to the sky, I aspire. I am nothing but contented; Until my patient rage is vented. What am I?','A volcano.','Hard','2024-07-10 03:24:56.115018'),(1215,'Planet Riddles','I am in the beginning of the earth. I am at the end of time. I appear two times in a week. I appear once in a year. What Am I ?','The Letter \"E\".','Hard','2024-07-10 03:24:56.116836'),(1216,'Planet Riddles','Many always do say that I am life. I occupy most part of the earth surface, yet I\'m found in you. What am I?','Water.','Medium','2024-07-10 03:24:56.118566'),(1217,'Planet Riddles','Inside me, there is a teacup, a planet, a shelf, and you! What Am I?','The Universe!','Hard','2024-07-10 03:24:56.120215'),(1218,'Planet Riddles','Test Mars. What is the anagram word?','Smartest.','Hard','2024-07-10 03:24:56.121902'),(1219,'Planet Riddles','Fire is often maintained above me, and if you remove my first letter, you will find the home shared by everyone you have ever known. What am I?','A Hearth.','Easy','2024-07-10 03:24:56.123586'),(1220,'Planet Riddles','I\'m mean, I\'m green, I am an eating machine. What am I?','A Venus Flytrap.','Hard','2024-07-10 03:24:56.125385'),(1221,'Planet Riddles','It is everywhere yet nowhere and time mars it not. All things are within its grasp and it is within the grasp of all things. It has no limits, for it does and does not exist. What is it?','Nothing.','Hard','2024-07-10 03:24:56.126870'),(1222,'Planet Riddles','I\'m teary-eyed but never cry, silver-tongued, but never lie. double-winged, but never fly, air-cooled, but never dry. What am I?','Mercury. The element looks shiny, silver, and is wet. The god Mercury has two wings but only uses them to run.','Medium','2024-07-10 03:24:56.128656'),(1223,'Planet Riddles','I lie in the earth, and under the ground; A map may reveal me for journey\'s abound; I can be found in squares, to reduce down to size; Or at the end of a strand, where attachment lies. What am I?','Roots','Hard','2024-07-10 03:24:56.130302'),(1224,'Planet Riddles','Stronger than any beast, Rougher than any sea. Steadier than a favorable wind, and of me, none shall be free. What am I?','I am Earth.','Medium','2024-07-10 03:24:56.131741'),(1225,'Planet Riddles','I am named for my fleeting motion. Numbered zero and four score more. A barren desert and a heavy ocean. One is flowing, the other a solid core. Who are we?','Mercury and mercury.','Medium','2024-07-10 03:24:56.133688'),(1226,'Planet Riddles','I shake but unlike the strength of an earthquake. You can find me both high and low, usually out of control. I can be considered both good or bad, sometimes used for both happy or sad. What am I?','Singing Pitch.','Hard','2024-07-10 03:24:56.135211'),(1227,'Planet Riddles','My first is appropriate, my second \'tis nine to one if you guess it. My whole elevates the sole above the earth. What am I?','Pat-ten.','Hard','2024-07-10 03:24:56.136848'),(1228,'Planet Riddles','What can emit an umbra on the earth, and provide phosphorescence for all its creatures, all while altering the visual surface of itself within phases?','The','Hard','2024-07-10 03:24:56.138168'),(1229,'Planet Riddles','Endlessly, I hunger, Lazily, I sleep. Murderous, I thunder, Desires, I do seek. Hoarding countless treasures, so my stature I retain, Envious of others whose feet on Earth remain. What am I?','\"The Seven Deadly Sins\" - Reasoning: Each sentence structure portrays one of the seven deadly sins from Christian theology, with the exception of the final 5 words. In order according to the riddle, these are; gluttony, sloth, wrath, lust, greed, pride and envy. The final 5 words, \"whose feet on Earth remain\", act in conjunction with the section on envy, demonstrating the perspective of a sinner in hell, who is envious of those still alive, and thus can still repent for their sins in order to enter Heaven.','Easy','2024-07-10 03:24:56.139502'),(1230,'Planet Riddles','Which is lighter, the sun or the earth?','The sun, rises every morning.','Hard','2024-07-10 03:24:56.141412'),(1231,'Planet Riddles','One-fourth of the population of a newly discovered planet has 4 legs. The rest have two legs. There are 60 legs in total. How big is the population of the newly discovered planet?','24','Hard','2024-07-10 03:24:56.142667'),(1232,'Planet Riddles','What is the best way to get from earth to mars?','PLANET!','Medium','2024-07-10 03:24:56.144223'),(1233,'Planet Riddles','Where on Earth do the winds always blow from the South?','The North Pole.','Easy','2024-07-10 03:24:56.145966'),(1234,'Planet Riddles','A forest exists somewhere on Earth. This forest has no life except for trees. After a storm, a tree was hit by lightning and fell. What sound would it make?','None. Sound does not exist if it is unheard.','Medium','2024-07-10 03:24:56.147256'),(1235,'Rabbit Riddles','Do rabbits use combs?','No, they use hare brushes.','Easy','2024-07-10 03:24:56.148815'),(1236,'Rabbit Riddles','How can you say rabbit without using the letter R?','Bunny.','Easy','2024-07-10 03:24:56.150016'),(1237,'Rabbit Riddles','How many hairs are in a bunny rabbit\'s tail?','None. They are all outside.','Medium','2024-07-10 03:24:56.151341'),(1238,'Rabbit Riddles','Where does a rabbit go for shampoo?','To a hare-dresser.','Hard','2024-07-10 03:24:56.152862'),(1239,'Rabbit Riddles','What would you get if you crossed a rabbit and a lawn sprinkler?','Hare spray.','Hard','2024-07-10 03:24:56.154123'),(1240,'Rabbit Riddles','What would you get if 120 rabbits took one step backward at the same time?','A receding hare-line.','Easy','2024-07-10 03:24:56.155533'),(1241,'Rabbit Riddles','How do rabbits travel?','By hare-plane.','Easy','2024-07-10 03:24:56.157149'),(1242,'Rabbi