vil the poor have nothing the rich don\'t have anything they have everything If you eat nothing you die','Medium','2024-07-10 03:24:56.177430'),(1254,'Religion Riddles','Used to threaten, used to defeat. Sometimes it grows, and sometimes it shrinks. Used to conquer, used to protect. It marks your downfall, it marks your success. The true god of war, the creator of mess. What is it?','Power.','Hard','2024-07-10 03:24:56.178969'),(1255,'Religion Riddles','How does Moses make his coffee?','Hebrews it.','Hard','2024-07-10 03:24:56.180790'),(1256,'Religion Riddles','I am more powerful than god and more evil than the devil. I am what rich people want and what poor people have. I can never die. What am I?','I am nothing.','Medium','2024-07-10 03:24:56.182761'),(1257,'Religion Riddles','Does the','A dead man cannot marry. His widow would mean he is dead.','Easy','2024-07-10 03:24:56.185120'),(1258,'Religion Riddles','I am everywhere yet not seen; I was dead yet I\'m alive; a Son to a man who is dead yet a Son to One Who\'s forever alive; suffered, not for myself but for others. I have disproved many beliefs and many laws. Who am I?','Jesus Christ.','Hard','2024-07-10 03:24:56.187298'),(1259,'Religion Riddles','I\'m the person that God made me. I\'m caring. I\'m nice. I love my family. I\'m myself. Who am I?','I\'m a human being.','Medium','2024-07-10 03:24:56.189481'),(1260,'Religion Riddles','What would you say in everyone in the US Sneezed at the same time?','God bless America!','Hard','2024-07-10 03:24:56.191217'),(1261,'Religion Riddles','Some people want to meet me, some people don\'t believe in me, and some people claim to be me. What am I?','God.','Easy','2024-07-10 03:24:56.193167'),(1262,'Religion Riddles','I\'m teary-eyed but never cry, silver-tongued, but never lie. double-winged, but never fly, air-cooled, but never dry. What am I?','Mercury. The element looks shiny, silver, and wet. The god Mercury has two wings but only uses them to run.','Hard','2024-07-10 03:24:56.194762'),(1263,'Religion Riddles','Priest-tied guitar. What is the anagrammed word?','Prestidigitateur.','Easy','2024-07-10 03:24:56.196398'),(1264,'Religion Riddles','In this place, people lie, people cry, and people ask why. In this place, people sleep, people, weep, and people\'s solitude, they keep. What is it?','\"Graveyard\" or \"Cemetery\" - Reasoning: Both \"people lie\" and \"people sleep\" are indications of many people using this place to lie down, or to sleep, which in itself is an odd thought. Crying and weeping indicate that this is a sad place, and the continued use of \"people\" allows this to mean not just those who are lying down or sleeping, but those who come to visit them there, (i.e. mourners). People come to ask the person\'s grave why they did what they did that resulted in their death, as a form of mourning, or to ask their chosen God or Gods why they took that person to their grave. And peoples solitude refers to people sleeping on their own, or the mourners usually coming the mourn privately.','Easy','2024-07-10 03:24:56.198068'),(1265,'Religion Riddles','Why couldn\'t the church steeple keep a secret?','Because the bell always tolled.','Hard','2024-07-10 03:24:56.200058'),(1266,'Religion Riddles','The rich want it, but the poor have it, god takes it, satin gives it?','nothing','Hard','2024-07-10 03:24:56.201977'),(1267,'Religion Riddles','I\'m greater than God, yet worse than the devil. I am what the miser spends and the spendthrift saves. I am what the blind see and the paralyzed hold. What am I?','Nothing.','Medium','2024-07-10 03:24:56.203691'),(1268,'Religion Riddles','What do you call a priest riding a cycle?','A cyclist.','Medium','2024-07-10 03:24:56.205165'),(1269,'Religion Riddles','I am a holiday, of course, celebrated in December, I am celebrated until New Year, People who celebrate me are considered Evil by many Religions, what am I?','I am Yule!','Medium','2024-07-10 03:24:56.206488'),(1270,'Religion Riddles','What Jewish king a leper died?','Uzziah��2 Chron. xxvi. 21.','Hard','2024-07-10 03:24:56.207713'),(1271,'Religion Riddles','Endlessly, I hunger, Lazily, I sleep. Murderous, I thunder, Desires, I do seek. Hoarding countless treasures, so my stature I retain, Envious of others whose feet on Earth remain. What am I?','\"The Seven Deadly Sins\" - Reasoning: Each sentence structure portrays one of the seven deadly sins from Christian theology, with the exception of the final 5 words. In order according to the riddle, these are; gluttony, sloth, wrath, lust, greed, pride, and envy. The final 5 words, \"whose feet on Earth remain\", act in conjunction with the section on envy, demonstrating the perspective of a sinner in hell, who is envious of those still alive, and thus can still repent for their sins in order to enter Heaven.','Hard','2024-07-10 03:24:56.209601'),(1272,'Religion Riddles','First is the last. Last is the first. You are in the middle. What am I?','CH UR CH CHURCH.','Medium','2024-07-10 03:24:56.211313'),(1273,'Religion Riddles','On which side of a church is the graveyard always situated?','On the outside, of course.','Easy','2024-07-10 03:24:56.213259'),(1274,'Religion Riddles','Why is orange not like a church bell?','Because it is never peeled (pealed) but once.','Easy','2024-07-10 03:24:56.214932'),(1275,'Religion Riddles','My love\'s the type of thing you have to earn, but when you earn it, you won\'t need it. Who am I?','God. Credit: Bo Burnham, Musical Comedian, Song title- \"God\'s Perspective\".','Medium','2024-07-10 03:24:56.216525'),(1276,'Religion Riddles','Gods\' arrows cannot be counted. What are they?','Rain.','Hard','2024-07-10 03:24:56.218211'),(1277,'Religion Riddles','A woman who lives in new york legally married three men, she did not get divorced, get an enrollment, or is legally separated. How is this possible?','She is a minister.','Easy','2024-07-10 03:24:56.219728'),(1278,'Religion Riddles','There were five men going to church and it started to rain. The four that ran got wet and the one that stood still stayed dry. How did the one stay dry?','It was a body in a coffin with the bearers.','Easy','2024-07-10 03:24:56.221406'),(1279,'Religion Riddles','Read my riddle, I pray. What God never sees, what the king seldom sees, and what we see every day. What is it?','An equal.','Hard','2024-07-10 03:24:56.223443'),(1280,'Riddle Books','What did one math book say to the other math book?','Do you want to hear my problems?','Medium','2024-07-10 03:24:56.225228'),(1281,'Riddle Books','Where do bedtime books sleep?','Under their covers.','Easy','2024-07-10 03:24:56.226769'),(1282,'Riddle Books','What English word has three consecutive double letters?','Bookkeeper.','Medium','2024-07-10 03:24:56.228113'),(1283,'Riddle Books','What building has the most stories?','The library.','Medium','2024-07-10 03:24:56.230010'),(1284,'Riddle Books','A teacher is yelling, she closes the door, the window, and a book. What did she forget to close?','Her mouth.','Medium','2024-07-10 03:24:56.231688'),(1285,'Riddle Books','My life is often a volume of grief, your help is needed to turn a new leaf. Stiff is my spine and my body is pale, but I\'m always ready to tell a tale. What am I?','A book!','Easy','2024-07-10 03:24:56.233299'),(1286,'Riddle Books','What has a spine, but no bones?','A book.','Medium','2024-07-10 03:24:56.234847'),(1287,'Riddle Books','I am the shell of something interesting. My front is very eye-catching but my inside tells all. What am I?','A Book.','Medium','2024-07-10 03:24:56.236122'),(1288,'Riddle Books','What did one math book say to another?','I have so many problems.','Easy','2024-07-10 03:24:56.237837'),(1289,'Riddle Books','My numbers may vary, thin as a sheet, take one away, and we\'re just not complete. What am I?','A Book.','Medium','2024-07-10 03:24:56.239536'),(1290,'Riddle Books','There were 5 children in a room. Iris drew a picture, Barry played video games, Andrew played chess, and Trina read a 