oks','What makes \"Book, Box, and Noon\" the same?','There are all nouns.','Hard','2024-07-10 03:24:56.259109'),(1301,'Riddle Books','I am very important to all living creatures. I was firstborn in the sun. I am a chapter in textbooks and I am not made of fire. I make the sun-worthy. Too much of me may kill you. But humans can still prevent me. What am I?','Heat!','Easy','2024-07-10 03:24:56.260864'),(1302,'Riddle Books','Why were the notebooks afraid to go to college?','Because the College ruled notebooks!','Hard','2024-07-10 03:24:56.262475'),(1303,'Riddle Books','I am the king\'s, given by the people; Used by the king, on the people who gave him; everyone obeys him because he has me. What am I?','Authority!','Medium','2024-07-10 03:24:56.264442'),(1304,'Riddle Books','What is that which has many leaves, but no stem?','A book.','Hard','2024-07-10 03:24:56.266387'),(1305,'Riddle Books','A color is seen on a stoplight, an item you use to eliminate the darkness. What comic book character is it?','Green Lantern.','Easy','2024-07-10 03:24:56.268238'),(1306,'Riddle Books','There\'s a land where there are mummies and daddies but no babies. Books but no libraries. Mirrors but no reflections. Kittens but no cats. Cattle but no cows. Lollipops but no candy and trees but no forests. It\'s the land of what?','The land of double letters.','Easy','2024-07-10 03:24:56.270192'),(1307,'Riddle Books','Tara has $29.00 dollars. She bought 4 coloring books that cost $3.00 each, and 4 boxes of Crayola crayons that cost $2.00 each. She spends the rest of her money on markers. How much money did she spend on markers?','She spent $9.00 on markers.','Medium','2024-07-10 03:24:56.271990'),(1308,'Riddle Books','A book costs $1 plus half its price. How much does it cost?','$2 ','Medium','2024-07-10 03:24:56.274039'),(1309,'Riddle Books','My first is high, My second damp, My whole a tie, A writer\'s cramp. What am I?','Hyphen. The first two lines yield high-fen. A hyphen is used by a writer to