 in arms, but lacking in legs. A tall skinny body, but missing a head. I change with the seasons, it\'s winter I dread. What am I?','A Tree.','Hard','2024-07-10 03:24:56.388106'),(1364,'Season Riddles','A woman went to Virginia to get a job. She promised her mother she would come back and visit sometime. Then, in the middle of winter, her mother shouted, \"April is here!\". How is this possible?','The woman\'s name is April.','Medium','2024-07-10 03:24:56.389763'),(1365,'Season Riddles','Walk on the living, they don\'t even mumble. Walk on the dead, they mutter and grumble. What are they?','Fallen leaves.','Hard','2024-07-10 03:24:56.391509'),(1366,'Season Riddles','What lives in winter, dies in summer, and grows with its roots upward?','An icicle.','Easy','2024-07-10 03:24:56.393111'),(1367,'Season Riddles','In what year did Christmas Day and New Year\'s Day fall in the same year?','It happens every year.','Hard','2024-07-10 03:24:56.394528'),(1368,'Season Riddles','Upside-down or on its side, this merry-go-round Is quite a ride. In the summer heat, It is quite a treat with blades so dull, that they will not slice. It spins too fast, for your sight. What is this ride?','A motorized fan.','Easy','2024-07-10 03:24:56.396040'),(1369,'Season Riddles','You are falling out of a window. What season is it?','Fall.','Hard','2024-07-10 03:24:56.397682'),(1370,'Season Riddles','David\'s birthday is in December, but it is never in the winter. Why?','He lives in Australia (or any other country that has December in summer)','Easy','2024-07-10 03:24:56.399158'),(1371,'Season Riddles','A man is in a room and the door is locked so he can\'t get out. He has with him a piano, a calendar, and a bed. How does he eat, drink, and get out?','He uses the dates from the calendar to eat, the springs from the bed to drink and the keys from the piano to get out.','Easy','2024-07-10 03:24:56.401393'),(1372,'Season Riddles','Why is snow like a maple tree?','Because it leaves in the early spring.','Medium','2024-07-10 03:24:56.402989'),(1373,'Season Riddles','I am spring-bloomed petals birthed from Turkish gardens. I am a creature not bound by land or sea I am the champion of human rights. What am I?','Two lips (tulips). Explanation: Tulips were first','Easy','2024-07-10 03:24:56.404597'),(1374,'Season Riddles','What happens only in the middle of each month, in all of the seasons, except summer, and happens only in the night, never in the day?','The letter \'N.\'','Medium','2024-07-10 03:24:56.406459'),(1375,'Season Riddles','Of all vegetables, only two can live to produce on their own for several growing seasons. All other vegetables must be replanted every year. What are the only two perennial vegetables?','Asparagus and rhubarb.','Hard','2024-07-10 03:24:56.408145'),(1376,'Season Riddles','I am a stop sign, what you see in blood, a rose, and, of course, an Autumn leaf. What am I?','The color red.','Hard','2024-07-10 03:24:56.409793'),(1377,'Season Riddles','Whiling away the hours of flowers, Walking through fields of gold. Preening and pruning in lights fading hours, For petals to freeze in the cold. What is it?','\"The Four Seasons\" - Reasoning: This riddle takes the perspective of plant life during these times of the year, where each line represents one of the four seasons of the year; Spring, Summer, Autumn, and Winter. Spring - where flowers are blooming - Summer - where fields of farm crop mature and turn golden in color, before being harvested - Autumn - where the trees shed their leaves and days grow shorter - and Winter - where the cold leaves frost and freezes plants.','Hard','2024-07-10 03:24:56.411471'),(1378,'Season Riddles','The fire shows - my kin, born. The fire grows - my kin, adorn. The fire slows - my kin, deform. The fire goes - my kin, mourn.','Fruit-bearing tree through the four seasons.','Easy','2024-07-10 03:24:56.413527'),(1379,'Season Riddles','Why are trees in winter like troublesome visitors?','Because it\'s a long time before they leave.','Easy','2024-07-10 03:24:56.415119'),(1380,'Season Riddles','What is another name for the season of fall?','Autumn.','Easy','2024-07-10 03:24:56.417080'),(1381,'Season Riddles','How far is it from March to June?','A single spring.','Hard','2024-07-10 03:24:56.419686'),(1382,'Sister Riddles','There is a brother and a sister. The boy wants to visit his father in jail, and the sister wants to visit her mother in the hospital. But they both are not allowed in jail or hospital. All they have is a gun. What do they do?','The boy shoots the girl, and then the boy goes to jail for attempted murder and the girl goes to the hospital due to her injuries.','Hard','2024-07-10 03:24:56.421588'),(1383,'Sister Riddles','Tom and his younger sister were fighting. Their mother was tired of the fighting and decided to punish them by making them stand on the same piece of newspaper in such a way that they couldn\'t touch each other. How did she accomplish this?','Tom\'s mother slid a newspaper under a door, each sibling standing on each side.','Medium','2024-07-10 03:24:56.423622'),(1384,'Sister Riddles','Can a man legally marry his widow\'s sister in the state of California?','NO since she is a \'widow\', the guy\'s dead!','Hard','2024-07-10 03:24:56.425984'),(1385,'Sister Riddles','There was a man who was born before his father, killed his mother, and married his sister. Yet, there was nothing wrong with what he had done. Why?','His father was in front of him when he was born, therefore he was born before him. His mother died while giving birth to him. Finally, he grew up to be a minister and married his sister at her ceremony.','Easy','2024-07-10 03:24:56.428411'),(1386,'Sister Riddles','If your uncle\'s sister is not your aunt, what relation is she to you?','Your mother.','Easy','2024-07-10 03:24:56.430602'),(1387,'Sister Riddles','What relation would your father\'s sister\'s sister-in-law be to you?','This person would be your mother.','Medium','2024-07-10 03:24:56.432548'),(1388,'Sister Riddles','A beggar\'s brother died, but the man who died had no brother. How could that be?','The beggar was his sister!','Hard','2024-07-10 03:24:56.434532'),(1389,'Sister Riddles','A woman is at her mother\'s funeral when suddenly she sees a man so handsome, she instantly falls in love with her. Unfortunately, she never got a chance to talk to the man. The next day, the woman kills her sister. What was the motive?','The woman was hoping to see the man again. If you got this correct on the first try, you have the mind of a psychopath.','Easy','2024-07-10 03:24:56.436410'),(1390,'Sister Riddles','You give someone a dollar. You are this person\'s brother, but the person is not your brother. How can that be?','It\'s your sister!','Medium','2024-07-10 03:24:56.438825'),(1391,'Sister Riddles','All 5 sisters are busy. Ann is reading, Rose is cooking, Katie is playing chess and Mary is doing laundry. What is the fifth sister doing?','She is playing chess with Katie.','Easy','2024-07-10 03:24:56.441426'),(1392,'Sister Riddles','You are my brother, but I am not your brother. Who am I?','I am your sister.','Medium','2024-07-10 03:24:56.443366'),(1393,'Sister Riddles','Does the christian religion allow a man to marry his widow\'s sister?','A dead man cannot marry. His widow would mean he is dead.','Easy','2024-07-10 03:24:56.445963'),(1394,'Sister Riddles','If May\'s daughter\'s daughter is my granddaughter\'s mother\'s mother\'s brother\'s sister, then what am I to May? (May only has one sibling)','I am May.','Easy','2024-07-10 03:24:56.448223'),(1395,'Sister Riddles','What did the cell say to his sister who stood on his toe?','Mitosis! ( My - toe - sis)','Hard','2024-07-10 03:24:56.450406'),(1396,'Sister Riddles','Brothers and sisters have I none, But that man\'s father is my father\'s son. Who is \"that man\"?','The son of the speaker.','Easy','2024-07-10 03:24:56.452521'),(1397,'Sister Riddles','As I went over London Bridge I met my sister Jenny. I broke her neck and drank her blood And left her standing empty. What am I?','Gin.','Medium','2024-07-10 03:24:56.454948'),(1398,'Sister Riddles','A woman proves in court that her husband was murdered by her sister, but the judge decides that the sister cannot be punished. Why?','The sisters are Siamese twins.','Medium','2024-07-10 03:24:56.457540'),(1399,'Sister Riddles','A boy has as many sisters as brothers, but each sister has only half as many sisters as brothers. How many brothers and sisters are there in the family?','Four brothers and three sisters.','Hard','2024-07-10 03:24:56.459563'),(1400,'Sister Riddles','There is a certain family with both girl and boy children. Each of the boys has the same number of brothers as he has sisters. Each of the girls has twice as many brothers as she has sisters. How many boys and girls are there in this family?','Four boys and three girls.','Hard','2024-07-10 03:24:56.461737'),(1401,'Sister Riddles','A man while looking at a photograph said, \"Brothers and sisters have I none. That man\'s father is my father\'s son.\" Who was the person in the photograph?','That man\'s son.','Hard','2024-07-10 03:24:56.463611'),(1402,'cat-riddles','When is it bad luck to see a black cat?','When you are a mouse.','Medium','2024-07-10 03:24:56.466243'),(1403,'cat-riddles','While on my way to St. Ives, I saw a man with 7 wives. Each wife had 7 sacks. Each sack had 7 cats. Each cat had 7 kittens. Kitten, cats, sacks, wives, How many were going to St. Ives?','Just one, me.','Easy','2024-07-10 03:24:56.467978'),(1404,'cat-riddles','If 5 cats catch 5 mice in 5 minutes, how long will it take one cat to catch a mouse?','Five minutes.','Easy','2024-07-10 03:24:56.469807'),(1405,'cat-riddles','I\'m found in socks, scarves, and mittens. I\'m found in the paws of playful kittens. What am I?','Yarn.','Medium','2024-07-10 03:24:56.471912'),(1406,'cat-riddles','All of Mrs. Smith\'s pets are dogs except one, and all her pets are cats except one. How many cats and dogs does she have?','Mrs. Smith has one cat and one dog.','Hard','2024-07-10 03:24:56.473993'),(1407,'cat-riddles','What\'s 3/7 chicken, 2/3 cat, and 2/4 goat?','Chicago. The first three words out of seven of chicken is CHI, the first two words out of 3 of cat is CA, and the first two words out of goat is GO. Therefore making, (CHI)(CA)(GO).','Easy','2024-07-10 03:24:56.475840'),(1408,'cat-riddles','What happens after it rains cats and dogs?','You step in a poodle.','Medium','2024-07-10 03:24:56.477637'),(1409,'cat-riddles','What do you get when you cross a black cat and a lemon?','A Sour Puss.','Hard','2024-07-10 03:24:56.479367'),(1410,'cat-riddles','If there is a Yellow house on Bluebird Lane, a Green house on Orange Street, a Pink house on Kitten Road, a Black house on Whitehorse Pike and a Purple house on Firebird hill, where is the White house?','Washington, D.C.','Easy','2024-07-10 03:24:56.481399'),(1411,'cat-riddles','Inside napper, bird chaser, quick stoker, small animal killer, fish eater. What is it?','A cat.','Medium','2024-07-10 03:24:56.483162'),(1412,'cat-riddles','10 copycats were sitting in a car. One came out. How many are left?','None( as they were copycats they copied each other).','Easy','2024-07-10 03:24:56.485303'),(1413,'cat-riddles','What word doesn\'t belong in this group? That, hat, what, mat, cat, sat, pat, or chat?','What. It\'s pronounced differently; all of the others rhyme.','Hard','2024-07-10 03:24:56.487091'),(1414,'cat-riddles','Where did the cat go after losing its tail?','To the re-tail store.','Medium','2024-07-10 03:24:56.489174'),(1415,'cat-riddles','If three cats catch three mice in three minutes, how many cats would be needed to catch 100 mice in 100 minutes?','The same three cats would do. Since these three cats are averaging one mouse per minute, given 100 minutes, the cats could catch 100 mice.','Medium','2024-07-10 03:24:56.490765'),(1416,'cat-riddles','What do you call Santa for cats?','Santa paws.','Easy','2024-07-10 03:24:56.492662'),(1417,'cat-riddles','When is the worst weather for rats and mice?','When it rains cats and dogs.','Easy','2024-07-10 03:24:56.494653'),(1418,'cat-riddles','What do cats call mice on a skateboard?','Meals on wheels!','Hard','2024-07-10 03:24:56.496425'),(1419,'cat-riddles','I am one with eight to spare, lest I lose my one. I\'m not a number. What am I?','A Cat. ( Nine Lives )','Hard','2024-07-10 03:24:56.498805'),(1420,'cat-riddles','Why was the cat thrown out of the card game?','Because he was a Cheetah!','Medium','2024-07-10 03:24:56.501254'),(1421,'cat-riddles','Why was the cat sitting at the computer?','It was keeping an eye on the mouse.','Hard','2024-07-10 03:24:56.503307'),(1422,'cat-riddles','What side of a cat has the most fur?','The outside.','Easy','2024-07-10 03:24:56.505299'),(1423,'cat-riddles','Forward I catch fish, backward I am the tenth of numbers. What am I?','Net.','Hard','2024-07-10 03:24:56.507163'),(1424,'cat-riddles','The ghost of the mountain never to be seen, leaps like a raging fire to catch his prey. As pale as the moon but fast as the wind. Cold as ice, but a flash of light in the night. What is it?','A snow leopard.','Hard','2024-07-10 03:24:56.509062'),(1425,'cat-riddles','Give a name to a cat and it will call itself. What is the name?','Meeoow is the name.','Hard','2024-07-10 03:24:56.510545'),(1426,'cat-riddles','What do you call a cat that gets anything it wants?','Purr-suasive','Easy','2024-07-10 03:24:56.512274'),(1427,'cat-riddles','What happens when a cat meets with a tragic accident?','A cat-astrophy!','Easy','2024-07-10 03:24:56.513913'),(1428,'cat-riddles','What sneaks through doors and windows without knocking? What heats an unlit stove? What gives the cat a snug place to rest?','The sun!','Medium','2024-07-10 03:24:56.515395'),(1429,'cat-riddles','Stealthy as a shadow in the dead of night, Cunning but affectionate if given a bite. Never owned but often loved. In my sport considered cruel, But that\'s