','Cleopatra and Anthony were fish and a cat knocked over their fish bowl and since fish can\'t survive without water they died!!','Easy','2024-07-10 03:24:56.533773'),(1440,'cat-riddles','If it takes four rat catchers four minutes to kill four rats, how many rat catchers would be needed to catch 50 rats in 50 minutes?','The same number of rat-catchers: Four.','Easy','2024-07-10 03:24:56.535762'),(1441,'cat-riddles','If seven cats kill seven rats in 7 minutes, how many would be needed to kill one hundred rats in 50 minutes?','14','Hard','2024-07-10 03:24:56.537942'),(1442,'cat-riddles','How many cats are in a small room if in each of the four corners a cat is sitting, and opposite each cat there sit three cats, and on each cat\'s tail another is sitting?','Four cats, each near a tail of a cat in an adjacent corner.','Medium','2024-07-10 03:24:56.540050'),(1443,'skeleton-riddles','Why is France like a skeleton?','Because only the bony part is left. This is a play on words referring to Napoleon Bonaparte who played a key role in the 1789 French Revolution and was the first Emporer of France from 1804-15.','Easy','2024-07-10 03:24:56.541987'),(1444,'skeleton-riddles','What did the skeleton order at the restaurant?','Spare ribs!','Hard','2024-07-10 03:24:56.543741'),(1445,'skeleton-riddles','Why do skeletons hate the cold?','The wind goes right through them!','Easy','2024-07-10 03:24:56.545460'),(1446,'skeleton-riddles','Why do skeletons go on vacations alone?','Because they have no-body to go with.','Hard','2024-07-10 03:24:56.546911'),(1447,'skeleton-riddles','Who was the most famous Skeleton detective?','Sherlock Bones.','Hard','2024-07-10 03:24:56.548383'),(1448,'skeleton-riddles','What instrument does a skeleton play?','Trombone.','Hard','2024-07-10 03:24:56.550066'),(1449,'skeleton-riddles','Why did the skeleton go to the barbecue?','To get some spare - ribs.','Medium','2024-07-10 03:24:56.551624'),(1450,'skeleton-riddles','Why did the skeleton head cross the road?','To get to the other spine.','Medium','2024-07-10 03:24:56.553129'),(1451,'skeleton-riddles','Why did the skeleton climb up the tree?','Because the dog was after his bones.','Hard','2024-07-10 03:24:56.554576'),(1452,'skeleton-riddles','Why didn\'t the skeleton use a towel?','Because he always comes out bone dry.','Hard','2024-07-10 03:24:56.556032'),(1453,'football-riddles','What has one foot but no legs?','A football.','Easy','2024-07-10 03:24:56.557495'),(1454,'football-riddles','What is the only time you run in football?','When you kick off the game.','Hard','2024-07-10 03:24:56.558860'),(1455,'football-riddles','What do you call a football player who can\'t stop talking?','A quarterback.','Easy','2024-07-10 03:24:56.560903'),(1456,'football-riddles','What do you call a group of cows playing football?','A pasture-ization.','Easy','2024-07-10 03:24:56.562704'),(1457,'football-riddles','Why did the football coach go to the bank?','To get his quarterback!','Easy','2024-07-10 03:24:56.564414'),(1458,'football-riddles','What do football players do when they get cold?','They stand in the corner.Because it\'s always 90 degrees there.','Medium','2024-07-10 03:24:56.566702'),(1459,'football-riddles','What do you call a football player with no legs?','Ground beef.','Easy','2024-07-10 03:24:56.568695'),(1460,'football-riddles','What do you call a ghost who loves football?','A receiver-ant.','Easy','2024-07-10 03:24:56.570829'),(1461,'football-riddles','John bet Tom $100 that he can predict the score of the football game before it starts. Tom agrees but loses the bet. Why did Tom lose the bet?','John said the score would be 0-0 and he was right. \"Before\" any football game starts. The score is always 0-0.','Medium','2024-07-10 03:24:56.573193'),(1462,'football-riddles','What has 22 legs and 2 wings?',' A football team!','Medium','2024-07-10 03:24:56.575251'),(1463,'football-riddles','Why is it always hot at the end of a football game?',' Because all of the FANS have gon