 freedom of birds and the pen of old men?','Feathers. Feathers make up a bird\'s wings, giving it flight or freedom. Quill pens were used by men in older times.','Hard','2024-07-10 03:25:05.290322'),(1702,'Bird Riddles','What do you get when you cross Santa Claus and a duck?','A Christmas quacker.','Hard','2024-07-10 03:25:05.291707'),(1703,'Bird Riddles','Why don\'t chickens play baseball?','Because they hit fowl balls.','Hard','2024-07-10 03:25:05.293004'),(1704,'Bird Riddles','Why did the chicken cross the playground?','To get to the other slide!','Easy','2024-07-10 03:25:05.294401'),(1705,'Bird Riddles','In what place did the rooster crow when all the world heard him?','In Noah\'s Ark.','Medium','2024-07-10 03:25:05.295564'),(1706,'Bird Riddles','A bird has a head 9cm long. The tail is equal to the size of the head plus half of the size of the body. The body is the size of the head plus the tail. How long is the bird?','72cm. Th head is 9cm. The tail is 18 + 9= 27cm. The body is 9 + 18 + 9= 36cm. 9 + 27 + 36= 72cm.','Hard','2024-07-10 03:25:05.297532'),(1707,'Bird Riddles','A large truck is crossing a bridge 1 mile long. The bridge can only hold 14000 lbs, which is the exact weight of the truck. The truck makes it halfway across the bridge and stops. A bird lands on the truck. Does the bridge collapse?','No, it does not collapse. Because it has driven a half-mile - you would subtract the gas used from the total weight of the truck.','Medium','2024-07-10 03:25:05.298781'),(1708,'Bird Riddles','What kind of can never needs a can-opener?','A pelican!','Medium','2024-07-10 03:25:05.300175'),(1709,'Bird Riddles','A great banquet was prepared for a Roman emperor and his courtiers. 22 Dormice, 40 Larks\' Tongues, 30 Flamingos, and 40 Roast Parrots were served. How many portions of Boiled Ostrich were served?','42. Each vowel is worth 2 and each consonant 4, so Dormice gives 22, etc.','Hard','2024-07-10 03:25:05.301694'),(1710,'Black Riddles','I am white when I am dirty, and black when I am clean. What am I?','A','Easy','2024-07-10 03:25:05.302834'),(1711,'Black Riddles','What is black when you buy it, red when you use it, and gray when you throw it away?','Charcoal.','Easy','2024-07-10 03:25:05.304016'),(1712,'Black Riddles','When is it bad luck to see a','When you are a mouse.','Medium','2024-07-10 03:25:05.305752'),(1713,'Black Riddles','Why is Santa so good at Karate?','Because he has a black belt.','Hard','2024-07-10 03:25:05.307266'),(1714,'Black Riddles','I\'m clean when I\'m black, Dirty when white; Get too close, And you might sneeze. What am I?','A Chalkboard.','Medium','2024-07-10 03:25:05.309190'),(1715,'Black Riddles','I am white, black, and read all over. What am I?','Newspaper!','Hard','2024-07-10 03:25:05.310659'),(1716,'Black Riddles','Pronounced as one letter, And written with three, Two letters there are, And two only in me. I\'m double, I\'m single, I\'m black, blue, and gray, I\'m read from both ends, And the same either way. What am I?','An eye.','Easy','2024-07-10 03:25:05.312114'),(1717,'Black Riddles','Take one out and scratch my head, I am now black but once was red. What am I?','A Match.','Hard','2024-07-10 03:25:05.313728'),(1718,'Black Riddles','What do you get when you cross a black cat and a lemon?','A Sour Puss.','Medium','2024-07-10 03:25:05.315266'),(1719,'Black Riddles','If there is a Yellow house on Bluebird Lane, a Green House on Orange Street, a Pink house on Kitten Road, a Black House on Whitehorse Pike, and a Purple house on Firebird hill, where is the White House?','Washington, D.C.','Medium','2024-07-10 03:25:05.317408'),(1720,'Black Riddles','You get 2 clues to this riddle. 1. It can be green, black, or even sweet. 2. It sounds like a letter. What is it?','Tea.','Hard','2024-07-10 03:25:05.319264'),(1721,'Black Riddles','I am not a person or an animal. I was born from the death of something large and hot. I am capable of consuming anything and everything. I am very dark and exist in a place where there is no gravity. What am I?','A black hole.','Hard','2024-07-10 03:25:05.321348'),(1722,'Black Riddles','Duels of good and evil, A fighter of good am I, Revealed beside watched words, King of the black night sky. What am I?','The dark.','Hard','2024-07-10 03:25:05.323075'),(1723,'Black Riddles','Dark with white markings, smooth like a rock. Where learning occurs, I help convey thought. What am I?','Blackboard/chalkboard.','Easy','2024-07-10 03:25:05.325804'),(1724,'Black Riddles','With three eyes and a black as night, I frequently knock down ten men with a single strike! What am I?','A Bowling ball.','Medium','2024-07-10 03:25:05.327446'),(1725,'Black Riddles','Tear off one and scratch its head, what was red is now black instead. What is It?','A Matchstick!','Hard','2024-07-10 03:25:05.329315'),(1726,'Black Riddles','Dead on the field lie ten soldiers in white, felled by three eyes, black as night. What happened?','A strike was thrown in 10-pin bowling.','Easy','2024-07-10 03:25:05.330928'),(1727,'Black Riddles','The king of the jungle, rare as gold, black as night, in light not there and night not seen. Goes in water, goes on trees, goes in caves, goes on the ground. Claws of knives, teeth of swords, the roar of death but silent as a mouse. What is it?','A','Medium','2024-07-10 03:25:05.332898'),(1728,'Black Riddles','What 3 common songs have the same melody?','Baa Baa Black Sheep twinkle twinkle little star and the Alphabet song! wow kid songs','Medium','2024-07-10 03:25:05.334528'),(1729,'Black Riddles','What do you call a tavern of blackbirds?','A crowbar.','Easy','2024-07-10 03:25:05.336006'),(1730,'Black Riddles','I\'m blue at day and black at night; I do contain some creatures born and died. What am I?','Sea water.','Medium','2024-07-10 03:25:05.337797'),(1731,'Black Riddles','I always point in the right direction. My instructions are written in black and white. Disobey me and pay the consequences. I will never say more than two words at a time. 