t?','An untied balloon','Easy','2024-07-10 03:25:05.352763'),(1740,'Black Riddles','What kind of music does a blacksmith like?','Heavy metal!','Medium','2024-07-10 03:25:05.355233'),(1741,'Black Riddles','How many black beans will make five white ones?','Five when peeled.','Hard','2024-07-10 03:25:05.357389'),(1742,'Black Riddles','What insect does a blacksmith manufacture?','He makes the firefly.','Easy','2024-07-10 03:25:05.359241'),(1743,'Black Riddles','Black within, red without, with four corners, roundabout. What is it?','A chimney.','Medium','2024-07-10 03:25:05.361491'),(1744,'Black Riddles','What\'s black and white and red all over?','A zebra with a sunburn.','Easy','2024-07-10 03:25:05.364028'),(1745,'Black Riddles','Don\'t burn me I\'ll be crusty and black, but butter me and I\'ll be greasy and wack. What am I?','Bread','Easy','2024-07-10 03:25:05.366658'),(1746,'Black Riddles','What goes in the water red, and comes out black?','Iron.','Easy','2024-07-10 03:25:05.369243'),(1747,'Black Riddles','Slam slam slam all day long slam slam slam some fast, some slow something solid. flat and sturdy its friend lights up the night and is sensitive to the eye slam slam slam A through Z 1,2,3 black as night. What am I?','A Computer keyboard.','Easy','2024-07-10 03:25:05.371315'),(1748,'Black Riddles','I am sometimes green, I am sometimes yellow and green. When I\'m green, I have many white babies inside me; and when yellow and green, I have many black babies inside of me, and is sweet. What am I?','Pawpaw.','Easy','2024-07-10 03:25:05.373754'),(1749,'Black Riddles','I\'m sometimes white, Although sometimes I\'m black. I take you there But never bring you back. What am I?','I\'m a Hearse.','Hard','2024-07-10 03:25:05.375855'),(1750,'Black Riddles','What do you get when you cross Beyonce with a black hole?','A single-lady-ty (singularity/single lady)','Medium','2024-07-10 03:25:05.378738'),(1751,'Black Riddles','What game has a black dragon?','Skool of dragons.','Easy',