ne boat with a capacity for one person. The two people managed to cross the river safely. How did they do it?','The two were on opposite sides of the river.','Easy','2024-07-10 03:25:05.413419'),(1770,'Boat Riddles','When is a boat like a knife?','When it is a cutter.','Hard','2024-07-10 03:25:05.415078'),(1771,'Boat Riddles','A pro fisherman decided to become a pro golfer. In order to buy his clubs, he had to sell his boat. How did he list it?','Fore Sail!','Medium','2024-07-10 03:25:05.417089'),(1772,'Boat Riddles','Why is a ferry boat like a good rule?','Because it works both ways.','Hard','2024-07-10 03:25:05.418654'),(1773,'Boat Riddles','Four men were in a boat on the lake. The boat turns over, and all four men sink to the bottom of the lake, yet not a single man got wet! Why?','Because they were all married and not single.','Medium','2024-07-10 03:25:05.420630'),(1774,'Boat Riddles','Peter celebrated his birthday on one day, and two days later his older twin brother, Paul, celebrated his birthday. How could this be?','When the mother of the twins went into labor, she was traveling by boat. The older twin, Paul, was born first, barely on March 1st. The boat then crossed a time zone, and the younger twin was born on February the 28th. In a leap year, the younger twin celebrates his birthday two days before his older brother.','Easy','2024-07-10 03:25:05.422427'),(1775,'Boat Riddles','A girl went over to the U.S. on the 4th of July and partied for 3 days and came back on the 4th of July. How did she do that?','She went over on the date of the 4th of July and came home on the boat called the 4th of July.','Easy','2024-07-10 03:25:05.424094'),(1776,'Brother Riddles','Mr. and Mrs. Mustard have six daughters and each daughter has one brother. How many people are in the Mustard family?','There are nine Mustards in the family. Since each daughter shares the same brother, there are six girls, one boy, and Mr. and Mrs. Mustard.','Easy','2024-07-10 03:25:05.426095'),(177