he dark.','Hard','2024-07-10 03:25:05.555015'),(1853,'Dark Riddles','I always follow you around, everywhere you go at night. I look very bright to people, but I can make the sun dark. I can be in many different forms and shapes. What am I?','The moon!','Medium','2024-07-10 03:25:05.555994'),(1854,'Dark Riddles','I run in and out of town all day and night. What am I?','A road.','Easy','2024-07-10 03:25:05.557333'),(1855,'Dark Riddles','I was carried into a dark room, and set on fire. I wept, and then my head was cut off. What am I?','A Candle.','Medium','2024-07-10 03:25:05.558718'),(1856,'Dark Riddles','What did Sir Lancelot wear to bed?','A knight gown!','Easy','2024-07-10 03:25:05.559784'),(1857,'Dark Riddles','I am the beginning of sorrow and the end of sickness. You cannot express happiness without me, yet I am in the midst of crosses. I am always in risk, yet never in danger. You may find me in the sun, but I am never out of darkness. What am I?','The letter S.','Medium','2024-07-10 03:25:05.560969'),(1858,'Dark Riddles','A little pool with two layers of wall around it. One white and soft and the other dark and hard, amidst a light brown grassy lawn with an outline of green grass. What am I?','A Coconut.','Hard','2024-07-10 03:25:05.562221'),(1859,'Dark Riddles','How do you know that a vampire loves baseball?','Because he turns into a bat every night.','Medium','2024-07-10 03:25:05.563240'),(1860,'Dark Riddles','What falls down but never breaks?','Nightfall.','Hard','2024-07-10 03:25:05.564571'),(1861,'Dark Riddles','What boy wizard magically grew a beard each night?','Hairy Potter.','Medium','2024-07-10 03:25:05.565611'),(1862,'Dark Riddles','Why couldn\'t Goldilocks sleep?','Because of nightbears.','Easy','2024-07-10 03:25:05.566736'),(1863,'Dark Riddles','When I point up it\'s bright, but when I point down it\'s dark. What am I?','A Light Switch.','Hard','2024-07-10 03:25:05.568050'),(1864,'Dark Riddles','I\'m like a doll, But I\'m not for playing; I stand up straight, but if windy I may be laying; I\'m well-known and famous for having no brain; I work outside both day and night in sunshine or in rain. What am I?','A Scarecrow.','Medium','2024-07-10 03:25:05.569352'),(1865,'Dark Riddles','Lovely and round, I shine with pale light, grown in the darkness, A lady\'s delight. What am I?','A Pearl.','Easy','2024-07-10 03:25:05.570389'),(1866,'Dark Riddles','They are dark and always on the run. Without the sun, there would be none. What are they?','Shadows.','Easy','2024-07-10 03:25:05.571371'),(1867,'Dark Riddles','Why does a dragon sleep all day?','So it can hunt knights!','Medium','2024-07-10 03:25:05.572581'),(1868,'Dark Riddles','What falls but doesn\'t break, and what breaks but doesn\'t fall?','Night and Day.','Easy','2024-07-10 03:25:05.573656'),(1869,'Dark Riddles','I follow you by day, by night I blend right in but no one sees me except when I\'m in the light. What am I?','A shadow.','Easy','2024-07-10 03:25:05.574665'),(1870,'Dark Riddles','Every night, I\'m told what to do. And every morning, I do what you tell me to do. But you still get mad at me and hit me. What am I?','An alarm clock.','Hard','2024-07-10 03:25:05.575793'),(1871,'Dark Riddles','I weaken all men for hours each day. I show you strange visions while you are away. I take you by night, by day take you back, None suffer to have me, but do from my lack. What am I?','Sleep.','Hard','2024-07-10 03:25:05.577362'),(1872,'Dark Riddles','My first four letters describe all living things. My last five letters are another word for knight. My job is to save you, and I\'m a fan of water. Who am I?','I��m a lifeguard','Easy','2024-07-10 03:25:05.578543'),(1873,'Dark Riddles','A man rides into town on Friday. He stays two nights. How does he leave on Tuesday?','His horse was called Friday.','Hard','2024-07-10 03:25:05.580212'),(1874,'Dark Riddles','Who always stalks you during the day but becomes too tired to stalk you at night?','Your own shadow!','Easy','2024-0