4-07-10 03:25:05.594015'),(1885,'Dark Riddles','Duels of good and evil, A fighter of good am I, Revealed beside watched words, King of the black night sky. What am I?','The dark.','Easy','2024-07-10 03:25:05.595289'),(1886,'Dark Riddles','When I am metal or wood, I bring you home. When I am flesh and blood, in the darkness I roam. What am I?','A bat.','Easy','2024-07-10 03:25:05.596777'),(1887,'Dark Riddles','A nightmare for some. For others, a savior I come. My hand\'s cold and bleak. It\'s the warm hearts they seek. What am I?','Death.','Easy','2024-07-10 03:25:05.597923'),(1888,'Dark Riddles','I grow in the dark and shine in the light; The paler I am, the more I am liked; My maker never gets paid, but never goes on strike. What am I?','A pearl.','Medium','2024-07-10 03:25:05.599264'),(1889,'Dark Riddles','I have an eye in the middle of me, but as you see, I cannot see. I am dark and not far away. You don\'t see me every day. I am not night and I am not bright. I can have twists and water and scares. What am I?','A hurricane.','Medium','2024-07-10 03:25:05.600688'),(1890,'Dark Riddles','I\'m far away from you, but I still shine bright. I sleep by day, I wake up at night. I stay by the moon but never get close to it. What am I?','A star.','Easy','2024-07-10 03:25:05.602301'),(1891,'Dark Riddles','I can\'t t hurt you, but I can leave you with scars. Nobody wants me, but everyone has me. But you are the only one who can see me. What am I?','Nightmares.','Medium','2024-07-10 03:25:05.603361'),(1892,'Dark Riddles','You see me at night, by day you tell everyone about me. I come back looking different than before. I sometimes leave you in the darkness. What am I?','A dream.','Hard','2024-07-10 03:25:05.604957'),(1893,'Dark Riddles','With three eyes and a black as night, I frequently knock down ten men with a single strike! What am I?','A Bowling ball.','Easy','2024-07-10 03:25:05.606022'),(1894,'Dark Riddles','I\'m grown from darkness but shine with a pale light. Very round I am, and always a lady\'s delight. What am I?','A Pearl.','Medium','2024-07-10 03:25:05.607325'),(1895,'Dark Riddles','I take you by night, by day take you back. None suffer to have me but do from my lack. What am I?','Sleep','Medium','2024-07-10 03:25:05.608783'),(1896,'Dark Riddles','Dead on the field lie ten soldiers in white, felled by three eyes, black as night. What happened?','A strike was thrown in 10-pin bowling.','Hard','2024-07-10 03:25:05.610257'),(1897,'Dark Riddles','What loses its head in the morning, and gets it back at night?','A Pillow.','Hard','2024-07-10 03:25:05.611733'),(1898,'Dark Riddles','The king of the jungle, rare as gold, black as night, in light not there and night not seen. Goes in water, goes on trees, goes in caves, goes on the ground. Claws of knives, teeth of swords, the roar of death but silent as a mouse. What is it?','A black panther (black jaguar)','Medium','2024-07-10 03:25:05.613324'),(1899,'Dark Riddles','I am nothing, I am everything. I am perfect dark, I am the brightest light. I am hungry, I am full. I am nowhere, I am everywhere. I am unseen, I am watched by millions. What am I?','The universe.','Easy','2024-07-10 03:25:05.614522'),(1900,'Dark Riddles','I\'m blue at day and black at night; I do contain some creatures born and died. What am I?','Seawater.','Easy','2024-07-10 03:25:05.615800'),(1901,'Dark Riddles','I\'m the first thing you see in the morning and the last thing you see at night, I\'m always there but you choose to ignore me, cross your eyes and you will see me. What am I?','Your nose.','Easy','2024-07-10 03:25:05.617320'),(1902,'Dark Riddles','Dark with white markings, And smooth like a rock. Where learning occurs, I help convey thought. What am I?','Blackboard/chalkboard.','Hard','2024-07-10 03:25:05.618507'),(1903,'Dark Riddles','I welcome the day with a show of light, I stealthily came here in the night. I bathe the earthy stuff at dawn, But by noon, alas! I\'m gone. What am I?','The morning dew!','