is possible?','He sleeps during the night.','Medium','2024-07-10 03:25:05.635405'),(1914,'Dark Riddles','The man had not slept in days, yet he was well-rested. How could this be?','He only sleeps at night (he had not slept in DAYS)','Easy','2024-07-10 03:25:05.636764'),(1915,'Dark Riddles','I am life, yet not real. When we first meet, things are dark. When we leave each other, you are in the light. I meet many people with and after you. What am I?','A movie.','Easy','2024-07-10 03:25:05.638059'),(1916,'Dark Riddles','I have billions of eyes, yet I live in darkness. I have millions of ears, yet only four lobes. I have no muscle, yet I rule two hemispheres. What am I?','The human brain.','Easy','2024-07-10 03:25:05.639427'),(1917,'Dark Riddles','In a tunnel of darkness lies a beast of iron. It can only attack when pulled back. What is it?','A bullet.','Medium','2024-07-10 03:25:05.640989'),(1918,'Dark Riddles','The ghost of the mountain never to be seen, leaps like a raging fire to catch his prey. As pale as the moon but fast as the wind. Cold as ice, but a flash of light in the night. What is it?','A snow leopard.','Hard','2024-07-10 03:25:05.642429'),(1919,'Dark Riddles','My body has a dozen heads or more, My tails don\'t wag when you walk in the door. Count the ways you can hold me tight, Or use me for a special night! What Am I?','A piggy bank.','Hard','2024-07-10 03:25:05.643905'),(1920,'Dark Riddles','From dawn to dusk I soar through the sky, A thunderous voice, but silent I fly. Through the darkest depths, I will not die, Yet I can not be seen by the naked eye. What am I?','Radio waves.','Medium','2024-07-10 03:25:05.645586'),(1921,'Dark Riddles','A group of men is suddenly awakened by a loud, piercing, continuous sound. They all scramble out of their beds, get dressed, grab a pole, and disappear into a hole. What in the world are these men doing?','The men are firemen who were on night-shift duty at their firehouse. When they heard the fire alarm, they got dressed, slid down the fire pole, and got in the fire truck.','Medium','2024-07-10 03:25:05.647070'),(1922,'Dark Riddles','What falls but never breaks? What breaks but never falls?','Night and Day!','Hard','2024-07-10 03:25:05.649295'),(1923,'Dark Riddles','A light aloft alone in shadow, I light the way for paths you follow. What am I?','\"Lampost\" - Reasoning: Often, a street lampost will be a source of light above paths that are often traveled at night, hence it is the reference to this lonely light guiding you on paths through the darkness.','Easy','2024-07-10 03:25:05.650833'),(1924,'Dark Riddles','I scream out in the dark, I bring light to you, my flame whispers in the darkness. What am I?','A candle.','Easy','2024-07-10 03:25:05.652134'),(1925,'Dark Riddles','Nick timed himself and found out that if he wore a bright white outfit he ran 20 miles in 80 minutes, but when he wore a dark outfit, he ran 20 miles in one hour and twenty minutes. What does this mean for his next race?','Nothing, as 80 minutes equals an hour and twenty minutes.','Easy','2024-07-10 03:25:05.653826'),(1926,'Dark Riddles','In the light, I may reflect. In the dark, I\'m cold and wet. What am I?','Water.','Medium','2024-07-10 03:25:05.655304'),(1927,'Dark Riddles','From house to house he goes, A messenger small and slight. And whether it rains or snows, He sleeps outside at night. What am I?','A Street or Road.','Hard','2024-07-10 03:25:05.656893'),(1928,'Dark Riddles','Where once there were many, now there are none. Time has done ticking; the hours are done. For now, is an end, but also beginning, For darkest is now, but soon shall be thinning. What is it?','\"Midnight\" - Reasoning: The riddle is all about following something through to the end - a day. Once the day reaches its end, at midnight, when all the hours of the day are gone, right down to the last second, the clock resets. Thus, it marks both the end of a day and the beginning of a new one.','Medium','2024-07-10 03:25:05.658389'),(1929,'Dark Riddles','Stealthy as a shadow in the dead of night, Cunning but affectionate if given a bite. Never owned but often loved. In my','A cat.','Hard','2024-07-10 03:25:05.659711'),(1930,'Dark Riddles','Which is the creature that has one voice, but has four feet in the morning, two feet in the afternoon, and three feet at night?','Man crawls on all fours as a baby, walks on two as an adult, and needs a walking cane when old.','Hard','2024-07-10 03:25:05.661300'),(1931,'Dark Riddles','A glow in the dark, A place without life, Where a small spark, Means the greatest strife. Where am I?','Space.','Hard','2024-07-10 03:25:05.662585'),(1932,'Dark Riddles','One knight, a pregnant lady, and a doctor walk into a hospital, the next morning three people walk out, who was the third person?','The knight.','Medium','2024-07-10 03:25:05.664062'),(1933,'Dark Riddles','Spelled forwards is a type of rodent that you might find in drains, spelled backward is something that you cannot touch but see it every day at night. What is this word?','Rats, star.','Hard','2024-07-10 03:25:05.665484'),(1934,'Dark Riddles','My first is a part of the day, My last a conductor of light, My whole to take the measure of time, Is useful by day and by night. What am I?','An Hour-glass.','Easy','2024-07-10 03:25:05.667020'),(1935,'Dark Riddles','There lived a man in a house and every time he went to bed he turned on the light. One night, the man forgot to turn on the light. The next day he read the paper and killed himself. Why?','The man lived in a lighthouse. He forgot to turn on the light and a ship crashed. The next morning he read in the paper that the ship crashed and killed himself because he felt guilty.','Medium','2024-07-10 03:25:05.668735'),(1936,'Dark Riddles','Which would see most clearly in total darkness? A bat, a tiger, or an owl.','None. In total darkness, it is impossible to see anything.','Medium','2024-07-10 03:25:05.670554'),(1937,'Dark Riddles','The more it is made, the more i