 of double letters.','Easy','2024-07-10 03:25:06.586520'),(2444,'Mummy Riddles','What is a mummy\'s favorite type of paper?','WRAP-ing paper','Easy','2024-07-10 03:25:06.588015'),(2445,'Murder Riddles','I am not alive, but I grow; I don\'t have lungs, but I need air; I don\'t have a mouth, but water kills me. What am I?','Fire.','Easy','2024-07-10 03:25:06.589754'),(2446,'Murder Riddles','Always in you, Sometimes on you; If I surround you, I can kill you. What am I?','Water.','Easy','2024-07-10 03:25:06.591360'),(2447,'Murder Riddles','It can\'t be seen, can\'t be felt, can\'t be heard, and can\'t be smelt. It lies behind stars and under hills, And empty holes it fills. It comes first and follows after, Ends life, and kills laughter. What is it?','The dark.','Hard','2024-07-10 03:25:06.593130'),(2448,'Murder Riddles','Why did Snap, Crackle, and Pop get scared?','They heard there was a cereal killer on the loose.','Easy','2024-07-10 03:25:06.594607'),(2449,'Murder Riddles','There is a brother and a sister. The boy wants to visit his father in jail, and the sister wants to visit her mother in the hospital. But they both are not allowed in jail or hospital. All they have is a gun. What do they do?','The boy shoots the girl, and then the boy goes to jail for attempted murder and the girl goes to the hospital due to her injuries.','Hard','2024-07-10 03:25:06.596093'),(2450,'Murder Riddles','What kind of candy would a prisoner want before he is executed?','A Life Saver.','Hard','2024-07-10 03:25:06.597694'),(2451,'Murder Riddles','There was a man who was born before his father, killed his mother, and married his sister. Yet, there was nothing wrong with what he had done. Why?','His father was in front of him when he was born, therefore he was born before him. His mother died while giving birth to him. Finally, he grew up to be a minister and married his sister at her ceremony.','Easy','2024-07-10 03:25:06.599254'),(2452,'Murder Riddles','There is a clerk at the butcher shop, he is five feet ten inches tall, and he wears size 13 sneakers. He has a wife and 2 kids. What does he weigh?','Meat.','Easy','2024-07-10 03:25:06.601910'),(2453,'Murder Riddles','A woman is at her mother\'s funeral when suddenly she sees a man so handsome, that she instantly falls in love with her. Unfortunately, she never got a chance to talk to the man. The next day, the woman kills her sister. What was the motive?','The woman was hoping to see the man again. If you got this correct on the first try, you have the mind of a psychopath.','Easy','2024-07-10 03:25:06.603599'),(2454,'Murder Riddles','What hired killer never goes to jail?','An exterminator.','Hard','2024-07-10 03:25:06.605334'),(2455,'Murder Riddles','A thousand colored folds stretch toward the sky, Atop a tender strand, Rising from the land, \'Til killed by maiden\'s hand, Perhaps a token of love, perhaps to say goodbye. What am I?','A flower.','Easy','2024-07-10 03:25:06.606920'),(2456,'Murder Riddles','I am a rock group that has 4 members, all of whom are dead, one of which was assassinated. What am I?','Mount Rushmore.? Get it, rock group?','Medium','2024-07-10 03:25:06.608420'),(2457,'Murder Riddles','Something that requires our mental skill to decode it, our imagination to understand it, our knowledge is tested to its max, it confuses us at every stage, it seems easy yet difficult, only those who are used to, will get through. What is it?','A riddle.','Easy','2024-07-10 03:25:06.610269'),(2458,'Murder Riddles','Every month someone dies, and there are five suspects. The suspects are, Jason, Lily, Nathan, Elizabeth, and Erin, and the months of the murders are July, August, September, October, and November. Who\'s the murderer?','Jason. J, July. A, August. S, September. O, October. N, November.','Medium','2024-07-10 03:25:06.611834'),(2459,'Murder Riddles','Inside napper, bird chaser, quick stoker, small animal killer, fish eater. What is it?','A cat.','Medium','2024-07-10 03:25:06.613311'),(2460,'Murder Riddles','What kills you inside the more you keep it and sets you free the moment you release it?','Guilt.','Hard','2024-07-10 03:25:06.614791'),(2461,'Murder Riddles','I wear you down, yet you\'ll mourn me once I fly. You can kill me, but I will never die. What am I?','Time.','Easy','2024-07-10 03:25:06.616076'),(2462,'Murder Riddles','A man moved into a new house and decided he was tired after the journey and turned off all the lights and went to bed. The next morning he had killed 365 people how could this be? he does not sleep walk he slept like a baby','he lived in a lighthouse','Medium','2024-07-10 03:25:06.617889'),(2463,'Murder Riddles','What word is a fun word until you add one letter and it becomes a terrible word that no one wants to happen?','Laughter: If you add an \'S\' to the begging of laughter it becomes slaughter.','Hard','2024-07-10 03:25:06.619265'),(2464,'Murder Riddles','A plane crashed and every single person on board this flight was killed, yet, there were survivors. Can you explain how?','The married people lived; the singles died.','Easy','2024-07-10 03:25:06.620916'),(2465,'Murder Riddles','You are sitting at a table eating lunch and there are ten flies on the table. With a quick swat, you are able to kill three flies. How many flies are left on the table?','You killed three flies that remain on the table.? The others flew off when you swatted.','Medium','2024-07-10 03:25:06.622200'),(2466,'Murder Riddles','I have a butt, but I\'m not alive. I bring smoke but am not fire. I destroy, I kill, though I am not used in a war. What am I?','A cigarette.','Medium','2024-07-10 03:25:06.623739'),(2467,'Murder Riddles','I eat animals but I don\'t hunt or kill. What am I?','A vulture.','Medium','2024-07-10 03:25:06.625498'),(2468,'Murder Riddles','When I move, I tip the scales. I am the source of many tales. Around your foot, a sign of wealth. Around a stick, a sign of health. Around your chest, your final breath. On your neck, say hi to death. What am I?','A snake. Snake scales. Snake Tail and snakes are usually the antagonists. Snakeskin is very expensive. Snakes on a stick are almost always seen in hospitals. Constrictors squeeze the life out of you. A poisonous snakebite on your neck would kill you extremely fast.','Hard','2024-07-10 03:25:06.627276'),(2469,'Murder Riddles','Why did the man shoot the clock?','He was','Hard','2024-07-10 03:25:06.629254'),(2470,'Murder Riddles','I am both a killer and a savior, it depends on those who wield me. I will bring you from deep water to the shallows, or maybe I could be the one who will hang you on the gallows. What am I?','A rope.','Medium','2024-07-10 03:25:06.631048'),(2471,'Murder Riddles','I want everything within sight. The impossible will not flee my plight. I will take it all by any means. To have is my heart\'s very need. A bottomless pit that nothing will fill. I have even led humans to kill. What am I?','Greed.','Medium','2024-07-10 03:25:06.633135'),(2472,'Murder Riddles','I am boneless, small, and weak, yet can crush and kill; the speed of what comes out of me outstrips the steed. My great storehouse is your heart. Keep me to keep your soul from troubles. What am I?','Your tongue!','Medium','2024-07-10 03:25:06.635852'),(2473,'Murder Riddles','An excess of individuals skilled in the preparation of edibles impairs the quality of this soup. What is the proverb?','Too many cooks spoil the broth.','Hard','2024-07-10 03:25:06.637983'),(2474,'Murder Riddles','Why was the clock arrested?','For killing time.','Hard','2024-07-10 03:25:06.640166'),(2475,'Murder Riddles','I\'m a killing machine used again and again; I bend a little, but way less than my friend; For many years I was number one, But I\'ve been replaced by my modern son. What am I?','Arrow','Hard','2024-07-10 03:25:06.642204'),(2476,'Murder Riddles','What is a cereal\'s worst fear?','A cereal killer.','Hard','2024-07-10 03:25:06.644286'),(2477,'Murder Riddles','I am very important to all living creatures. I was firstborn in the sun. I am a chapter in textbooks and I am not made of fire. I make the sun-worthy. Too much of me may kill you. But humans can still prevent me. What am I?','Heat!','Easy','2024-07-10 03:25:06.646239'),(2478,'Murder Riddles','There lived a man in a house and every time he went to bed he turned on the light. One night, the man forgot to turn on the light. The next day he read the paper and killed himself. Why?','The man lived in a lighthouse. He forgot to turn on the light and a ship crashed. The next morning he read in the paper that the ship crashed and killed himself because he felt guilty.','Medium','2024-07-10 03:25:06.648099'),(2479,'Murder Riddles','I kill people when you need me to, I am not accepted and illegal, I need to be refilled from time to time and I can harm my owner. What am I?','A gun.','Medium','2024-07-10 03:25:06.649977'),(2480,'Murder Riddles','A man is found dead at the end of an alley. A detective who enters the scene sees the letter X and immediately knows who killed the man and why. How did the detective know?','This was a bowling alley, and the man who died was a pin spotter. A player had a strike and was to bowl again, but he bowled too soon before the pin spotter was clear. The X is on the score sheet and this tells the detective the name of the bowler.','Hard','2024-07-10 03:25:06.651757'),(2481,'Murder Riddles','I am brave but, wear the thing I used to fear most, I am bold, but not willing to kill. Who am I?','Batman.','Hard','2024-07-10 03:25:06.653591'),(2482,'Murder Riddles','A color is seen on a stoplight, an item you use to eliminate the darkness. What comic book character is it?','Green Lantern.','Easy','2024-07-10 03:25:06.655661'),(2483,'Murder Riddles','I am as small as a beetle, as annoying as a fly, and I like to kill trees, what am I?','A Lantern Fly! (Also stop stealing my riddles, Berries, the LearnyVerse Wizard from Pyranic)','Hard','2024-07-10 03:25:06.657629'),(2484,'Murder Riddles','Endlessly, I hunger, Lazily, I sleep. Murderous, I thunder, Desires, I do seek. Hoarding countless treasures, so my stature I retain, Envious of others whose feet on Earth remain. What am I?','\"The Seven Deadly Sins\" - Reasoning: Each sentence structure portrays one of the seven deadly sins from Christian theology, with the exception of the final 5 words. In order according to the riddle, these are; gluttony, sloth, wrath, lust, greed, pride, and envy. The final 5 words, \"whose feet on Earth remain\", act in conjunction with the section on envy, demonstrating the perspective of a sinner in hell, who is envious of those still alive, and thus can still repent for their sins in order to enter Heaven.','Easy','2024-07-10 03:25:06.659309'),(2485,'Murder Riddles','What dies but is never killed?','A bad joke.','Hard','2024-07-10 03:25:06.661415'),(2486,'Murder Riddles','A parliament, a congress, a conspiracy, a murder, a wake. What am I?','A flock of Corvids.','Hard','2024-07-10 03:25:06.663550'),(2487,'Murder Riddles','A woman proves in court that her husband was murdered by her sister, but the judge decides that the sister cannot be punished. Why?','The sisters are Siamese twins.','Easy','2024-07-10 03:25:06.666126'),(2488,'Murder Riddles','Who cowardly a prince did kill?','Joab��2 Samuel xviii. 14.','Medium','2024-07-10 03:25:06.668102'),(2489,'Murder Riddles','What is an executioner\'s favorite hobby?','Hang gliding.','Medium','2024-07-10 03:25:06.670199'),(2490,'Murder Riddles','If it takes four rat catchers four minutes to kill four rats, how many rat catchers would be needed to catch 50 rats in 50 minutes?','The same number of rat catchers- Four.','Medium','2024-07-10 03:25:06.672043'),(2491,'Murder Riddles','A queen bee was buzzing, a worker bee was buzzing, a honey bee was buzzing, and a killer bee was buzzing. How many bees were buzzing?','One. There is only one b in the word buzzing','Medium','2024-07-10 03:25:06.673990'),(2492,'Murder Riddles','If seven cats kill seven rats in 7 minutes, how many would be needed to kill one hundred rats in 50 minutes?','14','Easy','2024-07-10 03:25:06.675781'),(2493,'Murder Riddles','I\'m one of five, I\'m not alive. The one who sent me forth became king, The one who received me died. What am I?','A Stone from the popular Biblical story, David had five stones. He used one of the stones to kill Goliath.','Medium','2024-07-10 03:25:06.677647'),(2494,'Murder Riddles','I killed one-fourth of all mankind. Who am I?','Cain (who killed Abel).','Hard','2024-07-10 03:25:06.679448'),(2495,'Music Riddles','What type of music do rabbits listen to?','Hip hop.','Medium','2024-07-10 03:25:06.681680'),(2496,'Music Riddles','When is music like vegetables?','When there are two beats (beets) to the measure.','Medium','2024-07-10 03:25:06.683546'),(2497,'Music Riddles','What type of music is a mummy\'s favorite?','Wrap.','Easy','2024-07-10 03:25:06.685559'),(2498,'Music Riddles','What kind of music can you hear in space?','A nept-tune.','Hard','2024-07-10 03:25:06.687037'),(2499,'Music Riddles','I am a fruit. If you take away the first letter of my name I become a crime. Take away the first two letters of my name I become an animal. Take away the first and last letter of my name and I become a form of music. What am I?','Grape.','Medium','2024-07-10 03:25:06.688717'),(2500,'Music Riddles','I can bring you joy or sorrow, or everything in between. None have seen, smelt or felt me, yet many still know what I am. I have many types, but I am really just one thing. What am I?','Music.','Easy','2024-07-10 03:25:06.690304'),(2501,'Music Riddles','What kind of a band, never plays music?','A rubber band!','Medium','2024-07-10 03:25:06.691882'),(2502,'Music Riddles','At the sound of me, men may dream, Or stamp their feet. At the sound of me, women may laugh, Or sometimes weep. What am I?','I am Music!','Hard','2024-07-10 03:25:06.693321'),(2503,'Music Riddles','What kind of music do aliens like?','Nep-tunes.','Ea