ens so that each pen has an even number of pigs. Zero is not allowed, nor will it work. How do you do this?','Stack the pens.','Easy','2024-07-10 03:25:07.009176'),(2658,'Pig Riddles','When was pork first introduced into the Navy?','When Noah brought Ham into the ark.','Medium','2024-07-10 03:25:07.010873'),(2659,'Pig Riddles','The hand sows, the eyes harvest?','To read and to write.','Hard','2024-07-10 03:25:07.012583'),(2660,'Planet Riddles','Before Mount Everest was discovered, what was the highest mountain on Earth?','Mount Everest.','Easy','2024-07-10 03:25:07.014235'),(2661,'Planet Riddles','I\'m a god, a planet, and a measurer of heat. Who am I?','Mercury.','Medium','2024-07-10 03:25:07.015783'),(2662,'Planet Riddles','A cloud was my mother, the wind is my father, my son is the cool stream, and my daughter is the fruit of the land. A rainbow is my bed, the earth my final resting place, and I\'m the torment of man. Who Am I?','Rain.','Medium','2024-07-10 03:25:07.017661'),(2663,'Planet Riddles','How does NASA throw a party?','They planet.','Easy','2024-07-10 03:25:07.019391'),(2664,'Planet Riddles','Here on earth it is true, yesterday is always before today; but there is a place where yesterday always follows today. Where?','The Dictionary.','Hard','2024-07-10 03:25:07.021174'),(2665,'Planet Riddles','What is one thing that all wise men, regardless of their politics or religion, agree is between heaven and earth?','The word \'And\'.','Hard','2024-07-10 03:25:07.022740'),(2666,'Planet Riddles','What is always traveling, has life, has sense but doesn\'t live?','The Earth!','Easy','2024-07-10 03:25:07.024677'),(2667,'Planet Riddles','I come right in front of Earth, at the end of time, and twice in a week. What am I?','The letter E.','Medium','2024-07-10 03:25:07.026852'),(2668,'Planet Riddles','How can we tell that Saturn was married more than once?','Because she has so many rings!','Medium','2024-07-10 03:25:07.029573'),(2669,'Planet Riddles','I\'m first on earth, second in heaven, I appear twice in a week, and once in a year, I\'m in the middle of the Sea. What am I?','The letter E.','Hard','2024-07-10 03:25:07.032484'),(2670,'Planet Riddles','Why did Mickey Mouse go to space?','To look for Pluto!','Hard','2024-07-10 03:25:07.034539'),(2671,'Planet Riddles','What is made of wood but no saw on earth is sharp enough to cut?','Sawdust.','Easy','2024-07-10 03:25:07.036291'),(2672,'Planet Riddles','I blossom like a flower, a hindrance I create, and save you from the earth, do not use me too late. What am I?','A Parachute.','Hard','2024-07-10 03:25:07.038081'),(2673,'Planet Riddles','The higher I climb, the hotter I engage, I can not escape my crystal cage. What am I?','Mercury in a thermometer.','Medium','2024-07-10 03:25:07.039877'),(2674,'Planet Riddles','I welcome the day with a show of light, I steathily came here in the night. I bathe the earthy stuff at dawn, But by the noon, alas! I\'m gone. What am I?','The morning dew!','Hard','2024-07-10 03:25:07.041663'),(2675,'Planet Riddles','I begin the earth and end the eclipse, I occur in seconds and minutes, but never in a hand although I am in a lifetime. What am I?','Letter E.','Medium','2024-07-10 03:25:07.043164'),(2676,'Planet Riddles','What do cows give after an earthquake?','Milk shakes.','Easy','2024-07-10 03:25:07.044918'),(2677,'Planet Riddles','I am hewn from Earth and Fire; But to the sky, I aspire. I am nothing but contented; Until my patient rage is vented. What am I?','A volcano.','Hard','2024-07-10 03:25:07.046557'),(2678,'Planet Riddles','I am in the beginning of the earth. I am at the end of time. I appear two times in a week. I appear once in a year. What Am I ?','The Letter \"E\".','Hard','2024-07-10 03:25:07.048345'),(2679,'Planet Riddles','Many always do say that I am life. I occupy most part of the earth surface, yet I\'m found in you. What am I?','Water.','Medium','2024-07-10 03:25:07.049997'),(2680,'Planet Riddles','Inside me, there is a teacup, a planet, a shelf, and you! What Am I?','The Universe!','Hard','2024-07-10 03:25:07.051988'),(2681,'Planet Riddles','Test Mars. What is the anagram word?','Smartest.','Hard','2024-07-10 03:25:07.054335'),(2682,'Planet Riddles','Fire is often maintained above me, and if you remove my first letter, you will find the home shared by everyone you have ever known. What am I?','A Hearth.','Easy','2024-07-10 03:25:07.056701'),(2683,'Planet Riddles','I\'m mean, I\'m green, I am an eating machine. What am I?','A Venus Flytrap.','Hard','2024-07-10 03:25:07.059117'),(2684,'Planet Riddles','It is everywhere yet nowhere and time mars it not. All things are within its grasp and it is within the grasp of all things. It has no limits, for it does and does not exist. What is it?','Nothing.','Hard','2024-07-10 03:25:07.061369'),(2685,'Planet Riddles','I\'m teary-eyed but never cry, silver-tongued, but never lie. double-winged, but never fly, air-cooled, but never dry. What am I?','Mercury. The element looks shiny, silver, and is wet. The god Mercury has two wings but only uses them to run.','Medium','2024-07-10 03:25:07.063510'),(2686,'Planet Riddles','I lie in the earth, and under the ground; A map may reveal me for journey\'s abound; I can be found in squares, to reduce down to size; Or at the end of a strand, where attachment lies. What am I?','Roots','Hard','2024-07-10 03:25:07.066418'),(2687,'Planet Riddles','Stronger than any beast, Rougher than any sea. Steadier than a favorable wind, and of me, none shall be free. What am I?','I am Earth.','Medium','2024-07-10 03:25:07.068307'),(2688,'Planet Riddles','I am named for my fleeting motion. Numbered zero and four score more. A barren desert and a heavy ocean. One is flowing, the other a solid core. Who are we?','Mercury and mercury.','Medium','2024-07-10 03:25:07.070214'),(2689,'Planet Riddles','I shake but unlike the strength of an earthquake. You can find me both high and low, usually out of control. I can be considered both good or bad, sometimes used for both happy or sad. What am I?','Singing Pitch.','Hard','2024-07-10 03:25:07.072208'),(2690,'Planet Riddles','My first is appropriate, my second \'tis nine to one if you guess it. My whole elevates the sole above the earth. What am I?','Pat-ten.','Hard','2024-07-10 03:25:07.074070'),(2691,'Planet Riddles','What can emit an umbra on the earth, and provide phosphorescence for all its creatures, all while altering the visual surface of itself within phases?','The','Hard','2024-07-10 03:25:07.075878'),(2692,'Planet Riddles','Endlessly, I hunger, Lazily, I sleep. Murderous, I thunder, Desires, I do seek. Hoarding countless treasures, so my stature I retain, Envious of others whose feet on Earth remain. What am I?','\"The Seven Deadly Sins\" - Reasoning: Each sentence structure portrays one of the seven deadly sins from Christian theology, with the exception of the final 5 words. In order according to the riddle, these are; gluttony, sloth, wrath, lust, greed, pride and envy. The final 5 words, \"whose feet on Earth remain\", act in conjunction with the section on envy, demonstrating the perspective of a sinner in hell, who is envious of those still alive, and thus can still repent for their sins in order to enter Heaven.','Easy','2024-07-10 03:25:07.077699'),(2693,'Planet Riddles','Which is lighter, the sun or the earth?','The sun, rises every morning.','Hard','2024-07-10 03:25:07.079708'),(2694,'Planet Riddles','One-fourth of the population of a newly discovered planet has 4 legs. The rest have two legs. There are 60 legs in total. How big is the population of the newly discovered planet?','24','Hard','2024-07-10 03:25:07.081801'),(2695,'Planet Riddles','What is the best way to get from earth to mars?','PLANET!','Medium','2024-07-10 03:25:07.083674'),(2696,'Planet Riddles','Where on Earth do the winds always blow from the South?','The North Pole.','Easy','2024-07-10 03:25:07.085404'),(2697,'Planet Riddles','A forest exists somewhere on Earth. This forest has no life except for trees. After a storm, a tree was hit by lightning and fell. What sound would it make?','None. Sound does not exist if it is unheard.','Medium','2024-07-10 03:25:07.087265'),(2698,'Rabbit Riddles','Do rabbits use combs?','No, they use hare brushes.','Easy','2024-07-10 03:25:07.089387'),(2699,'Rabbit Riddles','How can you say rabbit without using the letter R?','Bunny.','Easy','2024-07-10 03:25:07.091144'),(2700,'Rabbit Riddles','How many hairs are in a bunny rabbit\'s tail?','None. They are all outside.','Medium','2024-07-10 03:25:07.093347'),(2701,'Rabbit Riddles','Where does a rabbit go for shampoo?','To a hare-dresser.','Hard','2024-07-10 03:25:07.095265'),(2702,'Rabbit Riddles','What would you get if you crossed a rabbit and a lawn sprinkler?','Hare spray.','Hard','2024-07-10 03:25:07.098131'),(2703,'Rabbit Riddles','What would you get if 120 rabbits took one step backward at the same time?','A receding hare-line.','Easy','2024-07-10 03:25:07.099781'),(2704,'Rabbit Riddles','How do rabbits travel?','By hare-plane.','Easy','2024-07-10 03:25:07.101542'),(2705,'Rabbit Riddles','What does the Easter Bunny do after it takes a shower?','He uses a Hare dryer','Medium','2024-07-10 03:25:07.103249'),(2706,'Rabbit Riddles','What do you get when you cross a roach and a rabbit?','Bugs Bunny.','Medium','2024-07-10 03:25:07.105167'),(2707,'Rabbit Riddles','What kind of jewelry does the Easter bunny wear?','14-carrot gold!','Hard','2024-07-10 03:25:07.106829'),(2708,'Rabbit Riddles','What kind of story does the Easter Bunny like?','One\'s with hoppy-endings!','Hard','2024-07-10 03:25:07.108381'),(2709,'Rabbit Riddles','How do you send Easter Cards?','By hare-mail!','Medium','2024-07-10 03:25:07.110108'),(2710,'Rabbit Riddles','What do you call the Easter bunny the day after Easter?','Tired!','Easy','2024-07-10 03:25:07.111710'),(2711,'Rabbit Riddles','How can you catch a unique rabbit?','You u-neak up on it.','Hard','2024-07-10 03:25:07.113330'),(2712,'Religion Riddles','I\'m a god, a planet, and a measurer of heat. Who am I?','Mercury.','Medium','2024-07-10 03:25:07.115137'),(2713,'Religion Riddles','There was a man who was born before his father, killed his mother, and married his sister. Yet, there was nothing wrong with what he had done. Why?','His father was in front of him when he was born, therefore he was born before him. His mother died while giving birth to him. Finally, he grew up to be a minister and married his sister at her ceremony.','Easy','2024-07-10 03:25:07.116976'),(2714,'Religion Riddles','Mountains will crumble and temples will fall, and no man can survive its endless call. What is it?','Time.','Medium','2024-07-10 03:25:07.118631'),(2715,'Religion Riddles','What is one thing that all wise men, regardless of their politics or religion, agree is between heaven and earth?','The word \'And\'.','Hard','2024-07-10 03:25:07.121926'),(2716,'Religion Riddles','What is Greater than God, worse than evil, the poor have it, the rich require it and if you eat it you die?','Nothing nothing is better than God nothing is worse than evil the poor have nothing the rich don\'t have anything they have everything If you eat nothing you die','Medium','2024-07-10 03:25:07.123837'),(2717,'Religion Riddles','Used to threaten, used to defeat. Sometimes it grows, and sometimes it shrinks. Used to conquer, used to protect. It marks your downfall, it marks your success. The true god of war, the creator of mess. What is it?','Power.','Hard','2024-07-10 03:25:07.125903'),(2718,'Religion Riddles','How does Moses make his coffee?','Hebrews it.','Hard','2024-07-10 03:25:07.127392'),(2719,'Religion Riddles','I am more powerful than god and more evil than the devil. I am what rich people want and what poor people have. I can never die. What am I?','I am nothing.','Medium','2024-07-10 03:25:07.129172'),(2720,'Religion Riddles','Does the','A dead man cannot marry. His widow would mean he is dead.','Easy','2024-07-10 03:25:07.131618'),(2721,'Religion Riddles','I am everywhere yet not seen; I was dead yet I\'m alive; a Son to a man who is dead yet a Son to One Who\'s forever alive; suffered, not for myself but for others. I have disproved many beliefs and many laws. Who am I?','Jesus Christ.','Hard','2024-07-10 03:25:07.133544'),(2722,'Religion Riddles','I\'m the person that God made me. I\'m caring. I\'m nice. I love my family. I\'m myself. Who am I?','I\'m a human being.','Medium','2024-07-10 03:25:07.135228'),(2723,'Religion Riddles','What would you say in everyone in the US Sneezed at the same time?','God bless America!','Hard','2024-07-10 03:25:07.137145'),(2724,'Religion Riddles','Some people want to meet me, some people don\'t believe in me, and some people claim to be me. What am I?','God.','Easy','2024-07-10 03:25:07.138774'),(2725,'Religion Riddles','I\'m teary-eyed but never cry, silver-tongued, but never lie. double-winged, but never fly, air-cooled, but never dry. What am I?','Mercury. The element looks shiny, silver, and wet. The god Mercury has two wings but only uses them to run.','Hard','2024-07-10 03:25:07.140444'),(2726,'Religion Riddles','Priest-tied guitar. What is the anagrammed word?','Prestidigitateur.','Easy','2024-07-10 03:25:07.142065'),(2727,'Religion Riddles','In this place, people lie, people cry, and people ask why. In this place, people sleep, people, weep, and people\'s solitude, they keep. What is it?','\"Graveyard\" or \"Cemetery\" - Reasoning: Both \"people lie\" and \"people sleep\" are indications of many people using this place to lie down, or to sleep, which in itself is an odd thought. Crying and weeping indicate that this is a sad place, and the continued use of \"people\" allows this to mean not just those who are lying down or sleeping, but those who come to visit them there, (i.e. mourners). People come to ask the person\'s grave why they did what they did that resulted in their death, as a form of mourning, or to ask their chosen God or Gods why they took that person to their grave. And peoples solitude refers to people sleeping on their own, or the mourners usually coming the mourn privately.','Easy','2024-07-10 03:25:07.143623'),(2728,'Religion Riddles','Why couldn\'t the church steeple keep a secret?','Because the bell always tolled.','Hard','2024-07-10 03:25:07.145415'),(2729,'Religion Riddles','The rich want it, but the poor have it, god takes it, satin gives it?','nothing','Hard','2024-07-10 03:25:07.147074'),(2730,'Religion Riddles','I\'m greater than God, yet worse than the devil. I am what the miser spends and the spendthrift saves. I am what the blind see and the paralyzed hold. What am I?','Nothing.','Medium','2024-07-10 03:25:07.148909'),(2731,'Religion Riddles','What do you call a priest riding a cycle?','A cyclist.','Medium','2024-07-10 03:25:07.150534'),(2732,'Religion Riddles','I am a holiday, of course, celebrated in December, I am celebrated until New Year, People who celebrate me are considered Evil by many Religions, what am I?','I am Yule!','Medium','2024-07-10 03:25:07.152384'),(2733,'Religion Riddles','What Jewish king a leper died?','Uzziah��2 Chron. xxvi. 21.','Hard','2024-07-10 03:25:07.154125'),(2734,'Religion Riddles','Endlessly, I hunger, Lazily, I sleep. Murderous, I thunder, Desires, I do seek. Hoarding countless treasures, so my stature I retain, Envious of others whose feet on Earth remain. What am I?','\"The Seven Deadly Sins\" - Reasoning: Each sentence structure portrays one of the seven deadly sins from Christian theology, with the exception of the final 5 words. In order according to the riddle, these are; gluttony, sloth, wrath, lust, greed, pride, and envy. The final 5 words, \"whose feet on Earth remain\", act in conjunction with the section on envy, demonstrating the perspective of a sinner in hell, who is envious of those still alive, and thus can still repent for their sins in order to enter Heaven.','Hard','2024-07-10 03:25:07.155659'),(2735,'Religion Riddles','First is the last. Last is the first. You are in the middle. What am I?','CH UR CH CHURCH.','Medium','2024-07-10 03:25:07.157877'),(2736,'Religion Riddles','On which side of a church is the graveyard always situated?','On the outside, of course.','Easy','2024-07-10 03:25:07.159648'),(2737,'Religion Riddles','Why is orange not like a church bell?','Because it is never peeled (pealed) but once.','Easy','2024-07-10 03:25:07.161238'),(2738,'Religion Riddles','My love\'s the type of thing you have to earn, but when you earn it, you won\'t need it. Who am I?','God. Credit: Bo Burnham, Musical Comedian, Song title- \"God\'s Perspective\".','Medium','2024-07-10 03:25:07.162840'),(2739,'Religion Riddles','Gods\' arrows cannot be counted. What are they?','Rain.','Hard','2024-07-10 03:25:07.164419'),(2740,'Religion Riddles','A woman who lives in new york legally married three men, she did not get divorced, get an enrollment, or is legally separated. How is this possible?','She is a minister.','Easy','2024-07-10 03:25:07.166129'),(2741,'Religion Riddles','There were five men going to church and it started to rain. The four that ran got wet and the one that stood still stayed dry. How did the one stay dry?','It was a body in a coffin with the bearers.','Easy','2024-07-10 03:25:07.167669'),(2742,'Religion Riddles','Read my riddle, I pray. What God never sees, what the king seldom sees, and what we see every day. What is it?','An equal.','Hard','2024-07-10 03:25:07.169328'),(2743,'Riddle Books','What did one math book say to the other math book?','Do you want to hear my problems?','Medium','2024-07-10 03:25:07.171122'),(2744,'Riddle Books','Where do bedtime books sleep?','Under their covers.','Easy','2024-07-10 03:25:07.172951'),(2745,'Riddle Books','What English word has three consecutive double letters?','Bookkeeper.','Medium','2024-07-10 03:25:07.174599'),(2746,'Riddle Books','What building has the most stories?','The library.','Medium','2024-07-10 03:25:07.176362'),(2747,'Riddle Books','A teacher is yelling, she closes the door, the window, and a book. What did she forget to close?','Her mouth.','Medium','2024-07-10 03:25:07.178017'),(2748,'Riddle Books','My life is often a volume of grief, your help is needed to turn a new leaf. Stiff is my spine and my body is pale, but I\'m always ready to tell a tale. What am I?','A book!','Easy','2024-07-10 03:25:07.179481'),(2749,'Riddle Books','What has a spine, but no bones?','A book.','Medium','2024-07-10 03:25:07.181284'),(2750,'Riddle Books','I am the shell of something interesting. My front is very eye-catching but my inside tells all. What am I?','A Book.','Medium','2024-07-10 03:25:07.182854'),(2751,'Riddle Books','What did one math book say to another?','I have so many problems.','Easy','2024-07-10 03:25:07.184752'),(2752,'Riddle Books','My numbers may vary, thin as a sheet, take one away, and we\'re just not complete. What am I?','A Book.','Medium','2024-07-10 03:25:07.186538'),(2753,'Riddle Books','There were 5 children in a room. Iris drew a picture, Barry played video games, Andrew played chess, and Trina read a book. What is the fifth child, Mindy, doing?','Mindy is playing chess with Andrew. You can\'t play chess alone!','Hard','2024-07-10 03:25:07.188855'),(2754,'Riddle Books','Why did everybody like to go out to eat with the librarian?','She could always book a reservation.','Medium','2024-07-10 03:25:07.190929'),(2755,'Riddle Books','What are the smartest creatures?','Bookworms.','Easy','2024-07-10 03:25:07.193052'),(2756,'Riddle Books','I wiggled and cannot see, sometimes underground and sometimes on a tree. I really don\'t want to be on a hook, and I become a person when combined with a book. What am I?','Worm','Hard','2024-07-10 03:25:07.194956'),(2757,'Riddle Books','I have 10 books and I label them with their number. I take seven out to read. How many books are left?','9! You have taken the book with the label seven!','Easy','2024-07-10 03:25:07.196930'),(2758,'Riddle Books