,'Scary Riddles','What does a troll call his apartment?','Gnome sweet gnome.','Hard','2024-07-10 03:25:07.311508'),(2821,'Season Riddles','What do you call a snowman in the summer?','Puddle.','Easy','2024-07-10 03:25:07.313260'),(2822,'Season Riddles','What is in seasons, seconds, centuries, and minutes but not in decades, years or days?','The letter ��n��','Medium','2024-07-10 03:25:07.314664'),(2823,'Season Riddles','In spring I am gay in handsome array; in summer more clothing I wear; when colder it grows I fling off my clothes; and in winter quite naked appear. What am I?','A Tree.','Easy','2024-07-10 03:25:07.316151'),(2824,'Season Riddles','What shoes do frogs wear in the summer?','Open toad shoes.','Medium','2024-07-10 03:25:07.317744'),(2825,'Season Riddles','What is whiter than the first snow, redder than the blood of the righteous, greener than the spring grass, bluer than a cloudless sky?','Light. These objects have different colors. But they differ from the standard, which is contained in the light spectrum.','Medium','2024-07-10 03:25:07.319561'),(2826,'Season Riddles','An abundance in arms, but lacking in legs. A tall skinny body, but missing a head. I change with the seasons, it\'s winter I dread. What am I?','A Tree.','Hard','2024-07-10 03:25:07.322242'),(2827,'Season Riddles','A woman went to Virginia to get a job. She promised her mother she would come back and visit sometime. Then, in the middle of winter, her mother shouted, \"April is here!\". How is this possible?','The woman\'s name is April.','Medium','2024-07-10 03:25:07.324047'),(2828,'Season Riddles','Walk on the living, they don\'t even mumble. Walk on the dead, they mutter and grumble. What are they?','Fallen leaves.','Hard','2024-07-10 03:25:07.325910'),(2829,'Season Riddles','What lives in winter, dies in summer, and grows with its roots upward?','An icicle.','Easy','2024-07-10 03:25:07.327721'),(2830,'Season Riddles','In what year did Christmas Day and New Year\'s Day fall in the same year?','It happens every year.','Hard','2024-07-10 03:25:07.329423'),(2831,'Season Riddles','Upside-down or on its side, this merry-go-round Is quite a ride. In the summer heat, It is quite a treat with blades so dull, that they will not slice. It spins too fast, for your sight. What is this ride?','A motorized fan.','Easy','2024-07-10 03:25:07.331025'),(2832,'Season Riddles','You are falling out of a window. What season is it?','Fall.','Hard','2024-07-10 03:25:07.333165'),(2833,'Season Riddles','David\'s birthday is in December, but it is never in the winter. Why?','He lives in Australia (or any other country that has December in summer)','Easy','2024-07-10 03:25:07.335314'),(2834,'Season Riddles','A man is in a room and the door is locked so he can\'t get out. He has with him a piano, a calendar, and a bed. How does he eat, drink, and get out?','He uses the dates from the calendar to eat, the springs from the bed to drink and the keys from the piano to get out.','Easy','2024-07-10 03:25:07.337727'),(2835,'Season Riddles','Why is snow like a maple tree?','Because it leaves in the early spring.','Medium','2024-07-10 03:25:07.340058'),(2836,'Season Riddles','I am spring-bloomed petals birthed from Turkish gardens. I am a creature not bound by land or sea I am the champion of human rights. What am I?','Two lips (tulips). Explanation: Tulips were first','Easy','2024-07-10 03:25:07.342205'),(2837,'Season Riddles','What happens only in the middle of each month, in all of the seasons, except summer, and happens only in the night, never in the day?','The letter \'N.\'','Medium','2024-07-10 03:25:07.344100'),(2838,'Season Riddles','Of all vegetables, only two can live to produce on their own for several growing seasons. All other vegetables must be replanted every year. What are the only two perennial vegetables?','Asparagus and rhubarb.','Hard','2024-07-10 03:25:07.345971'),(2839,'Season Riddles','I am a stop sign, what you see in blood, a rose, and, of course, an Autumn leaf. What am I?','The color red.','Hard','2024-07-10 03:25:07.347785'),(2840,'Season Riddles','Whiling away the hours of flowers, Walking through fields of gold. Preening and pruning in lights fading hours, For petals to freeze in the cold. What is it?','\"The Four Seasons\" - Reasoning: This riddle takes the perspective of plant life during these times of the year, where each line represents one of the four seasons of the year; Spring, Summer, Autumn, and Winter. Spring - where flowers are blooming - Summer - where fields of farm crop mature and turn golden in color, before being harvested - Autumn - where the trees shed their leaves and days grow shorter - and Winter - where the cold leaves frost and freezes plants.','Hard','2024-07-10 03:25:07.349573'),(2841,'Season Riddles','The fire shows - my kin, born. The fire grows - my kin, adorn. The fire slows - my kin, deform. The fire goes - my kin, mourn.','Fruit-bearing tree through the four seasons.','Easy','2024-07-10 03:25:07.357330'),(2842,'Season Riddles','Why are trees in winter like troublesome visitors?','Because it\'s a long time before they leave.','Easy','2024-07-10 03:25:07.359336'),(2843,'Season Riddles','What is another name for the season of fall?','Autumn.','Easy','2024-07-10 03:25:07.361415'),(2844,'Season Riddles','How far is it from March to June?','A single spring.','Hard','2024-07-10 03:25:07.363521'),(2845,'Sister Riddles','There is a brother and a sister. The boy wants to visit his father in jail, and the sister wants to visit her mother in the hospital. But they both are not allowed in jail or hospital. All they have is a gun. What do they do?','The boy shoots the girl, and then the boy goes to jail for attempted murder and the girl goes to the hospital due to her injuries.','Hard','2024-07-10 03:25:07.365640'),(2846,'Sister Riddles','Tom and his younger sister were fighting. Their mother was tired of the fighting and decided to punish them by making them stand on the same piece of newspaper in such a way that they couldn\'t touch each other. How did she accomplish this?','Tom\'s mother slid a newspaper under a door, each sibling standing on each side.','Medium','2024-07-10 03:25:07.367844'),(2847,'Sister Riddles','Can a man legally marry his widow\'s sister in the state of California?','NO since she is a \'widow\', the guy\'s dead!','Hard','2024-07-10 03:25:07.370113'),(2848,'Sister Riddles','There was a man who was born before his father, killed his mother, and married his sister. Yet, there was nothing wrong with what he had done. Why?','His father was in front of him when he was born, therefore he was born before him. His mother died while giving birth to him. Finally, he grew up to be a minister and married his sister at her ceremony.','Easy','2024-07-10 03:25:07.372009'),(2849,'Sister Riddles','If your uncle\'s sister is not your aunt, what relation is she to you?','Your mother.','Easy','2024-07-10 03:25:07.374182'),(2850,'Sister Riddles','What relation would your father\'s sister\'s sister-in-law be to you?','This person would be your mother.','Medium','2024-07-10 03:25:07.376020'),(2851,'Sister Riddles','A beggar\'s brother died, but the man who died had no brother. How could that be?','The beggar was his sister!','Hard','2024-07-10 03:25:07.377842'),(2852,'Sister Riddles','A woman is at her mother\'s funeral when suddenly she sees a man so handsome, she instantly falls in love with her. Unfortunately, she never got a chance to talk to the man. The next day, the woman kills her sister. What was the motive?','The woman was hoping to see the man again. If you got this correct on the first try, you have the mind of a psychopath.','Easy','2024-07-10 03:25:07.379719'),(2853,'Sister Riddles','You give someone a dollar. You are this person\'s brother, but the person is not your brother. How can that be?','It\'s your sister!','Medium','2024-07-10 03:25:07.381769'),(2854,'Sister Riddles','All 5 sisters are busy. Ann is reading, Rose is cooking, Katie is 