irls.','Hard','2024-07-10 03:25:07.403451'),(2864,'Sister Riddles','A man while looking at a photograph said, \"Brothers and sisters have I none. That man\'s father is my father\'s son.\" Who was the person in the photograph?','That man\'s son.','Hard','2024-07-10 03:25:07.405436'),(2865,'cat-riddles','When is it bad luck to see a black cat?','When you are a mouse.','Medium','2024-07-10 03:25:07.407534'),(2866,'cat-riddles','While on my way to St. Ives, I saw a man with 7 wives. Each wife had 7 sacks. Each sack had 7 cats. Each cat had 7 kittens. Kitten, cats, sacks, wives, How many were going to St. Ives?','Just one, me.','Easy','2024-07-10 03:25:07.409612'),(2867,'cat-riddles','If 5 cats catch 5 mice in 5 minutes, how long will it take one cat to catch a mouse?','Five minutes.','Easy','2024-07-10 03:25:07.411384'),(2868,'cat-riddles','I\'m found in socks, scarves, and mittens. I\'m found in the paws of playful kittens. What am I?','Yarn.','Medium','2024-07-10 03:25:07.413346'),(2869,'cat-riddles','All of Mrs. Smith\'s pets are dogs except one, and all her pets are cats except one. How many cats and dogs does she have?','Mrs. Smith has one cat and one dog.','Hard','2024-07-10 03:25:07.415013'),(2870,'cat-riddles','What\'s 3/7 chicken, 2/3 cat, and 2/4 goat?','Chicago. The first three words out of seven of chicken is CHI, the first two words out of 3 of cat is CA, and the first two words out of goat is GO. Therefore making, (CHI)(CA)(GO).','Easy','2024-07-10 03:25:07.418316'),(2871,'cat-riddles','What happens after it rains cats and dogs?','You step in a poodle.','Medium','2024-07-10 03:25:07.421755'),(2872,'cat-riddles','What do you get when you cross a black cat and a lemon?','A Sour Puss.','Hard','2024-07-10 03:25:07.424235'),(2873,'cat-riddles','If there is a Yellow house on Bluebird Lane, a Green house on Orange Street, a Pink house on Kitten Road, a Black house on Whitehorse Pike and a Purple house on Firebird hill, where is the White house?','Washington, D.C.','Easy','2024-07-10 03:25:07.427146'),(2874,'cat-riddles','Inside napper, bird chaser, quick stoker, small animal killer, fish eater. What is it?','A cat.','Medium','2024-07-10 03:25:07.430901'),(2875,'cat-riddles','10 copycats were sitting in a car. One came out. How many are left?','None( as they were copycats they copied each other).','Easy','2024-07-10 03:25:07.433887'),(2876,'cat-riddles','What word doesn\'t belong in this group? That, hat, what, mat, cat, sat, pat, or chat?','What. It\'s pronounced differently; all of the others rhyme.','Hard','2024-07-10 03:25:07.436593'),(2877,'cat-riddles','Where did the cat go after losing its tail?','To the re-tail store.','Medium','2024-07-10 03:25:07.439368'),(2878,'cat-riddles','If three cats catch three mice in three minutes, how many cats would be needed to catch 100 mice in 100 minutes?','The same three cats would do. Since these three cats are averaging one mouse per minute, given 100 minutes, the cats could catch 100 mice.','Medium','2024-07-10 03:25:07.441758'),(2879,'cat-riddles','What do you call Santa for cats?','Santa paws.','Easy','2024-07-10 03:25:07.443933'),(2880,'cat-riddles','When is the worst weather for rats and mice?','When it rains cats and dogs.','Easy','2024-07-10 03:25:07.446417'),(2881,'cat-riddles','What do cats call mice on a skateboard?','Meals on wheels!','Hard','2024-07-10 03:25:07.462879'),(2882,'cat-riddles','I am one with eight to spare, lest I lose my one. I\'m not a number. What am I?','A Cat. ( Nine Lives )','Hard','2024-07-10 03:25:07.464980'),(2883,'cat-riddles','Why was the cat thrown out of the card game?','Because he was a Cheetah!','Medium','2024-07-10 03:25:07.466904'),(2884,'cat-riddles','Why was the cat sitting at the computer?','It was keeping an eye on the mouse.','Hard','2024-07-10 03:25:07.468875'),(2885,'cat-riddles','What side of a cat has the most fur?','The outside.','Easy','2024-07-10 03:25:07.470591'),(2886,'cat-riddles','Forward I catch fish, backward I am the tenth of numbers. What am I?','Net.','Hard','2024-07-10 03:25:07.472366'),(2887,'cat-riddles','The ghost of the mountain never to be seen, leaps like a raging fire to catch his prey. As pale as the moon but fast as the wind. Cold as ice, but a flash of light in the night. What is it?','A snow leopard.','Hard','2024-07-10 03:25:07.474209'),(2888,'cat-riddles','Give a name to a cat and it will call itself. What is the name?','Meeoow is the name.','Hard','2024-07-10 03:25:07.476122'),(2889,'cat-riddles','What do you call a cat that gets anything it wants?','Purr-suasive','Easy','2024-07-10 03:25:07.477968'),(2890,'cat-riddles','What happens when a cat meets with a tragic accident?','A cat-astrophy!','Easy','2024-07-10 03:25:07.479834'),(2891,'cat-riddles','What sneaks through doors and windows without knocking? What heats an unlit stove? What gives the cat a snug place to rest?','The sun!','Medium','2024-07-10 03:25:07.481656'),(2892,'cat-riddles','Stealthy as a shadow in the dead of night, Cunning but affectionate if given a bite. Never owned but often loved. In my sport considered cruel, But that\'s because you never know me at all. What am I?','A cat.','Easy','2024-07-10 03:25:07.484153'),(2893,'cat-riddles','I am covered with three layers, two of them can be very sensitive, my layers can cover me in a heartbeat or a long time. What am I?','A cat\'s eye.','Medium','2024-07-10 03:25:07.486206'),(2894,'cat-riddles','Why is green grass like a mouse?','Green grass is like a mouse because the cattle eat it (cat��ll eat it).','Medium','2024-07-10 03:25:07.487776'),(2895,'cat-riddles','Why didn\'t the cat want to speak about his problems?','Because it\'s purr-sonal information!','Easy','2024-07-10 03:25:07.489464'),(2896,'cat-riddles','Tom can pet lions. What is the anagrammed word?','Contemplation.','Medium','2024-07-10 03:25:07.491049'),(2897,'cat-riddles','Cat, horse, monkey; Hat, sombrero, Cappello; Sheep, wool, haggis; Dairy, blueberry, cherry; Television, computer, phone; Which set of words doesn\'t belong?','Dairy, blueberry, cherry; All sets of words have a common theme, but this set of words is the only one that rhymes.','Medium','2024-07-10 03:25:07.492886'),(2898,'cat-riddles','There\'s a land where there are mummies and daddies but no babies. Books but no libraries. Mirrors but no reflections. Kittens but no cats. Cattle but no cows. Lollipops but no candy and trees but no forests. It\'s the land of what?','The land of double letters.','Easy','2024-07-10 03:25:07.494344'),(2899,'cat-riddles','What animal has more lives than a cat?','A frog, he croaks every night!','Hard','2024-07-10 03:25:07.495747'),(2900,'cat-riddles','Who was the most famous cat in the wild west?','Kit-ty Carson.','Hard','2024-07-10 03:25:07.497562'),(2901,'cat-riddles','My first is in chocolate but not in ham, my second\'s in cake and also in jam, my third at tea-time is easily found, my whole is a friend who\'s often around. What am I?','A Cat!','Hard','2024-07-10 03:25:07.499309'),(2902,'cat-riddles','Cleopatra and Anthony were near a fish bowl and somehow they died. What happened?','Cleopatra and Anthony were fish and a cat knocked over their fish bowl and since fish can\'t survive without water they died!!','Easy','2024-07-10 03:25:07.501071'),(2903,'cat-riddles','If it takes four rat catchers four minutes to kill four rats, how many rat catchers would be needed to catch 50 rats in 50 minutes?','The same number of rat-catchers: Four.','Easy','2024-07-10 03:25:07.502620'),(2904,'cat-riddles','If seven cats kill seven rats in 7 minutes, how many would be needed to kill one hundred rats in 50 minutes?','14','Hard','2024-07-10 03:25:07.504011'),(2905,'cat-riddles','How many cats are in a small room if in each of the four corners a cat is sitting, and opposite each cat there sit three cats, and on each cat\'s tail another is sitting?','Four cats, each near a tail of a cat in an adjacent corner.','Medium','2024-07-10 03:25:07.505723'),(2906,'skeleton-riddles','Why is France like a skeleton?','Because only the bony part is left. This is a play on words referring to Napoleon Bonaparte who played a key role in the 1789 French Revolution and was the first Emporer of France from 1804-15.','Easy','2024-07-10 03:25:07.506964'),(2907,'skeleton-riddles','What did the skeleton order at the restaurant?','Spare ribs!','Hard','2024-07-10 03:25:07.508773'),(2908,'skeleton-riddles','Why do skeletons hate the cold?','The wind goes right through them!','Easy','2024-07-10 03:25:07.510864'),(2909,'skeleton-riddles','Why do skeletons go on vacations alone?','Because they have no-body to go with.','Hard','2024-07-10 03:25:07.512422'),(2910,'skeleton-riddles','Who was the most famous Skeleton detective?','Sherlock Bones.','Hard','2024-07-10 03:25:07.513945'),(2911,'skeleton-riddles','What instrument does a skeleton play?','Trombone.','Hard','2024-07-10 03:25:07.515623'),(2912,'skeleton-riddles','Why did the skeleton go to the barbecue?','To get some spare - ribs.','Medium','2024-07-10 03:25:07.517324'),(2913,'skeleton-riddles','Why did the skeleton head cross the road?','To get to the other spine.','Medium','2024-07-10 03:25:07.519148'),(2914,'skeleton-riddles','Why did the skeleton climb up the tree?','Because the dog was after his bones.','Hard','2024-07-10 03:25:07.521217'),(2915,'skeleton-riddles','Why didn\'t the skeleton use a towel?','Because he always comes out bone dry.','Hard','2024-07-10 03:25:07.523002'),(2916,'football-riddles','What has one foot but no legs?','A football.','Easy','2024-07-10 03:25:07.524824'),(2917,'football-riddles','What is the only time you run in football?','When you kick off the game.','Hard','2024-07-10 03:25:07.526267'),(2918,'football-riddles','What do you call a football player who can\'t stop talking?','A quarterback.','Easy','2024-07-10 03:25:07.527636'),(2919,'football-riddles','What do you call a group of cows playing football?','A pasture-ization.','Easy','2024-07-10 03:25:07.529424'),(2920,'football-riddles','Why did the football coach go to the bank?','To get his quarterback!','Easy','2024-07-10 03:25:07.530896'),(2921,'football-riddles','What do football players do when they get cold?','They stand in the corner.Because it\'s always 90 degrees there.','Medium','2024-07-10 03:25:07.532247'),(2922,'football-riddles','What do you call a football player with no legs?','Ground beef.','Easy','2024-07-10 03:25:07.533835'),(2923,'football-riddles','What do you call a ghost who loves football?','A receiver-ant.','Easy','2024-07-10 03:25:07.535157'),(2924,'football-riddles','John bet Tom $100 that he can predict the score of the football game before it starts. Tom agrees but loses the bet. Why did Tom lose the bet?','John said the score would be 0-0 and he was right. \"Before\" any football game starts. The score is always 0-0.','Medium','2024-07-10 03:25:07.536803'),(2925,'football-riddles','What has 22 legs and 2 wings?',' A football team!','Medium','2024-07-10 03:25:07.538241'),(2926,'football-riddles','Why is it always hot at the end of a football game?',' Because all of the FANS have gone home.','Hard','2024-07-10 03:25:07.539595'),(2927,'Animal Riddles','What four-legged animal can jump higher than a house?','Any, Houses can\'t jump.','Medium','2024-07-10 03:25:19.231511'),(2928,'Animal Riddles','How many of each type of animal did Moses take on the Ark?','None, it was Noah.','Hard','2024-07-10 03:25:19.238991'),(2929,'Animal Riddles','What animal is the best at baseball?','A bat.','Medium','2024-07-10 03:25:19.241398'),(2930,'Animal Riddles','What animal is most likely to eat a relative?','An ant-eater!','Easy','2024-07-10 03:25:19.243447'),(2931,'Animal Riddles','Why don\'t African animals play games?','There are too many cheetahs!','Easy','2024-07-10 03:25:19.245914'),(2932,'Animal Riddles','Where do animals go to get their new tails when they\'re broken?','Retail Shop.','Easy','2024-07-10 03:25:19.248133'),(2933,'Animal Riddles','What flower would remind you of a certain animal that took a great deal of care about its appearance?','A dandelion (dandy lion).','Medium','2024-07-10 03:25:19.250369'),(2934,'Animal Riddles','I can spell yet I have no mouth I can speak to animals but can\'t speak to humans I am fierce but small. What am I?','I am a bee.','Easy','2024-07-10 03:25:19.252697'),(2935,'Animal Riddles','I eat animals but I don\'t hunt or kill. What am I?','A vulture.','Hard','2024-07-10 03:25:19.254869'),(2936,'Animal Riddles','Through a sea of green and islands of brown, leaving a crystal path behind, safe inside a spiral cave, preparing to come out again. What animal am I?','A snail.','Easy','2024-07-10 03:25:19.256681'),(2937,'Animal Riddles','What kind of animal can do Kung fu?','Kung fu pandas!','Medium','2024-07-10 03:25:19.258625'),(2938,'Animal Riddles','What kind of animal is a slope?','A Hypote-moose.','Hard','2024-07-10 03:25:19.260539'),(2939,'Animal Riddles','What animal is it the hardest to have a staring contest with?','A fish. They cannot blink!','Easy','2024-07-10 03:25:19.262791'),(2940,'Animal Riddles','Add 10 to nothing and you get what animal?','Unanswered.','Hard','2024-07-10 03:25:19.264588'),(2941,'Animal Riddles','A man but an animal, a horn with two hands. What am I?','A Minotaur.','Hard','2024-07-10 03:25:19.266668'),(2942,'Animal Riddles','What animal would you get crossed a duck, a beaver, and an otter?','A platypus.','Easy','2024-07-10 03:25:19.269607'),(2943,'Animal Riddles','What animal has more lives than a cat?','A frog, it croaks every night!','Medium','2024-07-10 03:25:19.271828'),(2944,'Animal Riddles','Add a letter to an animal, and make a building. What is it?','Sable, stable.','Hard','2024-07-10 03:25:19.274233'),(2945,'Animal Riddles','How are people like animals?','We have bare (bear) feet, frogs in our throats, calves on our legs and bull on our tongue.','Easy','2024-07-10 03:25:19.276698'),(2946,'Animal Riddles','What animals would be the best at playing video games?','An octopus.','Medium','2024-07-10 03:25:19.279811'),(2947,'Animal Riddles','What animal probably likes doors?','A door mouse.','Hard','2024-07-10 03:25:19.282357'),(2948,'Animal Riddles','What is 1 animal that can see at night but be blinded at day?','A bat.','Medium','2024-07-10 03:25:19.284659'),(2949,'Animal Riddles','With what two animals do you always go to bed?','Two calves.','Easy','2024-07-10 03:25:19.287341'),(2950,'Animal Riddles','What animal has no wings, but yet will fly?','A caterpillar has no wings, but will fly when it matures and becomes a butterfly.','Medium','2024-07-10 03:25:19.290012'),(2951,'Animal Riddles','Use all letters of this sentence once each only to spell out three animals. \'TALL ELEPHANT OR APEMAN\' What are the three animals?','PANTHER, ANTELOPE, LLAMA','Hard','2024-07-10 03:25:19.292601'),(2952,'Animal Riddles','Why did Tigger go to the bathroom?','He wanted to find his friend, Pooh!','Medium','2024-07-10 03:25:19.295243'),(2953,'Animal Riddles','What do you call a bear with no teeth?','A gummy bear.','Hard','2024-07-10 03:25:19.297568'),(2954,'Animal Riddles','Why couldn\'t Goldilocks sleep?','Because of night-bears.','Medium','2024-07-10 03:25:19.299548'),(2955,'Animal Riddles','Why are teddy bears never hungry?','Because they are stuffed.','Medium','2024-07-10 03:25:19.301872'),(2956,'Animal Riddles','A man builds a house with all 4 sides facing south. A bear walks past the house. What color is the bear?','White, the house is built directly on the North Pole.','Easy','2024-07-10 03:25:19.303954'),(2957,'Animal Riddles','There are 30 cows in a field, and 28 chickens. How many didn\'t?','10. Listen closely: 30 cows, and twenty-eight chickens. Say EIGHT and ATE. They sound the same. Therefore, it means 20 ATE chickens. 30-20=10, so 10 cows didn\'t eat any chickens.','Medium','2024-07-10 03:25:19.306624'),(2958,'Animal Riddles','There are two bodies on the floor. They are surrounded by water and broken glass. How did they die?',