, \"All chickens are liars\". Is the chicken telling the truth?','Answer: Chickens cannot talk.','Medium','2024-07-10 03:25:19.573722'),(3101,'Bird Riddles','I\'m the part of the bird that\'s not in the sky. I can swim in the ocean and yet remain dry. What am I?','A shadow.','Medium','2024-07-10 03:25:19.575230'),(3102,'Bird Riddles','Why did the scarecrow win so many awards?','He was out-standing in his field!','Easy','2024-07-10 03:25:19.576942'),(3103,'Bird Riddles','What bird is always out of breath?','A puffin.','Easy','2024-07-10 03:25:19.578362'),(3104,'Bird Riddles','If it takes 5 microwaves and 5 minutes to cook 5 chickens, how long does it take 100 microwaves to cook 100 chickens?','5 minutes. We can assume that one chicken is placed in each microwave and that each chicken takes 5 minutes to cook.','Easy','2024-07-10 03:25:19.579763'),(3105,'Bird Riddles','I\'m like a doll, But I\'m not for playing; I stand up straight, but if windy I may be laying; I\'m well-known and famous for having no brain; I work outside both day and night in sunshine or in rain. What am I?','A Scarecrow.','Medium','2024-07-10 03:25:19.581481'),(3106,'Bird Riddles','What was never scared but became petrified, can\'t make a bird but can make a bat, can\'t live in a house but would die to have one. What is it?','A tree.','Easy','2024-07-10 03:25:19.583659'),(3107,'Bird Riddles','Why do chickens lay eggs?','Because if they drop them, they will break.','Easy','2024-07-10 03:25:19.585884'),(3108,'Bird Riddles','What\'s 3/7 chicken, 2/3 cat, and 2/4 goat?','Chicago. The first three words out of seven of chicken is CHI, the first two words out of 3 of cat is CA, and the first two words out of goat is GO. Therefore making, (CHI)(CA)(GO).','Hard','2024-07-10 03:25:19.587926'),(3109,'Bird Riddles','If there are fifteen crows on a fence and the farmer shoots a third of them, how many crows are left?','None. The rest of the crows flew away when they heard the gunshot.','Medium','2024-07-10 03:2