ecause ducks can\'t read.','Easy','2024-07-10 03:25:19.639235'),(3135,'Bird Riddles','Why was the chicken forbidden from sending e-mails?','Because he kept using fowl language.','Medium','2024-07-10 03:25:19.641023'),(3136,'Bird Riddles','They can trickle down, They can tickle too. Or make you sneeze, Or comfort you. Their rustling sound, you\'ve rarely heard, Unless you\'re a pillow or a bird! What are they?','They are feathers.','Hard','2024-07-10 03:25:19.642606'),(3137,'Bird Riddles','Why did Mama Duck scold her goslings?','For eating quackers in bed.','Easy','2024-07-10 03:25:19.644093'),(3138,'Bird Riddles','How do chickens like to dance?','Chick to chick','Easy','2024-07-10 03:25:19.645814'),(3139,'Bird Riddles','Under no circumstances compute the number of your barnyard fowl previous to their incubation. What is the proverb?','Do not count your chickens before they hatch.','Hard','2024-07-10 03:25:19.647387'),(3140,'Bird Riddles','I have a house with no doors no windows, nothing. If I want to get out I break the wall. Who am I?','Chicken as if it wants to come out breaks the wall.','Medium','2024-07-10 03:25:19.649242'),(3141,'Bird Riddles','What time does a duck get up?','At the quack of dawn.','Easy','2024-07-10 03:25:19.650832'),(3142,'Bird Riddles','A feathered Biped in the terminal part of the arm equals in value a pair of feathered bipeds in densely branched shrubbery. What is the proverb?','A bird in the hand is worth two in the bush.','Easy','2024-07-10 03:25:19.653114'),(3143,'Bird Riddles','Why did the duck get fired from his Easter job?','He kept quacking the eggs.','Easy','2024-07-10 03:25:19.655032'),(3144,'Bird Riddles','This thing all things devours: Birds, beasts, trees, flowers; Gnaws iron, bites steel; Grinds hard stones to meal; Slays king, ruins town, And beats high mountain down. What am I?','Time!','Hard','2024-07-10 03:25:19.656879'),(3145,'Bird Riddles','What do you call two birds that are in love?','Tweet-hearts','Easy','2024-07-10 0