e feeling is mootual.','Medium','2024-07-10 03:25:19.682348'),(3159,'Bird Riddles','What animal would you get crossed a duck, a beaver, and an otter?','A platypus.','Easy','2024-07-10 03:25:19.684060'),(3160,'Bird Riddles','What kind of can never needs a can-opener?','A toucan!','Easy','2024-07-10 03:25:19.685626'),(3161,'Bird Riddles','Why did the woolly mammoth cross the road?','Because there were no chickens in the ice age!','Easy','2024-07-10 03:25:19.688098'),(3162,'Bird Riddles','There are 10 birds on a branch, a man shot 5 of them. How many were left?','Zero, because when birds see someone coming or hear something they fly away.','Hard','2024-07-10 03:25:19.690684'),(3163,'Bird Riddles','NASA was considering sending canaries into space to study them under zero gravity. The project was scrapped when someone realized that in spite of having sufficient water supplies, they could die of dehydration within a few hours. Why?','Birds, unlike humans, need gravity to swallow. Humans can swallow even while hanging upside down.','Easy','2024-07-10 03:25:19.692732'),(3164,'Bird Riddles','What are the freedom of birds and the pen of old men?','Feathers. Feathers make up a bird\'s wings, giving it flight or freedom. Quill pens were used by men in older times.','Hard','2024-07-10 03:25:19.694743'),(3165,'Bird Riddles','What do you get when you cross Santa Claus and a duck?','A Christmas quacker.','Hard','2024-07-10 03:25:19.696771'),(3166,'Bird Riddles','Why don\'t chickens play baseball?','Because they hit fowl balls.','Hard','2024-07-10 03:25:19.698656'),(3167,'Bird Riddles','Why did the chicken cross the playground?','To get to the other slide!','Easy','2024-07-10 03:25:19.700285'),(3168,'Bird Riddles','In what place did the rooster crow when all the world heard him?','In Noah\'s Ark.','Medium','2024-07-10 03:25:19.702085'),(3169,'Bird Riddles','A bird has a head 9cm long. The tail is equal to the size of the head plus half of the size of the body. The body is the size of the head plus the tail. How long is the bird?','72cm. Th head is 9cm. The tail is 18 + 9= 27cm. The body is 9 + 18 + 9= 36cm. 9 + 27 + 36= 72cm.','Hard','2024-07-10 03:25:19.703741'),(3170,'Bird Riddles','A large truck is crossing a bridge 1 mile long. The bridge can only hold 14000 lbs, which is the exact weight of the truck. The truck makes it halfway across the bridge and stops. A bird lands on the truck. Does the bridge collapse?','No, it does not collapse. Because it has driven a half-mile - you would subtract the gas used from the total weight of the truck.','Medium','2024-07-10 03:25:19.705368'),(3171,'Bird Riddles','What kind of can never needs a can-opener?','A pelican!','Medium','2024-07-10 03:25:19.707042'),(3172,'Bird Riddles','A great banquet was prepared for a Roman emperor and his courtiers. 22 Dormice, 40 Larks\' Tongues, 30 Flamingos, and 40 Roast Parrots were served. How many portions of Boiled Ostrich were served?','42. Each vowel is worth 2 and each consonant 4, so Dormice gives 22, etc.','Hard','2024-07-10 03:25:19.708939'),(3173,'Black Riddles','I am white when I am dirty, and black when I am clean. What am I?','A','Easy','2024-07-10 03:25:19.710827'),(3174,'Black Riddles','What is black when you buy it, red when you use it, and gray when you throw it away?','Charcoal.','Easy','2024-07-10 03:25:19.712434'),(3175,'Black Riddles','When is it bad luck to see a','When you are a mouse.','Medium','2024-07-10 03:25:19.714096'),(3176,'Black Riddles','Why is Santa so good at Karate?','Because he has a black belt.','Hard','2024-07-10 03:25:19.715687'),(3177,'Black Riddles','I\'m clean when I\'m black, Dirty when white; Get too close, And you might sneeze. What am I?','A Chalkboard.','Medium','2024-07-10 03:25:19.717259'),(3178,'Black Riddles','I am white, black, and read all over. What am I?','Newspaper!','Hard','2024-07-10 03:25:19.719417'),(3179,'Black Riddles','Pronounced as one letter, And written with three, Two letters there are, And two only in 