ul not to misspell my name with the letter \"i\". What am I?','I am a PEN!','Hard','2024-07-10 03:25:19.758084'),(3199,'Black Riddles','I am missing from every emotion, the alpha of the black and white herd. I am the end of the written notion, and yet I am the least used in a word. What am I?','The letter Z. No emotion contains the letter z zebras are a herd of black and white and their alpha(first) letter is z The end of the written notion(the alphabet) is the letter z The letter z is statistically the least used letter.','Medium','2024-07-10 03:25:19.759858'),(3200,'Black Riddles','I am black of the eye and bright of hair. I fast into the ground and follow my lord as he races around the world. What am I?','I\'m a Sunflower.','Hard','2024-07-10 03:25:19.761565'),(3201,'Black Riddles','What','He makes the firefly.','Hard','2024-07-10 03:25:19.763267'),(3202,'Black Riddles','A girl was holding something in her hand. With her other hand, she picked up a regular black pen and wrote on the object in her hand. When she let go of the object, the writing shrunk and became more solid. What was the object?','An untied balloon','Easy','2024-07-10 03:25:19.765363'),(3203,'Black Riddles','What kind of music does a blacksmith like?','Heavy metal!','Medium','2024-07-10 03:25:19.767164'),(3204,'Black Riddles','How many black beans will make five white ones?','Five when peeled.','Hard','2024-07-10 03:25:19.769071'),(3205,'Black Riddles','What insect does a blacksmith manufacture?','He makes the firefly.','Easy','2024-07-10 03:25:19.770813'),(3206,'Black Riddles','Black within, red without, with four corners, roundabout. What is it?','A chimney.','Medium','2024-07-10 03:25:19.772521'),(3207,'Black Riddles','What\'s black and white and red all over?','A zebra with a sunburn.','Easy','2024-07-10 03:25:19.774369'),(3208,'Black Riddles','Don\'t burn me I\'ll be crusty and black, but butter me and I\'ll be greasy and wack. What am I?','Bread','Easy','2024-07-10 03:25:19.776160'),(3209,'B