on fits on it. Luckily they both got to the other side of the river. How?','They were on opposite sides of the river.','Hard','2024-07-10 03:25:19.811581'),(3227,'Boat Riddles','What is a vampire\'s favorite boat to travel on?','A blood vessel.','Easy','2024-07-10 03:25:19.813914'),(3228,'Boat Riddles','What house has a post on top, A roof at the bottom, While the rain comes from below?','A boat.','Easy','2024-07-10 03:25:19.816505'),(3229,'Boat Riddles','What type of boat has authority?','Ownership!','Medium','2024-07-10 03:25:19.818809'),(3230,'Boat Riddles','I dance in the wind and I bow to a storm. I grow best in temperatures that are warm. By the riverbeds, I like to grow, where the people in boats like to row. What am I?','A river reed. Didn\'t guess it did you?','Hard','2024-07-10 03:25:19.820749'),(3231,'Boat Riddles','I\'m done to boats, to cargo, to loads; When indoors I\'m, in a way, a narrow road. What am I?','Haul?/ Hall','Hard','2024-07-10 03:25:19.822754'),(3232,'Boat Riddles','Two people are standing on the bank of a river looking forward to crossing to the other side. There is one boat with a capacity for one person. The two people managed to cross the river safely. How did they do it?','The two were on opposite sides of the river.','Easy','2024-07-10 03:25:19.824844'),(3233,'Boat Riddles','When is a boat like a knife?','When it is a cutter.','Hard','2024-07-10 03:25:19.827028'),(3234,'Boat Riddles','A pro fisherman decided to become a pro golfer. In order to buy his clubs, he had to sell his boat. How did he list it?','Fore Sail!','Medium','2024-07-10 03:25:19.829958'),(3235,'Boat Riddles','Why is a ferry boat like a good rule?','Because it works both ways.','Hard','2024-07-10 03:25:19.832287'),(3236,'Boat Riddles','Four men were in a boat on the lake. The boat turns over, and all four men sink to the bottom of the lake, yet not a single man got wet! Why?','Because they were all married and not single.','Medium','2024-07-10 03:25:19.835023'),(3237,'Boat Riddles','Peter celebrated his birthday on one day, and two days later his older twin brother, Paul, celebrated his birthday. How could this be?','When the mother of the twins went into labor, she was traveling by boat. The older twin, Paul, was born first, barely on March 1st. The boat then crossed a time zone, and the younger twin was born on February the 28th. In a leap year, the younger twin celebrates his birthday two days before his older brother.','Easy','2024-07-10 03:25:19.837770'),(3238,'Boat Riddles','A girl went over to the U.S. on the 4th of July and partied for 3 days and came back on the 4th of July. How did she do that?','She went over on the date of the 4th of July and came home on the boat called the 4th of July.','Easy','2024-07-10 03:25:19.840445'),(3239,'Brother Riddles','Mr. and Mrs. Mustard have six daughters and each daughter has one brother. How many people are in the Mustard family?','There are nine Mustards in the family. Since each daughter shares the same brother, there are six girls, one boy, and Mr. and Mrs. Mustard.','Easy','2024-07-10 03:25:19.843160'),(3240,'Brother Riddles','I have a heart that never beats, I have a home but I never sleep. I can take a man\'s house and build another, And I love to play games with my many brothers. I am a king among fools. Who am I?','The King of Hearts in a deck of cards.','Easy','2024-07-10 03:25:19.845723'),(3241,'Brother Riddles','There is a brother and a sister. The boy wants to visit his father in jail, and the sister wants to visit her mother in the hospital. But they both are not allowed in jail or hospital. All they have is a gun. What do they do?','The boy shoots the girl, and then the boy goes to jail for attempted murder and the girl goes to the hospital due to her injuries.','Hard','2024-07-10 03:25:19.848010'),(3242,'Brother Riddles','A mother has 6 girls and each of them has a brother. How many children are there?','7. Each girl has the same brother.','Hard','2024-07-10 03:25:19.850377'),(3243,'Brother Riddles','A beggar\'s brother died, but the man who died had no brother. How could that be?','The beggar was his sister!','Medium','2024-07-10 03:25:19.853396'),(3244,'Brother Riddles','The 22nd and 24th presidents of the United States of America had the same parents, but were not brothers. How can this be possible?','They were the same man. Grover Cleveland served two terms as president of the United States, but the terms were not consecutive.','Hard','2024-07-10 03:25:19.855711'),(3245,'Brother Riddles','You give someone a dollar. You are this person\'s brother, but the person is not your brother. How can that be?','It\'s your sister!','Hard','2024-07-10 03:25:19.858459'),(3246,'Brother Riddles','Peter is 4 and his little brother is 2, half his age. How older will Peter\'s little brother be when he is 100?','98 because there\'s only a 2-year difference.','Medium','2024-07-10 03:25:19.860596'),(3247,'Brother Riddles','You must keep this thing, its loss will affect your brothers. For once yours is lost, it will soon be lost by others. What is it?','Your Temper.','Easy','2024-07-10 03:25:19.862852'),(3248,'Brother Riddles','There are 8 brothers. Brother 1 is playing checkers. Brother 2 is eating. Brother 3 is watching video games. Brother 4 is dancing. Brother 5 is texting. Brother 6 is at school. Brother 7 is sleeping. What is Brother 8 doing?','Brother 8 is playing checkers with Brother 1 because checkers includes two people to play.','Medium','2024-07-10 03:25:19.865716'),(3249,'Brother Riddles','I am very powerful, And my brother is patient. I am of infinite value, And I wait for no one. What am I?','Time.','Hard','2024-07-10 03:25:19.867991'),(3250,'Brother Riddles','You are my brother, but I am not your brother. Who am I?','I am your sister.','Medium','2024-07-10 03:25:19.870277'),(3251,'Brother Riddles','Three doctors say Robert is their brother. However, Robert says he has no brother. Who\'s lying?','No one. The doctors are all girls.