2024-07-10 03:25:19.962995'),(3290,'Chicken Riddles','What does a chicken say instead of good?','EGGcelent','Hard','2024-07-10 03:25:19.965544'),(3291,'Chicken Riddles','He\'s a boastful, puffed-up fellow, wearing spurs; eyes gleaming yellow. As he proudly struts about, he\'s in charge, there is no doubt. What is he?','He is a Rooster.','Easy','2024-07-10 03:25:19.967921'),(3292,'Chicken Riddles','A fast-food restaurant sells chicken in orders of 6,9 and 20. What\'s the largest number of pieces of chicken you cannot order from the restaurant?','43 is the last number that doesn\'t fall into these categories.','Medium','2024-07-10 03:25:19.970661'),(3293,'Chicken Riddles','Why does a chicken coop have two doors?','Because, if it had four it would be a sedan.','Easy','2024-07-10 03:25:19.974217'),(3294,'Chicken Riddles','Why did the woolly mammoth cross the road?','Because there were no chickens in the ice age!','Hard','2024-07-10 03:25:19.977977'),(3295,'Chicken Riddles','Why don\'t chickens play baseball?','Because they hit fowl balls.','Hard','2024-07-10 03:25:19.980590'),(3296,'Chicken Riddles','Why did the chicken cross the playground?','To get to the other slide!','Medium','2024-07-10 03:25:19.983038'),(3297,'Chicken Riddles','What is the time-piece, That needs no winding?','A rooster.','Easy','2024-07-10 03:25:19.986982'),(3298,'Chicken Riddles','In what place did the rooster crow when all the world heard him?','In Noah\'s Ark.','Medium','2024-07-10 03:25:19.989637'),(3299,'Classroom Riddles','Why does the teacher wear sunglasses when she comes to the class?','Because the students are bright.','Easy','2024-07-10 03:25:19.991875'),(3300,'Classroom Riddles','When is homework not homework?','When it\'s done at school.','Hard','2024-07-10 03:25:19.995132'),(3301,'Classroom Riddles','A teacher is yelling, she closes the door, the window, and a book. What did she forget to close?','Her mouth.','Hard','2024-07-10 03:25:19.997419'),(3302,'Classroom Riddles','What do mathematics teachers like to eat?','Pi.','Easy','2024-07-10 03:25:19.999839'),(3303,'Classroom Riddles','Why did the boy eat his homework?','Because the teacher said it was a piece of cake.','Medium','2024-07-10 03:25:20.002499'),(3304,'Classroom Riddles','What happened to the plant in the math classroom?','It grew square roots, of course.','Medium','2024-07-10 03:25:20.004226'),(3305,'Classroom Riddles','What is the most useful instrument in a mathematics teacher\'s tool kit?','Multi-pilers!','Easy','2024-07-10 03:25:20.006421'),(3306,'Classroom Riddles','What do grape students do when they have a question?','Raisin their hand!','Easy','2024-07-10 03:25:20.008198'),(3307,'Classroom Riddles','What\'s the difference between a Teacher and a Train?','The Teacher says \"Spit out your gum!\" And the train says \"Chew, Chew, Chew!\"','Easy','2024-07-10 03:25:20.010261'),(3308,'Classroom Riddles','What are the science teacher\'s favorite states?','Solid, Liquid, Gas. The states of all matter.','Hard','2024-07-10 03:25:20.011809'),(3309,'Classroom Riddles','1. Where do fish go on vacation? 2. Where do songbirds go on vacation? 3. Where do zombies go on vacation? 4. Where do Thanksgiving Birds go on vacation? 5. Where do geometry teachers go on vacation? 6. Where do locksmiths go on vacation?','1. Finland 2. The Canary Islands 3. The Dead Sea 4. Turkey 5. Cuba 6. The Florida Keys','Hard','2024-07-10 03:25:20.013425'),(3310,'Classroom Riddles','A student was once given a simple task to accomplish. He was given 6 numbers: 1, 10, 20, 30, 40, and 80, and was told to sum them together to be equal to 100. At last, he was able to accomplish this task. How did he do it?','He read 10 and 80 backward to give him 01 and 08 respectively. So, 1 + 01 + 20 + 30 + 40 + 08 = 100.','Easy','2024-07-10 03:25:20.014900'),(3311,'Classroom Riddles','What word can be grammatically correct when used consecutively in the English language?','Had: \"James while John had had had had had had had had had had had a better effect on the teacher\" is an English sentence used to demonstrate lexical ambiguity and the necessity of punctuation, which serves as a substitute for the intonation, stress, and pauses found in speech.\"-Wikipedia. Cool, Huh?','Hard','2024-07-10 03:25:20.017164'),(3312,'Classroom Riddles','In the olden days, the student of logic was given this problem: If half of 5 were 3, what would one-third of 10 be?','It would be 4.','Hard','2024-07-10 03:25:20.019248'),(3313,'Classroom Riddles','Why was the student\'s homework in his father\'s handwriting?','Because the student borrowed his pen.','Easy','2024-07-10 03:25:20.021039'),(3314,'Dark Riddles','A man rode out of town on Sunday, he stayed a whole night at a hotel and rode back to town the next day on Sunday. How is this possible?','His Horse was called Sunday!','Hard','2024-07-10 03:25:20.022554'),(3315,'Dark Riddles','It can\'t be seen, can\'t be felt, can\'t be heard, and can\'t be smelt. It lies behind stars and under hills, And empty holes it fills. It comes first and follows after, Ends life, and kills laughter. What is it?','The dark.','Hard','2024-07-10 03:25:20.024120'),(3316,'Dark Riddles','I always follow you around, everywhere you go at night. I look very bright to people, but I can make the sun dark. I can be in many different forms and shapes. What am I?','The moon!','Medium','2024-07-10 03:25:20.025606'),(3317,'Dark Riddles','I run in and out of town all day and night. What am I?','A road.','Easy','2024-07-10 03:25:20.027037'),(3318,'Dark Riddles','I was carried into a dark room, and set on fire. I wept, and then my head was cut off. What am I?','A Candle.','Medium','2024-07-10 03:25:20.028729'),(3319,'Dark Riddles','What did Sir Lancelot wear to bed?','A knight gown!','Easy','2024-07-10 03:25:20.030178'),(3320,'Dark Riddles','I am the beginning of sorrow and the end of sickness. You cannot express happiness without me, yet I am in the midst of crosses. I am always in risk, yet never in danger. You may find me in the sun, but I am never out of darkness. What am I?','The letter S.','Medium','2024-07-10 03:25:20.031578'),(3321,'Dark Riddles','A little pool with two layers of wall around it. One white and soft and the other dark and hard, amidst a light brown grassy lawn with an outline of green grass. What am I?','A Coconut.','Hard','2024-07-10 03:25:20.033150'),(3322,'Dark Riddles','How do you know that a vampire loves baseball?','Because he turns into a bat every night.','Medium','2024-07-10 03:25:20.034511'),(3323,'Dark Riddles','What falls down but never breaks?','Nightfall.','Hard','2024-07-10 03:25:20.036030'),(3324,'Dark Riddles','What boy wizard magically grew a beard each night?','Hairy Potter.','Medium','2024-07-10 03:25:20.037448'),(3325,'Dark Riddles','Why couldn\'t Goldilocks sleep?','Because of nightbears.','Easy','2024-07-10 03:25:20.038745'),(3326,'Dark Riddles','When I point up it\'s bright, but when I point down it\'s dark. What am I?','A Light Switch.','Hard','2024-07-10 03:25:20.040162'),(3327,'Dark Riddles','I\'m like a doll, But I\'m not for playing; I stand up straight, but if windy I may be laying; I\'m well-known and famous for having no brain; I work outside both day and night in sunshine or in rain. What am I?','A Scarecrow.','Medium','2024-07-10 03:25:20.041762'),(3328,'Dark Riddles','Lovely and round, I shine with pale light, grown in the darkness, A lady\'s delight. What am I?','A Pearl.','Easy','2024-07-10 03:25:20.043906'),(3329,'Dark Riddles','They are dark and always on the run. Without the sun, there would be none. What are they?','Shadows.','Easy','2024-07-10 03:25:20.045601'),(3330,'Dark Riddles','Why does a dragon sleep all day?','So it can hunt knights!','Medium','2024-07-10 03:25:20.046990'),(3331,'Dark Riddles','What falls but doesn\'t break, and what breaks but doesn\'t fall?','Night and Day.','Easy','2024-07-10 03:25:20.048460'),(3332,'Dark Riddles','I follow you by day, by night I blend right in but no one sees me except when I\'m in the light. What am I?','A shadow.','Easy','2024-07-10 03:25:20.050082'),(3333,'Dark Riddles','Every night, I\'m told what to do. And every morning, I do what you tell me to do. But you still get mad at me and hit me. What am I?','An alarm clock.','Hard','2024-07-10 03:25:20.051417'),(3334,'Dark Riddles','I weaken all men for hours each day. I show you strange visions while you are away. I take you by night, by day take you back, None suffer to have me, but do from my lack. What am I?','Sleep.','Hard','2024-07-10 03:25:20.053177'),(3335,'Dark Riddles','My first four letters describe all living things. My last five letters are another word for knight. My job is to save you, and I\'m a fan of water. Who am I?','I��m a lifeguard','Easy','2024-07-10 03:25:20.054594'),(3336,'Dark Riddles','A man rides into town on Friday. He stays two nights. How does he leave on Tuesday?','His horse was called Friday.','Hard','2024-07-10 03:25:20.055980'),(3337,'Dark Riddles','Who always stalks you during the day but becomes too tired to stalk you at night?','Your own shadow!','Easy','2024-07-10 03:25:20.057591'),(3338,'Dark Riddles','People have stepped on me, but not many. I never stay full for long. I have a dark side. What am I?','The moon.','Hard','2024-07-10 03:25:20.058950'),(3339,'Dark Riddles','What do ghosts like to do on a Saturday night?','BOOGIE.','Medium','2024-07-10 03:25:20.060313'),(3340,'Dark Riddles','I can fly but have no wings. I can cry but I have no eyes. Wherever I go, darkness follows me. What am I?','Clouds.','Hard','2024-07-10 03:25:20.061876'),(3341,'Dark Riddles','The marathon man timed himself and found out that if he wore a bright white outfit he ran 20 miles in 80 minutes, but when he wore a dark outfit, he ran 20 miles in one hour and twenty minutes. What does this mean for his next race?','Absolutely nothing, as 80 minutes equals an hour and twenty minutes.','Easy','2024-07-10 03:25:20.063722'),(3342,'Dark Riddles','I sleep by day, I fly by night. I have no feathers to aid my flight. What am I?','I am a Bat.','Medium','2024-07-10 03:25:20.073030'),(3343,'Dark Riddles','What\'s light during the day but heavy during the night?','Eyelids.','Hard','2024-07-10 03:25:20.076303'),(3344,'Dark Riddles','You can have me almost every night, sometimes I could be bad sometimes I can be nice or good, Whether you were a child or an adult I\'ll be there. What am I?','Dreams between (Sweet dreams, Nightmare).','Hard','2024-07-10 03:25:20.078642'),(3345,'Dark Riddles','I have 16 legs then, I sleep for about a fortnight and a merge with 6 legs. What am I?','A Butterfly','Hard','2024-07-10 03:25:20.081367'),(3346,'Dark Riddles','I am not a person nor an animal. I was born from the death of something large and hot. I am capable of consuming anything and everything. I am very dark and exist in a place where there is no gravity. What am I?','A black hole.','Easy','2024-07-10 03:25:20.083504'),(3347,'Dark Riddles','At night they come without being fetched, And by day they are lost without being stolen. What are they?','The stars.','Easy','2024-07-10 03:25:20.085754'),(3348,'Dark Riddles','Duels of good and evil, A fighter of good am I, Revealed beside watched words, King of the black night sky. What am I?','The dark.','Easy','2024-07-10 03:25:20.087462'),(3349,'Dark Riddles','When I am metal or wood, I bring you home. When I am flesh and blood, in the darkness I roam. What am I?','A bat.','Easy','2024-07-10 03:25:20.089981'),(3350,'Dark Riddles','A nightmare for some. For others, a savior I come. My hand\'s cold and bleak. It\'s the warm hearts they seek. What am I?','Death.','Easy','2024-07-10 03:25:20.091729'),(3351,'Dark Riddles','I grow in the dark and shine in the light; The paler I am, the more I am liked; My maker never gets paid, but never goes on strike. What am I?','A pearl.','Medium','2024-07-10 03:25:20.093855'),(3352,'Dark Riddles','I have an eye in the middle of me, but as you see, I cannot see. I am dark and not far away. You don\'t see me every day. I am not night and I am not bright. I can have twists and water and scares. What am I?','A hurricane.','Medium','2024-07-10 03:25:20.095707'),(3353,'Dark Riddles','I\'m far away from you, but I still shine bright. I sleep by day, I wake up at night. I stay by the moon but never get close to it. What am I?','A star.','Easy','2024-07-10 03:25:20.097744'),(3354,'Dark Riddles','I can\'t t hurt you, but I can leave you with scars. Nobody wants me, but everyone has me. But you are the only one who can see me. What am I?','Nightmares.','Medium','2024-07-10 03:25:20.099394'),(3355,'Dark Riddles','You see me at night, by day you tell everyone about me. I come back looking different than before. I sometimes leave you in the darkness. What am I?','A dream.','Hard','2024-07-10 03:25:20.101521'),(3356,'Dark Riddles','With three eyes and a black as night, I frequently knock down ten men with a single strike! What am I?','A Bowling ball.','Easy','2024-07-10 03:25:20.103047'),(3357,'Dark Riddles','I\'m grown from darkness but shine with a pale light. Very round I am, and always a lady\'s delight. What am I?','A Pearl.','Medium','2024-07-10 03:25:20.104931'),(3358,'Dark Riddles','I take you by night, by day take you back. None suffer to have me but do from my lack. What am I?','Sleep','Medium','2024-07-10 03:25:20.106686'),(3359,'Dark Riddles','Dead on the field lie ten soldiers in white, felled by three eyes, black as night. What happened?','A strike was thrown in 10-pin bowling.','Hard','2024-07-10 03:25:20.108342'),(3360,'Dark Riddles','What loses its head in the morning, and gets it back at night?','A Pillow.','Hard','2024-07-10 03:25:20.109940'),(3361,'Dark Riddles','The king of the jungle, rare as gold, black as night, in light not there and night not seen. Goes in water, goes on trees, goes in caves, goes on the ground. Claws of knives, teeth of swords, the roar of death but silent as a mouse. What is it?','A black panther (black jaguar)','Medium','2024-07-10 03:25:20.111433'),(3362,'Dark Riddles','I am nothing, I am everything. I am perfect dark, I am the brightest light. I am hungry, I am full. I am nowhere, I am everywhere. I am unseen, I am watched by millions. What am I?','The universe.','Easy','2024-07-10 03:25:20.113275'),(3363,'Dark Riddles','I\'m blue at day and black at night; I do contain some creatures born and died. What am I?','Seawater.','Easy','2024-07-10 03:25:20.114601'),(3364,'Dark Riddles','I\'m the first thing you see in the morning and the last thing you see at night, I\'m always there but you choose to ignore me, cross your eyes and you will see me. What am I?','Your nose.','Easy','2024-07-10 03:25:20.115955'),(3365,'Dark Riddles','Dark with white markings, And smooth like a rock. Where learning occurs, I help convey thought. What am I?','Blackboard/chalkboard.','Hard','2024-07-10 03:25:20.117741'),(3366,'Dark Riddles','I welcome the day with a show of light, I stealthily came here in the night. I bathe the earthy stuff at dawn, But by noon, alas! I\'m gone. What am I?','The morning dew!','Medium','2024-07-10 03:25:20.119499'),(3367,'Dark Riddles','What brightens your day when it\'s dark, although it\'s usually in the shade?','A lamp.','Medium','2024-07-10 03:25:20.121328'),(3368,'Dark Riddles','I\'m as plain to see as black & white. I prefer to roam about at night. Just don\'t attack or startle me. Or odiferous emissions may result you see. I\'m an omnivore yes it\'s true. But what\'s my name tell me do?','I am a skunk!','Easy','2024-07-10 03:25:20.122883'),(3369,'Dark Riddles','You use me every day but let me rest at night. I have an identical twin beside me all the time. For some reason, you always cover me up. I am not alive but I have a soul. What am I?','Your Feet.','Easy','2024-07-10 03:25:20.124336'),(3370,'Dark Riddles','I watch you sleep, I haunt you by day. You stare at me and saw nothing, but darkness. What am I?','Fear.','Medium','2024-07-10 03:25:20.125836'),(3371,'Dark Riddles','Sometimes I am black, sometimes I am white sometimes you can see me at night. I have friends that are with me that are much smaller. Some of you have walked on me but not all. What am I?','The Moon.','Medium','2024-07-10 03:25:20.127325'),(3372,'Dark Riddles','I usually wear a yellow coat. I usually have a dark head. I make marks wherever I go. What am I?','A pencil.','Hard','2024-07-10 03:25:20.129149'),(3373,'Dark Riddles','My first is in ocean but never in sea, my second\'s in wasp but never in bee. My third is in glider and also in flight, my whole is a creature that comes out at night. What am I?','An Owl.','Hard','2024-07-10 03:25:20.130641'),(3374,'Dark Riddles','I come out at night, I am neither human nor animal, I rarely eat I only drink, I can only be found at night, I will glow in the sunlight. What am I?','A vampire.','Easy','2024-07-10 03:25:20.132247'),(3375,'Dark Riddles','Imagine you are in a dark room. How do you get out?','Stop imagining.','Hard','2024-07-10 03:25:20.133963'),(3376,'Dark Riddles','Allan survived 12 days without sleep. How is this possible?','He sleeps during the night.','Medium','2024-07-10 03:25:20.135329'),(3377,'Dark Riddles','The man had not slept in days, yet he was well-rested. How could this be?','He only sleeps at night (he had not slept in DAYS)','Easy','2024-07-10 03:25:20.137024'),(3378,'Dark Riddles','I am life, yet not real. When we first meet, things are dark. When we leave each other, you are in the light. I meet many people with and after you. What am I?','A movie.','Easy','2024-07-10 03:25:20.138807'),(3379,'Dark Riddles','I have billions of eyes, yet I live in darkness. I have millions of ears, yet only four lobes. I have no muscle, yet I rule two hemispheres. What am I?','The human brain.','Easy','2024-07-10 03:25:20.140308'),(3380,'Dark Riddles','In a tunnel of darkness lies a beast of iron. It can only attack when pulled back. What is it?','A bullet.','Medium','2024-07-10 03:25:20.141894'),(3381,'Dark Riddles','The ghost of the mountain never to be seen, leaps like a raging fire to catch his prey. As pale as the moon but fast as the wind. Cold as ice, but a flash of light in the night. What is it?','A snow leopard.','Hard','2024-07-10 03:25:20.143480'),(3382,'Dark Riddles','My body has a dozen heads or more, My tails don\'t wag when you walk in the door. Count the ways you can hold me tight, Or use me for a special night! What Am I?','A piggy bank.','Hard','2024-07-10 03:25:20.145239'),(3383,'Dark Riddles','From dawn to dusk I soar through the sky, A thunderous voice, but silent I fly. Through the darkest depths, I will not die, Yet I can not be seen by the naked eye. What am I?','Radio waves.','Medium','2024-07-10 03:25:20.147161'),(3384,'Dark Riddles','A group of men is suddenly awakened by a loud, piercing, continuous sound. They all scramble out of their beds, get dressed, grab a pole, and disappear into a hole. What in the world are these men doing?','The men are firemen who were on night-shift duty at their firehouse. When they heard the fire alarm, they got dressed, slid down the fire pole, and got in the fire truck.','Medium','2024-07-10 03:25:20.149184'),(3385,'Dark Riddles','What falls but never breaks? What breaks but never falls?','Night and Day!','Hard','2024-07-10 03:25:20.151109'),(3386,'Dark Riddles','A light aloft alone in shadow, I light the way for paths you follow. What am I?','\"Lampost\" - Reasoning: Often, a street lampost will be a source of light above paths that are often traveled at night, hence it is the reference to this lonely light guiding you on paths through the darkness.','Easy','2024-07-10 03:25:20.153062'),(3387,'Dark Riddles','I scream out in the dark, I bring light to you, my flame whispers in the darkness. What am I?','A candle.','Easy','2024-07-10 03:25:20.154635'),(3388,'Dark Riddles','Nick timed himself and found out that if he wore a bright white outfit he ran 20 miles in 80 minutes, but when he wore a dark outfit, he ran 20 miles in one hour and twenty minutes. What does this mean for his next race?','Nothing, as 80 minutes equals an hour and twenty minutes.','Easy','2024-07-10 03:25:20.156016'),(3389,'Dark Riddles','In the light, I may reflect. In the dark, I\'m cold and wet. What am I?','Water.','Medium','2024-07-10 03:25:20.157789'),(3390,'Dark Riddles','From house to house he goes, A messenger small and slight. And whether it rains or snows, He sleeps outside at night. What am I?','A Street or Road.','Hard','2024-07-10 03:25:20.159472'),(3391,'Dark Riddles','Where once there were many, now there are none. Time has done ticking; the hours are done. For now, is an end, but also beginning, For darkest is now, but soon shall be thinning. What is it?','\"Midnight\" - Reasoning: The riddle is all about following something through to the end - a day. Once the day reaches its end, at midnight, when all the hours of the day are gone, right down to the last second, the clock resets. Thus, it marks both the end of a day and the beginning of a new one.','Medium','2024-07-10 03:25:20.160957'),(3392,'Dark Riddles','Stealthy as a shadow in the dead of night, Cunning but affectionate if given a bite. Never owned but often loved. In my','A cat.','Hard','2024-07-10 03:25:20.162443'),(3393,'Dark Riddles','Which is the creature that has one voice, but has four feet in the morning, two feet in the afternoon, and three feet at night?','Man crawls on all fours as a baby, walks on two as an adult, and needs a walking cane when old.','Hard','2024-07-10 03:25:20.164752'),(3394,'Dark Riddles','A glow in the dark, A place without life, Where a small spark, Means the greatest strife. Where am I?','Space.','Hard','2024-07-10 03:25:20.166730'),(3395,'Dark Riddles','One knight, a pregnant lady, and a doctor walk into a hospital, the next morning three people walk out, who was the third person?','The knight.','Medium','2024-07-10 03:25:20.168271'),(3396,'Dark Riddles','Spelled forwards is a type of rodent that you might find in drains, spelled backward is something that you cannot touch but see it every day at night. What is this word?','Rats, star.','Hard','2024-07-10 03:25:20.169889'),(3397,'Dark Riddles','My first is a part of the day, My last a conductor of light, My whole to take the measure of time, Is useful by day and by night. What am I?','An Hour-glass.','Easy','2024-07-10 03:25:20.171628'),(3398,'Dark Riddles','There lived a man in a house and every time he went to bed he turned on the light. One night, the man forgot to turn on the light. The next day he read the paper and killed himself. Why?','The man lived in a lighthouse. He forgot to turn on the light and a ship crashed. The next morning he read in the paper that the ship crashed and killed himself because he felt guilty.','Medium','2024-07-10 03:25:20.173334'),(3399,'Dark Riddles','Which would see most clearly in total darkness? A bat, a tiger, or an owl.','None. In total darkness, it is impossible to see anything.','Medium','2024-07-10 03:25:20.174644'),(3400,'Dark Riddles','The more it is made, the more it is destroyed. The case can\'t be cracked, yet you won\'t be able to avoid it. It can be used for play or just a simple stay. Small, medium, or large, used in both light and in dark. What is it?','A Bed.','Easy','2024-07-10 03:25:20.175980'),(3401,'Dark Riddles','I\'m in Kentucky, with 2 bowls of chili. I stay there for 3 nights. I take a train to Georgia and back peddle to Kansas. Where am I?','Do not know the answer, help! Driving me crazy, and it\'s a short trip.','Easy','2024-07-10 03:25:20.177574'),(3402,'Dark Riddles','My legs are knives. I am a knight. I can reclaim what I lose in a fight. What am I?','A crab.','Hard','2024-07-10 03:25:20.178801'),(3403,'Dark Riddles','What happens only in the middle of each month, in all of the seasons, except summer, and happens only in the night, never in the day?','The letter \'N.\'','Medium','2024-07-10 03:25:20.180169'),(3404,'D