?','The feeling is moo-tual.','Hard','2024-07-10 03:25:20.329619'),(3499,'Duck Riddles','What animal would you get crossed a duck, a beaver, and an otter?','A platypus.','Medium','2024-07-10 03:25:20.331137'),(3500,'Duck Riddles','What do you get when you cross Santa Claus and a duck?','A Christmas quacker.','Easy','2024-07-10 03:25:20.333286'),(3501,'Fire Riddles','I am not alive, but I grow; I don\'t have lungs, but I need air; I don\'t have a mouth, but water kills me. What am I?','Fire.','Hard','2024-07-10 03:25:20.334840'),(3502,'Fire Riddles','I was carried into a dark room, and set on fire. I wept, and then my head was cut off. What am I?','A Candle.','Hard','2024-07-10 03:25:20.336239'),(3503,'Fire Riddles','If a fire hydrant has H2O inside, what does it have on the outside?','K9P (you\'ll get it eventually).','Medium','2024-07-10 03:25:20.337915'),(3504,'Fire Riddles','No legs have I to dance, No lungs have I to breathe, No life have I to live or die And yet I do all three. What am I?','Fire.','Hard','2024-07-10 03:25:20.339436'),(3505,'Fire Riddles','If I eat I live yet if I drink I die. What am I ?','Fire.','Medium','2024-07-10 03:25:20.341089'),(3506,'Fire Riddles','What lives as long as it eats but dies when it drinks?','Fire.','Medium','2024-07-10 03:25:20.342594'),(3507,'Fire Riddles','There are three doors. In each door is a way to die. The first door has fire and lava. The second door has lions that haven\'t eaten in 5 years. In the third door, there is a 1,000-foot drop into alligators. Which door will you likely survive?','The second door with the lions. Since they haven\'t eaten in 5 years they will have died.','Medium','2024-07-10 03:25:20.344049'),(3508,'Fire Riddles','If there is a Yellow house on Bluebird Lane, a Green house on Orange Street, a Pink house on Kitten Road, a Black house on Whitehorse Pike and a Purple house on Firebird hill, where is the White house?','Washington, D.C.','Medium','2024-07-10 03:25:20.345898'),(3509,'Fire Riddles