y','2024-07-10 03:25:20.363105'),(3520,'Fire Riddles','Crimson I am born, yellow I dance, ebony I die. What am I?','Fire.','Hard','2024-07-10 03:25:20.364946'),(3521,'Fire Riddles','I truly am cause for alarm. When you see me you can lose your house or your life. When you hear me you can also lose your job. What am I?','Fire.','Hard','2024-07-10 03:25:20.366585'),(3522,'Fire Riddles','I have a butt, but I\'m not alive. I bring smoke, but am not fire. I destroy, I kill, though I am not used in a war. What am I?','A cigarette.','Medium','2024-07-10 03:25:20.368205'),(3523,'Fire Riddles','Despised I am by knave and liar. After me, the wise inquire, I rise above all death and fire. What am I?','The Truth.','Easy','2024-07-10 03:25:20.369828'),(3524,'Fire Riddles','I am hewn from Earth and Fire; But to the sky, I aspire. I am nothing but contented; Until my patient rage is vented. What am I?','A volcano.','Medium','2024-07-10 03:25:20.371164'),(3525,'Fire Riddles','The ghost of the mountain never to be seen, leaps like a raging fire to catch his prey. As pale as the moon but fast as the wind. Cold as ice, but a flash of light in the night. What is it?','A snow leopard.','Easy','2024-07-10 03:25:20.372951'),(3526,'Fire Riddles','What insect does a blacksmith manufacture?','He makes the firefly.','Easy','2024-07-10 03:25:20.374457'),(3527,'Fire Riddles','A group of men is suddenly awakened by a loud, piercing, continuous sound. They all scramble out of their beds, get dressed, grab a pole, and disappear into a hole. What in the world are these men doing?','The men are firemen who were on night-shift duty at their firehouse. When they heard the fire alarm, they got dressed, slid down the fire pole, and got in the fire truck.','Easy','2024-07-10 03:25:20.375842'),(3528,'Fire Riddles','Fire is often maintained above me, and if you remove my first letter, you will find the home shared by everyone you have ever known. What am I?','A Hearth.','Medium','2024-07-10 03:25:20.377579'),(3529,'Fire Riddles','Why does a firefly glow?','It eats light meals.','Medium','2024-07-10 03:25:20.379150'),(3530,'Fire Riddles','I am energy. I am heat. I am hot. I am red. What am I?','I am fire.','Medium','2024-07-10 03:25:20.380898'),(3531,'Fire Riddles','A group of men are suddenly awakened by a loud, piercing, continuous sound. They all scramble out of their beds, get dressed, grab a pole, and disappear into a hole. What in the world are these men doing?','They are firemen who were sleeping in their fire station. When they heard the fire alarm, they quickly got dressed, slid down the fire pole, and got in the fire engine to head to the reported fire.','Hard','2024-07-10 03:25:20.382615'),(3532,'Fire Riddles','What can be underwater, under fire, on fire and taking water all at the same time?','Submarine. Underwater meaning in water. Under fire meaning getting shot at. On fire meaning burning. Taking water meaning water is flooding into or through something.','Medium','2024-07-10 03:25:20.384213'),(3533,'Fire Riddles','Why did the duck get fired from his Easter job?','He kept quacking the eggs.','Hard','2024-07-10 03:25:20.385766'),(3534,'Fire Riddles','What insect does a blacksmith manufacture?','He makes the firefly.','Easy','2024-07-10 03:25:20.387842'),(3535,'Fire Riddles','I am very important to all living creatures. I was firstborn in the sun. I am a chapter in textbooks and I am not made of fire. I make the sun-worthy. Too much of me may kill you. But humans can still prevent me. What am I?','Heat!','Medium','2024-07-10 03:25:20.389702'),(3536,'Fire Riddles','I can make many people scream yet I can still be seen I make many things grow yet still I can melt the snow. What am I?','I am fire.','Easy','2024-07-10 03:25:20.391385'),(3537,'Fire Riddles','As destructive as life, As healing as death; An institutioner of strife, Just as prone to bless. It is all that is good, Yet with an evil trend; As it was the beginning of things, It can also be the end. What is it?','It is fire!','Medium','2024-07-10 03:25:20.393118'),(3538,'Fire Riddles','In me a gas is confined, Upon my head a pot, And out of me is fire. What I am?','A gas cooker!','Easy','2024-07-10 03:25:20.394692'),(3539,'Fire Riddles','I give you a group of three. One is sitting down, and will never get up. The second eats as much as is given to him, yet is always hungry. The third goes away and never returns. What are the three things?','Stove, fire, and smoke.','Hard','2024-07-10 03:25:20.396255'),(3540,'Fire Riddles','Why is the letter F like an incendiary?','Because it makes ire fire.','Medium','2024-07-10 03:25:20.397727'),(3541,'Fire Riddles','My head and the point are made from same. I am held by what\'s taken apart from the grain. I am atop of a great ocean beast. My swing will let fire and lead release. What am I?','Hammer.','Hard','2024-07-10 03:25:20.399390'),(3542,'Fire Riddles','What did the parrot say on the 4th of July?','\"Poly wants a firecracker!\"','Hard','2024-07-10 03:25:20.401278'),(3543,'Fire Riddles','What did the firecracker say to the other firecracker?','\"My pop is bigger than your pop\".','Hard','2024-07-10 03:25:20.402783'),(3544,'Fire Riddles','Inside a burning house, this thing is best to make. And best to make it quickly, before the fire\'s too much to take! What is it?','Haste!','Hard','2024-07-10 03:25:20.404233'),(3545,'Fire Riddles','The fire shows - my kin, born. The fire grows - my kin, adorn. The fire slows - my kin, deform. The fire goes - my kin, mourn.','Fruit-bearing tree through the four seasons.','Medium','2024-07-10 03:25:20.405885'),(3546,'Fire Riddles','What is dressed when night falls and undressed when day breaks?','Fire.','Easy','2024-07-10 03:25:20.407423'),(3547,'Fire Riddles','When is a ship at sea not on the water?','When she is on fire.','Medium','2024-07-10 03:25:20.408956'),(3548,'Fire Riddles','Name three things that? 1. Are red 2. Can swim 3. Give off heat','Answers may vary. 1. Apples, Roses, Stop Signs 2. Fish, Dogs, Snakes 3. Sun, Fire, Your body','Easy','2024-07-10 03:25:20.410510'),(3549,'Fish Riddles','Two fathers and two sons went fishing one day. They were there the whole day and only caught 3 fish. One father said, that is enough for all of us, we will have one each. How can this be possible?','There was the father, his son, and his son\'s son. This equals 2 fathers and 2 sons for a total of 3!','Easy','2024-07-10 03:25:20.411979'),(3550,'Fish Riddles','I am a word of six; my first three letters refer to an automobile; my last three letters refer to a household animal; my first four letters is a fish; my whole is found in your room. What am I?','A carpet.','Medium','2024-07-10 03:25:20.413585'),(3551,'Fish Riddles','There are two bodies on the floor. They are surrounded by water and broken glass. How did they die?','The bodies were goldfish because their fishbowl got knocked over onto the floor and broke.','Easy','2024-07-10 03:25:20.415604'),(3552,'Fish Riddles','What has cities, but no houses; forests, but no trees; and water, but no fish?','A map.','Hard','2024-07-10 03:25:20.417470'),(3553,'Fish Riddles','If fish lived on land, where would they live?','In Finland.','Easy','2024-07-10 03:25:20.419152'),(3554,'Fish Riddles','What do you call a fish with no eye\'s?','Fsh.','Hard','2024-07-10 03:25:20.420973'),(3555,'Fish Riddles','What does a shark eat with peanut butter?','Jellyfish!','Easy','2024-07-10 03:25:20.422592'),(3556,'Fish Riddles','A big person and a small person are going to fish. The big person is not the small person father but the small person is the big person\'s son. What is the relationship between the two?','The big person is the small person\'s mother.','Easy','2024-07-10 03:25:20.424096'),(3557,'Fish Riddles','If you hadn\'t put me in a bowl, I would have lived for 20 years. What am I?','I\'m your goldfish, you monster.','Medium','2024-07-10 03:25:20.425732'),(3558,'Fish Riddles','Inside napper, bird chaser, quick stoker, small animal killer, fish eater. What is it?','A cat.','Easy','2024-07-10 03:25:20.427150'),(3559,'Fish Riddles','Alive without breath, As cold as death, Never thirsty, Ever drinking, Clad in mail, Never clinking, Drowns on dry land, Thinks an island Is a mountain, Thinks a fountain Is a puff of air. What am I?','A fish.','Hard','2024-07-10 03:25:20.429036'),(3560,'Fish Riddles','10 fish are in a tank. 10 drown. How many died?','None, cause fish can\'t drown.','Hard','2024-07-10 03:25:20.430590'),(3561,'Fish Riddles','Where do fish keep their money?','In the riverbank.','Medium','2024-07-10 03:25:20.432072'),(3562,'Fish Riddles','There were two mothers and two daughters,and they all went fishing. All of them caught a fish but when they counted there were only three fish. How was this possible?','There were only three because there was a grandmother a mother and a daughter. The mother was the daughter to the grandmother and she was the mother to the mother and the daughter was the daughter to the mother.','Easy','2024-07-10 03:25:20.433810'),(3563,'Fish Riddles','Why are some fish at the bottom of the ocean?','Because they dropped out of school!','Hard','2024-07-10 03:25:20.435443'),(3564,'Fish Riddles','Why are fish so clever?','They live in schools.','Hard','2024-07-10 03:25:20.437250'),(3565,'Fish Riddles','If you have nine fish in a fish bowl and 3 drown how many fish do you have left?','Nine because fish don\'t drown.','Hard','2024-07-10 03:25:20.438827'),(3566,'Fish Riddles','1. Where do fish go on vacation? 2. Where do songbirds go on vacation? 3. Where do zombies go on vacation? 4. Where do Thanksgiving Birds go on vacation? 5. Where do geometry teachers go on vacation? 6. Where do locksmiths go on vacation?','1. Finland 2. The Canary Islands 3. The Dead Sea 4. Turkey 5. Cuba 6. The Florida Keys','Easy','2024-07-10 03:25:20.440329'),(3567,'Fish Riddles','A grandfather, a father, and a son go fishing. Each gets one fish but there is only one fish how is this?','It is only one person. He is a son of his father, he is a father to his son and he is a grandfather to his grandchild.','Medium','2024-07-10 03:25:20.442256'),(3568,'Fish Riddles','I\'m first found in caves, now prolific online; I\'m a depiction, a drawing, a symbol, or a sign. I\'ll convey whichever mood you could wish; or for that matter, a fist, flask, or fish. What am I?','An emoji.','Hard','2024-07-10 03:25:20.444433'),(3569,'Fish Riddles','Where do fish go for vacation?','Finland.','Easy','2024-07-10 03:25:20.446501'),(3570,'Fish Riddles','Where do jellyfish sleep?','In tent-acles.','Easy','2024-07-10 03:25:20.448232'),(3571,'Fish Riddles','What do sea monsters eat for lunch?','Fish and ships.','Easy','2024-07-10 03:25:20.449960'),(3572,'Fish Riddles','There were seven fish in the sea. Two drowned and three swam away. How many are left?','Four because fish can\'t drown.','Easy','2024-07-10 03:25:20.451237'),(3573,'Fish Riddles','Martha and George died, there was glass and water all around but, no blood. How did they die?','They were fish.','Medium','2024-07-10 03:25:20.452802'),(3574,'Fish Riddles','Forward I catch fish, backward I am the tenth of numbers. What am I?','Net.','Easy','2024-07-10 03:25:20.454326'),(3575,'Fish Riddles','Why are fish so good at watching their weight?','Because they have lots of scales.','Medium','2024-07-10 03:25:20.455833'),(3576,'Fish Riddles','What did the cowboy go fishing with a lasso?','To catch a Bull Shark or maybe some Sea Horses.','Easy','2024-07-10 03:25:20.457562'),(3577,'Fish Riddles','Larry is dead the window is open. There is a glass and water on the floor, and Mary is sleeping. What happened??','Larry is a fish. the breeze from the window knocked over his fishbowl it broke and he died from no water.','Medium','2024-07-10 03:25:20.459159'),(3578,'Fish Riddles','Why wouldn\'t the shrimp share his treasure?','Because he was a little shellfish.','Easy','2024-07-10 03:25:20.460948'),(3579,'Fish Riddles','What do you call a classy fish?','Sofishsticated.','Hard','2024-07-10 03:25:20.462563'),(3580,'Fish Riddles','What musical instrument would you use to catch a fish?','Castanets.','Easy','2024-07-10 03:25:20.464298'),(3581,'Fish Riddles','There is an old abandoned house, there are six fish, and three die. How many are left?','Six no one cleaned the tank out. You probably said three.','Easy','2024-07-10 03:25:20.466189'),(3582,'Fish Riddles','A professional fisherman caught 30 fish during a 5-day tournament. Each day, he caught three more fish than the day before. How many fish did the fisherman catch on the first day?','He didn\'t catch any fish the first day, but he caught 3 on the second day, 6 on the third day, 9 on the fourth day, and 12 on the fifth day.','Medium','2024-07-10 03:25:20.467730'),(3583,'Fish Riddles','There once was an abandoned hotel with a fish bowl on the third floor. In the fishbowl, there were 3 big fish and 5 little fish. 2 of the big fish died and 3 little fish died. How many fish are left in the bowl?','8 fish (3 big fish and 5 small fish) because it is an ABANDONED hotel which means there are no cleaners to clean the fish out of the bowl so all of the fish are still in the fish bowl.','Hard','2024-07-10 03:25:20.469393'),(3584,'Fish Riddles','Hold the tail, While I fish for you. What am I?','A net.','Easy','2024-07-10 03:25:20.470856'),(3585,'Fish Riddles','Part carbon, part water, I am poison to the fishes. Many have falsely claimed my name, for I am the pause that refreshes. What am I?','I am Soda Pop!','Medium','2024-07-10 03:25:20.472796'),(3586,'Fish Riddles','Why shouldn\'t you eat a French fish?','It\'s \"poisson\".','Hard','2024-07-10 03:25:20.474523'),(3587,'Fish Riddles','How do fish communicate?','With a shell-phone.','Medium','2024-07-10 03:25:20.476049'),(3588,'Fish Riddles','If you eat me, my sender will eat you. What am I?','A Fish Hook.','Easy','2024-07-10 03:25:20.477776'),(3589,'Fish Riddles','Why does footwear smell of fish?','Maybe, it is the soles and (h) eels.','Easy','2024-07-10 03:25:20.479355'),(3590,'Fish Riddles','I am in Time, and I am in Tie. I am in FIsh, I am also sometimes the only one. What Am I?','The Letter i. The letter I is in every word it is in \"I am in time, and I am in tIe, I am in fIsh,\" The letter I can also be alone in A Sentence. Example: Well, I can be alone!','Hard','2024-07-10 03:25:20.480952'),(3591,'Fish Riddles','When the below was jerking, the above was preferring. When the below was hurting, the above was happy rejoicing. What is that?','That is fishing.','Medium','2024-07-10 03:25:20.482556'),(3592,'Fish Riddles','What animal is it the hardest to have a staring contest with?','A fish. They cannot blink!','Medium','2024-07-10 03:25:20.484127'),(3593,'Fish Riddles','What do you call a magic fish?','A sardini!','Hard','2024-07-10 03:25:20.485864'),(3594,'Fish Riddles','What can someone do that a fish has?','Scale.','Medium','2024-07-10 03:25:20.487445'),(3595,'Fish Riddles','Name three types of fish that one can never catch?','Selfish, wolfish, and huffish.','Hard','2024-07-10 03:25:20.489062'),(3596,'Fish Riddles','What do kids, worms, bears, fish, and rings all have in common?','They are GUMMIES!','Medium','2024-07-10 03:25:20.490629'),(3597,'Fish Riddles','Why ought a fisherman to be very wealthy?','Because he is all','Easy','2024-07-10 03:25:20.492340'),(3598,'Fish Riddles','Slippery, wet and greasy, when it\'s in its easy, when it\'s out it jumps about, slippery wet, and greasy. What am I?','A Fish.','Medium','2024-07-10 03:25:20.494168'),(3599,'Fish Riddles','I am the symbol of prying and meddling, for I smell fish that is worth a roundabout fish to fry. What am I?','A nose.','Easy','2024-07-10 03:25:20.496045'),(3600,'Fish Riddles','A pro fisherman decided to become a pro golfer. In order to buy his clubs, he had to sell his boat. How did he list it?','Fore Sail!','Easy','2024-07-10 03:25:20.498200'),(3601,'Fish Riddles','Cleopatra and Anthony were near a fish b