ng children cry, it means they are crying for a turn to write the answer and the defeaters are the erasers)','Hard','2024-07-10 03:25:20.822124'),(3804,'Horror Riddles','There is a man standing on top of a mountain frozen holding a piece of straw. How did he get there?','He was with his friend in a hot-air balloon when they were about to hit a mountain so they took off their clothes to make it lighter so they would go higher it wasn\'t working so they drew straws and whoever had the shortest straw would have to jump out so he was the one who picked the shortest straw.','Hard','2024-07-10 03:25:20.824312'),(3805,'Kitchen Riddles','You have three stoves: a gas stove, a wood stove, and a coal stove, but only one match. Which should you light first?','The match!','Easy','2024-07-10 03:25:20.825863'),(3806,'Kitchen Riddles','Which is the only way a leopard can change his spots?','By going from one spot to another.','Medium','2024-07-10 03:25:20.827122'),(3807,'Kitchen Riddles','If it takes 5 microwaves 5 minutes to cook 5 chickens, how long does it take 100 microwaves to cook 100 chickens?','5 minutes. We can assume that one chicken is placed in each microwave and that each chicken takes 5 minutes to cook.','Hard','2024-07-10 03:25:20.828764'),(3808,'Kitchen Riddles','If you put roast in a roaster, what do you put in toaster?','Bread.','Hard','2024-07-10 03:25:20.830014'),(3809,'Kitchen Riddles','Double my number, I\'m less than a score, and half of my number is less than four. Add one to my double when bakers are near, days of the week are still greater, I fear. What am I?','The number six.','Hard','2024-07-10 03:25:20.831094'),(3810,'Kitchen Riddles','Why did the outlaw hold up the bakery?','He kneaded the dough.','Medium','2024-07-10 03:25:20.832554'),(3811,'Kitchen Riddles','What kind of garden does a baker have?','A flour garden!','Hard','2024-07-10 03:25:20.833949'),(3812,'Kitchen Riddles','I have a short, wide body. It is cold and shiny. My insides are hot as flam