ight. What is it?','A snow leopard.','Easy','2024-07-10 03:25:20.939372'),(3873,'Monster Riddles','What business is King Kong in?','The Monkey Business.','Hard','2024-07-10 03:25:20.941043'),(3874,'Monster Riddles','What is a vampire\'s favorite fruit?','A neck-tarine!','Easy','2024-07-10 03:25:20.942347'),(3875,'Monster Riddles','How do monsters like their eggs?','Terri-Fried.','Hard','2024-07-10 03:25:20.943675'),(3876,'Monster Riddles','My first is twice in apple but not once in tart. My second is in liver but not in heart. My third is in giant and also in ghost. Whole I\'m best when I am roast. What am I?','The word Pig.','Hard','2024-07-10 03:25:20.945876'),(3877,'Monster Riddles','What time is it when you see the monster?','Time to run.','Medium','2024-07-10 03:25:20.947248'),(3878,'Monster Riddles','What is a ghost\'s favorite pepper?','A ghost pepper.','Hard','2024-07-10 03:25:20.949023'),(3879,'Monster Riddles','What did the ghost eat for breakfast?','Dreaded-Wheats.','Hard','2024-07-10 03:25:20.950409'),(3880,'Monster Riddles','What kind of drinks do aliens like best?','Gravi-tea.','Medium','2024-07-10 03:25:20.951815'),(3881,'Monster Riddles','What is a vampire\'s favorite car to drive in?','A bloodmobile?','Medium','2024-07-10 03:25:20.953740'),(3882,'Monster Riddles','A ghost was painting a picture. What did he paint on his picture?','A picture!','Easy','2024-07-10 03:25:20.955305'),(3883,'Monster Riddles','When I looked At the lake, I saw my reflection, yet I disappear from every picture I take. What am I?','A ghost.','Easy','2024-07-10 03:25:20.957092'),(3884,'Monster Riddles','What was written on Frankenstein\'s monster\'s grave?','\"Rust in peace.\"','Hard','2024-07-10 03:25:20.958685'),(3885,'Monster Riddles','What do you call a ghost who ran out of toilet paper?','Sheet out of luck!','Easy','2024-07-10 03:25:20.960153'),(3886,'Monster Riddles','My hair is blue and pink, I am human, I am daddy\'s Lil monster. Who am I?','Harley Quinn.','Medium','20