d Frankenstein\'s monster get indigestion?','He bolted down his food.','Medium','2024-07-10 03:25:20.987682'),(3900,'Monster Riddles','What do you call an out-of-work Ghost?','Lazy Bones.','Easy','2024-07-10 03:25:20.990171'),(3901,'Monster Riddles','Why did the game warden arrest the ghost?','He did not have a current haunting license.','Hard','2024-07-10 03:25:20.992157'),(3902,'Mummy Riddles','Why do mummies like','Because of all the wrapping.','Easy','2024-07-10 03:25:20.994299'),(3903,'Mummy Riddles','Why didn\'t the Mummy have any friends?','He was too wrapped up in himself.','Hard','2024-07-10 03:25:20.996219'),(3904,'Mummy Riddles','What type of music is a mummy\'s favorite?','Wrap.','Hard','2024-07-10 03:25:20.998389'),(3905,'Mummy Riddles','How do mummies hide?','They wear masking tape.','Easy','2024-07-10 03:25:21.000356'),(3906,'Mummy Riddles','There\'s a land where there are mummies and daddies but no babies. Books but no libraries. Mirrors but no reflections. Kittens but no cats. Cattle but no cows. Lollipops but no candy and trees but no forests. It\'s the land of what?','The land of double letters.','Easy','2024-07-10 03:25:21.002366'),(3907,'Mummy Riddles','What is a mummy\'s favorite type of paper?','WRAP-ing paper','Easy','2024-07-10 03:25:21.004281'),(3908,'Murder Riddles','I am not alive, but I grow; I don\'t have lungs, but I need air; I don\'t have a mouth, but water kills me. What am I?','Fire.','Easy','2024-07-10 03:25:21.006075'),(3909,'Murder Riddles','Always in you, Sometimes on you; If I surround you, I can kill you. What am I?','Water.','Easy','2024-07-10 03:25:21.007847'),(3910,'Murder Riddles','It can\'t be seen, can\'t be felt, can\'t be heard, and can\'t be smelt. It lies behind stars and under hills, And empty holes it fills. It comes first and follows after, Ends life, and kills laughter. What is it?','The dark.','Hard','2024-07-10 03:25:21.009831'),(3911,'Murder Riddles','Why did Snap, Crackle, and Pop get scared?','They heard there was a cereal killer on the loose.','Easy','2024-07-10 03:25:21.011559'),(3912,'Murder Riddles','There is a brother and a sister. The boy wants to visit his father in jail, and the sister wants to visit her mother in the hospital. But they both are not allowed in jail or hospital. All they have is a gun. What do they do?','The boy shoots the girl, and then the boy goes to jail for attempted murder and the girl goes to the hospital due to her injuries.','Hard','2024-07-10 03:25:21.013323'),(3913,'Murder Riddles','What kind of candy would a prisoner want before he is executed?','A Life Saver.','Hard','2024-07-10 03:25:21.015827'),(3914,'Murder Riddles','There was a man who was born before his father, killed his mother, and married his sister. Yet, there was nothing wrong with what he had done. Why?','His father was in front of him when he was born, therefore he was born before him. His mother died while giving birth to him. Finally, he grew up to be a minister and married his sister at her ceremony.','Easy','2024-07-10 03:25:21.018106'),(3915,'Murder Riddles','There is a clerk at the butcher shop, he is five feet ten inches tall, and he wears size 13 sneakers. He has a wife and 2 kids. What does he weigh?','Meat.','Easy','2024-07-10 03:25:21.020324'),(3916,'Murder Riddles','A woman is at her mother\'s funeral when suddenly she sees a man so handsome, that she instantly falls in love with her. Unfortunately, she never got a chance to talk to the man. The next day, the woman kills her sister. What was the motive?','The woman was hoping to see the man again. If you got this correct on the first try, you have the mind of a psychopath.','Easy','2024-07-10 03:25:21.022461'),(3917,'Murder Riddles','What hired killer never goes to jail?','An exterminator.','Hard','2024-07-10 03:25:21.024614'),(3918,'Murder Riddles','A thousand colored folds stretch toward the sky, Atop a tender strand, Rising from the land, \'Til killed by maiden\'s hand, Perhaps a token of love, perhaps to say goodbye. What am I?','A flower.','Easy','2024-07-10 03:25:21.026303'),(3919,'Murder Riddles','I am a rock group that has 4 members, all of whom are dead, one of which was assassinated. What am I?','Mount Rushmore.? Get it, rock group?','Medium','2024-07-10 03:25:21.027867'),(3920,'Murder Riddles','Something that requires our mental skill to decode it, our imagination to understand it, our knowledge is tested to its max, it confuses us at every stage, it seems easy yet difficult, only those who are used to, will get through. What is it?','A riddle.','Easy','2024-07-10 03:25:21.029846'),(3921,'Murder Riddles','Every month someone dies, and there are five suspects. The suspects are, Jason, Lily, Nathan, Elizabeth, and Erin, and the months of the murders are July, August, September, October, and November. Who\'s the murderer?','Jason. J, July. A, August. S, September. O, October. N, November.','Medium','2024-07-10 03:25:21.031902'),(3922,'Murder Riddles','Inside napper, bird chaser, quick stoker, small animal killer, fish eater. What is it?','A cat.','Medium','2024-07-10 03:25:21.034869'),(3923,'Murder Riddles','What kills you inside the more you keep it and sets you free the moment you release it?','Guilt.','Hard','2024-07-10 03:25:21.037458'),(3924,'Murder Riddles','I wear you down, yet you\'ll mourn me once I fly. You can kill me, but I will never die. What am I?','Time.','Easy','2024-07-10 03:25:21.039905'),(3925,'Murder Riddles','A man moved into a new house and decided he was tired after the journey and turned off all the lights and went to bed. The next morning he had killed 365 people how could this be? he does not sleep walk he slept like a baby','he lived in a lighthouse','Medium','2024-07-10 03:25:21.042856'),(3926,'Murder Riddles','What word is a fun word until you add one letter and it becomes a terrible word that no one wants to happen?','Laughter: If you add an \'S\' to the begging of laughter it becomes slaughter.','Hard','2024-07-10 03:25:21.045605'),(3927,'Murder Riddles','A plane crashed and every single person on board this flight was killed, yet, there were survivors. Can you explain how?','The married people lived; the singles died.','Easy','2024-07-10 03:25:21.047821'),(3928,'Murder Riddles','You are sitting at a table eating lunch and there are ten flies on the table. With a quick swat, you are able to kill three flies. How many flies are left on the table?','You killed three flies that remain on the table.? The others flew off when you swatted.','Medium','2024-07-10 03:25:21.049794'),(3929,'Murder Riddles','I have a butt, but I\'m not alive. I bring smoke but am not fire. I destroy, I kill, though I am not used in a war. What am I?','A cigarette.','Medium','2024-07-10 03:25:21.052308'),(3930,'Murder Riddles','I eat animals but I don\'t hunt or kill. What am I?','A vulture.','Medium','2024-07-10 03:25:21.054279'),(3931,'Murder Riddles','When I move, I tip the scales. I am the source of many tales. Around your foot, a sign of wealth. Around a stick, a sign of health. Around your chest, your final breath. On your neck, say hi to death. What am I?','A snake. Snake scales. Snake Tail and snakes are usually the antagonists. Snakeskin is very expensive. Snakes on a stick are almost always seen in hospitals. Constrictors squeeze the life out of you. A poisonous snakebite on your neck would kill you extremely fast.','Hard','2024-07-10 03:25:21.055981'),(3932,'Murder Riddles','Why did the man shoot the clock?','He was','Hard','2024-07-10 03:25:21.057609'),(3933,'Murder Riddles','I am both a killer and a savior, it depends on those who wield me. I will bring you from deep water to the shallows, or maybe I could be the one who will hang you on the gallows. What am I?','A rope.','Medium','2024-07-10 03:25:21.059429'),(3934,'Murder Riddles','I want everything within sight. The impossible will not flee my plight. I will take it all by any means. To have is my heart\'s very need. A bottomless pit that nothing will fill. I have even led humans to kill. What am I?','Greed.','Medium','2024-07-10 03:25:21.061469'),(3935,'Murder Riddles','I am boneless, small, and weak, yet can crush and kill; the speed of what comes out of me outstrips the steed. My great storehouse is your heart. Keep me to keep your soul from troubles. What am I?','Your tongue!','Medium','2024-07-10 03:25:21.063238'),(3936,'Murder Riddles','An excess of individuals skilled in the preparation of edibles impairs the quality of this soup. What is the proverb?','Too many cooks spoil the broth.','Hard','2024-07-10 03:25:21.065649'),(3937,'Murder Riddles','Why was the clock arrested?','For killing time.','Hard','2024-07-10 03:25:21.067615'),(3938,'Murder Riddles','I\'m a killing machine used again and again; I bend a little, but way less than my friend; For many years I was number one, But I\'ve been replaced by my modern son. What am I?','Arrow','Hard','2024-07-10 03:25:21.069578'),(3939,'Murder Riddles','What is a cereal\'s worst fear?','A cereal killer.','Hard','2024-07-10 03:25:21.071382'),(3940,'Murder Riddles','I am very important to all living creatures. I was firstborn in the sun. I am a chapter in textbooks and I am not made of fire. I make the sun-worthy. Too much of me may kill you. But humans can still prevent me. What am I?','Heat!','Easy','2024-07-10 03:25:21.073241'),(3941,'Murder Riddles','There lived a man in a house and every time he went to bed he turned on the light. One night, the man forgot to turn on the light. The next day he read the paper and killed himself. Why?','The man lived in a lighthouse. He forgot to turn on the light and a ship crashed. The next morning he read in the paper that the ship crashed and killed himself because he felt guilty.','Medium','2024-07-10 03:25:21.075092'),(3942,'Murder Riddles','I kill people when you need me to, I am not accepted and illegal, I need to be refilled from time to time and I can harm my owner. What am I?','A gun.','Medium','2024-07-10 03:25:21.077096'),(3943,'Murder Riddles','A man is found dead at the end of an alley. A detective who enters the scene sees the letter X and immediately knows who killed the man and why. How did the detective know?','This was a bowling alley, and the man who died was a pin spotter. A player had a strike and was to bowl again, but he bowled too soon before the pin spotter was clear. The X is on the score sheet and this tells the detective the name of the bowler.','Hard','2024-07-10 03:25:21.078941'),(3944,'Murder Riddles','I am brave but, wear the thing I used to fear most, I am bold, but not willing to kill. Who am I?','Batman.','Hard','2024-07-10 03:25:21.081074'),(3945,'Murder Riddles','A color is seen on a stoplight, an item you use to eliminate the darkness. What comic book character is it?','Green Lantern.','Easy','2024-07-10 03:25:21.082794'),(3946,'Murder Riddles','I am as small as a beetle, as annoying as a fly, and I like to kill trees, what am I?','A Lantern Fly! (Also stop stealing my riddles, Berries, the LearnyVerse Wizard from Pyranic)','Hard','2024-07-10 03:25:21.084431'),(3947,'Murder Riddles','Endlessly, I hunger, Lazily, I sleep. Murderous, I thunder, Desires, I do seek. Hoarding countless treasures, so my stature I retain, Envious of others whose feet on Earth remain. What am I?','\"The Seven Deadly Sins\" - Reasoning: Each sentence structure portrays one of the seven deadly sins from Christian theology, with the exception of the final 5 words. In order according to the riddle, these are; gluttony, sloth, wrath, lust, greed, pride, and envy. The final 5 words, \"whose feet on Earth remain\", act in conjunction with the section on envy, demonstrating the perspective of a sinner in hell, who is envious of those still alive, and thus can still repent for their sins in order to enter Heaven.','Easy','2024-07-10 03:25:21.086158'),(3948,'Murder Riddles','What dies but is never killed?','A bad joke.','Hard','2024-07-10 03:25:21.088253'),(3949,'Murder Riddles','A parl