tongued, but never lie. double-winged, but never fly, air-cooled, but never dry. What am I?','Mercury. The element looks shiny, silver, and wet. The god Mercury has two wings but only uses them to run.','Hard','2024-07-10 03:25:21.530508'),(4189,'Religion Riddles','Priest-tied guitar. What is the anagrammed word?','Prestidigitateur.','Easy','2024-07-10 03:25:21.533153'),(4190,'Religion Riddles','In this place, people lie, people cry, and people ask why. In this place, people sleep, people, weep, and people\'s solitude, they keep. What is it?','\"Graveyard\" or \"Cemetery\" - Reasoning: Both \"people lie\" and \"people sleep\" are indications of many people using this place to lie down, or to sleep, which in itself is an odd thought. Crying and weeping indicate that this is a sad place, and the continued use of \"people\" allows this to mean not just those who are lying down or sleeping, but those who come to visit them there, (i.e. mourners). People come to ask the person\'s grave why they did what they did that resulted in their death, as a form of mourning, or to ask their chosen God or Gods why they took that person to their grave. And peoples solitude refers to people sleeping on their own, or the mourners usually coming the mourn privately.','Easy','2024-07-10 03:25:21.535104'),(4191,'Religion Riddles','Why couldn\'t the church steeple keep a secret?','Because the bell always tolled.','Hard','2024-07-10 03:25:21.537295'),(4192,'Religion Riddles','The rich want it, but the poor have it, god takes it, satin gives it?','nothing','Hard','2024-07-10 03:25:21.539348'),(4193,'Religion Riddles','I\'m greater than God, yet worse than the devil. I am what the miser spends and the spendthrift saves. I am what the blind see and the paralyzed hold. What am I?','Nothing.','Medium','2024-07-10 03:25:21.541487'),(4194,'Religion Riddles','What do you call a priest riding a cycle?','A cyclist.','Medium','2024-07-10 03:25:21.543561'),(4195,'Religion Riddles','I am a holiday, of course, celebrated in December, I am celebrated until New Year, People who celebrate me are considered Evil by many Religions, what am I?','I am Yule!','Medium','2024-07-10 03:25:21.545821'),(4196,'Religion Riddles','What Jewish king a leper died?','Uzziah��2 Chron. xxvi. 21.','Hard','2024-07-10 03:25:21.548108'),(4197,'Religion Riddles','Endlessly, I hunger, Lazily, I sleep. Murderous, I thunder, Desires, I do seek. Hoarding countless treasures, so my stature I retain, Envious of others whose feet on Earth remain. What am I?','\"The Seven Deadly Sins\" - Reasoning: Each sentence structure portrays one of the seven deadly sins from Christian theology, with the exception of the final 5 words. In order according to the riddle, these are; gluttony, sloth, wrath, lust, greed, pride, and envy. The final 5 words, \"whose feet on Earth remain\", act in conjunction with the section on envy, demonstrating the perspective of a sinner in hell, who is envious of those still alive, and thus can still repent for their sins in order to enter Heaven.','Hard','2024-07-10 03:25:21.550526'),(4198,'Religion Riddles','First is the last. Last is the first. You are in the middle. What am I?','CH UR CH CHURCH.','Medium','2024-07-10 03:25:21.552788'),(4199,'Religion Riddles','On which side of a church is the graveyard always situated?','On the outside, of course.','Easy','2024-07-10 03:25:21.554762'),(4200,'Religion Riddles','Why is orange not like a church bell?','Because it is never peeled (pealed) but once.','Easy','2024-07-10 03:25:21.556567'),(4201,'Religion Riddles','My love\'s the type of thing you have to earn, but when you earn it, you won\'t need it. Who am I?','God. Credit: Bo Burnham, Musical Comedian, Song title- \"God\'s Perspective\".','Medium','2024-07-10 03:25:21.558289'),(4202,'Religion Riddles','Gods\' arrows cannot be counted. What are they?','Rain.','Hard','2024-07-10 03:25:21.560252'),(4203,'Religion Riddles','A woman who lives in new york legally married three men, she did not get divorced, get an enrollment, or is legally separated. How is this possible?','She is a minister.','Easy','2024-07-10 03:25:21.562182'),(4204,'Religion Riddles','There were five men going to church and it started to rain. The four that ran got wet and the one that stood still stayed dry. How did the one stay dry?','It was a body in a coffin with the bearers.','Easy','2024-07-10 03:25:21.565259'),(4205,'Religion Riddles','Read my riddle, I pray. What God never sees, what the king seldom sees, and what we see every day. What is it?','An equal.','Hard','2024-07-10 03:25:21.567274'),(4206,'Riddle Books','What did one math book say to the other math book?','Do you want to hear my problems?','Medium','2024-07-10 03:25:21.569439'),(4207,'Riddle Books','Where do bedtime books sleep?','Under their covers.','Easy','2024-07-10 03:25:21.571339'),(4208,'Riddle Books','What English word has three consecutive double letters?','Bookkeeper.','Medium','2024-07-10 03:25:21.573517'),(4209,'Riddle Books','What building has the most stories?','The library.','Medium','2024-07-10 03:25:21.575651'),(4210,'Riddle Books','A teacher is yelling, she closes the door, the window, and a book. What did she forget to close?','Her mouth.','Medium','2024-07-10 03:25:21.578055'),(4211,'Riddle Books','My life is often a volume of grief, your help is needed to turn a new leaf. Stiff is my spine and my body is pale, but I\'m always ready to tell a tale. What am I?','A book!','Easy','2024-07-10 03:25:21.579968'),(4212,'Riddle Books','What has a spine, but no bones?','A book.','Medium','2024-07-10 03:25:21.582010'),(4213,'Riddle Books','I am the shell of something interesting. My front is very eye-catching but my inside tells all. What am I?','A Book.','Medium','2024-07-10 03:25:21.583948'),(4214,'Riddle Books','What did one math book say to another?','I have so many problems.','Easy','2024-07-10 03:25:21.585648'),(4215,'Riddle Books','My numbers may vary, thin as a sheet, take one away, and we\