er than a cloudless sky?','Light. These objects have different colors. But they differ from the standard, which is contained in the light spectrum.','Medium','2024-07-10 03:25:21.715122'),(4289,'Season Riddles','An abundance in arms, but lacking in legs. A tall skinny body, but missing a head. I change with the seasons, it\'s winter I dread. What am I?','A Tree.','Hard','2024-07-10 03:25:21.717087'),(4290,'Season Riddles','A woman went to Virginia to get a job. She promised her mother she would come back and visit sometime. Then, in the middle of winter, her mother shouted, \"April is here!\". How is this possible?','The woman\'s name is April.','Medium','2024-07-10 03:25:21.718814'),(4291,'Season Riddles','Walk on the living, they don\'t even mumble. Walk on the dead, they mutter and grumble. What are they?','Fallen leaves.','Hard','2024-07-10 03:25:21.720582'),(4292,'Season Riddles','What lives in winter, dies in summer, and grows with its roots upward?','An icicle.','Easy','2024-07-10 03:25:21.722201'),(4293,'Season Riddles','In what year did Christmas Day and New Year\'s Day fall in the same year?','It happens every year.','Hard','2024-07-10 03:25:21.723629'),(4294,'Season Riddles','Upside-down or on its side, this merry-go-round Is quite a ride. In the summer heat, It is quite a treat with blades so dull, that they will not slice. It spins too fast, for your sight. What is this ride?','A motorized fan.','Easy','2024-07-10 03:25:21.725355'),(4295,'Season Riddles','You are falling out of a window. What season is it?','Fall.','Hard','2024-07-10 03:25:21.727719'),(4296,'Season Riddles','David\'s birthday is in December, but it is never in the winter. Why?','He lives in Australia (or any other country that has December in summer)','Easy','2024-07-10 03:25:21.729684'),(4297,'Season Riddles','A man is in a room and the door is locked so he can\'t get out. He has with him a piano, a calendar, and a bed. How does he eat, drink, and get out?','He uses the dates from the 