he fire goes - my kin, mourn.','Fruit-bearing tree through the four seasons.','Easy','2024-07-10 03:25:21.742893'),(4305,'Season Riddles','Why are trees in winter like troublesome visitors?','Because it\'s a long time before they leave.','Easy','2024-07-10 03:25:21.744444'),(4306,'Season Riddles','What is another name for the season of fall?','Autumn.','Easy','2024-07-10 03:25:21.746005'),(4307,'Season Riddles','How far is it from March to June?','A single spring.','Hard','2024-07-10 03:25:21.747513'),(4308,'Sister Riddles','There is a brother and a sister. The boy wants to visit his father in jail, and the sister wants to visit her mother in the hospital. But they both are not allowed in jail or hospital. All they have is a gun. What do they do?','The boy shoots the girl, and then the boy goes to jail for attempted murder and the girl goes to the hospital due to her injuries.','Hard','2024-07-10 03:25:21.749048'),(4309,'Sister Riddles','Tom and his younger sister were fighting. Their mother was tired of the fighting and decided to punish them by making them stand on the same piece of newspaper in such a way that they couldn\'t touch each other. How did she accomplish this?','Tom\'s mother slid a newspaper under a door, each sibling standing on each side.','Medium','2024-07-10 03:25:21.750689'),(4310,'Sister Riddles','Can a man legally marry his widow\'s sister in the state of California?','NO since she is a \'widow\', the guy\'s dead!','Hard','2024-07-10 03:25:21.752847'),(4311,'Sister Riddles','There was a man who was born before his father, killed his mother, and married his sister. Yet, there was nothing wrong with what he had done. Why?','His father was in front of him when he was born, therefore he was born before him. His mother died while giving birth to him. Finally, he grew up to be a minister and married his sister at her ceremony.','Easy','2024-07-10 03:25:21.755017'),(4312,'Sister Riddles','If your uncle\'s sister is not your aunt, what relation is she 