ns. I\'m found in the paws of playful kittens. What am I?','Yarn.','Medium','2024-07-10 03:25:21.791847'),(4332,'cat-riddles','All of Mrs. Smith\'s pets are dogs except one, and all her pets are cats except one. How many cats and dogs does she have?','Mrs. Smith has one cat and one dog.','Hard','2024-07-10 03:25:21.793667'),(4333,'cat-riddles','What\'s 3/7 chicken, 2/3 cat, and 2/4 goat?','Chicago. The first three words out of seven of chicken is CHI, the first two words out of 3 of cat is CA, and the first two words out of goat is GO. Therefore making, (CHI)(CA)(GO).','Easy','2024-07-10 03:25:21.795539'),(4334,'cat-riddles','What happens after it rains cats and dogs?','You step in a poodle.','Medium','2024-07-10 03:25:21.797984'),(4335,'cat-riddles','What do you get when you cross a black cat and a lemon?','A Sour Puss.','Hard','2024-07-10 03:25:21.800720'),(4336,'cat-riddles','If there is a Yellow house on Bluebird Lane, a Green house on Orange Street, a Pink house on Kitten Road, a Black house on Whitehorse Pike and a Purple house on Firebird hill, where is the White house?','Washington, D.C.','Easy','2024-07-10 03:25:21.803121'),(4337,'cat-riddles','Inside napper, bird chaser, quick stoker, small animal killer, fish eater. What is it?','A cat.','Medium','2024-07-10 03:25:21.805608'),(4338,'cat-riddles','10 copycats were sitting in a car. One came out. How many are left?','None( as they were copycats they copied each other).','Easy','2024-07-10 03:25:21.807836'),(4339,'cat-riddles','What word doesn\'t belong in this group? That, hat, what, mat, cat, sat, pat, or chat?','What. It\'s pronounced differently; all of the others rhyme.','Hard','2024-07-10 03:25:21.810180'),(4340,'cat-riddles','Where did the cat go after losing its tail?','To the re-tail store.','Medium','2024-07-10 03:25:21.812612'),(4341,'cat-riddles','If three cats catch three mice in three minutes, how many cats would be needed to catch 100 mice in 100 minutes?','The same three cats would do. Since 