y could die of dehydration within a few hours. Why?','Birds, unlike humans, need gravity to swallow. Humans can swallow even while hanging upside down.','Easy','2024-07-10 03:25:27.825238'),(4627,'Bird Riddles','What are the freedom of birds and the pen of old men?','Feathers. Feathers make up a bird\'s wings, giving it flight or freedom. Quill pens were used by men in older times.','Hard','2024-07-10 03:25:27.827225'),(4628,'Bird Riddles','What do you get when you cross Santa Claus and a duck?','A Christmas quacker.','Hard','2024-07-10 03:25:27.829332'),(4629,'Bird Riddles','Why don\'t chickens play baseball?','Because they hit fowl balls.','Hard','2024-07-10 03:25:27.831078'),(4630,'Bird Riddles','Why did the chicken cross the playground?','To get to the other slide!','Easy','2024-07-10 03:25:27.833046'),(4631,'Bird Riddles','In what place did the rooster crow when all the world heard him?','In Noah\'s Ark.','Medium','2024-07-10 03:25:27.834671'),(4632,'Bird Riddles','A bird has a head 9cm long. The tail is equal to the size of the head plus half of the size of the body. The body is the size of the head plus the tail. How long is the bird?','72cm. Th head is 9cm. The tail is 18 + 9= 27cm. The body is 9 + 18 + 9= 36cm. 9 + 27 + 36= 72cm.','Hard','2024-07-10 03:25:27.836357'),(4633,'Bird Riddles','A large truck is crossing a bridge 1 mile long. The bridge can only hold 14000 lbs, which is the exact weight of the truck. The truck makes it halfway across the bridge and stops. A bird lands on the truck. Does the bridge collapse?','No, it does not collapse. Because it has driven a half-mile - you would subtract the gas used from the total weight of the truck.','Medium','2024-07-10 03:25:27.838450'),(4634,'Bird Riddles','What kind of can never needs a can-opener?','A pelican!','Medium','2024-07-10 03:25:27.840378'),(4635,'Bird Riddles','A great banquet was prepared for a Roman emperor and his courtiers. 22 Dormice, 40 Larks\' Tongues, 30 Flamingos, and 40 Roast Parrots were served. How many portions of Boiled Ostrich were served?','42. Each vowel is worth 2 and each consonant 4, so Dormice gives 22, etc.','Hard','2024-07-10 03:25:27.842046'),(4636,'Black Riddles','I am white when I am dirty, and black when I am clean. What am I?','A','Easy','2024-07-10 03:25:27.843739'),(4637,'Black Riddles','What is black when you buy it, red when you use it, and gray when you throw it away?','Charcoal.','Easy','2024-07-10 03:25:27.845351'),(4638,'Black Riddles','When is it bad luck to see a','When you are a mouse.','Medium','2024-07-10 03:25:27.846978'),(4639,'Black Riddles','Why is Santa so good at Karate?','Because he has a black belt.','Hard','2024-07-10 03:25:27.848874'),(4640,'Black Riddles','I\'m clean when I\'m black, Dirty when white; Get too close, And you might sneeze. What am I?','A Chalkboard.','Medium','2024-07-10 03:25:27.850396'),(4641,'Black Riddles','I am white, black, and read all over. What am I?','Newspaper!','Hard','2024-07-10 03:25:27.852074'),(4642,'Black Riddles','Pronounced as one letter, And written with three, Two letters there are, And two only in me. I\'m double, I\'m single, I\'m black, blue, and gray, I\'m read from both ends, And the same either way. What am I?','An eye.','Easy','2024-07-10 03:25:27.853724'),(4643,'Black Riddles','Take one out and scratch my head, I am now black but once was red. What am I?','A Match.','Hard','2024-07-10 03:25:27.855551'),(4644,'Black Riddles','What do you get when you cross a black cat and a lemon?','A Sour Puss.','Medium','2024-07-10 03:25:27.857466'),(4645,'Black Riddles','If there is a Yellow house on Bluebird Lane, a Green House on Orange Street, a Pink house on Kitten Road, a Black House on Whitehorse Pike, and a Purple house on Firebird hill, where is the White House?','Washington, D.C.','Medium','2024-07-10 03:25:27.859011'),(4646,'Black Riddles','You get 2 clues to this riddle. 1. It can be green, black, or even sweet. 2. It sounds like a letter. What is it?','Tea.','Hard','2024-07-10 03:25:27.860909'),(4647,'Black Riddles','I am not a person or an animal. I was born from the death of something large and hot. I am capable of consuming anything and everything. I am very dark and exist in a place where there is no gravity. What am I?','A black hole.','Hard','2024-07-10 03:25:27.862494'),(4648,'Black Riddles','Duels of good and evil, A fighter of good am I, Revealed beside watched words, King of the black night sky. What am I?','The dark.','Hard','2024-07-10 03:25:27.864148'),(4649,'Black Riddles','Dark with white markings, smooth like a rock. Where learning occurs, I help convey thought. What am I?','Blackboard/chalkboard.','Easy','2024-07-10 03:25:27.865684'),(4650,'Black Riddles','With three eyes and a black as night, I frequently knock down ten men with a single strike! What am I?','A Bowling ball.','Medium','2024-07-10 03:25:27.867648'),(4651,'Black Riddles','Tear off one and scratch its head, what was red is now black instead. What is It?','A Matchstick!','Hard','2024-07-10 03:25:27.869625'),(4652,'Black Riddles','Dead on the field lie ten soldiers in white, felled by three eyes, black as night. What happened?','A strike was thrown in 10-pin bowling.','Easy','2024-07-10 03:25:27.871299'),(4653,'Black Riddles','The king of the jungle, rare as gold, black as night, in light not there and night not seen. Goes in water, goes on trees, goes in caves, goes on the ground. Claws of knives, teeth of swords, the roar of death but silent as a mouse. What is it?','A','Medium','2024-07-10 03:25:27.873139'),(4654,'Black Riddles','What 3 common songs have the same melody?','Baa Baa Black Sheep twinkle twinkle little star and the Alphabet song! wow kid songs','Medium','2024-07-10 03:25:27.875063'),(4655,'Black Riddles','What do you call a tavern of blackbirds?','A crowbar.','Easy','2024-07-10 03:25:27.877043'),(4656,'Black Riddles','I\'m blue at day and black at night; I do contain some creatures born and died. What am I?','Sea water.','Medium','2024-07-10 03:25:27.878819'),(4657,'Black Riddles','I always point in the right direction. My instructions are written in black and white. Disobey me and pay the consequences. I will never say more than two words at a time. What am I?','A \"One Way\" sign!','Hard','2024-07-10 03:25:27.880442'),(4658,'Black Riddles','I\'m as plain to see as black & white. I prefer to roam about at night. Just don\'t attack or startle me. Or odiferous emissions may result you see. I\'m an omnivore yes it\'s true. But what\'s my name tell me do?','I am a skunk!','Hard','2024-07-10 03:25:27.882128'),(4659,'Black Riddles','Sometimes I am black, sometimes I am white sometimes you can see me at night. I have friends that are with me that are much smaller. Some of you have walked on me but not all. What am I?','The Moon.','Easy','2024-07-10 03:25:27.883983'),(4660,'Black Riddles','Blacker than black, colder than cold, some things out here are worth more than gold. What is it?','Space.','Medium','2024-07-10 03:25:27.886032'),(4661,'Black Riddles','I come in many colors, but folks prefer me in black or blue, also be careful not to misspell my name with the letter \"i\". What am I?','I am a PEN!','Hard','2024-07-10 03:25:27.887854'),(4662,'Black Riddles','I am missing from every emotion, the alpha of the black and white herd. I am the end of the written notion, and yet I am the least used in a word. What am I?','The letter Z. No emotion contains the letter z zebras are a herd of black and white and their alpha(first) letter is z The end of the written notion(the alphabet) is the letter z The letter z is statistically the least used letter.','Medium','2024-07-10 03:25:27.889932'),(4663,'Black Riddles','I am black of the eye and bright of hair. I fast into the ground and follow my lord as he races around the world. What am I?','I\'m a Sunflower.','Hard','2024-07-10 03:25:27.891948'),(4664,'Black Riddles','What','He makes the firefly.','Hard','2024-07-10 03:25:27.893844'),(4665,'Black Riddles','A girl was holding something in her hand. With her other hand, she picked up a regular black pen and wrote on the object in her hand. When she let go of the object, the writing shrunk and became more solid. What was the object?','An untied balloon','Easy','2024-07-10 03:25:27.895631'),(4666,'Black Riddles','What kind of music does a blacksmith like?','Heavy metal!','Medium','2024-07-10 03:25:27.897365'),(4667,'Black Riddles','How many black beans will make five white ones?','Five when peeled.','Hard','2024-07-10 03:25:27.899625'),(4668,'Black Riddles','What insect does a blacksmith manufacture?','He makes the firefly.','Easy','2024-07-10 03:25:27.901755'),(4669,'Black Riddles','Black within, red without, with four corners, roundabout. What is it?','A chimney.','Medium','2024-07-10 03:25:27.903564'),(4670,'Black Riddles','What\'s black and white and red all over?','A zebra with a sunburn.','Easy','2024-07-10 03:25:27.905391'),(4671,'Black Riddles','Don\'t burn me I\'ll be crusty and black, but butter me and I\'ll be greasy and wack. What am I?','Bread','Easy','2024-07-10 03:25:27.907061'),(4672,'Black Riddles','What goes in the water red, and comes out black?','Iron.','Easy','2024-07-10 03:25:27.909037'),(4673,'Black Riddles','Slam slam slam all day long slam slam slam some fast, some slow something solid. flat and sturdy its friend lights up the night and is sensitive to the eye slam slam slam A through Z 1,2,3 black as night. What am I?','A Computer keyboard.','Easy','2024-07-10 03:25:27.910791'),(4674,'Black Riddles','I am sometimes green, I am sometimes yellow and green. When I\'m green, I have many white babies inside me; and when yellow and green, I have many black babies inside of me, and is sweet. What am I?','Pawpaw.','Easy','2024-07-10 03:25:27.912936'),(4675,'Black Riddles','I\'m sometimes white, Although sometimes I\'m black. I take you there But never bring you back. What am I?','I\'m a Hearse.','Hard','2024-07-10 03:25:27.914758'),(4676,'Black Riddles','