 I?','I am the wind.','Hard','2024-07-10 03:25:27.930045'),(4686,'Boat Riddles','A man is on one side of a river, his dog on the other. The man calls his dog, who immediately crossed the river without getting wet and without using a bridge or a boat. How did the dog do it?','The river was frozen.','Medium','2024-07-10 03:25:27.931403'),(4687,'Boat Riddles','You walk onto a bridge you see a boat full of people but there is not a single person on it. How is that possible?','There all married.','Easy','2024-07-10 03:25:27.932878'),(4688,'Boat Riddles','Pete and Repeat were on a boat. Pete fell out, who was left on the boat?','Repeat! Pete and Repeat were on a boat. Pete fell out, who was left on the boat? Repeat! Pete and Repeat were on a boat. Pete fell out, who was left on the boat? Repeat! Pete and Repeat were on a boat. Pete fell out, who was left on the boat? Repeat! Pete and Repeat were on a boat. Pete fell out, who was left on the boat? Repeat! Ex','Easy','2024-07-10 03:25:27.933981'),(4689,'Boat Riddles','Two men had to go to the other side of the river, there is one boat, but only one person fits on it. Luckily they both got to the other side of the river. How?','They were on opposite sides of the river.','Hard','2024-07-10 03:25:27.935154'),(4690,'Boat Riddles','What is a vampire\'s favorite boat to travel on?','A blood vessel.','Easy','2024-07-10 03:25:27.936907'),(4691,'Boat Riddles','What house has a post on top, A roof at the bottom, While the rain comes from below?','A boat.','Easy','2024-07-10 03:25:27.938319'),(4692,'Boat Riddles','What type of boat has authority?','Ownership!','Medium','2024-07-10 03:25:27.939598'),(4693,'Boat Riddles','I dance in the wind and I bow to a storm. I grow best in temperatures that are warm. By the riverbeds, I like to grow, where the people in boats like to row. What am I?','A river reed. Didn\'t guess it did you?','Hard','2024-07-10 03:25:27.941136'),(4694,'Boat Riddles','I\'m done to boats, to cargo, to loads; When indoors I\'m, in a way, a narrow road. What am I?','Haul?/ Hall','Hard','2024-07-10 03:25:27.942253'),(4695,'Boat Riddles','Two people are standing on the bank of a river looking forward to crossing to the other side. There is one boat with a capacity for one person. The two people managed to cross the river safely. How did they do it?','The two were on opposite sides of the river.','Easy','2024-07-10 03:25:27.943435'),(4696,'Boat Riddles','When is a boat like a knife?','When it is a cutter.','Hard','2024-07-10 03:25:27.944911'),(4697,'Boat Riddles','A pro fisherman decided to become a pro golfer. In order to buy his clubs, he had to sell his boat. How did he list it?','Fore Sail!','Medium','2024-07-10 03:25:27.946061'),(4698,'Boat Riddles','Why is a ferry boat like a good rule?','Because it works both ways.','Hard','2024-07-10 03:25:27.947537'),(4699,'Boat Riddles','Four men were in a boat on the lake. The boat turns over, and all four men sink to the bottom of the lake, yet not a single man got wet! Why?','Because they were all married and not single.','Medium','2024-07-10 03:25:27.948691'),(4700,'Boat Riddles','Peter celebrated his birthday on one day, and two days later his older twin brother, Paul, celebrated his birthday. How could this be?','When the mother of the twins went into labor, she was traveling by boat. The older twin, Paul, was born first, barely on March 1st. The boat then crossed a time zone, and the younger twin was born on February the 28th. In a leap year, the younger twin celebrates his birthday two days before his older brother.','Easy','2024-07-10 03:25:27.950387'),(4701,'Boat Riddles','A girl went over to the U.S. on the 4th of July and partied for 3 days and came back on the 4th of July. How did she do that?','She went over on the date of the 4th of July and came home on the boat called the 4th of July.','Easy','2024-07-10 03:25:27.951489'),(4702,'Brother Riddles','Mr. and Mrs. Mustard have six daughters and each daughter has one brother. How many people are in the Mustard family?','There are nine Mustards in the family. Since each daughter shares the same brother, there are six girls, one boy, and Mr. and Mrs. Mustard.','Easy','2024-07-10 03:25:27.952955'),(4703,'Brother Riddles','I have a heart that never beats, I have a home but I never sleep. I can take a man\'s house and build another, And I love to play games with my many brothers. I am a king among fools. Who am I?','The King of Hearts in a deck of cards.','Easy','2024-07-10 03:25:27.954049'),(4704,'Brother Riddles','There is a brother and a sister. The boy wants to visit his father in jail, and the sister wants to visit her mother in the hospital. But they both are not allowed in jail or hospital. All they have is a gun. What do they do?','The boy shoots the girl, and then the boy goes to jail for attempted murder and the girl goes to the hospital due to her injuries.','Hard','2024-07-10 03:25:27.955269'),(4705,'Brother Riddles','A mother has 6 girls and each of them has a brother. How many children are there?','7. Each girl has the same brother.','Hard','2024-07-10 03:25:27.956939'),(4706,'Brother Riddles','A beggar\'s brother died, but the man who died had no brother. How could that be?','The beggar was his sister!','Medium','2024-07-10 03:25:27.958911'),(4707,'Brother Riddles','The 22nd and 24th presidents of the United States of America had the same parents, but were not brothers. How can this be possible?','They were the same man. Grover Cleveland served two terms as president of the United States, but the terms were not consecutive.','Hard','2024-07-10 03:25:27.960756'),(4708,'Brother Riddles','You give someone a dollar. You are this person\'s brother, but the person is not your brother. How can that be?','It\'s your sister!','Hard','2024-07-10 03:25:27.962712'),(4709,'Brother Riddles','Peter is 4 and his little brother is 2, half his age. How older will Peter\'s little brother be when he is 100?','98 because there\'s only a 2-year difference.','Medium','2024-07-10 03:25:27.964170'),(4710,'Brother Riddles','You must keep this thing, its loss will affect your brothers. For once yours is lost, it will soon be lost by others. What is it?','Your Temper.','Easy','2024-07-10 03:25:27.966381'),(4711,'Brother Riddles','There are 8 brothers. Brother 1 is playing checkers. Brother 2 is eating. Brother 3 is watching video games. Brother 4 is dancing. Brother 5 is texting. Brother 6 is at school. Brother 7 is sleeping. What is Brother 8 doing?','Brother 8 is playing checkers with Brother 1 because checkers includes two people to play.','Medium','2024-07-10 03:25:27.968252'),(4712,'Brother Riddles','I am very powerful, And my brother is patient. I am of infinite value, And I wait for no one. What am I?','Time.','Hard','2024-07-10 03:25:27.970666'),(4713,'Brother Riddles','You are my brother, but I am not your brother. Who am I?','I am your sister.','Medium','2024-07-10 03:25:27.972945'),(4714,'Brother Riddles','Three doctors say Robert is their brother. However, Robert says he has no brother. Who\'s lying?','No one. The doctors are all girls.','Medium','2024-07-10 03:25:27.975355'),(4715,'Brother Riddles','Lobi\'s brother is MobiLodi\'s brother is ModiLofi\'s brother is MofiLoki\'s brother is ____HINT: It\'s a four-letter word','Thor.','Hard','2024-07-10 03:25:27.979005'),(4716,'Brother Riddles','We are three brothers, running behind each other. Always running around our mother: one after the other, yet no matter how fast we run, we never touch each other. What are we?','Fan blades.','Easy','2024-07-10 03:25:27.981524'),(4717,'Brother Riddles','What is the name of Frosty\'s brother that really likes sweets?','Frosting the Snowman!','Easy','2024-07-10 03:25:27.983690'),(4718,'Brother Riddles','If May\'s daughter\'s daughter is my granddaughter\'s mother\'s mother\'s brother\'s sister, then what am I to May? (May only has one sibling)','I am May.','Medium','2024-07-10 03:25:27.986341'),(4719,'Brother Riddles','One side hopes you have a great day. The other wishes you\'d just go away. One side wants to be its best self. The other just wants back up on the shelf. One side always needs the other, and yet you may require a brother. What is it?','A battery. One side is positive and the other is negative. Most devices need at least a pair of batteries.','Easy','2024-07-10 03:25:27.987956'),(4720,'Brother Riddles','They grab me, carry me, roast me on an open flame, grind me to pieces, blast what\'s left apart with boiling water, then finally, consume me. This happens to me and my billions of brothers daily. What am I?','I am (or rather, I become) Coffee! (Coffee bean is also acceptable)','Easy','2024-07-10 03:25:27.989711'),(4721,'Brother Riddles','If Peter has 2 brothers and Peter\'s father has three cupcakes and gives two to Peter\'s brothers who gets the last cupcake?','Peter.','Hard','2024-07-10 03:25:27.991405'),(4722,'Brother Riddles','As far as I run, I never meet my brother on my right. What am I?','A wheel.','Hard','2024-07-10 03:25:27.994068'),(4723,'Brother Riddles','Brothers and sisters have I none, But that man\'s father is my father\'s son. Who is \"that man\"?','The son of the speaker.','Easy','2024-07-10 03:25:27.996165'),(4724,'Brother Riddles','A boy has as many sisters as brothers, but each sister has only half as many sisters as brothers. How many brothers and sisters are there in the family?','Four brothers and three sisters.','Hard','2024-07-10 03:25:27.998252'),(4725,'Brother Riddles','A girl is twice as old as her brother and half as old as her father. In 50 years, her brother will be half as old as his father. How old is the daughter now?','50 years old.','Medium','2024-07-10 03:25:27.999958'),(4726,'Brother Riddles','There is a certain family with both girl and boy children. Each of the boys has the same number of brothers as he has sisters. Each of the girls has twice as many brothers as she has sisters. How many boys and girls are there in this family?','Four boys and three girls.','Medium','2024-07-10 03:25:28.001551'),(4727,'Brother Riddles','A man while looking at a photograph said, \"Brothers and sisters have I none. That man\'s father is my father\'s son.\" Who was the person in the photograph?','That man\'s son.','Hard','2024-07-10 03:25:28.003197'),(4728,'Brother Riddles','Who are the two brothers who live on opposite sides of the road yet never see each other?','A person\'s eyes, the nose is the road.','Hard','2024-07-10 03:25:28.004917'),(4729,'Brother Riddles','Peter celebrated his birthday one day, and two days later his older twin brother, Paul, celebrated his birthday. How could this be?','When the mother of the twins went into labor, she was traveling by boat. The older twin, Paul, was born first, barely on March 1st. The boat then crossed a time zone, and the younger twin was born on February 28th. In a leap year, the younger twin celebrates his birthday two days before his older brother.','Hard','2024-07-10 03:25:28.006277'),(4730,'Chicken Riddles','There are 30 cows in a field, and 28 chickens. How many didn\'t?','10. Listen closely: 30 cows, and twenty-eight chickens. Say EIGHT and ATE. They sound the same. Therefore, it means 20 ATE chickens. 30-20=10, so 10 cows didn\'t eat any chickens.','Easy','2024-07-10 03:25:28.008132'),(4731,'Chicken Riddles','If a rooster laid a brown egg and a white egg, what kind of chicks would hatch?','Roosters don\'t lay eggs.','Easy','2024-07-10 03:25:28.009917'),(4732,'Chicken Riddles','Why did the turkey cross the road?','To prove he wasn\'t chicken.','Hard','2024-07-10 03:25:28.011431'),(4733,'Chicken Riddles','If a chicken says, \"All chickens are liars\". Is the chicken telling the truth?','Answer: Chickens cannot talk.','Medium','2024-07-10 03:25:28.013017'),(4734,'Chicken Riddles','If it takes 5 microwaves 5 minutes to cook 5 chickens, how long does it take 100 microwaves to cook 100 chickens?','5 minutes. We can assume that one chicken is placed in each microwave and that each chicken takes 5 minutes to cook.','Hard','2024-07-10 03:25:28.014482'),(4735,'Chicken Riddles','Why do chickens lay eggs?','Because if they drop them, they will break.','Easy','2024-07-10 03:25:28.016109'),(4736,'Chicken Riddles','What\'s 3/7 chicken, 2/3 cat, and 2/4 goat?','Chicago. The first three words out of seven of chicken is CHI, the first two words out of 3 of cat is CA, and first two words out of','Easy','2024-07-10 03:25:28.017699'),(4737,'Chicken Riddles','What did the scientist get when he crossed a chicken and a cow?','Roost beef.','Easy','2024-07-10 03:25:28.019143'),(4738,'Chicken Riddles','What do you get if you cross a hen with a guitar?','A chicken that plucks itself.','Medium','2024-07-10 03:25:28.021025'),(4739,'Chicken Riddles','What do you call a chicken with bad sunburn?','Fried Chicken.','Hard','2024-07-10 03:25:28.022578'),(4740,'Chicken Riddles','Why did the chicken cross the road twice, and jump in the mud?','He was a dirty double-crosser.','Easy','2024-07-10 03:25:28.024170'),(4741,'Chicken Riddles','If a rooster laid 11 eggs and the farmer took 5 of them and another','0, Roosters don\'t lay eggs.','Easy','2024-07-10 03:25:28.025772'),(4742,'Chicken Riddles','A mouse, a squirrel, a duck, a chicken, and an elephant are sitting on the side of the road. Someone offers them a lift, but one prefers to stay. Who preferred to stay?','The Elephant Stayed. If you didn\'t know, elephants are scared of mice.','Medium','2024-07-10 03:25:28.027141'),(4743,'Chicken Riddles','Why did the sheriff arrest the chicken?','It used fowl language','Easy','2024-07-10 03:25:28.028855'),(4744,'Chicken Riddles','Why was the chicken forbidden from sending e-mails?','Because he kept using fowl language.','Medium','2024-07-10 03:25:28.030204'),(4745,'Chicken Riddles','My call, I pray, at dawn of day, Shall rest you from your slumber, With job all done, my song all sung, I\'ll sit on the seat of lumber. What am I?','A Rooster.','Easy','2024-07-10 03:25:28.031502'),(4746,'Chicken Riddles','How do chickens like to dance?','Chick to chick','Hard','2024-07-10 03:25:28.033303'),(4747,'Chicken Riddles','Under no circumstances compute the number of your barnyard fowl previous to their incubation. What is the proverb?','Do not count your chickens before they hatch.','Medium','2024-07-10 03:25:28.034779'),(4748,'Chicken Riddles','A Rooster laid an','It didn\'t. And since when do Roosters lay Eggs?','Medium','2024-07-10 03:25:28.036717'),(4749,'Chicken Riddles','I have a house with no doors no windows, nothing. If I want to get out I break the wall. Who am I?','Chicken as if it wants to come out breaks the wall.','Medium','2024-07-10 03:25:28.038207'),(4750,'Chicken Riddles','If a rooster lays an egg on the ridge of a roof, which side will the egg fall on?','Roosters don��t lay eggs. Hen��s do.','Easy','2024-07-10 03:25:28.039508'),(4751,'Chicken Riddles','How did the chicken manage to pay for, \'A de Luxe\' roost?','By Higher Perch-ase.','Medium','2024-07-10 03:25:28.041196'),(4752,'Chicken Riddles','Why was the','It was a little chicken!','Easy','2024-07-10 03:25:28.042438'),(4753,'Chicken Riddles','What does a chicken say instead of good?','EGGcelent','Hard','2024-07-10 03:25:28.043732'),(4754,'Chicken Riddles','He\'s a boastful, puffed-up fellow, wearing spurs; eyes gleaming yellow. As he proudly struts about, he\'s in charge, there is no doubt. What is he?','He is a Rooster.','Easy','2024-07-10 03:25:28.045570'),(4755,'Chicken Riddles','A fast-food restaurant sells chicken in orders of 6,9 and 20. What\'s the largest number of pieces of chicken you cannot order from the restaurant?','43 is the last number that doesn\'t fall into these categories.','Medium','2024-07-10 03:25:28.047061'),(4756,'Chicken Riddles','Why does a chicken coop have two doors?','Because, if it had four it would be a sedan.','Easy','2024-07-10 03:25:28.048911'),(4757,'Chicken Riddles','Why did the woolly mammoth cross the road?','Because there were no chickens in the ice age!','Hard','2024-07-10 03:25:28.050394'),(4758,'Chicken Riddles','Why don\'t chickens play baseball?','Because they hit fowl balls.','Hard','2024-07-10 03:25:28.051964'),(4759,'Chicken Riddles','Why did the chicken cross the playground?','To get to the other slide!','Medium','2024-07-10 03:25:28.053487'),(4760,'Chicken Riddles','What is the time-piece, That needs no winding?','A rooster.','Easy','2024-07-10 03:25:28.055282'),(4761,'Chicken Riddles','In what place did the rooster crow when all the world heard him?','In Noah\'s Ark.','Medium','2024-07-10 03:25:28.057333'),(4762,'Classroom Riddles','Why does the teacher wear sunglasses when she comes to the class?','Because the students are bright.','Easy','2024-07-10 03:25:28.058960'),(4763,'Classroom Riddles','When is homework not homework?','When it\'s done at school.','Hard','2024-07-10 03:25:28.060723'),(4764,'Classroom Riddles','A teacher is yelling, she closes the door, the window, and a book. What did she forget to close?','Her mouth.','Hard','2024-07-10 03:25:28.062223'),(4765,'Classroom Riddles','What do mathematics teachers like to eat?','Pi.','Easy','2024-07-10 03:25:28.063629'),(4766,'Classroom Riddles','Why did the boy eat his homework?','Because the teacher said it was a piece of cake.','Medium','2024-07-10 03:25:28.065422'),(4767,'Classroom Riddles','What happened to the plant in the math classroom?','It grew square roots, of course.','Medium','2024-07-10 03:25:28.067869'),(4768,'Classroom Riddles','What is the most useful instrument in a mathematics teacher\'s tool kit?','Multi-pilers!','Easy','2024-07-10 03:25:28.069991'),(4769,'Classroom Riddles','What do grape students do when they have a question?','Raisin their hand!','Easy','2024-07-10 03:25:28.071777'),(4770,'Classroom Riddles','What\'s the difference between a Teacher and a Train?','The Teacher says \"Spit out your gum!\" And the train says \"Chew, Chew, Chew!\"','Easy','2024-07-10 03:25:28.073496'),(4771,'Classroom Riddles','What are the science teacher\'s favorite states?','Solid, Liquid, Gas. The states of all matter.','Hard','2024-07-10 03:25:28.075292'),(4772,'Classroom Riddles','1. Where do fish go on vacation? 2. Where do songbirds go on vacation? 3. Where do zombies go on vacation? 4. Where do Thanksgiving Birds go on vacation? 5. Where do geometry teachers go on vacation? 6. Where do locksmiths go on vacation?','1. Finland 2. The Canary Islands 3. The Dead Sea 4. Turkey 5. Cuba 6. The Florida Keys','Hard','2024-07-10 03:25:28.077332'),(4773,'Classroom Riddles','A student was once given a simple task to accomplish. He was given 6 numbers: 1, 10, 20, 30, 40, and 80, and was told to sum them together to be equal to 100. At last, he was able to accomplish this task. How did he do it?','He read 10 and 80 backward to give him 01 and 08 respectively. So, 1 + 01 + 20 + 30 + 40 + 08 = 100.','Easy','2024-07-10 03:25:28.079097'),(4774,'Classroom Riddles','What word can be grammatically correct when used consecutively in the English language?','Had: \"James while John had had had had had had had had had had had a better effect on the teacher\" is an English sentence used to demonstrate lexical ambiguity and the necessity of punctuation, which serves as a substitute for the intonation, stress, and pauses found in speech.\"-Wikipedia. Cool, Huh?','Hard','2024-07-10 03:25:28.081029'),(4775,'Classroom Riddles','In the olden days, the student of logic was given this problem: If half of 5 were 3, what would one-third of 10 be?','It would be 4.','Hard','2024-07-10 03:25:28.082793'),(4776,'Classroom Riddles','Why was the student\'s homework in his father\'s handwriting?','Because the student borrowed his pen.','Easy','2024-07-10 03:25:28.084745'),(4777,'Dark Riddles','A man rode out of town on Sunday, he stayed a whole night at a hotel and rode back to town the next day on Sunday. How is this possible?','His Horse was called Sunday!','Hard','2024-07-10 03:25:28.086758'),(4778,'Dark Riddles','It can\'t be seen, can\'t be felt, can\'t be heard, and can\'t be smelt. It lies behind stars and under hills, And empty holes it fills. It comes first and follows after, Ends life, and kills laughter. What is it?','The dark.','Hard','2024-07-10 03:25:28.088873'),(4779,'Dark Riddles','I always follow you around, everywhere you go at night. I look very bright to people, but I can make the sun dark. I can be in many different forms and shapes. What am I?','The moon!','Medium','2024-07-10 03:25:28.090731'),(4780,'Dark Riddles','I run in and out of town all day and night. What am I?','A road.','Easy','2024-07-10 03:25:28.092495'),(4781,'Dark Riddles','I was carried into a dark room, and set on fire. I wept, and then my head was cut off. What am I?','A Candle.','Medium','2024-07-10 03:25:28.095030'),(4782,'Dark Riddles','What did Sir Lancelot wear to bed?','A knight gown!','Easy','2024-07-10 03:25:28.098590'),(4783,'Dark Riddles','I am the beginning of sorrow and the end of sickness. You cannot express happiness without me, yet I am in the midst of crosses. I am always in risk, yet never in danger. You may find me in the sun, but I am never out of darkness. What am I?','The letter S.','Medium','2024-07-10 03:25:28.102118'),(4784,'Dark Riddles','A little pool with two layers of wall around it. One white and soft and the other dark and hard, amidst a light brown grassy lawn with an outline of green grass. What am I?','A Coconut.','Hard','2024-07-10 03:25:28.104354'),(4785,'Dark Riddles','How do you know that a vampire loves baseball?','Because he turns into a bat every night.','Medium','2024-07-10 03:25:28.106459'),(4786,'Dark Riddles','What falls down but never breaks?','Nightfall.','Hard','2024-07-10 03:25:28.108382'),(4787,'Dark Riddles','What boy wizard magically grew a beard each night?','Hairy Potter.','Medium','2024-07-10 03:25:28.110323'),(4788,'Dark Riddles','Why couldn\'t Goldilocks sleep?','Because of nightbears.','Easy','2024-07-10 03:25:28.112110'),(4789,'Dark Riddles','When I point up it\'s bright, but when I point down it\'s dark. What am I?','A Light Switch.','Hard','2024-07-10 03:25:28.113946'),(4790,'Dark Riddles','I\'m like a doll, But I\'m not for playing; I stand up straight, but if windy I may be laying; I\'m well-known and famous for having no brain; I work outside both day and night in sunshine or in rain. What am I?','A Scarecrow.','Medium','2024-07-10 03:25:28.115784'),(4791,'Dark Riddles','Lovely and round, I shine with pale light, grown in the darkness, A lady\'s delight. What am I?','A Pearl.','Easy','2024-07-10 03:25:28.117655'),(4792,'Dark Riddles','They are dark and always on the run. Without the sun, there would be none. What are they?','Shadows.','Easy','2024-07-10 03:25:28.119668'),(4793,'Dark Riddles','Why does a dragon sleep all day?','So it can hunt knights!','Medium','2024-07-10 03:25:28.122347'),(4794,'Dark Riddles','What falls but doesn\'t break, and what breaks but doesn\'t fall?','Night and Day.','Easy','2024-07-10 03:25:28.124778'),(4795,'Dark Riddles','I follow you by day, by night I blend right in but no one sees me except when I\'m in the light. What am I?','A shadow.','Easy','2024-07-10 03:25:28.127711'),(4796,'Dark Riddles','Every night, I\'m told what to do. And every morning, I do what you tell me to do. But you still get mad at me and hit me. What am I?','An alarm clock.','Hard','2024-07-10 03:25:28.129724'),(4797,'Dark Riddles','I weaken all men for hours each day. I show you strange visions while you are away. I take you by night, by day take you back, None suffer to have me, but do from my lack. What am I?','Sleep.','Hard','2024-07-10 03:25:28.131668'),(4798,'Dark Riddles','My first four letters describe all living things. My last five letters are another word for knight. My job is to save you, and I\'m a fan of water. Who am I?','I��m a lifeguard','Easy','2024-07-10 03:25:28.133915'),(4799,'Dark Riddles','A man rides into town on Friday. He stays two nights. How does he leave on Tuesday?','His horse was called Friday.','Hard','2024-07-10 03:25:28.136105'),(4800,'Dark Riddles','Who always stalks you during the day but becomes too tired to stalk you at night?','Your own shadow!','Easy','2024-07-10 03:25:28.138831'),(4801,'Dark Riddles','People have stepped on me, but not many. I never stay full for long. I have a dark side. What am I?','The moon.','Hard','2024-07-10 03:25:28.140924'),(4802,'Dark Riddles','What do ghosts like to do on a Saturday night?','BOOGIE.','Medium','2024-07-10 03:25:28.143208'),(4803,'Dark Riddles','I can fly but have no wings. I can cry but I have no eyes. Wherever I go, darkness follows me. What am I?','Clouds.','Hard','2024-07-10 03:25:28.145447'),(4804,'Dark Riddles','The marathon man timed himself and found out that if he wore a bright white outfit he ran 20 miles in 80 minutes, but when he wore a dark outfit, he ran 20 miles in one hour and twenty minutes. What does this mean for his next race?','Absolutely nothing, as 80 minutes equals an hour and twenty minutes.','Easy','2024-07-10 03:25:28.147695'),(4805,'Dark Riddles','I sleep by day, I fly by night. I have no feathers to aid my flight. What am I?','I am a Bat.','Medium','2024-07-10 03:25:28.149787'),(4806,'Dark Riddles','What\'s light during the day but heavy during the night?','Eyelids.','Hard','2024-07-10 03:25:28.151580'),(4807,'Dark Riddles','You can have me almost every night, sometimes I could be bad sometimes I can be nice or good, Whether you were a child or an adult I\'ll be there. What am I?','Dreams between (Sweet dreams, Nightmare).','Hard','2024-07-10 03:25:28.153767'),(4808,'Dark Riddles','I have 16 legs then, I sleep for about a fortnight and a merge with 6 legs. What am I?','A Butterfly','Hard','2024-07-10 03:25:28.155996'),(4809,'Dark Riddles','I am not a person nor an animal. I was born from the death of something large and hot. I am capable of consuming anything and everything. I am very dark and exist in a place where there is no gravity. What am I?','A black hole.','Easy','2024-07-10 03:25:28.158143'),(4810,'Dark Riddles','At night they come without being fetched, And by day they are lost without being stolen. What are they?','The stars.','Easy','2024-07-10 03:25:28.160116'),(4811,'Dark Riddles','Duels of good and evil, A fighter of good am I, Revealed beside watched words, King of the black night sky. What am I?','The dark.','Easy','2024-07-10 03:25:28.162145'),(4812,'Dark Riddles','When I am metal or wood, I bring you home. When I am flesh and blood, in the darkness I roam. What am I?','A bat.','Easy','2024-07-10 03:25:28.164194'),(4813,'Dark Riddles','A nightmare for some. For others, a savior I come. My hand\'s cold and bleak. It\'s the warm hearts they seek. What am I?','Death.','Easy','2024-07-10 03:25:28.166215'),(4814,'Dark Riddles','I grow in the dark and shine in the light; The paler I am, the more I am liked; My maker never gets paid, but never goes on strike. What am I?','A pearl.','Medium','2024-07-10 03:25:28.168371'),(4815,'Dark Riddles','I have an eye in the middle of me, but as you see, I cannot see. I am dark and not far away. You don\'t see me every day. I am not night and I am not bright. I can have twists and water and scares. What am I?','A hurricane.','Medium','2024-07-10 03:25:28.170389'),(4816,'Dark Riddles','I\'m far away from you, but I still shine bright. I sleep by day, I wake up at night. I stay by the moon but never get close to it. What am I?','A star.','Easy','2024-07-10 03:25:28.172192'),(4817,'Dark Riddles','I can\'t t hurt you, but I can leave you with scars. Nobody wants me, but everyone has me. But you are the only one who can see me. What am I?','Nightmares.','Medium','2024-07-10 03:25:28.174946'),(4818,'Dark Riddles','You see me at night, by day you tell everyone about me. I come back looking different than before. I sometimes leave you in the darkness. What am I?','A dream.','Hard','2024-07-10 03:25:28.177267'),(4819,'Dark Riddles','With three eyes and a black as night, I frequently knock down ten men with a single strike! What am I?','A Bowling ball.','Easy','2024-07-10 03:25:28.179564'),(4820,'Dark Riddles','I\'m grown from darkness but shine with a pale light. Very round I am, and always a lady\'s delight. What am I?','A Pearl.','Medium','2024-07-10 03:25:28.182083'),(4821,'Dark Riddles','I take you by night, by day take you back. None suffer to have me but do from my lack. What am I?','Sleep','Medium','2024-07-10 03:25:28.183979'),(4822,'Dark Riddles','Dead on the field lie ten soldiers in white, felled by three eyes, black as night. What happened?','A strike was thrown in 10-pin bowling.','Hard','2024-07-10 03:25:28.185726'),(4823,'Dark Riddles','What loses its head in the morning, and gets it back at night?','A Pillow.','Hard','2024-07-10 03:25:28.187505'),(4824,'Dark Riddles','The king of the jungle, rare as gold, black as night, in light not there and night not seen. Goes in water, goes on trees, goes in caves, goes on the ground. Claws of knives, teeth of swords, the roar of death but silent as a mouse. What is it?','A black panther (black jaguar)','Medium','2024-07-10 03:25:28.189664'),(4825,'Dark Riddles','I am nothing, I am everything. I am perfect dark, I am the brightest light. I am hungry, I am full. I am nowhere, I am everywhere. I am unseen, I am watched by millions. What am I?','The universe.','Easy','2024-07-10 03:25:28.191509'),(4826,'Dark Riddles','I\'m blue at day and black at night; I do contain some creatures born and died. What am I?','Seawater.','Easy','2024-07-10 03:25:28.193670'),(4827,'Dark Riddles','I\'m the first thing you see in the morning and the last thing you see at night, I\'m always there but you choose to ignore me, cross your eyes and you will see me. What am I?','Your nose.','Easy','2024-07-10 03:25:28.195465'),(4828,'Dark Riddles','Dark with white markings, And smooth like a rock. Where learning occurs, I help convey thought. What am I?','Blackboard/chalkboard.','Hard','2024-07-10 03:25:28.197559'),(4829,'Dark Riddles','I welcome the day with a show of light, I stealthily came here in the night. I bathe the earthy stuff at dawn, But by noon, alas! I\'m gone. What am I?','The morning dew!','Medium','2024-07-10 03:25:28.199263'),(4830,'Dark Riddles','What brightens your day when it\'s dark, although it\'s usually in the shade?','A lamp.','Medium','2024-07-10 03:25:28.201270'),(4831,'Dark Riddles','I\'m as plain to see as black & white. I prefer to roam about at night. Just don\'t attack or startle me. Or odiferous emissions may result you see. I\'m an omnivore yes it\'s true. But what\'s my name tell me do?','I am a skunk!','Easy','2024-07-10 03:25:28.202973'),(4832,'Dark Riddles','You use me every day but let me rest at night. I have an identical twin beside me all the time. For some reason, you always cover me up. I am not alive but I have a soul. What am I?','Your Feet.','Easy','2024-07-10 03:25:28.204968'),(4833,'Dark Riddles','I watch you sleep, I haunt you by day. You stare at me and saw nothing, but darkness. What am I?','Fear.','Medium','2024-07-10 03:25:28.206721'),(4834,'Dark Riddles','Sometimes I am black, sometimes I am white sometimes you can see me at night. I have friends that are with me that are much smaller. Some of you have walked on me but not all. What am I?','The Moon.','Medium','2024-07-10 03:25:28.209048'),(4835,'Dark Riddles','I usually wear a yellow coat. I usually have a dark head. I make marks wherever I go. What am I?','A pencil.','Hard','2024-07-10 03:25:28.211163'),(4836,'Dark Riddles','My first is in ocean but never in sea, my second\'s in wasp but never in bee. My third is in glider and also in flight, my whole is a creature that comes out at night. What am I?','An Owl.','Hard','2024-07-10 03:25:28.213101'),(4837,'Dark Riddles','I come out at night, I am neither human nor animal, I rarely eat I only drink, I can only be found at night, I will glow in the sunlight. What am I?','A vampire.','Easy','2024-07-10 03:25:28.215051'),(4838,'Dark Riddles','Imagine you are in a dark room. How do you get out?','Stop imagining.','Hard','2024-07-10 03:25:28.217632'),(4839,'Dark Riddles','Allan survived 12 days without sleep. How is this possible?','He sleeps during the night.','Medium','2024-07-10 03:25:28.219887'),(4840,'Dark Riddles','The man had not slept in days, yet he was well-rested. How could this be?','He only sleeps at night (he had not slept in DAYS)','Easy','2024-07-10 03:25:28.222650'),(4841,'Dark Riddles','I am life, yet not real. When we first meet, things are dark. When we leave each other, you are in the light. I meet many people with and after you. What am I?','A movie.','Easy','2024-07-10 03:25:28.225180'),(4842,'Dark Riddles','I have billions of eyes, yet I live in darkness. I have millions of ears, yet only four lobes. I have no muscle, yet I rule two hemispheres. What am I?','The human brain.','Easy','2024-07-10 03:25:28.227369'),(4843,'Dark Riddles','In a tunnel of darkness lies a beast of iron. It can only attack when pulled back. What is it?','A bullet.','Medium','2024-07-10 03:25:28.229583'),(4844,'Dark Riddles','The ghost of the mountain never to be seen, leaps like a raging fire to catch his prey. As pale as the moon but fast as the wind. Cold as ice, but a flash of light in the night. What is it?','A snow leopard.','Hard','2024-07-10 03:25:28.231624'),(4845,'Dark Riddles','My body has a dozen heads or more, My tails don\'t wag when you walk in the door. Count the ways you can hold me tight, Or use me for a special night! What Am I?','A piggy bank.','Hard','2024-07-10 03:25:28.233761'),(4846,'Dark Riddles','From dawn to dusk I soar through the sky, A thunderous voice, but silent I fly. Through the darkest depths, I will not die, Yet I can not be seen by the naked eye. What am I?','Radio waves.','Medium','2024-07-10 03:25:28.235751'),(4847,'Dark Riddles','A group of men is suddenly awakened by a loud, piercing, continuous sound. They all scramble out of their beds, get dressed, grab a pole, and disappear into a hole. What in the world are these men doing?','The men are firemen who were on night-shift duty at their firehouse. When they heard the fire alarm, they got dressed, slid down the fire pole, and got in the fire truck.','Medium','2024-07-10 03:25:28.237626'),(4848,'Dark Riddles','What falls but never breaks? What breaks but never falls?','Night and Day!','Hard','2024-07-10 03:25:28.239477'),(4849,'Dark Riddles','A light aloft alone in shadow, I light the way for paths you follow. What am I?','\"Lampost\" - Reasoning: Often, a street lampost will be a source of light above paths that are often traveled at night, hence it is the reference to this lonely light guiding you on paths through the darkness.','Easy','2024-07-10 03:25:28.241651'),(4850,'Dark Riddles','I scream out in the dark, I bring light to you, my flame whispers in the darkness. What am I?','A candle.','Easy','2024-07-10 03:25:28.244181'),(4851,'Dark Riddles','Nick timed himself and found out that if he wore a bright white outfit he ran 20 miles in 80 minutes, but when he wore a dark outfit, he ran 20 miles in one hour and twenty minutes. What does this mean for his next race?','Nothing, as 80 minutes equals an hour and twenty minutes.','Easy','2024-07-10 03:25:28.246371'),(4852,'Dark Riddles','In the light, I may reflect. In the dark, I\'m cold and wet. What am I?','Water.','Medium','2024-07-10 03:25:28.248366'),(4853,'Dark Riddles','From house to house he goes, A messenger small and slight. And whether it rains or snows, He sleeps outside at night. What am I?','A Street or Road.','Hard','2024-07-10 03:25:28.250569'),(4854,'Dark Riddles','Where once there were many, now there are none. Time has done ticking; the hours are done. For now, is an end, but also beginning, For darkest is now, but soon shall be thinning. What is it?','\"Midnight\" - Reasoning: The riddle is all about following something through to the end - a day. Once the day reaches its end, at midnight, when all the hours of the day are gone, right down to the last second, the clock resets. Thus, it marks both the end of a day and the beginning of a new one.','Medium','2024-07-10 03:25:28.252478'),(4855,'Dark Riddles','Stealthy as a shadow in the dead of night, Cunning but affectionate if given a bite. Never owned but often loved. In my','A cat.','Hard','2024-07-10 03:25:28.254543'),(4856,'Dark Riddles','Which is the creature that has one voice, but has four feet in the morning, two feet in the afternoon, and three feet at night?','Man crawls on all fours as a baby, walks on two as an adult, and needs a walking cane when old.','Hard','2024-07-10 03:25:28.256520'),(4857,'Dark Riddles','A glow in the dark, A place without life, Where a small spark, Means the greatest strife. Where am I?','Space.','Hard','2024-07-10 03:25:28.258545'),(4858,'Dark Riddles','One knight, a pregnant lady, and a doctor walk into a hospital, the next morning three people walk out, who was the third person?','The knight.','Medium','2024-07-10 03:25:28.260404'),(4859,'Dark Riddles','Spelled forwards is a type of rodent that you might find in drains, spelled backward is something that you cannot touch but see it every day at night. What is this word?','Rats, star.','Hard','2024-07-10 03:25:28.262332'),(4860,'Dark Riddles','My first is a part of the day, My last a conductor of light, My whole to take the measure of time, Is useful by day and by night. What am I?','An Hour-glass.','Easy','2024-07-10 03:25:28.264105'),(4861,'Dark Riddles','There lived a man in a house and every time he went to bed he turned on the light. One night, the man forgot to turn on the light. The next day he read the paper and killed himself. Why?','The man lived in a lighthouse. He forgot to turn on the light and a ship crashed. The next morning he read in the paper that the ship crashed and killed himself because he felt guilty.','Medium','2024-07-10 03:25:28.265816'),(4862,'Dark Riddles','Which would see most clearly in total darkness? A bat, a tiger, or an owl.','None. In total darkness, it is impossible to see anything.','Medium','2024-07-10 03:25:28.267586'),(4863,'Dark Riddles','The more it is made, the more it is destroyed. The case can\'t be cracked, yet you won\'t be able to avoid it. It can be used for play or just a simple stay. Small, medium, or large, used in both light and in dark. What is it?','A Bed.','Easy','2024-07-10 03:25:28.270136'),(4864,'Dark Riddles','I\'m in Kentucky, with 2 bowls of chili. I stay there for 3 nights. I take a train to Georgia and back peddle to Kansas. Where am I?','Do not know the answer, help! Driving me crazy, and it\'s a short trip.','Easy','2024-07-10 03:25:28.272463'),(4865,'Dark Riddles','My legs are knives. I am a knight. I can reclaim what I lose in a fight. What am I?','A crab.','Hard','2024-07-10 03:25:28.275392'),(4866,'Dark Riddles','What happens only in the middle of each month, in all of the seasons, except summer, and happens only in the night, never in the day?','The letter \'N.\'','Medium','2024-07-10 03:25:28.277688'),(4867,'Dark Riddles','Here\'s a riddle for those who fiddle. Our clan is safe within the middle. So those for dark go to little. As you\'ll see a dragon\'s crittle. The Irish can help a diddle. But can you see the misinformed biddle?','This riddle is unanswered.','Medium','2024-07-10 03:25:28.280163'),(4868,'Dark Riddles','I am, in truth, a yellow fork From tables in the sky By inadvertent fingers dropped The awful cutlery. Of mansions never quite disclosed And never quite concealed The apparatus of the dark To ignorance revealed. What am I?','I am lightning.','Hard','2024-07-10 03:25:28.282828'),(4869,'Dark Riddles','Empty as space, Scary as a ghost, I appear every night What am I?','Darkness.','Medium','2024-07-10 03:25:28.285241'),(4870,'Dark Riddles','A color is seen on a stoplight, an item you use to eliminate the darkness. What comic book character is it?','Green Lantern.','Hard','2024-07-10 03:25:28.287469'),(4871,'Dark Riddles','How long would it take a fly, wearing a pair of wellingtons, walk through a tin of treacle?','A fortnight, it��s too weak.','Hard','2024-07-10 03:25:28.290213'),(4872,'Dark Riddles','I could sell tickets day and night, I am always awake I never get a break. What am I?','I don��t know.','Easy','2024-07-10 03:25:28.292562'),(4873,'Dark Riddles','Slam slam slam all day long slam slam slam some fast, some slow something solid. flat and sturdy its friend lights up the night and is sensitive to the eye slam slam slam A through Z 1,2,3 black as night. What am I?','A Computer keyboard.','Easy','2024-07-10 03:25:28.295029'),(4874,'Dark Riddles','What can only move by jumping?','The Knight chess piece.','Hard','2024-07-10 03:25:28.298567'),(4875,'Dark Riddles','I am round or oval? It can be light or dark. You can cut me into pieces. What am I?','A Potato.','Medium','2024-07-10 03:25:28.301341'),(4876,'Dark Riddles','No legs or two legs, four legs or more, the color of green, on Terra it stays. Teeming with chemicals of darkness and light, needing only a wind, a breath to lift the kite. What is it?','Life.','Hard','2024-07-10 03:25:28.304006'),(4877,'Dark Riddles','Where do zombies go for a night out?','Club Dead.','Hard','2024-07-10 03:25:28.307130'),(4878,'Dark Riddles','A room with no windows or doors, walks in the night, grows in a day, and is found where there is death and decay. What is it?','Mushrooms.','Hard','2024-07-10 03:25:28.309614'),(4879,'Dark Riddles','What is it that is full all day and empty at night?','Shoes.','Hard','2024-07-10 03:25:28.311991'),(4880,'Dark Riddles','What animal has more lives than a cat?','A frog, he croaks every night!','Easy','2024-07-10 03:25:28.314460'),(4881,'Dark Riddles','I have four legs but no tail. Usually, I am heard only at night. What am I?','A Frog.','Easy','2024-07-10 03:25:28.316647'),(4882,'Dark Riddles','Where do dead outlaws go on a Saturday night?','To ghost towns.','Hard','2024-07-10 03:25:28.319577'),(4883,'Dark Riddles','What famous nurse wore her pajamas all day long?','Florence Nightingown.','Medium','2024-07-10 03:25:28.322221'),(4884,'Dark Riddles','What is dressed when night falls and undressed when day breaks?','Fire.','Hard','2024-07-10 03:25:28.324560'),(4885,'Dark Riddles','What is significant about 3661 seconds past midnight on 1st January 2001?','The time and date will be 01:01:01 on 01/01/01.','Hard','2024-07-10 03:25:28.327162'),(4886,'Dark Riddles','You can get fooled by me and you have no clue what you are doing, you can see them day and night. What am I?','A sign.','Medium','2024-07-10 03:25:28.329562'),(4887,'Dark Riddles','Runs over fields and woods all day Under the bed at night sits not alone, With long tongue hanging out, Awaiting for a bone. What am I?','A shoe.','Medium','2024-07-10 03:25:28.331825'),(4888,'Dark Riddles','What is 1 animal that can see at night but be blinded at day?','A bat and 1=a.','Hard','2024-07-10 03:25:28.334405'),(4889,'Dark Riddles','What wears an eyepatch and robs ships at night?','A vampirate.','Easy','2024-07-10 03:25:28.336502'),(4890,'Dark Riddles','It takes the town hall clock 6 seconds to strike 4 o\'clock in the afternoon. How long does it take to strike midnight?','22 Seconds.','Easy','2024-07-10 03:25:28.338497'),(4891,'Dark Riddles','How many times does the long hand of the clock pass the shorthand between midnight one day and midnight the following day? As both hands are together at the starting time of midnight this does not count as a pass.','21','Easy','2024-07-10 03:25:28.340547'),(4892,'Dark Riddles','A person gets up 180 times every night and sleeps for at least 7 hours at a time. Where does the person live?','At the North or South Pole.','Medium','2024-07-10 03:25:28.342615'),(4893,'Dark Riddles','Who spends the day at the window, goes to the table for meals, and hides at night?','A fly.','Medium','2024-07-10 03:25:28.344702'),(4894,'Dark Riddles','A woman is walking down a street at night at a constant pace. As she passes the street light, she notices that her shadow becomes longer. Does the top of her shadow move faster, slower, or the same when the shadow is longer as when it is shorter?','This point maintains a constant speed, independent of the length of the shadow.','Medium','2024-07-10 03:25:28.346584'),(4895,'Dentist Riddles','What\'s at least 6 inches long, goes in your mouth, and is more fun if it vibrates?','A toothbrush.','Medium','2024-07-10 03:25:28.348518'),(4896,'Dentist Riddles','I\'m white, and used for cutting and grinding. When I\'m damaged, humans usually remove me or fill me. For most animals, I am a useful tool. What am I?','A tooth!','Medium','2024-07-10 03:25:28.350471'),(4897,'Dentist Riddles','Why did the king go to the dentist?','To get a new crown.','Easy','2024-07-10 03:25:28.352424'),(4898,'Dentist Riddles','What would you do if you broke a tooth while flossing?','Use toothpaste.','Medium','2024-07-10 03:25:28.354182'),(4899,'Dentist Riddles','Why are Tooth Fairies so smart?','They gather a lot of wisdom teeth.','Easy','2024-07-10 03:25:28.355985'),(4900,'Dentist Riddles','What do you call dental X-rays?','Tooth-Pics.','Easy','2024-07-10 03:25:28.358514'),(4901,'Dentist Riddles','How do you clean a dirty tuba?','With a tuba toothpaste!','Medium','2024-07-10 03:25:28.360408'),(4902,'Dentist Riddles','Who is a painstaking man?','The dentist.','Easy','2024-07-10 03:25:28.362461'),(4903,'Dentist Riddles','When should you charge your electric toothbrush?','When you can\'t pay cash.','Medium','2024-07-10 03:25:28.364326'),(4904,'Dentist Riddles','Blend a teapot shot so the pearlies whites won\'t rot! What is it?','Toothpaste!','Easy','2024-07-10 03:25:28.366512'),(4905,'Dog Riddles','If there are four sheep, two dogs, and one herds-men, how many feet are there?','Two. Sheep have hooves; dogs have paws; only people have feet.','Medium','2024-07-10 03:25:28.368583'),(4906,'Dog Riddles','All of Mrs. Smith\'s pets are dogs except one, and all her pets are cats except one. How many cats and dogs does she have?','Mrs. Smith has one cat and one dog.','Hard','2024-07-10 03:25:28.370541'),(4907,'Dog Riddles','How can you tell the difference between dogs and trees?','By their bark.','Hard','2024-07-10 03:25:28.372505'),(4908,'Dog Riddles','What animal keeps the best time?','A Watchdog.','Hard','2024-07-10 03:25:28.375036'),(4909,'Dog Riddles','To you, rude would I never be, Though I flag my tongue for all to see. What am I?','A dog!','Hard','2024-07-10 03:25:28.377499'),(4910,'Dog Riddles','If a dog is tied to a piece of rope that is 6m long, how can he reach a bone that is 7m away?','The other end is not tied to anything.','Hard','2024-07-10 03:25:28.379795'),(4911,'Dog Riddles','Stranger: Does your dog bite? Farmer: Nope. All of a sudden the dog bites the stranger on the leg. Yet the farmer was telling the truth! How can this be?','It was not the farmer\'s dog!','Hard','2024-07-10 03:25:28.382117'),(4912,'Dog Riddles','There are 10 dogs in a yard. 3 go out, 4 run behind a tree, and 2 jump in the hole. How many are left?','10. Because none of them left the yard.','Easy','2024-07-10 03:25:28.384383'),(4913,'Dog Riddles','What happens after it rains cats and dogs?','You step in a poodle.','Hard','2024-07-10 03:25:28.386891'),(4914,'Dog Riddles','What type of dogs do scientists have?','Laboratory retrievers.','Medium','2024-07-10 03:25:28.389488'),(4915,'Dog Riddles','Two dogs are sitting on a porch - a fat dog and a thin dog. The little dog is the son of the fat dog, but the fat dog is not the father of the thin dog. Can you explain?','The fat dog is the mother.','Easy','2024-07-10 03:25:28.391449'),(4916,'Dog Riddles','A man is on one side of a river, his dog on the other. The man calls his dog, who immediately crossed the river without getting wet and without using a bridge or a boat. How did the dog do it?','The river was frozen.','Medium','2024-07-10 03:25:28.393833'),(4917,'Dog Riddles','What do you get when you cross a dog and a clock?','Lots and lots of tics!','Hard','2024-07-10 03:25:28.395848'),(4918,'Dog Riddles','What is the smallest sentence with all letters in the English alphabet?','The quick brown fox jumps over the lazy dog.','Hard','2024-07-10 03:25:28.398522'),(4919,'Dog Riddles','What type of dog does a vampire have?','A Bloodhound!','Hard','2024-07-10 03:25:28.400537'),(4920,'Dog Riddles','Walk on the living, they don\'t even mumble. Walk on the dead, they mutter and grumble. What are they?','Fallen leaves.','Medium','2024-07-10 03:25:28.402657'),(4921,'Dog Riddles','When is the worst weather for rats and mice?','When it rains cats and dogs.','Medium','2024-07-10 03:25:28.404726'),(4922,'Dog Riddles','What kind of dog does Dracula have?','A blood-hound.','Medium','2024-07-10 03:25:28.406887'),(4923,'Dog Riddles','What is a dog\'s name with one letter and one number?','K9 (canine).','Medium','2024-07-10 03:25:28.409193'),(4924,'Dog Riddles','A guy bet his neighbor 50 bucks that his dog could jump higher than a house. Thinking this was not possible, the neighbor took the bet and lost. Why did he lose the bet?','a house cannot jump!','Easy','2024-07-10 03:25:28.411427'),(4925,'Dog Riddles','How does a dog stop the VCR?','He uses the PAWS button.','Easy','2024-07-10 03:25:28.413798'),(4926,'Dog Riddles','What wears a coat all year round?','A dog.','Medium','2024-07-10 03:25:28.415991'),(4927,'Dog Riddles','You\'re never too old to learn. What is the contradictory proverb?','You can\'t teach an old dog new tricks.','Medium','2024-07-10 03:25:28.418000'),(4928,'Dog Riddles','How far can a dog run into the woods?','Halfway, any farther and he would be running out of the woods.','Easy','2024-07-10 03:25:28.420039'),(4929,'Dog Riddles','What is more amazing than a talking dog?','A spelling bee','Easy','2024-07-10 03:25:28.422259'),(4930,'Dog Riddles','What animal keeps the best time?','A Watchdog','Medium','2024-07-