e offers them a lift, but one prefers to stay. Who preferred to stay?','The Elephant Stayed. If you didn\'t know, elephants are scared of mice.','Medium','2024-07-10 03:25:28.470715'),(4956,'Duck Riddles','A duck arrives near a lake. He sees a sign where it is written \"No swimming allowed.\", but the duck jumps into the water. Why?','Because ducks can\'t read.','Easy','2024-07-10 03:25:28.473301'),(4957,'Duck Riddles','Why did Mama Duck scold her goslings?','For eating quackers in bed.','Medium','2024-07-10 03:25:28.474947'),(4958,'Duck Riddles','What time does a duck get up?','At the quack of dawn.','Medium','2024-07-10 03:25:28.476300'),(4959,'Duck Riddles','Why did the duck get fired from his Easter job?','He kept quacking the eggs.','Medium','2024-07-10 03:25:28.477965'),(4960,'Duck Riddles','Twenty-seven ducks are going to the pond. Five of them got lost, thirteen of them are staying home, nine of them are at the pond. Where are the rest of them?','There aren\'t any anywhere else.','Hard','2024-07-10 03:25:28.479328'),(4961,'Duck Riddles','What does the cow say when he agrees with the duck?','The feeling is moo-tual.','Hard','2024-07-10 03:25:28.481028'),(4962,'Duck Riddles','What animal would you get crossed a duck, a beaver, and an otter?','A platypus.','Medium','2024-07-10 03:25:28.482507'),(4963,'Duck Riddles','What do you get when you cross Santa Claus and a duck?','A Christmas quacker.','Easy','2024-07-10 03:25:28.483860'),(4964,'Fire Riddles','I am not alive, but I grow; I don\'t have lungs, but I need air; I don\'t have a mouth, but water kills me. What am I?','Fire.','Hard','2024-07-10 03:25:28.485536'),(4965,'Fire Riddles','I was carried into a dark room, and set on fire. I wept, and then my head was cut off. What am I?','A Candle.','Hard','2024-07-10 03:25:28.486852'),(4966,'Fire Riddles','If a fire hydrant has H2O inside, what does it have on the outside?','K9P (you\'ll get it eventually).','Medium','2024-07-10 03:25:28.488403'),(4967,'Fire Riddles