 What am I?','A volcano.','Medium','2024-07-10 03:25:28.528471'),(4988,'Fire Riddles','The ghost of the mountain never to be seen, leaps like a raging fire to catch his prey. As pale as the moon but fast as the wind. Cold as ice, but a flash of light in the night. What is it?','A snow leopard.','Easy','2024-07-10 03:25:28.530422'),(4989,'Fire Riddles','What insect does a blacksmith manufacture?','He makes the firefly.','Easy','2024-07-10 03:25:28.532409'),(4990,'Fire Riddles','A group of men is suddenly awakened by a loud, piercing, continuous sound. They all scramble out of their beds, get dressed, grab a pole, and disappear into a hole. What in the world are these men doing?','The men are firemen who were on night-shift duty at their firehouse. When they heard the fire alarm, they got dressed, slid down the fire pole, and got in the fire truck.','Easy','2024-07-10 03:25:28.534257'),(4991,'Fire Riddles','Fire is often maintained above me, and if you remove my first letter, you will find the home shared by everyone you have ever known. What am I?','A Hearth.','Medium','2024-07-10 03:25:28.537268'),(4992,'Fire Riddles','Why does a firefly glow?','It eats light meals.','Medium','2024-07-10 03:25:28.539396'),(4993,'Fire Riddles','I am energy. I am heat. I am hot. I am red. What am I?','I am fire.','Medium','2024-07-10 03:25:28.541724'),(4994,'Fire Riddles','A group of men are suddenly awakened by a loud, piercing, continuous sound. They all scramble out of their beds, get dressed, grab a pole, and disappear into a hole. What in the world are these men doing?','They are firemen who were sleeping in their fire station. When they heard the fire alarm, they quickly got dressed, slid down the fire pole, and got in the fire engine to head to the reported fire.','Hard','2024-07-10 03:25:28.544008'),(4995,'Fire Riddles','What can be underwater, under fire, on fire and taking water all at the same time?','Submarine. Underwater meaning in water. Under fire meaning getting shot a