'Your Fears.','Hard','2024-07-10 03:25:29.087220'),(5248,'Horror Riddles','A mouse, a squirrel, a duck, a chicken, and an elephant are sitting on the side of the road. Someone offers them a lift, but one prefers to stay. Who preferred to stay?','The Elephant Stayed. If you didn\'t know, elephants are scared of mice.','Easy','2024-07-10 03:25:29.089647'),(5249,'Horror Riddles','Adored by few, Feared and hated by many. Mistress of the entire universal reason, Master in the art of numbers. Some may have solved many of your mysteries, But there is still much of them to find. What are they?','Mathematics.','Easy','2024-07-10 03:25:29.091955'),(5250,'Horror Riddles','A woman was horrified to find a fly in her tea. The waiter took her cup and went into the kitchen and returned with a fresh cup of tea. She shouted, \"You brought me the same tea!\" How did she know?','She had already put sugar in it and when she tasted the new tea it was already sweet.','Medium','2024-07-10 03:25:29.094298'),(5251,'Horror Riddles','Why was the arrow trembling?','Because he saw his friends in a quiver. (arrow pouch)','Medium','2024-07-10 03:25:29.096820'),(5252,'Horror Riddles','What\'s a type of cloud that\'s afraid of heights?','Fog, because Fog is like a cloud but it\'s never in the sky.','Medium','2024-07-10 03:25:29.099228'),(5253,'Horror Riddles','Fifty is my first. Nothing is my second. Five just makes my third. My fourth, a vowel, is reckoned. Now to find my name, Fit my parts together. I die if I grow cold but never fear cold weather. What am I?','L O V E.','Hard','2024-07-10 03:25:29.101479'),(5254,'Horror Riddles','What is a cereal\'s worst fear?','A cereal killer.','Easy','2024-07-10 03:25:29.103475'),(5255,'Horror Riddles','I\'m alive and I die. When cut, I bleed I do not fear the seasons. I make my home above yet below the land. I\'m a friend to man and beastie, yet hunted by both. My bones are always within sight. What am I?','A Tree.','Medium','2024-07-10 03:25:29.105610'),(5256,'Horror Riddles','A girl walked into a bar and ordered some water. The bartender then threw a big hairy spider at her. A few minutes later, the girl thanked the man and walked out. Why?','The girl had the hiccups and the man scared them away by throwing the big hairy spider at her.','Easy','2024-07-10 03:25:29.107295'),(5257,'Horror Riddles','I know what my job is, The point has been made. You say I have a big head, And you\'re right, I\'m afraid. Put me in my place, And then leave me alone. What I need most, Is someone to drive me home. What am I?','A Nail!','Medium','2024-07-10 03:25:29.109270'),(5258,'Horror Riddles','In this place, people lie, people cry, and people ask why. In this place, people sleep, people, weep, and people\'s solitude, they keep. What is it?','\"Graveyard\" or \"Cemetery\" - Reasoning: Both \"people lie\" and \"people sleep\" are indications of many people using this place to lie down, or to sleep, which in itself is an odd thought. Crying and weeping indicate that this is a sad place, and the continued use of \"people\" allows this to mean not just those who are lying down or sleeping, but those who come to visit them there, (i.e. mourners). People come to ask the person\'s grave why they did what they did that resulted in their death, as a form of mourning, or to ask their chosen God or Gods why they took that person to their grave. And peoples solitude refers to people sleeping on their own, or the mourners usually coming the mourn privately.','Hard','2024-07-10 03:25:29.111020'),(5259,'Horror Riddles','When people add me they\'re often shaking; On the tip of their tongue there\'s no mistaking; I\'m here to help if the devil is waiting. What am I?','Salt.','Hard','2024-07-10 03:25:29.113463'),(5260,'Horror Riddles','Why was 6 afraid of 7?','Because 7,8,9.','Medium','2024-07-10 03:25:29.116498'),(5261,'Horror Riddles','Our armor may be stolen, But still a thousand blades cause us no fear, One or many, it\'s all the same, Before our number, you will fall. What are we?','Sheep.','Hard','2024-07-10 03:25:29.118737'),(5262,'Horror Riddles','I\'m scared of the water, But not scared of heights; I\'m light and come in different colors, But typically just white. What am I?','Tissue','Hard','2024-07-10 03:25:29.121157'),(5263,'Horror Riddles','I am brave but, wear the thing I used to fear most, I am bold, but not willing to kill. Who am I?','Batman.','Medium','2024-07-10 03:25:29.123493'),(5264,'Horror Riddles','Why were the notebooks afraid to go to college?','Because the College ruled notebooks!','Hard','2024-07-10 03:25:29.126081'),(5265,'Horror Riddles','I am the creature that robs men of their dignity, pride, and will. I feast on children\'s dreams till\' they have none. I am the monster in your head, waiting to strike. What am I?','I am fear, SO FEAR ME!','Easy','2024-07-10 03:25:29.128105'),(5266,'Horror Riddles','I am something that the naughty boys use to draw on, girls write beautifully on the side, you have to clap my defeaters every day, and I stand dumbly as the young children cry. What am I?','A chalkboard. (When the young children cry, it means they are crying for a turn to write the answer and the defeaters are the erasers)','Hard','2024-07-10 03:25:29.129897'),(5267,'Horror Riddles','There is a man standing on top of a mountain frozen holding a piece of straw. How did he get there?','He was with his friend in a hot-air balloon when they were about to hit a mountain so they took off their clothes to make it lighter so they would go higher it wasn\'t working so they drew straws and whoever had the shortest straw would have to jump out so he was the one who picked the shortest straw.','Hard','2024-07-10 03:25:29.131619'),(5268,'Kitchen Riddles','You have three stoves: a gas stove, a wood stove, and a coal stove, but only one match. Which should you light first?','The match!','Easy','2024-07-10 03:25:29.133308'),(5269,'Kitchen Riddles','Which is the only way a leopard can change his spots?','By going from one spot to another.','Medium','2024-07-10 03:25:29.135346'),(5270,'Kitchen Riddles','If it takes 5 microwaves 5 minutes to cook 5 chickens, how long does it take 100 microwaves to cook 100 chickens?','5 minutes. We can assume that one chicken is placed in each microwave and that each chicken takes 5 minutes to cook.','Hard','2024-07-10 03:25:29.138062'),(5271,'Kitchen Riddles','If you put roast in a roaster, what do you put in toaster?','Bread.','Hard','2024-07-10 03:25:29.139996'),(5272,'Kitchen Riddles','Double my number, I\'m less than a score, and half of my number is less than four. Add one to my double when bakers are near, days of the week are still greater, I fear. What am I?','The number six.','Hard','2024-07-10 03:25:29.141802'),(5273,'Kitchen Riddles','Why did the outlaw hold up the bakery?','He kneaded the dough.','Medium','2024-07-10 03:25:29.143641'),(5274,'Kitchen Riddles','What kind of garden does a baker have?','A flour garden!','Hard','2024-07-10 03:25:29.145513'),(5275,'Kitchen Riddles','I have a short, wide body. It is cold and shiny. My insides are hot as flame. I have two mouths. My tail is long and forked. What am I?','A Toaster.','Hard','2024-07-10 03:25:29.147447'),(5276,'Kitchen Riddles','Big as a biscuit, deep as a cup, even a river can\'t fill it up. What is it?','A kitchen strainer.','Easy','2024-07-10 03:25:29.150358'),(5277,'Kitchen Riddles','What washes up on tiny beaches?','Microwaves.','Easy','2024-07-10 03:25:29.151937'),(5278,'Kitchen Riddles','A woman was horrified to find a fly in her tea. The waiter took her cup and went into the kitchen and returned with a fresh cup of tea. She shouted, \"You brought me the same tea!\" How did she know?','She had already put sugar in it and when she tasted the new tea it was already sweet.','Easy','2024-07-10 03:25:29.153546'),(5279,'Kitchen Riddles','Why is the best baker most in want of bread?','Because he kneads (needs) it most.','Easy','2024-07-10 03:25:29.154749'),(5280,'Ki