re him. His mother died while giving birth to him. Finally, he grew up to be a minister and married his sister at her ceremony.','Easy','2024-07-10 03:25:29.340935'),(5378,'Murder Riddles','There is a clerk at the butcher shop, he is five feet ten inches tall, and he wears size 13 sneakers. He has a wife and 2 kids. What does he weigh?','Meat.','Easy','2024-07-10 03:25:29.343719'),(5379,'Murder Riddles','A woman is at her mother\'s funeral when suddenly she sees a man so handsome, that she instantly falls in love with her. Unfortunately, she never got a chance to talk to the man. The next day, the woman kills her sister. What was the motive?','The woman was hoping to see the man again. If you got this correct on the first try, you have the mind of a psychopath.','Easy','2024-07-10 03:25:29.346219'),(5380,'Murder Riddles','What hired killer never goes to jail?','An exterminator.','Hard','2024-07-10 03:25:29.348478'),(5381,'Murder Riddles','A thousand colored folds stretch toward the sky, Atop a tender strand, Rising from the land, \'Til killed by maiden\'s hand, Perhaps a token of love, perhaps to say goodbye. What am I?','A flower.','Easy','2024-07-10 03:25:29.351430'),(5382,'Murder Riddles','I am a rock group that has 4 members, all of whom are dead, one of which was assassinated. What am I?','Mount Rushmore.? Get it, rock group?','Medium','2024-07-10 03:25:29.354024'),(5383,'Murder Riddles','Something that requires our mental skill to decode it, our imagination to understand it, our knowledge is tested to its max, it confuses us at every stage, it seems easy yet difficult, only those who are used to, will get through. What is it?','A riddle.','Easy','2024-07-10 03:25:29.356321'),(5384,'Murder Riddles','Every month someone dies, and there are five suspects. The suspects are, Jason, Lily, Nathan, Elizabeth, and Erin, and the months of the murders are July, August, September, October, and November. Who\'s the murderer?','Jason. J, July. A, August. S, September. O, October. N, November.','Medium','2024-07-10 03:25:29.358999'),(5385,'Murder Riddles','Inside napper, bird chaser, quick stoker, small animal killer, fish eater. What is it?','A cat.','Medium','2024-07-10 03:25:29.362132'),(5386,'Murder Riddles','What kills you inside the more you keep it and sets you free the moment you release it?','Guilt.','Hard','2024-07-10 03:25:29.364698'),(5387,'Murder Riddles','I wear you down, yet you\'ll mourn me once I fly. You can kill me, but I will never die. What am I?','Time.','Easy','2024-07-10 03:25:29.367375'),(5388,'Murder Riddles','A man moved into a new house and decided he was tired after the journey and turned off all the lights and went to bed. The next morning he had killed 365 people how could this be? he does not sleep walk he slept like a baby','he lived in a lighthouse','Medium','2024-07-10 03:25:29.370000'),(5389,'Murder Riddles','What word is a fun word until you add one letter and it becomes a terrible word that no one wants to happen?','Laughter: If you add an \'S\' to the begging of laughter it becomes slaughter.','Hard','2024-07-10 03:25:29.372362'),(5390,'Murder Riddles','A plane crashed and every single person on board this flight was killed, yet, there were survivors. Can you explain how?','The married people lived; the singles died.','Easy','2024-07-10 03:25:29.375382'),(5391,'Murder Riddles','You are sitting at a table eating lunch and there are ten flies on the table. With a quick swat, you are able to kill three flies. How many flies are left on the table?','You killed three flies that remain on the table.? The others flew off when you swatted.','Medium','2024-07-10 03:25:29.377923'),(5392,'Murder Riddles','I have a butt, but I\'m not alive. I bring smoke but am not fire. I destroy, I kill, though I am not used in a war. What am I?','A cigarette.','Medium','2024-07-10 03:25:29.379859'),(5393,'Murder Riddles','I eat animals but I don\'t hunt or kill. What am I?','A vulture.','Medium','2024-07-10 03:25:29.381766'),(5394,'Murder Riddles','When I move, I tip the scales. I am the source of many tales. Around your foot, a sign of wealth. Around a stick, a sign of health. Around your chest, your final breath. On your neck, say hi to death. What am I?','A snake. Snake scales. Snake Tail and snakes are usually the antagonists. Snakeskin is very expensive. Snakes on a stick are almost always seen in hospitals. Constrictors squeeze the life out of you. A poisonous snakebite on your neck would kill you extremely fast.','Hard','2024-07-10 03:25:29.383911'),(5395,'Murder Riddles','Why did the man shoot the clock?','He was','Hard','2024-07-10 03:25:29.386338'),(5396,'Murder Riddles','I am both a killer and a savior, it depends on those who wield me. I will bring you from deep water to the shallows, or maybe I could be the one who will hang you on the gallows. What am I?','A rope.','Medium','2024-07-10 03:25:29.388313'),(5397,'Murder Riddles','I want everything within sight. The impossible will not flee my plight. I will take it all by any means. To have is my heart\'s very need. A bottomless pit that nothing will fill. I have even led humans to kill. What am I?','Greed.','Medium','2024-07-10 03:25:29.390231'),(5398,'Murder Riddles','I am boneless, small, and weak, yet can crush and kill; the speed of what comes out of me outstrips the steed. My great storehouse is your heart. Keep me to keep your soul from troubles. What am I?','Your tongue!','Medium','2024-07-10 03:25:29.392783'),(5399,'Murder Riddles','An excess of individuals skilled in the preparation of edibles impairs the quality of this soup. What is the proverb?','Too many cooks spoil the broth.','Hard','2024-07-10 03:25:29.394943'),(5400,'Murder Riddles','Why was the clock arrested?','For killing time.','Hard','2024-07-10 03:25:29.398367'),(5401,'Murder Riddles','I\'m a killing machine used again and again; I bend a little, but way less than my friend; For many years I was number one, But I\'ve been replaced by my modern son. 