 a beetle, as annoying as a fly, and I like to kill trees, what am I?','A Lantern Fly! (Also stop stealing my riddles, Berries, the LearnyVerse Wizard from Pyranic)','Hard','2024-07-10 03:25:29.418287'),(5410,'Murder Riddles','Endlessly, I hunger, Lazily, I sleep. Murderous, I thunder, Desires, I do seek. Hoarding countless treasures, so my stature I retain, Envious of others whose feet on Earth remain. What am I?','\"The Seven Deadly Sins\" - Reasoning: Each sentence structure portrays one of the seven deadly sins from Christian theology, with the exception of the final 5 words. In order according to the riddle, these are; gluttony, sloth, wrath, lust, greed, pride, and envy. The final 5 words, \"whose feet on Earth remain\", act in conjunction with the section on envy, demonstrating the perspective of a sinner in hell, who is envious of those still alive, and thus can still repent for their sins in order to enter Heaven.','Easy','2024-07-10 03:25:29.420133'),(5411,'Murder Riddles','What dies but is never killed?','A bad joke.','Hard','2024-07-10 03:25:29.421800'),(5412,'Murder Riddles','A parliament, a congress, a conspiracy, a murder, a wake. What am I?','A flock of Corvids.','Hard','2024-07-10 03:25:29.423546'),(5413,'Murder Riddles','A woman proves in court that her husband was murdered by her sister, but the judge decides that the sister cannot be punished. Why?','The sisters are Siamese twins.','Easy','2024-07-10 03:25:29.425690'),(5414,'Murder Riddles','Who cowardly a prince did kill?','Joab��2 Samuel xviii. 14.','Medium','2024-07-10 03:25:29.427559'),(5415,'Murder Riddles','What is an executioner\'s favorite hobby?','Hang gliding.','Medium','2024-07-10 03:25:29.430318'),(5416,'Murder Riddles','If it takes four rat catchers four minutes to kill four rats, how many rat catchers would be needed to catch 50 rats in 50 minutes?','The same number of rat catchers- Four.','Medium','2024-07-10 03:25:29.432040'),(5417,'Murder Riddles','A queen bee was buzzing, a worker bee was buzzing, a honey bee was buzzing, and a killer bee was buzzing. How many bees were buzzing?','One. There is only one b in the word buzzing','Medium','2024-07-10 03:25:29.434088'),(5418,'Murder Riddles','If seven cats kill seven rats in 7 minutes, how many would be needed to kill one hundred rats in 50 minutes?','14','Easy','2024-07-10 03:25:29.435860'),(5419,'Murder Riddles','I\'m one of five, I\'m not alive. The one who sent me forth became king, The one who received me died. What am I?','A Stone from the popular Biblical story, David had five stones. He used one of the stones to kill Goliath.','Medium','2024-07-10 03:25:29.437589'),(5420,'Murder Riddles','I killed one-fourth of all mankind. Who am I?','Cain (who killed Abel).','Hard','2024-07-10 03:25:29.439339'),(5421,'Music Riddles','What type of music do rabbits listen to?','Hip hop.','Medium','2024-07-10 03:25:29.441309'),(5422,'Music Riddles','When is music like vegetables?','When there are two beats (beets) to the measure.','Medium','2024-07-10 03:25:29.443069'),(5423,'Music Riddles','What type of music is a mummy\'s favorite?','Wrap.','Easy','2024-07-10 03:25:29.445096'),(5424,'Music Riddles','What kind of music can you hear in space?','A nept-tune.','Hard','2024-07-10 03:25:29.446839'),(5425,'Music Riddles','I am a fruit. If you take away the first letter of my name I become a crime. Take away the first two letters of my name I become an animal. Take away the first and last letter of my name and I become a form of music. What am I?','Grape.','Medium','2024-07-10 03:25:29.448685'),(5426,'Music Riddles','I can bring you joy or sorrow, or everything in between. None have seen, smelt or felt me, yet many still know what I am. I have many types, but I am really just one thing. What am I?','Music.','Easy','2024-07-10 03:25:29.450838'),(5427,'Music Riddles','What kind of a band, never plays music?','A rubber band!','Medium','2024-07-10 03:25:29.452815'),(5428,'Music Riddles','At the sound of me, men may dream, Or stamp their feet. At the sound of me, women may laugh, Or sometimes weep. What am I?','I am Music!','Hard','2024-07-10 03:25:29.454696'),(5429,'Music Riddles','What kind of music do aliens like?','Nep-tunes.','Easy','2024-07-10 03:25:29.456588'),(5430,'Music Riddles','In Ancient Egypt, what music did the mummies like most?','Wrap Music.','Easy','2024-07-10 03:25:29.458895'),(5431,'Music Riddles','My scale is something that does not weigh in grams, ounces, or pounds. However, I may be heavy or light. What am I?','Music scales.','Easy','2024-07-10 03:25:29.461519'),(5432,'Music Riddles','What 3 common songs have the same meleody?','Baa Baa Black Sheep twinkle twinkle litle star and the Alphabet song! wow kid songs','Easy','2024-07-10 03:25:29.463740'),(5433,'Music Riddles','What kind if music is played inside the vehicle?','Car-tunes.','Medium','2024-07-10 03:25:29.466780'),(5434,'Music Riddles','What type of music are balloons scared of?','Pop Music!','Hard','2024-07-10 03:25:29.469349'),(5435,'Music Riddles','I cannot be felt, seen or touched; Yet I can be found in everybody; My existence is always in debate; Yet I have my own style of music. What Am I?','I\'m a Soul.','Medium','2024-07-10 03:25:29.471700'),(5436,'Music Riddles','What song was the baseball player singing on third base?','\"There\'s no place like home.\"','Hard','2024-07-10 03:25:29.473875'),(5437,'Music Riddles','You can hear me and feel me but you can\'t see me or smell me, yet everyone has a taste in me. I can be created, but after that only remembered. What am I?','Music.','Medium','2024-07-10 03:25:29.475971'),(5438,'Music Riddles','My call, I pray, at dawn of day, Shall rest you from your slumber, With job all done, my song all sung, I\'ll sit on seat of lumber. What am I?','A Rooster.','Easy','2024-07-10 03:25:29.478491'),(5439,'Music Riddles','I cannot be felt, seen or touched; Yet I can be found in everybody; My existence is always in debate; Yet I have my own style of music. Wha