ht','Medium','2024-07-10 03:25:29.528510'),(5461,'Pet Riddles','If there are four sheep, two dogs and one herds-men, how many feet are there?','Two. Sheep have hooves; dogs have paws; only people have feet.','Hard','2024-07-10 03:25:29.530394'),(5462,'Pet Riddles','I act like a cat, I look like a','Kitten.','Medium','2024-07-10 03:25:29.531974'),(5463,'Pet Riddles','There are 2 ducks in front of 2 other ducks. There are 2 ducks behind 2 other ducks. There are 2 ducks beside 2 other ducks. How many ducks are there?','Just four, in a square formation.','Hard','2024-07-10 03:25:29.533522'),(5464,'Pet Riddles','While on my way to St. Ives, I saw a man with 7 wives. Each wife had 7 sacks. Each sack had 7 cats. Each cat had 7 kittens. Kitten, cats, sacks, wives, How many were going to St. Ives?','Just one, me.','Easy','2024-07-10 03:25:29.535202'),(5465,'Pet Riddles','I\'m found in socks, scarves, and mittens. I\'m found in the paws of playful kittens. What am I?','Yarn.','Medium','2024-07-10 03:25:29.537245'),(5466,'Pet Riddles','A farmer has twenty sheep, ten','Ten Cows. We can call the pigs cows but it doesn\'t make them cows.','Easy','2024-07-10 03:25:29.538905'),(5467,'Pet Riddles','Why did the turkey cross the road?','To prove he wasn\'t chicken.','Easy','2024-07-10 03:25:29.540576'),(5468,'Pet Riddles','If a chicken says, \"All chickens are liars\". Is the chicken telling the truth?','Answer: Chickens cannot talk.','Medium','2024-07-10 03:25:29.542742'),(5469,'Pet Riddles','All of Mrs. Smith\'s pets are dogs except one, and all her pets are cats except one. How many cats and dogs does she have?','Mrs. Smith has one cat and one dog.','Medium','2024-07-10 03:25:29.544352'),(5470,'Pet Riddles','How can you tell the difference between dogs and trees?','By their bark.','Medium','2024-07-10 03:25:29.546194'),(5471,'Pet Riddles','What animal keeps the best time?','A Watchdog.','Medium','2024-07-10 03:25:29.547916'),(5472,'Pet Riddles','If it takes 5 microwaves and 5 minut