all the pigs cows but it doesn\'t make them cows.','Medium','2024-07-10 03:25:29.742466'),(5569,'Pig Riddles','What do you call pigs that write letters to each other?','Pen Pals.','Hard','2024-07-10 03:25:29.744592'),(5570,'Pig Riddles','Why can\'t you play basketball with pigs?','Because they will \"hog\" the ball!','Hard','2024-07-10 03:25:29.746902'),(5571,'Pig Riddles','Why did Momma Pig leave her husband?','Because he was a boar.','Easy','2024-07-10 03:25:29.749698'),(5572,'Pig Riddles','What do you call a pig that does karate?','A Porkchop.','Medium','2024-07-10 03:25:29.751507'),(5573,'Pig Riddles','What pen should never be used for writing?','A pig-pen.','Medium','2024-07-10 03:25:29.753829'),(5574,'Pig Riddles','What do you get when you cross a pig with a','Jurassic pork!','Easy','2024-07-10 03:25:29.755939'),(5575,'Pig Riddles','It is said among my people that some things are improved by death. Tell me, what stinks while living, but in death, smells good?','A Pig.','Easy','2024-07-10 03:25:29.758020'),(5576,'Pig Riddles','What position do pigs play on the baseball field?','Short-stop.','Medium','2024-07-10 03:25:29.760047'),(5577,'Pig Riddles','What do you give a sick pig?','An \"oinkment\"','Hard','2024-07-10 03:25:29.761916'),(5578,'Pig Riddles','What do you call a car made of pigs?','A ��ham��borgini.','Hard','2024-07-10 03:25:29.764014'),(5579,'Pig Riddles','Why was the pig a bad teammate?','He was a ball hog.','Medium','2024-07-10 03:25:29.766518'),(5580,'Pig Riddles','My body has a dozen heads or more, My tails don\'t wag when you walk in the door. Count the ways you can hold me tight, Or use me for a special night! What Am I?','A piggy bank.','Easy','2024-07-10 03:25:29.768525'),(5581,'Pig Riddles','My first is twice in apple but not once in tart. My second is in liver but not in heart. My third is in giant and also in ghost. Whole I\'m best when I am roast. What am I?','The word Pig.','Easy','2024-07-10 03:25:29.770742'),(5582,'Pig Riddles','What did the falling space rock say when it landed on a pig farm?','Move over bacon, here comes something Meteor!','Easy','2024-07-10 03:25:29.772764'),(5583,'Pig Riddles','You have seven pens and nine pigs. You must arrange the pens so that each pen has an even number of pigs. Zero is not allowed, nor will it work. How do you do this?','Stack the pens.','Easy','2024-07-10 03:25:29.774803'),(5584,'Pig Riddles','When was pork first introduced into the Navy?','When Noah brought Ham into the ark.','Medium','2024-07-10 03:25:29.777246'),(5585,'Pig Riddles','The hand sows, the eyes harvest?','To read and to write.','Hard','2024-07-10 03:25:29.779348'),(5586,'Planet Riddles','Before Mount Everest was discovered, what was the highest mountain on Earth?','Mount Everest.','Easy','2024-07-10 03:25:29.781548'),(5587,'Planet Riddles','I\'m a god, a planet, and a measurer of heat. Who am I?','Mercury.','Medium','2024-07-10 03:25:29.783511'),(5588,'Planet Riddles','A cloud was my mother, the wind is my father, my son is the cool stream, and my daughter is the fruit of the land. A rainbow is my bed, the earth my final resting place, and I\'m the torment of man. Who Am I?','Rain.','Medium','2024-07-10 03:25:29.785671'),(5589,'Planet Riddles','How does NASA throw a party?','They planet.','Easy','2024-07-10 03:25:29.787681'),(5590,'Planet Riddles','Here on earth it is true, yesterday is always before today; but there is a place where yesterday always follows today. Where?','The Dictionary.','Hard','2024-07-10 03:25:29.789730'),(5591,'Planet Riddles','What is one thing that all wise men, regardless of their politics or religion, agree is between heaven and earth?','The word \'And\'.','Hard','2024-07-10 03:25:29.791604'),(5592,'Planet Riddles','What is always traveling, has life, has sense but doesn\'t live?','The Earth!','Easy','2024-07-10 03:25:29.793812'),(5593,'Planet Riddles','I come right in front of Earth, at the end of time, and twice in a week. What am I?','The letter E.','Medium','2024-07-10 03:25:29.795754'),(5594,'Planet Riddles','How can we tell that Saturn was married more than once?','Because she has so many rings!','Medium','2024-07-10 03:25:29.797473'),(5595,'Planet Riddles','I\'m first on earth, second in heaven, I appear twice in a week, and once in a year, I\'m in the middle of the Sea. What am I?','The letter E.','Hard','2024-07-10 03:25:29.799294'),(5596,'Planet Riddles','Why did Mickey Mouse go to space?','To look for Pluto!','Hard','2024-07-10 03:25:29.801260'),(5597,'Planet Riddles','What is made of wood but no saw on earth is sharp enough to cut?','Sawdust.','Easy','2024-07-10 03:25:29.803646'),(5598,'Planet Riddles','I blossom like a flower, a hindrance I create, and save you from the earth, do not use me too late. What am I?','A Parachute.','Hard','2024-07-10 03:25:29.805793'),(5599,'Planet Riddles','The higher I climb, the hotter I engage, I can not escape my crystal cage. What am I?','Mercury in a thermometer.','Medium','2024-07-10 03:25:29.807605'),(5600,'Planet Riddles','I welcome the day with a show of light, I steathily came here in the night. I bathe the earthy stuff at dawn, But by the noon, alas! I\'m gone. What am I?','The morning dew!','Hard','2024-07-10 03:25:29.809748'),(5601,'Planet Riddles','I begin the earth and end the eclipse, I occur in seconds and minutes, but never in a hand although I am in a lifetime. What am I?','Letter E.','Medium','2024-07-10 03:25:29.811756'),(5602,'Planet Riddles','What do cows give after an earthquake?','Milk shakes.','Easy','2024-07-10 03:25:29.814177'),(5603,'Planet Riddles','I am hewn from Earth and Fire; But to the sky, I aspire. I am nothing but contented; Until my patient rage is vented. What am I?','A volcano.','Hard','2024-07-10 03:25:29.816442'),(5604,'Planet Riddles','I am in the beginning of the earth. I am at the end of time. I appear two times in a week. I appear once in a year. What Am I ?','The Letter \"E\".','Hard','2024-07-10 03:25:29.818566'),(5605,'Planet Riddles','Many always do say that I am life. I occupy most part of the earth surface, yet I\'m found in you. What am I?','Water.','Medium','2024-07-10 03:25:29.820382'),(5606,'Planet Riddles','Inside me, there is a teacup, a planet, a shelf, and you! What Am I?','The Universe!','Hard','2024-07-10 03:25:29.822335'),(5607,'Planet Riddles','Test Mars. What is the anagram word?','Smartest.','Hard','2024-07-10 03:25:29.824440'),(5608,'Planet Riddles','Fire is often maintained above me, and if you remove my first letter, you will find the home shared by everyone you have ever known. What am I?','A Hearth.','Easy','2024-07-10 03:25:29.826675'),(5609,'Planet Riddles','I\'m mean, I\'m green, I am an eating machine. What am I?','A Venus Flytrap.','Hard','2024-07-10 03:25:29.828507'),(5610,'Planet Riddles','It is everywhere yet nowhere and time mars it not. All things are within its grasp and it is within the grasp of all things. It has no limits, for it does and does not exist. What is it?','Nothing.','Hard','2024-07-10 03:25:29.830363'),(5611,'Planet Riddles','I\'m teary-eyed but never cry, silver-tongued, but never lie. double-winged, but never fly, air-cooled, but never dry. What am I?','Mercury. The element looks shiny, silver, and is wet. The god Mercury has two wings but only uses them to run.','Medium','2024-07-10 03:25:29.832237'),(5612,'Planet Riddles','I lie in the earth, and under the ground; A map may reveal me for journey\'s abound; I can be found in squares, to reduce down to size; Or at the end of a strand, where attachment lies. What am I?','Roots','Hard','2024-07-10 03:25:29.834058'),(5613,'Planet Riddles','Stronger than any beast, Rougher than any sea. Steadier than a favorable wind, and of me, none shall be free. What am I?','I am Earth.','Medium','2024-07-10 03:25:29.835825'),(5614,'Planet Riddles','I am named for my fleeting motion. Numbered zero and four score more. A barren desert and a heavy ocean. One is flowing, the other a solid core. Who are we?','Mercury and mercury.','Medium','2024-07-10 03:25:29.838132'),(5615,'Planet Riddles','I shake but unlike the strength of an earthquake. You can find me both high and low, usually out of control. I can be considered both good or bad, sometimes used for both happy or sad. What am I?','Singing Pitch.','Hard','2024-07-10 03:25:29.840332'),(5616,'Planet Riddles','My first is appropriate, my second \'tis nine to one if you guess it. My whole elevates the sole above the earth. What am I?','Pat-ten.','Hard','2024-07-10 03:25:29.842641'),(5617,'Planet Riddles','What can emit an umbra on the earth, and provide phosphorescence for all its creatures, all while altering the visual surface of itself within phases?','The','Hard','2024-07-10 03:25:29.844914'),(5618,'Planet Riddles','Endlessly, I hunger, Lazily, I sleep. Murderous, I thunder, Desires, I do seek. Hoarding countless treasures, so my stature I retain, Envious of others whose feet on Earth remain. What am I?','\"The Seven Deadly Sins\" - Reasoning: Each sentence structure portrays one of the seven deadly sins from Christian theology, with the exception of the final 5 words. In order according to the riddle, these are; gluttony, sloth, wrath, lust, greed, pride and envy. The final 5 words, \"whose feet on Earth remain\", act in conjunction with the section on envy, demonstrating the perspective of a sinner in hell, who is envious of those still alive, and thus can still repent for their sins in order to enter Heaven.','Easy','2024-07-10 03:25:29.847505'),(5619,'Planet Riddles','Which is lighter, the sun or the earth?','The sun, rises every morning.','Hard','2024-07-10 03:25:29.849818'),(5620,'Planet Riddles','One-fourth of the population of a newly discovered planet has 4 legs. The rest have two legs. There are 60 legs in total. How big is the population of the newly discovered planet?','24','Hard','2024-07-10 03:25:29.851788'),(5621,'Planet Riddles','What is the best way to get from earth to mars?','PLANET!','Medium','2024-07-10 03:25:29.853856'),(5622,'Planet Riddles','Where on Earth do the winds always blow from the South?','The North Pole.','Easy','2024-07-10 03:25:29.855774'),(5623,'Planet Riddles','A forest exists somewhere on Earth. This forest has no life except for trees. After a storm, a tree was hit by lightning and fell. What sound would it make?','None. Sound does not exist if it is unheard.','Medium','2024-07-10 03:25:29.857745'),(5624,'Rabbit Riddles','Do rabbits use combs?','No, they use hare brushes.','Easy','2024-07-10 03:25:29.859647'),(5625,'Rabbit Riddles','How can you say rabbit without using the letter R?','Bunny.','Easy','2024-07-10 03:25:29.861961'),(5626,'Rabbit Riddles','How many hairs are in a bunny rabbit\'s tail?','None. They are all outside.','Medium','2024-07-10 03:25:29.863748'),(5627,'Rabbit Riddles','Where does a rabbit go for shampoo?','To a hare-dresser.','Hard','2024-07-10 03:25:29.865506'),(5628,'Rabbit Riddles','What would you get if you crossed a rabbit and a lawn sprinkler?','Hare spray.','Hard','2024-07-10 03:25:29.867278'),(5629,'Rabbit Riddles','What would you get if 120 rabbits took one step backward at the same time?','A receding hare-line.','Easy','2024-07-10 03:25:29.869375'),(5630,'Rabbit Riddles','How do rabbits travel?','By hare-plane.','Easy','2024-07-10 03:25:29.871451'),(5631,'Rabbit Riddles','What does the Easter Bunny do after it takes a shower?','He uses a Hare dryer','Medium','2024-07-10 03:25:29.874002'),(5632,'Rabbit Riddles','What do you get when you cross a roach and a rabbit?','Bugs Bunny.','Medium','2024-07-10 03:25:29.875684'),(5633,'Rabbit Riddles','What kind of jewelry does the Easter bunny wear?','14-carrot gold!','Hard','2024-07-10 03:25:29.877392'),(5634,'Rabbit Riddles','What kind of story does the Easter Bunny like?','One\'s with hoppy-endings!','Hard','2024-07-10 03:25:29.878903'),(5635,'Rabbit Riddles','How do you send Easter Cards?','By hare-mail!','Medium','2024-07-10 03:25:29.880372'),(5636,'Rabbit Riddles','What do you call the Easter bunny the day after Easter?','Tired!','Easy','2024-07-10 03:25:29.882097'),(5637,'Rabbit Riddles','How can you catch a unique rabbit?','You u-neak up on it.','Hard','2024-07-10 03:25:29.883587'),(5638,'Religion Riddles','I\'m a god, a planet, and a measurer of heat. Who am I?','Mercury.','Medium','2024-07-10 03:25:29.885250'),(5639,'Religion Riddles','There was a man who was born before his father, killed his mother, and married his sister. Yet, there was nothing wrong with what he had done. Why?','His father was in front of him when he was born, therefore he was born before him. His mother died while giving birth to him. Finally, he grew up to be a minister and married his sister at her ceremony.','Easy','2024-07-10 03:25:29.886717'),(5640,'Religion Riddles','Mountains will crumble and temples will fall, and no man can survive its endless call. What is it?','Time.','Medium','2024-07-10 03:25:29.888115'),(5641,'Religion Riddles','What is one thing that all wise men, regardless of their politics or religion, agree is between heaven and earth?','The word \'And\'.','Hard','2024-07-10 03:25:29.889792'),(5642,'Religion Riddles','What is Greater than God, worse than evil, the poor have it, the rich require it and if you eat it you die?','Nothing nothing is better than God nothing is worse than evil the poor have nothing the rich don\'t have anything they have everything If you eat nothing you die','Medium','2024-07-10 03:25:29.891472'),(5643,'Religion Riddles','Used to threaten, used to defeat. Sometimes it grows, and sometimes it shrinks. Used to conquer, used to protect. It marks your downfall, it marks your success. The true god of war, the creator of mess. What is it?','Power.','Hard','2024-07-10 03:25:29.893539'),(5644,'Religion Riddles','How does Moses make his coffee?','Hebrews it.','Hard','2024-07-10 03:25:29.895412'),(5645,'Religion Riddles','I am more powerful than god and more evil than the devil. I am what rich people want and what poor people have. I can never die. What am I?','I am nothing.','Medium','2024-07-10 03:25:29.897485'),(5646,'Religion Riddles','Does the','A dead man cannot marry. His widow would mean he is dead.','Easy','2024-07-10 03:25:29.899243'),(5647,'Religion Riddles','I am everywhere yet not seen; I was dead yet I\'m alive; a Son to a man who is dead yet a Son to One Who\'s forever alive; suffered, not for myself but for others. I have disproved many beliefs and many laws. Who am I?','Jesus Christ.','Hard','2024-07-10 03:25:29.901589'),(5648,'Religion Riddles','I\'m the person that God made me. I\'m caring. I\'m nice. I love my family. I\'m myself. Who am I?','I\'m a human being.','Medium','2024-07-10 03:25:29.903553'),(5649,'Religion Riddles','What would you say in everyone in the US Sneezed at the same time?','God bless America!','Hard','2024-07-10 03:25:29.905644'),(5650,'Religion Riddles','Some people want to meet me, some people don\'t believe in me, and some people claim to be me. What am I?','God.','Easy','2024-07-10 03:25:29.907648'),(5651,'Religion Riddles','I\'m teary-eyed but never cry, silver-tongued, but never lie. double-winged, but never fly, air-cooled, but never dry. What am I?','Mercury. The element looks shiny, silver, and wet. The god Mercury has two wings but only uses them to run.','Hard','2024-07-10 03:25:29.909579'),(5652,'Religion Riddles','Priest-tied guitar. What is the anagrammed word?','Prestidigitateur.','Easy','2024-07-10 03:25:29.911286'),(5653,'Religion Riddles','In this place, people lie, people cry, and people ask why. In this place, people sleep, people, weep, and people\'s solitude, they keep. What is it?','\"Graveyard\" or \"Cemetery\" - Reasoning: Both \"people lie\" and \"people sleep\" are indications of many people using this place to lie down, or to sleep, which in itself is an odd thought. Crying and weeping indicate that this is a sad place, and the continued use of \"people\" allows this to mean not just those who are lying down or sleeping, but those who come to visit them there, (i.e. mourners). People come to ask the person\'s grave why they did what they did that resulted in their death, as a form of mourning, or to ask their chosen God or Gods why they took that person to their grave. And peoples solitude refers to people sleeping on their own, or the mourners usually coming the mourn privately.','Easy','2024-07-10 03:25:29.913090'),(5654,'Religion Riddles','Why couldn\'t the church steeple keep a secret?','Because the bell always tolled.','Hard','2024-07-10 03:25:29.914763'),(5655,'Religion Riddles','The rich want it, but the poor have it, god takes it, satin gives it?','nothing','Hard','2024-07-10 03:25:29.916187'),(5656,'Religion Riddles','I\'m greater than God, yet worse than the devil. I am what the miser spends and the spendthrift saves. I am what the blind see and the paralyzed hold. What am I?','Nothing.','Medium','2024-07-10 03:25:29.918049'),(5657,'Religion Riddles','What do you call a priest riding a cycle?','A cyclist.','Medium','2024-07-10 03:25:29.919775'),(5658,'Religion Riddles','I am a holiday, of course, celebrated in December, I am celebrated until New Year, People who celebrate me are considered Evil by many Religions, what am I?','I am Yule!','Medium','2024-07-10 03:25:29.921350'),(5659,'Religion Riddles','What Jewish king a leper died?','Uzziah��2 Chron. xxvi. 21.','Hard','2024-07-10 03:25:29.922924'),(5660,'Religion Riddles','Endlessly, I hunger, Lazily, I sleep. Murderous, I thunder, Desires, I do seek. Hoarding countless treasures, so my stature I retain, Envious of others whose feet on Earth remain. What am I?','\"The Seven Deadly Sins\" - Reasoning: Each sentence structure portrays one of the seven deadly sins from Christian theology, with the exception of the final 5 words. In order according to the riddle, these are; gluttony, sloth, wrath, lust, greed, pride, and envy. The final 5 words, \"whose feet on Earth remain\", act in conjunction with the section on envy, demonstrating the perspective of a sinner in hell, who is envious of those still alive, and thus can still repent for their sins in order to enter Heaven.','Hard','2024-07-10 03:25:29.925118'),(5661,'Religion Riddles','First is the last. Last is the first. You are in the middle. What am I?','CH UR CH CHURCH.','Medium','2024-07-10 03:25:29.927646'),(5662,'Religion Riddles','On which side of a church is the graveyard always situated?','On the outside, of course.','Easy','2024-07-10 03:25:29.929743');
INSERT INTO `mystery_hunt_riddle` VALUES (5663,'Religion Riddles','Why is orange not like a church bell?','Because it is never peeled (pealed) but once.','Easy','2024-07-10 03:25:29.931482'),(5664,'Religion Riddles','My love\'s the type of thing you have to earn, but when you earn it, you won\'t need it. Who am I?','God. Credit: Bo Burnham, Musical Comedian, Song title- \"God\'s Perspective\".','Medium','2024-07-10 03:25:29.933220'),(5665,'Religion Riddles','Gods\' arrows cannot be counted. What are they?','Rain.','Hard','2024-07-10 03:25:29.935035'),(5666,'Religion Riddles','A woman who lives in new york legally married three men, she did not get divorced, get an enrollment, or is legally separated. How is this possible?','She is a minister.','Easy','2024-07-10 03:25:29.937220'),(5667,'Religion Riddles','There were five men going to church and it started to rain. The four that ran got wet and the one that stood still stayed dry. How did the one stay dry?','It was a body in a coffin with the bearers.','Easy','2024-07-10 03:25:29.939471'),(5668,'Religion Riddles','Read my riddle, I pray. What God never sees, what the king seldom sees, and what we see every day. What is it?','An equal.','Hard','2024-07-10 03:25:29.941524'),(5669,'Riddle Books','What did one math book say to the other math book?','Do you want to hear my problems?','Medium','2024-07-10 03:25:29.943242'),(5670,'Riddle Books','Where do bedtime books sleep?','Under their covers.','Easy','2024-07-10 03:25:29.945029'),(5671,'Riddle Books','What English word has three consecutive double letters?','Bookkeeper.','Medium','2024-07-10 03:25:29.946246'),(5672,'Riddle Books','What building has the most stories?','The library.','Medium','2024-07-10 03:25:29.947712'),(5673,'Riddle Books','A teacher is yelling, she closes the door, the window, and a book. What did she forget to close?','Her mouth.','Medium','2024-07-10 03:25:29.949247'),(5674,'Riddle Books','My life is often a volume of grief, your help is needed to turn a new leaf. Stiff is my spine and my body is pale, but I\'m always ready to tell a tale. What am I?','A book!','Easy','2024-07-10 03:25:29.950466'),(5675,'Riddle Books','What has a spine, but no bones?','A book.','Medium','2024-07-10 03:25:29.951731'),(5676,'Riddle Books','I am the shell of something interesting. My front is very eye-catching but my inside tells all. What am I?','A Book.','Medium','2024-07-10 03:25:29.953255'),(5677,'Riddle Books','What did one math book say to another?','I have so many problems.','Easy','2024-07-10 03:25:29.954507'),(5678,'Riddle Books','My numbers may vary, thin as a sheet, take one away, and we\'re just not complete. What am I?','A Book.','Medium','2024-07-10 03:25:29.955949'),(5679,'Riddle Books','There were 5 children in a room. Iris drew a picture, Barry played video games, Andrew played chess, and Trina read a book. What is the fifth child, Mindy, doing?','Mindy is playing chess with Andrew. You can\'t play chess alone!','Hard','2024-07-10 03:25:29.957412'),(5680,'Riddle Books','Why did everybody like to go out to eat with the librarian?','She could always book a reservation.','Medium','2024-07-10 03:25:29.958726'),(5681,'Riddle Books','What are the smartest creatures?','Bookworms.','Easy','2024-07-10 03:25:29.960058'),(5682,'Riddle Books','I wiggled and cannot see, sometimes underground and sometimes on a tree. I really don\'t want to be on a hook, and I become a person when combined with a book. What am I?','Worm','Hard','2024-07-10 03:25:29.961944'),(5683,'Riddle Books','I have 10 books and I label them with their number. I take seven out to read. How many books are left?','9! You have taken the book with the label seven!','Easy','2024-07-10 03:25:29.963256'),(5684,'Riddle Books','Four legs I do have, yet I never walk. I work not, yet I have food. All the food I get, none do I eat but you do. I cannot read yet many times I\'m found with books. I am only but a carpenter\'s work. What am I?','A table.','Easy','2024-07-10 03:25:29.964831'),(5685,'Riddle Books','What is the highest public building in your city?','The library has the most stories.','Medium','2024-07-10 03:25:29.966015'),(5686,'Riddle Books','I sit here collecting dust, I can wait forever to open me and you will not be disappointed, I can make you laugh, cry, and sad, I contain all the knowledge of the world, let me take you to a faraway land. What am I?','A book.','Hard','2024-07-10 03:25:29.967433'),(5687,'Riddle Books','There once was a book that was only owned by the wealthy, but now everyone can have it. You can\'t buy it in a bookstore or take it from a library. What book is it?','A telephone book.','Hard','2024-07-10 03:25:29.968850'),(5688,'Riddle Books','Don\'t judge a book by its cover. What is the contradictory proverb?','Clothes make the man.','Easy','2024-07-10 03:25:29.970225'),(5689,'Riddle Books','What makes \"Book, Box, and Noon\" the same?','There are all nouns.','Hard','2024-07-10 03:25:29.971527'),(5690,'Riddle Books','I am very important to all living creatures. I was firstborn in the sun. I am a chapter in textbooks and I am not made of fire. I make the sun-worthy. Too much of me may kill you. But humans can still prevent me. What am I?','Heat!','Easy','2024-07-10 03:25:29.973014'),(5691,'Riddle Books','Why were the notebooks afraid to go to college?','Because the College ruled notebooks!','Hard','2024-07-10 03:25:29.974577'),(5692,'Riddle Books','I am the king\'s, given by the people; Used by the king, on the people who gave him; everyone obeys him because he has me. What am I?','Authority!','Medium','2024-07-10 03:25:29.975848'),(5693,'Riddle Books','What is that which has many leaves, but no stem?','A book.','Hard','2024-07-10 03:25:29.977580'),(5694,'Riddle Books','A color is seen on a stoplight, an item you use to eliminate the darkness. What comic book character is it?','Green Lantern.','Easy','2024-07-10 03:25:29.978925'),(5695,'Riddle Books','There\'s a land where there are mummies and dad