, or bones. I can walk and talk. I can easily be controlled by people. What am I?','Artificial Intelligence, or a robot.','Medium','2024-07-10 03:25:30.050150'),(5736,'Scary Riddles','Why is France like a skeleton?','Because only the','Easy','2024-07-10 03:25:30.052732'),(5737,'Scary Riddles','1. Where do fish go on vacation? 2. Where do songbirds go on vacation? 3. Where do zombies go on vacation? 4. Where do Thanksgiving Birds go on vacation? 5. Where do geometry teachers go on vacation? 6. Where do locksmiths go on vacation?','1. Finland 2. The Canary Islands 3. The Dead Sea 4. Turkey 5. Cuba 6. The Florida Keys','Hard','2024-07-10 03:25:30.055274'),(5738,'Scary Riddles','What is a vampires favorite car to drive in?','A bloodmobile?','Medium','2024-07-10 03:25:30.057964'),(5739,'Scary Riddles','Why did the skeleton climb up the tree?','Because the dog was after his bones.','Easy','2024-07-10 03:25:30.060324'),(5740,'Scary Riddles','I am as small as a beetle, as annoying as a fly, I like to kill trees, what am I?','A Lantern Fly! (Also stop stealing my riddles, Berries, the LearnyVerse Wizard from Pyranic)','Easy','2024-07-10 03:25:30.062380'),(5741,'Scary Riddles','What is a mummy\'s favorite type of paper?','WRAPing paper','Hard','2024-07-10 03:25:30.064556'),(5742,'Scary Riddles','Where do zombies go for a night out?','Club Dead.','Hard','2024-07-10 03:25:30.066630'),(5743,'Scary Riddles','What did the zombie eat for breakfast?','Raisen Brain!','Medium','2024-07-10 03:25:30.068815'),(5744,'Scary Riddles','What was the pilgrim favorite type of music?','Plymouth Rock.','Medium','2024-07-10 03:25:30.070870'),(5745,'Scary Riddles','What kind of money do vampires use?','Blood money!','Easy','2024-07-10 03:25:30.073100'),(5746,'Scary Riddles','What does a troll call his apartment?','Gnome sweet gnome.','Hard','2024-07-10 03:25:30.075138'),(5747,'Season Riddles','What do you call a snowman in the summer?','Puddle.','Easy','2024-07-10 03:25:30.077740'),(5748,'Season Riddles','What is in seasons, seconds, centuries, and minutes but not in decades, years or days?','The letter ��n��','Medium','2024-07-10 03:25:30.079915'),(5749,'Season Riddles','In spring I am gay in handsome array; in summer more clothing I wear; when colder it grows I fling off my clothes; and in winter quite naked appear. What am I?','A Tree.','Easy','2024-07-10 03:25:30.082666'),(5750,'Season Riddles','What shoes do frogs wear in the summer?','Open toad shoes.','Medium','2024-07-10 03:25:30.084854'),(5751,'Season Riddles','What is whiter than the first snow, redder than the blood of the righteous, greener than the spring grass, bluer than a cloudless sky?','Light. These objects have different colors. But they differ from the standard, which is contained in the light spectrum.','Medium','2024-07-10 03:25:30.087503'),(5752,'Season Riddles','An abundance in arms, but lacking in legs. A tall skinny body, but missing a head. I change with the seasons, it\'s winter I dread. What am I?','A Tree.','Hard','2024-07-10 03:25:30.089667'),(5753,'Season Riddles','A woman went to Virginia to get a job. She promised her mother she would come back and visit sometime. Then, in the middle of winter, her mother shouted, \"April is here!\". How is this possible?','The woman\'s name is April.','Medium','2024-07-10 03:25:30.091746'),(5754,'Season Riddles','Walk on the living, they don\'t even mumble. Walk on the dead, they mutter and grumble. What are they?','Fallen leaves.','Hard','2024-07-10 03:25:30.093894'),(5755,'Season Riddles','What lives in winter, dies in summer, and grows with its roots upward?','An icicle.','Easy','2024-07-10 03:25:30.095900'),(5756,'Season Riddles','In what year did Christmas Day and New Year\'s Day fall in the same year?','It happens every year.','Hard','2024-07-10 03:25:30.098345'),(5757,'Season Riddles','Upside-down or on its side, this merry-go-round Is quite a ride. In the summer heat, It is quite a treat with blades so dull, that they will not slice. It spins too fast, for your sight. What is this ride?','A motorized fan.','Easy','2024-07-10 03:25:30.100225'),(5758,'Season Riddles','You are falling out of a window. What season is it?','Fall.','Hard','2024-07-10 03:25:30.102105'),(5759,'Season Riddles','David\'s birthday is in December, but it is never in the winter. Why?','He lives in Australia (or any other country that has December in summer)','Easy','2024-07-10 03:25:30.103695'),(5760,'Season Riddles','A man is in a room and the door is locked so he can\'t get out. He has with him a piano, a calendar, and a bed. How does he eat, drink, and get out?','He uses the dates from the calendar to eat, the springs from the bed to drink and the keys from the piano to get out.','Easy','2024-07-10 03:25:30.105408'),(5761,'Season Riddles','Why is snow like a maple tree?','Because it leaves in the early spring.','Medium','2024-07-10 03:25:30.107013'),(5762,'Season Riddles','I am spring-bloomed petals birthed from Turkish gardens. I am a creature not bound by land or sea I am the champion of human rights. What am I?','Two lips (tulips). Explanation: Tulips were first','Easy','2024-07-10 03:25:30.109051'),(5763,'Season Riddles','What happens only in the middle of each month, in all of the seasons, except summer, and happens only in the night, never in the day?','The letter \'N.\'','Medium','2024-07-10 03:25:30.111033'),(5764,'Season Riddles','Of all vegetables, only two can live to produce on their own for several growing seasons. All other vegetables must be replanted every year. What are the only two perennial vegetables?','Asparagus and rhubarb.','Hard','2024-07-10 03:25:30.113360'),(5765,'Season Riddles','I am a stop sign, what you see in blood, a rose, and, of course, an Autumn leaf. What am I?','The color red.','Hard','2024-07-10 03:25:30.115406'),(5766,'Season Riddles','Whiling away the hours of flowers, Walking through fields of gold. Preening and pruning in lights fading hours, For petals to freeze in the cold. What is it?','\"The Four Seasons\" - Reasoning: This riddle takes the perspective of plant life during these times of the year, where each line represents one of the four seasons of the year; Spring, Summer, Autumn, and Winter. Spring - where flowers are blooming - Summer - where fields of farm crop mature and turn golden in color, before being harvested - Autumn - where the trees shed their leaves and days grow shorter - and Winter - where the cold leaves frost and freezes plants.','Hard','2024-07-10 03:25:30.117820'),(5767,'Season Riddles','The fire shows - my kin, born. The fire grows - my kin, adorn. The fire slows - my kin, deform. The fire goes - my kin, mourn.','Fruit-bearing tree through the four seasons.','Easy','2024-07-10 03:25:30.120325'),(5768,'Season Riddles','Why are trees in winter like troublesome visitors?','Because it\'s a long time before they leave.','Easy','2024-07-10 03:25:30.122462'),(5769,'Season Riddles','What is another name for the season of fall?','Autumn.','Easy','2024-07-10 03:25:30.124342'),(5770,'Season Riddles','How far is it from March to June?','A single spring.','Hard','2024-07-10 03:25:30.126006'),(5771,'Sister Riddles','There is a brother and a sister. The boy wants to visit his father in jail, and the sister wants to visit her mother in the hospital. But they both are not allowed in jail or hospital. All they have is a gun. What do they do?','The boy shoots the girl, and then the boy goes to jail for attempted murder and the girl goes to the hospital due to her injuries.','Hard','2024-07-10 03:25:30.127603'),(5772,'Sister Riddles','Tom and his younger sister were fighting. Their mother was tired of the fighting and decided to punish them by making them stand on the same piece of newspaper in such a way that they couldn\'t touch each other. How did she accomplish this?','Tom\'s mother slid a newspaper under a door, each sibling standing on each side.','Medium','2024-07-10 03:25:30.129589'),(5773,'Sister Riddles','Can a man legally marry his widow\'s sister in the state of California?','NO since she is a \'widow\', the guy\'s dead!','Hard','2024-07-10 03:25:30.131261'),(5774,'Sister Riddles','There was a man who was born before his father, killed his mother, and married his sister. Yet, there was nothing wrong with what he had done. Why?','His father was in front of him when he was born, therefore he was born before him. His mother died while giving birth to him. Finally, he grew up to be a minister and married his sister at her ceremony.','Easy','2024-07-10 03:25:30.133059'),(5775,'Sister Riddles','If your uncle\'s sister is not your aunt, what relation is she to you?','Your mother.','Easy','2024-07-10 03:25:30.134607'),(5776,'Sister Riddles','What relation would your father\'s sister\'s sister-in-law be to you?','This person would be your mother.','Medium','2024-07-10 03:25:30.136164'),(5777,'Sister Riddles','A beggar\'s brother died, but the man who died had no brother. How could that be?','The beggar was his sister!','Hard','2024-07-10 03:25:30.137981'),(5778,'Sister Riddles','A woman is at her mother\'s funeral when suddenly she sees a man so handsome, she instantly falls in love with her. Unfortunately, she never got a chance to talk to the man. The next day, the woman kills her sister. What was the motive?','The woman was hoping to see the man again. If you got this correct on the first try, you have the mind of a psychopath.','Easy','2024-07-10 03:25:30.139694'),(5779,'Sister Riddles','You give someone a dollar. You are this person\'s brother, but the person is not your brother. How can that be?','It\'s your sister!','Medium','2024-07-10 03:25:30.141775'),(5780,'Sister Riddles','All 5 sisters are busy. Ann is reading, Rose is cooking, Katie is playing chess and Mary is doing laundry. What is the fifth sister doing?','She is playing chess with Katie.','Easy','2024-07-10 03:25:30.143371'),(5781,'Sister Riddles','You are my brother, but I am not your brother. Who am I?','I am your sister.','Medium','2024-07-10 03:25:30.145188'),(5782,'Sister Riddles','Does the christian religion allow a man to marry his widow\'s sister?','A dead man cannot marry. His widow would mean he is dead.','Easy','2024-07-10 03:25:30.146727'),(5783,'Sister Riddles','If May\'s daughter\'s daughter is my granddaughter\'s mother\'s mother\'s brother\'s sister, then what am I to May? (May only has one sibling)','I am May.','Easy','2024-07-10 03:25:30.148841'),(5784,'Sister Riddles','What did the cell say to his sister who stood on his toe?','Mitosis! ( My - toe - sis)','Hard','2024-07-10 03:25:30.150643'),(5785,'Sister Riddles','Brothers and sisters have I none, But that man\'s father is my father\'s son. Who is \"that man\"?','The son of the speaker.','Easy','2024-07-10 03:25:30.152080'),(5786,'Sister Riddles','As I went over London Bridge I met my sister Jenny. I broke her neck and drank her blood And left her standing empty. What am I?','Gin.','Medium','2024-07-10 03:25:30.153843'),(5787,'Sister Riddles','A woman proves in court that her husband was murdered by her sister, but the judge decides that the sister cannot be punished. Why?','The sisters are Siamese twins.','Medium','2024-07-10 03:25:30.155408'),(5788,'Sister Riddles','A boy has as many sisters as brothers, but each sister has only half as many sisters as brothers. How many brothers and sisters are there in the family?','Four brothers and three sisters.','Hard','2024-07-10 03:25:30.157376'),(5789,'Sister Riddles','There is a certain family with both girl and boy children. Each of the boys has the same number of brothers as he has sisters. Each of the girls has twice as many brothers as she has sisters. How many boys and girls are there in this family?','Four boys and three girls.','Hard','2024-07-10 03:25:30.158952'),(5790,'Sister Riddles','A man while looking at a photograph said, \"Brothers and sisters have I none. That man\'s father is my father\'s son.\" Who was the person in the photograph?','That man\'s son.','Hard','2024-07-10 03:25:30.161162'),(5791,'cat-riddles','When is it bad luck to see a black cat?','When you are a mouse.','Medium','2024-07-10 03:25:30.163084'),(5792,'cat-riddles','While on my way to St. Ives, I saw a man with 7 wives. Each wife had 7 sacks. Each sack had 7 cats. Each cat had 7 kittens. Kitten, cats, sacks, wives, How many were going to St. Ives?','Just one, me.','Easy','2024-07-10 03:25:30.165129'),(5793,'cat-riddles','If 5 cats catch 5 mice in 5 minutes, how long will it take one cat to catch a mouse?','Five minutes.','Easy','2024-07-10 03:25:30.166807'),(5794,'cat-riddles','I\'m found in socks, scarves, and mittens. I\'m found in the paws of playful kittens. What am I?','Yarn.','Medium','2024-07-10 03:25:30.168316'),(5795,'cat-riddles','All of Mrs. Smith\'s pets are dogs except one, and all her pets are cats except one. How many cats and dogs does she have?','Mrs. Smith has one cat and one dog.','Hard','2024-07-10 03:25:30.170055'),(5796,'cat-riddles','What\'s 3/7 chicken, 2/3 cat, and 2/4 goat?','Chicago. The first three words out of seven of chicken is CHI, the first two words out of 3 of cat is CA, and the first two words out of goat is GO. Therefore making, (CHI)(CA)(GO).','Easy','2024-07-10 03:25:30.171883'),(5797,'cat-riddles','What happens after it rains cats and dogs?','You step in a poodle.','Medium','2024-07-10 03:25:30.173892'),(5798,'cat-riddles','What do you get when you cross a black cat and a lemon?','A Sour Puss.','Hard','2024-07-10 03:25:30.175516'),(5799,'cat-riddles','If there is a Yellow house on Bluebird Lane, a Green house on Orange Street, a Pink house on Kitten Road, a Black house on Whitehorse Pike and a Purple house on Firebird hill, where is the White house?','Washington, D.C.','Easy','2024-07-10 03:25:30.177792'),(5800,'cat-riddles','Inside napper, bird chaser, quick stoker, small animal killer, fish eater. What is it?','A cat.','Medium','2024-07-10 03:25:30.179310'),(5801,'cat-riddles','10 copycats were sitting in a car. One came out. How many are left?','None( as they were copycats they copied each other).','Easy','2024-07-10 03:25:30.181123'),(5802,'cat-riddles','What word doesn\'t belong in this group? That, hat, what, mat, cat, sat, pat, or chat?','What. It\'s pronounced differently; all of the others rhyme.','Hard','2024-07-10 03:25:30.182628'),(5803,'cat-riddles','Where did the cat go after losing its tail?','To the re-tail store.','Medium','2024-07-10 03:25:30.184109'),(5804,'cat-riddles','If three cats catch three mice in three minutes, how many cats would be needed to catch 100 mice in 100 minutes?','The same three cats would do. Since these three cats are averaging one mouse per minute, given 100 minutes, the cats could catch 100 mice.','Medium','2024-07-10 03:25:30.185754'),(5805,'cat-riddles','What do you call Santa for cats?','Santa paws.','Easy','2024-07-10 03:25:30.187439'),(5806,'cat-riddles','When is the worst weather for rats and mice?','When it rains cats and dogs.','Easy','2024-07-10 03:25:30.189256'),(5807,'cat-riddles','What do cats call mice on a skateboard?','Meals on wheels!','Hard','2024-07-10 03:25:30.190758'),(5808,'cat-riddles','I am one with eight to spare, lest I lose my one. I\'m not a number. What am I?','A Cat. ( Nine Lives )','Hard','2024-07-10 03:25:30.192165'),(5809,'cat-riddles','Why was the cat thrown out of the card game?','Because he was a Cheetah!','Medium','2024-07-10 03:25:30.193833'),(5810,'cat-riddles','Why was the cat sitting at the computer?','It was keeping an eye on the mouse.','Hard','2024-07-10 03:25:30.195614'),(5811,'cat-riddles','What side of a cat has the most fur?','The outside.','Easy','2024-07-10 03:25:30.205150'),(5812,'cat-riddles','Forward I catch fish, backward I am the tenth of numbers. What am I?','Net.','Hard','2024-07-10 03:25:30.208659'),(5813,'cat-riddles','The ghost of the mountain never to be seen, leaps like a raging fire to catch his prey. As pale as the moon but fast as the wind. Cold as ice, but a flash of light in the night. What is it?','A snow leopard.','Hard','2024-07-10 03:25:30.211632'),(5814,'cat-riddles','Give a name to a cat and it will call itself. What is the name?','Meeoow is the name.','Hard','2024-07-10 03:25:30.213914'),(5815,'cat-riddles','What do you call a cat that gets anything it wants?','Purr-suasive','Easy','2024-07-10 03:25:30.216473'),(5816,'cat-riddles','What happens when a cat meets with a tragic accident?','A cat-astrophy!','Easy','2024-07-10 03:25:30.218918'),(5817,'cat-riddles','What sneaks through doors and windows without knocking? What heats an unlit stove? What gives the cat a snug place to rest?','The sun!','Medium','2024-07-10 03:25:30.221222'),(5818,'cat-riddles','Stealthy as a shadow in the dead of night, Cunning but affectionate if given a bite. Never owned but often loved. In my sport considered cruel, But that\'s because you never know me at all. What am I?','A cat.','Easy','2024-07-10 03:25:30.223639'),(5819,'cat-riddles','I am covered with three layers, two of them can be very sensitive, my layers can cover me in a heartbeat or a long time. What am I?','A cat\'s eye.','Medium','2024-07-10 03:25:30.225946'),(5820,'cat-riddles','Why is green grass like a mouse?','Green grass is like a mouse because the cattle eat it (cat��ll eat it).','Medium','2024-07-10 03:25:30.227837'),(5821,'cat-riddles','Why didn\'t the cat want to speak about his problems?','Because it\'s purr-sonal information!','Easy','2024-07-10 03:25:30.229611'),(5822,'cat-riddles','Tom can pet lions. What is the anagrammed word?','Contemplation.','Medium','2024-07-10 03:25:30.231397'),(5823,'cat-riddles','Cat, horse, monkey; Hat, sombrero, Cappello; Sheep, wool, haggis; Dairy, blueberry, cherry; Television, computer, phone; Which set of words doesn\'t belong?','Dairy, blueberry, cherry; All sets of words have a common theme, but this set of words is the only one that rhymes.','Medium','2024-07-10 03:25:30.233772'),(5824,'cat-riddles','There\'s a land where there are mummies and daddies but no babies. Books but no libraries. Mirrors but no reflections. Kittens but no cats. Cattle but no cows. Lollipops but no candy and trees but no forests. It\'s the land of what?','The land of double letters.','Easy','2024-07-10 03:25:30.236060'),(5825,'cat-riddles','What animal has more lives than a cat?','A frog, he croaks every night!','Hard','2024-07-10 03:25:30.238599'),(5826,'cat-riddles','Who was the most famous cat in the wild west?','Kit-ty Carson.','Hard','2024-07-10 03:25:30.240697'),(5827,'cat-riddles','My first is in chocolate but not in ham, my second\'s in cake and also in jam, my third at tea-time is easily found, my whole is a friend who\'s often around. What am I?','A Cat!','Hard','2024-07-10 03:25:30.243279'),(5828,'cat-riddles','Cleopatra and Anthony were near a fish bowl and somehow they died. What happened?','Cleopatra and Anthony were fish and a cat knocked over their fish bowl and since fish can\'t survive without water they died!!','Easy','2024-07-10 03:25:30.245398'),(5829,'cat-riddles','If it takes four rat catchers four minutes to kill four rats, how many rat catchers would be needed to catch 50 rats in 50 minutes?','The same number of rat-catchers: Four.','Easy','2024-07-10 03:25:30.247538'),(5830,'cat-riddles','If seven cats kill seven rats in 7 minutes, how many would be needed to kill one hundred rats in 50 minutes?','14','Hard','2024-07-10 03:25:30.249776'),(5831,'cat-riddles','How many cats are in a small room if in each of the four corners a cat is sitting, and opposite each cat there sit three cats, and on each cat\'s tail another is sitting?','Four cats, each near a tail of a cat in an adjacent corner.','Medium','2024-07-10 03:25:30.252234'),(5832,'skeleton-riddles','Why is France like a skeleton?','Because only the bony part is left. This is a play on words referring to Napoleon Bonaparte who played a key role in the 1789 French Revolution and was the first Emporer of France from 1804-15.','Easy','2024-07-10 03:25:30.254505'),(5833,'skeleton-riddles','What did the skeleton order at the restaurant?','Spare ribs!','Hard','2024-07-10 03:25:30.256609'),(5834,'skeleton-riddles','Why do skeletons hate the cold?','The wind goes right through them!','Easy','2024-07-10 03:25:30.259567'),(5835,'skeleton-riddles','Why do skeletons go on vacations alone?','Because they have no-body to go with.','Hard','2024-07-10 03:25:30.261634'),(5836,'skeleton-riddles','Who was the most famous Skeleton detective?','Sherlock Bones.','Hard','2024-07-10 03:25:30.263710'),(5837,'skeleton-riddles','What instrument does a skeleton play?','Trombone.','Hard','2024-07-10 03:25:30.265717'),(5838,'skeleton-riddles','Why did the skeleton go to the barbecue?','To get some spare - ribs.','Medium','2024-07-10 03:25:30.267632'),(5839,'skeleton-riddles','Why did the skeleton head cross the road?','To get to the other spine.','Medium','2024-07-10 03:25:30.269658'),(5840,'skeleton-riddles','Why did the skeleton climb up the tree?','Because the dog was after his bones.','Hard','2024-07-10 03:25:30.271672'),(5841,'skeleton-riddles','Why didn\'t the skeleton use a towel?','Because he always comes out bone dry.','Hard','2024-07-10 03:25:30.273695'),(5842,'football-riddles','What has one foot but no legs?','A football.','Easy','2024-07-10 03:25:30.275509'),(5843,'football-riddles','What is the only time you run in football?','When you kick off the game.','Hard','2024-07-10 03:25:30.277363'),(5844,'football-riddles','What do you call a football player who can\'t stop talking?','A quarterback.','Easy','2024-07-10 03:25:30.279206'),(5845,'football-riddles','What do you call a group of cows playing football?','A pasture-ization.','Easy','2024-07-10 03:25:30.281345'),(5846,'football-riddles','Why did the football coach go to the bank?','To get his quarterback!','Easy','2024-07-10 03:25:30.283288'),(5847,'football-riddles','What do football players do when they get cold?','They stand in the corner.Because it\'s always 90 degrees there.','Medium','2024-07-10 03:25:30.285347'),(5848,'football-riddles','What do you call a football player with no legs?','Ground beef.','Easy','2024-07-10 03:25:30.287147'),(5849,'football-riddles','What do you call a ghost who loves football?','A receiver-ant.','Easy','2024-07-10 03:25:30.289582'),(5850,'football-riddles','John bet Tom $100 that he can predict the score of the football game before it starts. Tom agrees but loses the bet. Why did Tom lose the bet?','John said the score would be 0-0 and he was right. \"Before\" any football game starts. The score is always 0-0.','Medium','2024-07-10 03:25:30.291826'),(5851,'football-riddles','What has 22 legs and 2 wings?',' A football team!','Medium','2024-07-10 03:25:30.294336'),(5852,'football-riddles','Why is it always hot at the end of a football game?',' Because all of the FANS have gone home.','Hard','2024-07-10 03:25:30.296426');
